var nu_01=['<h3>1. HALULI MINGGO MANAMPARA</h3>	<h4>G = 1 (4/4)</h4>	<p align="justify">	<b>Ayat 1</b> <br>		Haluli minggo manampara <br>		dan itah belom sampai toh <br>		Hatalla jari mari masi itah <br>		gagenep andau hung kau<u>tau</u>, <br>		Bakoya koyan nyelo lomos, <br>		katahin petak itah toh, <br>		Ka<u>tau</u>n Hatalla hindai hapus <br>		harajur asie sampai toh. <br>		<br>	<b>Ayat 2</b> <br>		Toh ikei mimbit trimakasih, <br>		o Tuhan hayak mampahai, <br>		manara aram tagal asi, <br>		yoh tagal berkat handiai, <br>		Balalu ikei blaku kea: <br>		O Tuhan, huang minggo toh, <br>		pahayak tuntang ajar ikei, <br>		mang<u>gau</u> salamat toto toh.		 	<h5>Lago: L.N. No. 23</h5>	</p>'];
var nu_02=['<h3>2. INTU TAHAREP AIM TUHAN</h3>	<h4>G = 1 (3/4)</h4>	<p align="justify">	<b>Ayat 1</b> <br>		Intu taharep <u>aim</u>, <br>		Tuhan, toh ikei hong hetoh, <br>		handak manara ka<u>haim</u> <br>		dan sombayang katon toh <br>		Ikei samai handak  <br>		mahining <u>auh</u> <u>aim</u> <br>		handak manyanyi toh akam. <br>		<br>	<b>Ayat 2</b> <br>		Ajar dan plawa toh atei <br>		<u>ain</u> ikei ayum, <br>		Trima <u>auh</u> laku, auh tara<br>		je imbit toh akam, <br>		Ikei samai toto <u>haus</u> <br>		mite ka<u>haim</u>, <br>		Tenga kan ikei Roh ayum. <br>		 	<h5>Lagu: Tara Hatalla, je pangkahai raya<i></i><br>	&nbsp;&nbsp;&nbsp;&nbsp;L.N. No.118</h5>	</p>'];
var nu_03=['<h3>3. IJE TINAI MINGGO HAPUS</h3>	<h4>G = 1 (4/4)</h4>	<p align="justify">	<b>Ayat 1</b> <br>		Ije tinai minggo hapus, <br>		khanjak dan kapehe aie, <br>		Minggu je taheta dumah,<br>		Tuhan ikei handiai, <br>		awang hong taharep <u>aim</u>, <br>		blaku, musok haliai: <br>		Ampun kare dosan ikei, <br>		mangat ikei sanang atei! <br>		<br>	<b>Ayat 2</b> <br>		Tuhan ikei toh mangaku, <br>		sintam toto paham hai, <br>		harap asim, ikei handiai:<br>		Berkat ikei handiai! <br>		Pasi kare oloh <u>aim</u>, <br>		mangat tame hung ka<u>haim</u>, <br>		Imbit ikei haya-hayak <br>		tame sorga, supa khanjak. <br>		 	<h5>Lago: L.N. No. 46</h5>	</p>'];
var nu_04=['<h3>4. O APANG, TUHAN PANGKAHAI</h3>	<h4>G = 1 (4/4)</h4>	<p align="justify">	<b>Ayat 1</b> <br>		O Apang, Tuhan pangkahai, <br>		tampayah ikei handiai, <br>		je blaku doa dengam toh:<br>		Paabas ikei awi Roh! <br>		<br>			<b>Ayat 2</b> <br>		Yoh keleh Tuhan magah wei, <br>		toh ikei huang jalan te, <br>		je mimbit ikei oloh <u>aim</u>,<br>		kan sorga, omba hung ka<u>haim</u>. <br>		<br>			<b>Ayat 3</b> <br>		Katiwas ikei totoh hai, <br>		basala ikei handiai, <br>		O Tuhan, tagal aran <u>aim</u>,<br>		karinah asim dan ka<u>haim</u>! <br>				<br>	<b>Ayat 4</b> <br>		Hung Yesusu, Kristus, <br>		Anak <u>aim</u>, <br>		injanjim slamat hung ka<u>haim</u>.<br>		Toh ikei blaku: Tenga te, <br>		kan ikei ije tiwas wei. <br>			<h5>Lago: Horumat palus katatai <br>	&nbsp;&nbsp;&nbsp;&nbsp;L.N. No.40</h5>	</p>'];
var nu_05=['<h3>5. HONG ANDAU AYUM, O YESUS</h3>	<h4>G = 1 (3/4)</h4>	<p align="justify">	<b>Ayat 1</b> <br>		Hong andau ayum, o Yesus, <br>		toh ikei hampumpong <br>		handak mahormat, <br>		pahai Tuhan, ije mananggong,<br>		dosa samai, ije tangkalalau<br>		kahaie, mimbit kajake karusak. <br>		<br>			<b>Ayat 2</b> <br>		Ikei mandino <u>auh</u> <u>aim</u> ajar salamat, <br>		Dengan kahajak toh ikei tarima <br>		<u>auh</u> awat, Ikei mang<u>gau</u>,<br>		Tuhan je paham ka<u>taue</u>, <br>		blaku kasanang salamat. <br>		<br>			<b>Ayat 3</b> <br>		Tenga kan ikei hong sorga, <br>		hung lewu kasanang <br>		bagin pambelom je tatap <br>		kan oloh je manang. <br>		Ikei samai rajin manara, <br>		pahai Tuhan, je inara. <br>					<h5>Lago: Tara Hatalla je pangkahai raja<br>	&nbsp;&nbsp;&nbsp;&nbsp;L.N. No.118</h5>	</p>'];
var nu_06=['<h3>6. HATALLA, IKEI JARI KANTOH</h3>	<h4>C = 1 (4/4)</h4>	<p align="justify">	<b>Ayat 1</b> <br>		Hatalla, ikei jari kantoh <br>		antai mahining brita hai, <br>		Yoh ajar ikei huang hetoh, <br>		manyingkap slamat katatai. <br>		O ampun ikei handiai <br>		dan awat oloh korik hai!<br>		<br>			<b>Ayat 2</b> <br>		O Tuhan, plawa atei ikei <br>		yoh dohop ikei handiai, <br>		mahakan hukum dan pampatei, <br>		naraka tuntang kpehe hai! <br>		Toh ikei musok hante wei: <br>		Karinah kare asim te! <br>		<br>			<b>Ayat 3</b> <br>		Yo ajar ikei <u>auh</u> pambelom, <br>		je mimbit brita slamat te, <br>		Te ikei liwus bara hukum, <br>		<u>tau</u> hanjak rantang sanang wei, <br>		dan tame sorga hung ka<u>haim</u>, <br>		je tatap akan oloh <u>aim</u>. <br>					<h5>Lagu: L.N. No.34</h5>	</p>'];
var nu_07=['<h3>7. KAKARE IKEI, O HATALLA</h3>	<h4>C = 1 (4/4)</h4>	<p align="justify">	<b>Ayat 1</b> <br>		Kakare ikei, o Hatalla, <br>		hapumpong tinai andau toh, <br>		mangaku kare-kare dosa, <br>		i awi ikei sampai toh, <br>		kasalan ikei toto hai, <br>		O Tuhan ampun te samai! <br>		<br>			<b>Ayat 2</b> <br>		Hung ara Yesus Anak Ayum, <br>		<u>auh</u> lakun ikei toh madai: <br>		O empas ikei bara hukum <br>		dan bara dosa handiai, <br>		yoh prasih ikei toh, <br>		O Tuhan tuntang tenga Roh! <br>		<br>			<b>Ayat 3</b> <br>		Yo ikei handak toh manara, <br>		mahormat Tuhan hung kahaim, <br>		ka<u>taum</u> je jari ingarinah <br>		hung Yesus, Anak tonggal aim, <br>		je mawat ikei handiai <br>		dan mimbit slamat katatai <br>					<h5>Lago: L.N. No.34</h5>	</p>'];
var nu_08=['<h3>8. APANG IKEI HUANG SORGA</h3>	<h4>G = 1 (4/4)</h4>	<p align="justify">	<b>Ayat 1</b> <br>		Apang ikei huang sorga, <br>		dengam ikei blaku toh: <br>		Ampun kare-kare dosa <br>		ajar ikei awi Roh. <br>		Lapas ikei handiai <br>		bara pasong te samai <br>		Hung pambelom hung patei, <br>		ikei magon hanjak atei. <br>		<br>			<b>Ayat 2</b> <br>		Prahan sintam dan katotom <br>		asim akan ikei toh, <br>		o pahayak oloh ayum <br>		ije blaku tumon <u>auhm</u>. <br>		Yesus Kristus, Anak <u>aim</u>; <br>		Imbit ikei kan ka<u>haim</u>, <br>		Keleh Roh <u>aim</u> wei manyaksi <br>		ikei jari toh iasi. <br>		<br>			<b>Ayat 3</b> <br>		Yoh paabas, mangarasan <br>		kepercayaan ikei wei, <br>		uka toto <u>tau</u> malawan, <br>		mampakalah musoh te. <br>		Dohop ikei handiai, <br>		mangat toto mampahai, <br>		aran ayum o Hatalla, <br>		hetoh palus huang sorga. <br>					<h5>Lago: Ije tinai minggo hapus, L.N. No.46</h5>	</p>'];
var nu_09=['<h3>9. O TUHAN PASI DOHOP IKEI</h3>	<h4>G = 1 (4/4)</h4>	<p align="justify">	<b>Ayat 1</b> <br>		O Tuhan pasi dohop ikei <br>		hung pumpong ikei <br>		andau toh! <br>		parendeng hapus pikir atei <br>		<u>ain</u> ikei, mangat toto <u>tau</u>, <br>		mahining <u>auh</u> aim andau jetoh. <br>		O suang ikei hapan Roh, <br>		je brasih, <br>		uka sondau ku toh, <br>		panenga asi huang Roh! <br>		<br>			<b>Ayat 2</b> <br>		O Tuhan plawa atei ikei, <br>		je hante magon kaput wei <br>		nakara <u>auh</u> <u>aimn</u> </u>tau</u> tame, <br>		manyingah ikei magon wei: <br>		Baketep, bujur dan batokei, <br>		manintu Tuhan haliai, <br>		Yoh kanan bara atei ikei, <br>		kapapa, aloh korik, hai. <br>		<br>			<b>Ayat 3</b> <br>		Toh akam kare hormat tara, <br>		O Tuhan, ije Tempongku! <br>		<u>Auh</u> ayum jari mampalawa, <br>		manyingah hapus huangku, <br>		Yoh keleh ah o Tuhan Yesus, <br>		manatap kae jalangku, <br>		te aku magon <u>tau</u> malalus <br>		kahandak <u>aim</u>, o Tuhanku! <br>					<h5>Lago: L.N. No.102</h5>	</p>'];
var nu_10=['<h3>10. TUHAN, BERKAT IKEI</h3>	<h4>D = 1 (4/4)</h4>	<p align="justify">	<b>Ayat 1</b> <br>		Tuhan, berkat ikei,<br>		hagai ikei hante,  <br>		dohop, ikei hung kat<u>au</u>m <br>		belom brasih tumon <u>auhm!</u> <br>		<br>			<b>Ayat 2</b> <br>		Tuhan o palawa ikei <br>		haran klawam: <br>		tenga asim ije hai, <br>		akan ikei handiai! <br>		<br>			<b>Ayat 3</b> <br>		O Roh brasih mohon, <br>		ajar ikei toto, <br>		manyak jalan sorga te <br>		hung kasanang magon wei! <br>		<br>			<b>Ayat 4</b> <br>		Amen! Amen! Amen! <br>		Aran <u>aim</u> inara; <br>		hormat tara akam toh, <br>		Bapak, Anak tuntang Roh! <br>			<h5>Lago: L.N. No.145</h5>	</p>'];
var nu_11=['<h3>11. KAMANGAT ANDAU JETOH</h3>	<h4>A = 1 (4/4)</h4>	<p align="justify">	<b>Ayat 1</b> <br>		Kamangat andau jetoh <br>		je ayun Tuhangku <br>		ingkeme toh tinai <br>		hong pahali sangku <br>		<br>			<b>Ayat 2</b> <br>		<u>Auh</u> ganta te marawei : <br>		Has dumah keton toh! <br>     	te lembut nyanyi, <br>		tara hong human Tuhangku <br>		<br>			<b>Ayat 3</b> <br>		Kamanis <u>auh</u> Hatalla <br>		mampangat huangku, <br>		kasanang bara sorga <br>		ngaliling aku toh. <br>		<br>			<b>Ayat 4</b> <br>		Te  kejau kare kikeh, <br>		kagogop, kipen te : <br>		te aku tokep Yesus, <br>		mardeka sanang wei. <br>		<br>			<b>Ayat 5</b> <br>		Mardeka tuntang sanang <br>		hung sintan Tuhangku, <br>		jajari muap Eden <br>		haluli akangku <br>		<br>			<b>Ayat 6</b> <br>		Kamangat andau jetoh <br>		mambrita akangku, <br>		tahiu Sabat beken <br>		hong lawin jalangku.<br>		<br>			 	<b>Ayat 7</b> <br>		Kasanang aton tinai, <br>		kasanang Sabat hai, <br>		kan Ungkup <u>ain</u> Hatalla, <br>		hong sorga katatai. <br>			<h5>Lago: So feierlich stille. <br>		&nbsp;&nbsp;&nbsp;&nbsp;Gr. M. H. 105 <br>		&nbsp;&nbsp;&nbsp;&nbsp;N.P No.27</h5>	</p>'];
var nu_12a=['<h3>12a. HALLELUYA! ANDAU TUHAN</h3>	<h4>C = 1 (2/4)</h4>	<p align="justify">	<b>Ayat 1</b> <br>		Haleluya! Andau Tuhan, <br>		jari sampai aku toh, <br>		mangat aku <u>tau</u> Malayan, <br>		bara gawin lengeku, <br>		Haleluya,tarawei, <br>		tagal andau kmangat te! <br>		<br>			<b>Ayat 2</b> <br>		Dohop aku toh mahaga <br>		andaum tumon sohom wei, <br>		manalikut taloh papa, <br>		je mahambang gawim te : <br>		mampakanan huangku, <br>		hapan <u>auh</u> katotom toh! <br>		<br>			<b>Ayat 3</b> <br>		Keleh Tuhan mamparahan, <br>		tarang toto akangku, <br>		kare gawingku je sala, <br>		hong saramin <u>auh</u> <u>aim</u> toh: <br>		mangat <u>tau</u> kasenangku, <br>		taloh huang ateiku! <br>		<br>			<b>Ayat 4</b> <br>		Keleh  Tuhan mahanjean, <br>		aku dengan Anam <u>aim</u>! <br>		Dan sombayang jaton lelan, <br>		Hayak dengan ungkup <u>aim</u>, <br>		Kelehatei ikei to, <br>		Bulat huang sintan Roh! <br>		<br>			<b>Ayat 5</b> <br>		Halleluya, andau ayum, <br>		jari sampai ikei toh, <br>		Ikei toto handak belom, <br>		awi <u>auh</u> katotom toh: <br>		Manhu je basilim te <br>		mampaabas ikei wei! <br>		<br>			<b>Ayat 6</b> <br>		O karasan ike miar, <br>		huang jalan ayum wei: <br>		mhoroi padang tunis sabar, <br>		sampai tanah janji te,<br>		eka ikei handiai, <br>		omba Sabat katatai!	<br>	<h5>Lago: Padang benyem <br>		&nbsp;&nbsp;&nbsp;&nbsp;R.L No.593</h5>	</p>'];
var nu_12b=['<h3>12b. HALLELUYA! ANDAU TUHAN</h3>	<h4>C = 1 (4/4)</h4>	<p align="justify">	<b>Ayat 1</b> <br>		Haleluya! Andau Tuhan, <br>		jari sampai aku toh <br>		mangat aku tau malayan, <br>		bara gawin lengengku <br>		Haleluya, tarawei, <br>		tagal kmangat andau te! <br>		<br>			<b>Ayat 2</b> <br>		Dohop aku toh mahaga <br>		andaum tumon sohom wei, <br>		manalikut taloh papa, <br>		je mahambang gawim te: <br>		Mampakanan huangku, <br>		hapan <u>auh</u> katotom toh! <br>		<br>			<b>Ayat 3</b> <br>		Keleh Tuhan mamparahan, <br>		tarang toto akangku, <br>		kare gawingku je sala, <br>		hong saramin <u>auh</u> <u>aim</u> toh: <br>		mangat <u>tau</u> kasenangku, <br>		taloh huang ateiku! <br>		<br>			<b>Ayat 4</b> <br>		Keleh Tuhan Mahanjean, <br>		aku dengan Anank <u>aim</u>! <br>		Dan sombayang jaton lelan, <br>		hayak dengan ungkum <u>aim</u>, <br>		Keleh atei ikei toh, <br>		bulat huang sintan Roh! <br>		<br>				<b>Ayat 5</b> <br>		Halleluya, andau ayum, <br>		jari sampai ikei toh, <br>		Ikei toto handak belom, <br>		awi <u>auh</u> katotom toh: <br>		Manhu je basilim te <br>		mampaabas ikei wei! <br>		<br>			<b>Ayat 6</b> <br>		O karasan ike miar, <br>		Huang jalan ayum wei; <br>		mhoroi padang tunis sabar, <br>		sampai tanah janji te, <br>		eka ikei handiai, <br>		omba Sabat katatai! <br>	<h5>Lago: Ewen tawon oloh kanih <br>		&nbsp;&nbsp;&nbsp;&nbsp;L.N No.21</h5>	</p>'];
var nu_13=['<h3>13. PUTRI SION, HANJAK WEI</h3>	<h4>F = 1 (4/4)</h4>	<p align="justify">	<b>Ayat 1</b> <br>		Putri Sion hanjak <br>		wei nyanyi toh Yerusalem! <br>		Hosianna, Rajangku: <br>		Hormat akam Rajangku! <br>		Rajam dumah tangoh ikau toh. <br>		Rajam dumah tanggoh ikau toh. <br>			<h5>Lago: L.N. No.108</h5>	</p>'];
var nu_14=['<h3>14. TOH EWN TAU MANAMBANG</h3>	<h4>C = 1 (4/4)</h4>	<p align="justify">	<b>Ayat 1</b> <br>		Toh eweh <u>tau</u> manambang <br>		Hattala Pangkahai? <br>		Kakare ije harap <u>auh</u> <br>		tuntang janji aie. <br>		Je jari bara horan <br>		insanan nabi aie, <br>		toh jete toto tulus <br>		hung Yesus Tuhan hai. <br>		<br>			<b>Ayat 2</b> <br>		Kalunen toto tiwas, <br>		kasalae paham hai, <br>		Toh Tuhan handak mempas <br>		mahapan asi aie, <br>		kakare awing harap, <br>		percaya haliai,<br>		hung Yesus, Juruslamat <br>		harajur kasatai. <br>		<br>			<b>Ayat 3</b> <br>		Toh ela itah mikeh, <br>		manalih Tuhan te, <br>		dan blaku into ie, <br>		maharap ie wei, <br>		Hung Yesus dinon slamat <br>		kakare oloh aie, <br>		je ater ateie harap <br>		ka<u>taue</u> dan asie hai. <br>		<br>	<h5>Lago: L.N No.129</h5>	</p>'];
var nu_15=['<h3>15. HANJAK RANTANG HUANGKU</h3>	<h4>G = 1 (4/4)</h4>	<p align="justify">	<b>Ayat 1</b> <br>		Hanjak rantang huangku <br>		Raja slamat dumah mawat <br>		Ie wei Hatallangku <br>		ije handak manyalamat. <br>		Janjie ije heran te, <br>		tulus awi sintae wei. <br>		<br>			<b>Ayat 2</b> <br>		Hanjak oloh brasih toh, <br>		asin Tuhan bakarinah. <br>		Slamat aie <u>tau</u> dinon toh, <br>		kare ije harap pangkahai <br>		mimbit slamat katatai.  <br>		<br>			<b>Ayat 3</b> <br>		Tuhan, tatap ateiku, <br>		malai eter huang ikau. <br>		Kanan bara huangku, <br>		kare dosa dan kalayau, <br>		Prasih aku haliai, <br>		tenga ksanang katatai. <br>		<br>			<b>Ayat 4</b> <br>		Pangat aku je mang<u>gau</u>, <br>		ampong Roh <u>aim</u> ije brasih, <br>		te harajur aku <u>tau</u>, <br>		mimbit tara, trimakash, <br>		Ikau wei ientaiku. <br>	<h5>Lago: Patut aku hanjak toh <br>	&nbsp;&nbsp;&nbsp;&nbsp;L.N No.107</h5>	</p>'];
var nu_16=['<h3>16. O TUHAN, JARI TAHI TOH</h3>	<h4>F = 1 (3/4)</h4>	<p align="justify">	<b>Ayat 1</b> <br>		O Tuhan jari tahi toh <br>		tabiri Ayum mentai <br>		Hamprea Tuhan dumah yoh <br>		hamprea kpehe terai? <br>		O jaka wayah kmanat te <br>		tau mimbit awim gulong wei! <br>		O dumah, Tuhan Yesus <br>		dumoah Tuhan Yesus! <br>		<br>			<b>Ayat 2</b> <br>		Yoh puna biti Ayum te <br>		hong bento kike magon, <br>		mahining lakun ikei wei, <br>		<u>auh</u> tombah Ayum aton, <br>		O Tuhan, aloh tumon te, <br>		harajur ikei blaku wei: <br>		O dumah, Tuhan Yesus, <br>		o dumah TUhan Yesus! <br>		<br>			<b>Ayat 3</b> <br>		Yoh amon tahi hindai <br>		toh panumah <u>aim</u> o Yesus, <br>		pagalak sumbon ikei toh <br>		dan tenga ombet undus! <br>		Te ikei ije baris <u>Aim</u>, <br>		<u>tau</u> mentai ikau hung kah<u>aim</u> <br>		O dumah, Tuhan Yesus, <br>		o dumah Tuhan Yesus! <br>		<br>			<b>Ayat 4</b> <br>		O dohop hong panumah <u>Aim</u>, <br>		nakara ikei kea, <br>		<u>tau</u> mite padadusan <u>Aim</u>, <br>		je aton huang sorga, <br>		O dumah, Tuhan Yesus, <br>		O dumah Tuhan Yesus! <br>	<h5>Lago: Es hart die Braut so lange schon <br>	&nbsp;&nbsp;&nbsp;&nbsp;R.L. 595. s.150. L.N.P. No.38</h5>	</p>'];
var nu_17=['<h3>17. INGAT AH HAMBRUANGKU</h3>	<h4>G = 1 (3/4)</h4>	<p align="justify">	<b>Ayat 1</b> <br>		Ingat ah hambruangku: <br>		Rajam jari dumah toh. <br>		Ie je Pa newus aim, <br>		mimbit ksanang akam toh. <br>		Halleluya! Akae wei. <br>		Halleluya! Akae wei. <br>		Ingat ah hambruangku <br>		Rajam jari dumah toh. <br>		<br>			<b>Ayat 2</b> <br>		Paham toto khanjakku <br>		mingat kare sinta Aie. <br>		Aku oloh papa toh, <br>		eka sintam Tuhangku. <br>		Halleluya! Akae wei. <br>		Halleluya! Akae wei. <br>		Ingat ah hambruangku <br>		Rajam jari dumah toh. <br>		<br>			<b>Ayat 3</b> <br>		Rajam ije dumah toh, <br>		sintae paham dengangku <br>		mampakalah musohku. <br>		slamat Ayue bagingku. <br> 		Halleluya! Akae wei. <br>		Halleluya! Akae wei. <br>		Ingat ah hambruangku <br>		Rajam jari dumah toh. <br>	<h5>Lago: Yesus, die mijn ziel bemint<br>	&nbsp;&nbsp;&nbsp;&nbsp;Zangbundel No.180</h5>	</p>'];
var nu_18=['<h3>18. HOSIANNA, TARA WEI</h3>	<h4>D = 1 (4/4)</h4>	<p align="justify">	<b>Ayat 1</b> <br>		Hosianna, tara wei <br>		akan anak Dawid te <br>		ije tame lewu aie, <br>		ateie randah haliai. <br>		<br>			<b>Ayat 2</b> <br>		Trimakasih, hormat toh <br>		akan Yesus Tuhangku, <br>		ije huang sintae hai, <br>		mohon bara sorga aie. <br>		<br>			<b>Ayat 3</b> <br>		Kare ksanang sorga te, <br>		uras te ilihie wei, <br>		tantai mimbit slamat hai, <br>		akan itah handiai. <br>		<br>			<b>Ayat 4</b> <br>		Halleluya, tara wei, <br>		akan Rajan slamat te, <br>		ije tanggoh aku toh, <br>		palus melai dengangku. <br>	<h5>Lago: Gott sei Dank in aller Welt<br>	&nbsp;&nbsp;&nbsp;&nbsp;R.L. 25. Gesangbuch No.107</h5>	</p>'];
var nu_19=['<h3>19. TOH INGAT KETON HANDIAI</h3>	<h4>D = 1 (4/4)</h4>	<p align="justify">	<b>Ayat 1</b> <br>		Toh ingat keton handiai: <br>		Hatalla Tuhan pangkahai, <br>		manyoho Yesus, Anak aie, <br>		malihi sorga dan kahai. <br>		<br>			<b>Ayat 2</b> <br>		Hong Betlhem, <br>		huang kandang wei, <br>		inkan anak await e, <br>		je dumah huang ka<u>hain</u> ka<u>taue</u> <br>		dan hasangkowong ampin <u>baue</u>. <br>		<br>			<b>Ayat 3</b> <br>		Toh eweh kea anak te, <br>		je menter huang dulang wei? <br>		Yoh ie Juruslamat hai, <br>		insanan kare nabi aie. <br>		<br>			<b>Ayat 4</b> <br>		Toh itah toto hanjak wei, <br>		mahining brita heran te: <br>		Hung Kristus, Tuhan Pangkahai, <br>		malalus kare janji te. <br>	<h5>Lago: Horumat palus katatai<br>	&nbsp;&nbsp;&nbsp;&nbsp;L.N. No.40</h5>	</p>'];
var nu_20=['<h3>20. TOH HINING KETON BRITA HAI</h3>	<h4>D = 1 (4/4)</h4>	<p align="justify">	<b>Ayat 1</b> <br>		Toh hining keton brita hai, <br>		impait Hatalla pakngkahai!<br>		Malekat mimbit kabare te,<br>		kan itah ije korik wei.<br>		<br>			<b>Ayat 2</b> <br>		Hong Betlhem, huang kandang wei,<br>		inkan anak await e,<br>		je dumah huang ka<u>hain</u> ka<u>taue</u>, <br>		dan hasangkowong ampin <u>baue</u>.<br>		<br>			<b>Ayat 3</b> <br>		Toh eweh kea anak te, <br>		je menter huang dulang wei?<br> 		Yoh ie Juruslamat hai,<br>		insanan kare nabi aie<br>		<br>			<b>Ayat 4</b> <br>		Toh itah toto hanjak wei, <br>		mahining brita heran te:<br>		Hung Kristus, Tuhan Pangkahai,<br>		malalus kare janji te.<br>			<h5>Lago : Horumat palus katatai<br>		&nbsp;&nbsp;&nbsp;&nbsp;L.N.No. 40</h5>	</p>'];
var nu_21a=['<h3>21a. ALEM BARASIH</h3>	<h4>C = 1 (6/8)</h4>	<p align="justify">	<b>Ayat 1</b> <br>		Alem Brasih tunis benyem <br>		bintang <u>Aim</u> blawa toh <br>		Yesus dumah hong Betlehem <br>		Juruslamat itah toh		Sembah Ie wei <br>		Sembah Ie Wei! <br>		<br>			<b>Ayat 2</b> <br>		Trima toh brita hai! <br>		Tumon <u>auh</u> mlekat te: <br>		Keleh itah hanjak toh, <br>		krana Juruslamat te <br>		jari dumah toh, <br>		jari dumah toh. <br>		<br>			<b>Ayat 3</b> <br>		Ayo wei! Talih toh, <br>		Betlehem, lewu te, <br>		mite anak awau te, <br>		menter huang dulang te: <br>		Trima Ie wei, <br>		trima Ie wei! <br>			<h5>Lago : L.N. No.70</h5>	</p>'];
var nu_21b=['<h3>21b. KELEH WEI ITAH TOH</h3>	<h4>C = 1 (6/8)</h4>	<p align="justify">	<b>Ayat 1</b> <br>		Keleh wei itah toh <br>		handiai mingat toh<br>		brita je bahalap te: <br>		Juruslamat itah te<br>		talih itah toh,<br>		talih itah toh.<br>		<br>			<b>Ayat 2</b> <br>		Hining toh brita hai! <br>		Tumon <u>auh</u> mlekat te:<br>		Buah keton hanjak toh, <br>		krana Juruslamat te<br>		jari dumah toh, <br>		jari dumah toh.<br>		<br>			<b>Ayat 3</b> <br>		Ayo wei! Talih toh, <br>		Betlehem, lewu te,<br>		Mite anak awau tem <br>		enter huang dulang te:<br>		Ie Tuhan <u>aim</u>,<br>		Ie Tuhan <u>aim</u>!<br>			<h5>Lago : L.N. No.70</h5>	</p>'];
var nu_22=['<h3>22. HOSIANNA</h3>	<h4>C = 1 (4/4)</h4>	<p align="justify">	<b>Ayat 1</b> <br>		Hosianna! Tara akae ije <br>		dumah huang aran Tuhangku.<br>		Hosianna hong ngambote! <br>		Tara akae je dumah kan itah<br>		huang aran Yehowa je hai. <br>		Hosianna!<br>		Hosianna! <br>		Hosianna ngambote! <br>		Hosianna ngambote!<br>			<h5>Lago : L.N. No.42</h5>	</p>'];
var nu_23=['<h3>23. TOH KELEH ITAH HANJAK</h3>	<h4>Bes = 1 (4/4)</h4>	<p align="justify">	<b>Ayat 1</b> <br>		Toh keleh itah hanjak, <br>		manara Tuhan itah,<br>		je mampamohon Anake, <br>		je tonggal akan petak.<br>		<br>			<b>Ayat 2</b> <br>		O Yesus, ikau tame<br>		calakan ikei hetoh,<br>		nakara awi jete<br>		salamat ikei toto.<br>		<br>			<b>Ayat 3</b> <br>		Karandahm mampalembut<br>		panatau akan ikei.<br>		Toh ela oloh Bantus<br>		manyarah akam ateie.<br>		<br>			<b>Ayat 4</b> <br>		Toh akam trimakasih,<br>		yoh tagal kare asi<br>		inengam huang Yesus,<br>		Yehowa, je Panewus!<br>			<h5>Lago : L.N. No.135</h5>	</p>'];
var nu_24=['<h3>24. TOH ITAH MINGAT JAMAN HORAN</h3>	<h4>Bes = 1 (4/4)</h4>	<p align="justify">	<b>Ayat 1</b> <br>		Toh itah mingat jaman horan<br>		Babala tarang haliai<br>		kajoha tuntang sintan<br>		tuhan dan asie ije pangkahai:<br>		yoh, Anak Raja sorga te<br>		inakan huang kandang wei <br>		inakan huang kandang wei.<br>		<br>			<b>Ayat 2</b> <br>		En bukue, Tempon langit petak<br>		impeter huang dulang te?<br>		Nakara itah ije rusak<br>		je asi-asi, pehe wei,<br>		<u>tau</u> dinon kamerdeka hai,<br>		panatau, ksanang katatai,<br>		panatau, ksanang katatai.<br>		<br>			<b>Ayat 3</b> <br>		Yoh baya awi sintae, asie <br>		ilihie sorga dan kahaie,<br>		inanggonge kpehe dan pampatei<br>		takirin itah handiai.<br>		Kamangat huang sorga te<br>		Inengae akan itah wei<br>		Inengae akan itah wei.<br>		<br>			<b>Ayat 4</b> <br>		Toh hanjak rantang atei itah <br>		hong pesta Alem brasih toh!<br>		Kan Yesus, Anak <u>ain</u> Hatalla,<br>		kakare nyanyin itah toh.<br>		O keleh jaka ateiku<br>		manjadi ayun Tuhangku,<br>		manjadi ayun Tuhangku.<br>			<h5>Lago : O jaka toto tatap jela <br>		&nbsp;&nbsp;&nbsp;&nbsp;L.N. No.77</h5>	</p>'];
var nu_25=['<h3>25. TOH JARI TOTO BAKARINAH</h3>	<h4>F = 1 (4/4)</h4>	<p align="justify">	<b>Ayat 1</b> <br>		Toh Jari toto bakari nah <br>		kataun Hatalla pangka hai.<br>		Yo, juruslamat jari dumah, <br>		kan huang klawae ije hai.<br>		Ka kaput tuntang kua <br>		sa aie impala toto haliai.<br>		<br>			<b>Ayat 2</b> <br>		Huang pahalendang klawam,<br>		Yesus manjadi blawa ateiku<br>		Auh janji ayum toto tulus<br>		mampangat hapus huangku, <br>		toh sanang, hanjak ateiku<br>		hong ikau, Yesus Tuhangku.<br>		<br>			<b>Ayat 3</b> <br>		Toh patut klawa te nyahandau<br>		pambelom, hapus umurku<br>		dan aku eter huang  ikau,<br>		O Yesus, Juruslamatku.<br>		nakara huang klawa aim<br>		palius ikei kan kahaim.<br>		<br>			<b>Ayat 4</b> <br>		O Yesus, Matanandau asi,<br>		hung pesta ayum andau toh<br>		sangkowong ayum ije brasih<br>		manyuang hapus huangku <br>		te magon hanjak ateiku<br>			<h5>Lago : L.N. No.128		&nbsp;&nbsp;&nbsp;&nbsp;</h5>	</p>'];
var nu_26=['<h3>26. TOH KELEH ITAH TOTO</h3>	<h4>F = 1 (4/4)</h4>	<p align="justify">	<b>Ayat 1</b> <br>		Toh keleh itah hanjak toto <br>		kataun Hatalla pangkahai.<br>		im prahana kan itah betoh <br>		hung Yesus Kristus Anak aie.<br>		Yoh slamat toto haliai <br>		je harap Yesus Tuhan aie.<br>		<br>			<b>Ayat 2</b> <br>		Kakaput manyangkulep oloh<br>		je jari layau handiai;<br>		te dumah Yesus, klawa toto,<br>		mamplawa itah toh samai;<br>		nakara huang klawa te,<br>		panggoet itah bujur wei<br>		<br>			<b>Ayat 3</b> <br>		Kaharap oloh bakas horan<br>		ilalus huang Yesus wei,<br>		yoh kare janji ayum Tuhan<br>		toh tulus huang ie wei,<br>		je dumah mimbit slamat hai <br>		dan itah belom katatai.  <br>		<h5>Lago : Toh jari toto bakarinah<br>		&nbsp;&nbsp;&nbsp;&nbsp;L.N. No.128</h5>	</p>'];
var nu_27=['<h3>27. JURUSLAMAT AIN ITAH</h3>	<h4>G = 1 (4/4)</h4>	<p align="justify">	<b>Ayat 1</b> <br>		Juruslamat ain itah <br>		je dumah has to<br>		keleh hanjak, <br>		has hanjak bewei!<br>		tatap atei aim <br>		akae te bagi aim te<br>		Yesus jurusalamat hai te.<br>		Has, has talih wei!<br>		Ela mikeh manyingkap<br>		salamat hai te. <br>		Yesus jurusalamat hai te.<br>		<br>			<b>Ayat 2</b> <br>		Juruslamat ain itah <br>		je dumah has toh,<br>		Keleh hanjak, <br>		has hanjak bewei!<br>		Akal, eka kaheran, <br>		hatalla je hai,<br>		kuasa, Bapa katatahie te.<br>		Yoh, te aran Aie.<br>		Ie rajan kasanang <br>		hung Pirdus aie te.<br>		Yesus Jurusalamat hai te.<br>		<br>			<b>Ayat 3</b> <br>		Juruslamat ain itah <br>		je dumah has to<br>		keleh hanjak, <br>		has hanjak bewei!<br>		Bintang slamat je <br>		lembut kan itah samai<br>		bara Yakob, yoh Israel te.<br>		Has, toh tatap wei!<br>		Atei itah tarima kamardeka aie.<br>		Yesus Jurusalamat hai te.<br>		<br>			<b>Ayat 4</b> <br>		Juruslamat ain itah <br>		je dumah has to<br>		keleh hanjak, <br>		has hanjak bewei!<br>		Tara akam o Tuhan, <br>		je paham kahaie.<br>		Sintam, asim, <br>		kasayangm je hai.<br>		Yoh, yoh akam wei.<br>		Biti, bereng dan <br>		gawingku samandiai<br>		Yesus Jurusalamat hai te.<br>		<h5>Lago : L.N. No.19		&nbsp;&nbsp;&nbsp;&nbsp;</h5>	</p>'];
var nu_28=['<h3>28. PAHAM KMANGAT AUH BARITA</h3>	<h4>C = 1 (6/8)</h4>	<p align="justify">	<b>Ayat 1</b> <br>		Paham kmangat auh barita <br>		ta into padang Eprata.<br>		Kare hormat kan Hatalla<br>		akae wei Haleluya!<br>		Ksanang hunjun petaka ton<br>		kilak Tuhan dengan olon<br>		Slamat Oloh je manalih<br>		Yesus Juruslamat te.<br>		<br>			<b>Ayat 2</b> <br>		Yesus mohon jaman horan<br>		asi-asi haliai<br>		Tapi Ie puna Tuhan<br>		Tempon taloh handiai.<br>		Ksanang hunjun petak aton<br>		kilak Tuhan dengan olon.<br>		Slamat oloh je manalih<br>		Yesus, Juruslamat te.<br>		<br>			<b>Ayat 3</b> <br>		Toto Ie te tabiri<br>		ain Hatalla pangkahai<br>		jadi prapah manakiri<br>		itah oloh handiai.<br>		Ksanang hunjun petak aton<br>		kilak Tuhan dengan olon.<br>		Slamat oloh je manalih <br>		Yesus, Juruslamat te.<br>		<br>			<b>Ayat 4</b> <br>		Ie paham asi-asi,<br>		menter huang dulang te.<br>		Mahin jeleng sampalaki<br>		jadi padadusae wei.<br>		Ksanang hunjun petak aton, <br>		kilak Tuhan dengan olon.<br>		Slamat oloh je manalih <br>		Yesus, Juruslamat.<br>		<br>		<b>Ayat 5</b> <br>		Ajar ikei, o Hatalla<br>		melai huang sintam te,<br>		belom akam jaton sala,<br>		palus rajur-rajur wei.<br>		Ksanang hunjun petak aton<br>		kilak Tuhan dengan olon.<br>		Slamat oloh je manalih<br>		Yesus, Juruslamat te.<br>		<br>		<b>Ayat 6</b> <br>		Plawa ikei je badosa,<br>		dosan ikei toto hai.<br>		Trima ikei o Hatalla<br>		tame lewum katatai.<br>		Ksanang hunjun petak aton<br>		kilak Tuhan dengan oloh.<br>		Slamat oloh je manalih<br>		Yesus, Juruslamat te.<br>		<h5>Lago : L.N. No.103		&nbsp;&nbsp;&nbsp;&nbsp;</h5>	</p>'];
var nu_29=['<h3>29. ALEM KRISTUS TUHAN ITAH</h3>	<h4>C = 1 (2/4)</h4>	<p align="justify">	<b>Ayat 1</b> <br>		Rangka-rangka<br>		Alem Kristus, Tuhan itah,<br>		tame hung kalunen tuh,<br>		mlekat ayue mimbit brita<br>		akan oloh korik<br>		yoh awing harap tanggar wei <br>		janji Tuhan bara horan : <br>		“Ela mikeh! Khanjak hai<br>		Bagin keton handiai.”<br>		<br>			<b>Ayat 2</b> <br>		Toh inakan akan keton <br>		Kristus, Juruslamat te,<br>		hung Betlehem ei aton,<br>		tinai katan ktantue te :<br>		Huang kandang meto wei.<br>		Ie menter huang dulang.<br>		Tara akae! Hormat aie<br>		nyanyin itah handiai.<br>		<br>			<b>Ayat 3</b> <br>		Khanjak tagal Juruslamat <br>		bagin oloh handiai;<br>		krana Yesus Kristus mawat<br>		kare oloh korik hai;<br>		ewen te samandiai<br>		ije harap Ie toto.<br>		Trimakasih akan toh!<br>		Yesus Juruslamatku!<br>		<br>			<b>Ayat 4</b> <br>		Sinta <u>aim</u>, o Tuhan Yesus,<br>		paham toto dengangku.<br>		Awim aku toh inewus<br>		liwus bara dosangku.<br>		Slamat, khanjak bagingku,<br>		uras awi asim, Tuhan!<br>		Dohop aku belom toh<br>		akam huang <u>kua</u>san Roh.<br>			<h5>Lago : L.N. No.10		&nbsp;&nbsp;&nbsp;&nbsp;</h5>	</p>'];
var nu_30=['<h3>30. TOH KRISTUS JARI DUMAH</h3>	<h4>G = 1 (4/4)</h4>	<p align="justify">	<b>Ayat 1</b> <br>		Toh Kristus jari dumah,<br>		salundik Isai te<br>		Hong Betlhem aton humae,<br>		Yoh kandang meto wei.<br>		O Raja pangkahai!<br>		Yoh ikau, Juruslamat,<br>		je patut impahai.<br>		<br>			<b>Ayat 2</b> <br>		Hong alem brasih horan<br>		hong lewun Dawid te<br>		Hatalla halalian<br>		kahanjak Pirdus te, <br>		kan itah handiai.<br>		Has itah omba Ie<br>		je mimbit slamat hai.<br>		<br>			<b>Ayat 3</b> <br>		O Yesus sampai matei<br>		pahayak ikei wei<br>		karinah akan atei<br>		kapaham sintam te!<br>		Hong lewu sorga te<br>		<u>tau</u> ikei mimbit tara,<br>		manyanyi akam wei.<br>			<h5>Lago : L.N. No.132		&nbsp;&nbsp;&nbsp;&nbsp;</h5>	</p>'];
var nu_31=['<h3>31. TOH PATUT ITAH HANJAK TOTO</h3>	<h4>A = 1 (9/8)</h4>	<p align="justify">	<b>Ayat 1</b> <br>		Toh patut itah hanjak toto <br>		huang pesta alem brasih to,<br>		te basa Anak je inakan<br>		kan itah horan andau toh.<br>		Batantu Anak ain Hatalla,<br>		je tumon <u>auh</u> dan janji aie,<br>		je bara horan imbarita<br>		insane kare Nabi aie.<br>		<br>			<b>Ayat 2</b> <br>		Katika Anak te inakan<br>		malekat Tuhan mohon wei<br>		tantai mansana jete akan<br>		sakatik kawan meto te.<br>		Yoh koae : Ela keton mikeh!<br>		Te basa <u>auh</u> je imbitku<br>		kahanjak hai je akan keton<br>		kan kare oloh handiai.<br>		<br>			<b>Ayat 3</b> <br>		Yoh Juruslamat jari dumah,<br>		inakan akan keton toh.<br>		Ie te Anak <u>ain</u> Hatalla,<br>		je eter auh dan janji aie,<br>		manenga slamat akan oloh<br>		je harap harap huang Ie wei.<br>		Toh katae keton sondau Ie<br>		impeter huang dulang wei.<br>		<br>			<b>Ayat 4</b> <br>		Toh patut itah hanjak toto<br>		manara sintan Tuhan te,<br>		mahormat asie je hakutoh,<br>		manempo Ie bujur wei.<br>		Toh sintae tarang huang Yesus,<br>		je Batang slamat toto te.<br>		O nyanyi keton, kare utus <br>		tuntang manara sintae wei!<br>			<h5>Lago : L.N. No.134		&nbsp;&nbsp;&nbsp;&nbsp;</h5>	</p>'];
var nu_32=['<h3>32. HORMAT, HORMAT, HORMAT</h3>	<h4>C = 1 (4/4)</h4>	<p align="justify">	<b>Ayat 1</b> <br>		Hormat, hormat, hormat,<br>		Hatalla hong ngambo!<br>		Kasanang hong ngiwa<br>		dengan oloh kakilak Hatal(ta)la,<br>		dengan oloh kakilak Hatalla.<br><br>				Hormat Hatalla huang ngambo!<br>		Hormat Hatalla huang ngambo!<br>		Kasanang hung ngiwa!<br>		Kasanang hung ngiwa!<br>		dengan oloh kakilak Hatalla.<br><br>		Hormat, hormat, hormat<br>		Hatalla hong ngambo!<br>		kasanang hong ngiwa;<br>		dengan oloh kakilak Hatal(ta)la,<br>		dengan oloh kakilak Hatalla<br>			<h5>Lago : L.N. No.41		&nbsp;&nbsp;&nbsp;&nbsp;</h5>	</p>'];
var nu_33=['<h3>33. TOH SLAMAT WEI (ALEM BRASIH)</h3>	<h4>F = 1 (4/4)</h4>	<p align="justify">	<b>Ayat 1</b> <br>		Toh salamat wei,<br>		toh kahanjak wei<br>		akan itah katika toh.<br>		Yesus handak mawat<br>		oloh ije rusak.<br>		Hanjak, hanjak <br>		oloh handiai.<br>		<br>		<b>Ayat 2</b> <br>		Toh salamat wei, <br>		toh kahanjak wei<br>		akan itah katika toh.<br>		Yesus mangarinah <br>		kare sinta Bapae.<br>		Hanjak, hanjak <br>		oloh handiai!<br>		<br>		<b>Ayat 3</b> <br>		Toh salamat wei, <br>		toh kahanjak wei<br>		akan itah katika toh.<br>		Kawan bara sorga <br>		mimbit nyanyi tara.<br>		Hanjak, hanjak <br>		oloh handiai!<br>		<br>		<b>Ayat 4</b> <br>		Toh salamat wei, <br>		toh kahanjak wei<br>		akan itah katika toh.<br>		Ikei toh manara <br>		aram, o Hatalla<br>		basa asim <br>		toto paham hai!<br>					<h5>Lago : L.N. No.136		&nbsp;&nbsp;&nbsp;&nbsp;</h5>	</p>'];
var nu_34=['<h3>34. O KETON JE HARAP</h3>	<h4>A = 1 (2/4)</h4>	<p align="justify">	<b>Ayat 1</b> <br>		O keton, je harap <br>		sakare janjin Tuhan,<br>		has omba, yoh omba <br>		akan betlehem.<br>		Jurusalamat, <br>		Yesus jari dumah.<br>		Toh santop sembah ie;<br>		toh santop sembah ie,<br>		toh santop, sembah ie,<br>		Panewus <u>aim</u>.<br>		<br>		<b>Ayat 2</b> <br>		O oloh badosa, <br>		toh hanja-hanjak keton!<br>		Kakilak Hatalla <br>		dengan itah toh.<br>		Dosa iampun, itah slamat toto<br>		Toh sontop, sembah ie;<br>		toh sontop, sembah ie;<br>		toh sontop, sembah ie, <br>		Panewus <u>aim</u>!<br>		<br>		<b>Ayat 3</b> <br>		O Raja salamat, <br>		o Tuhan Yesus Kristus,<br>		je mimbit kaliwus <br>		akan ikei toh<br>		Akam horumat <br>		tuntang trimakasih.<br>		Toh sontop, sembah ie;<br>		toh sontop, sembah ie;<br>		toh sontop, sembah ie,<br>		Panewus <u>aim</u>!<br>		<br>		<b>Ayat 4</b> <br>		O Jurupanewus, <br>		je duma bara sorga,<br>		karandahm impraham <br>		akan ikei toh<br>		Tuhan, Hatalla, <br>		Tempon kare kuasa!<br>		Toh sontop, sembah ie;<br>		toh sontop, sembah ie;<br>		toh sontop, sembah ie;<br>		Panewus <u>aim</u>!<br>			<h5>Lago : L.N. No.90		&nbsp;&nbsp;&nbsp;&nbsp;</h5>	</p>'];
var nu_35=['<h3>35. HANJAK O OLOH</h3>	<h4>G = 1 (3/4)</h4>	<p align="justify">	<b>Ayat 1</b> <br>		Hanjak o oloh pahayak <br>		malekat hong ngambo<br>		Krana Hatalla mamprahan <br>		kan itah hong hetoh<br>		asie je hai huang karanjaan aie.<br>		Itah iharga harajur. <br>		<br>		<b>Ayat 2</b> <br>		Hanjak, yoh hanjak,<br>		o keton hung hapus kalunen,<br>		Itah samai patut manara pahai<br>		Yesus, je tame kalunen.<br>		<br>		<b>Ayat 3</b> <br>		Yesus malihi kahaie,<br>		palus manjadi oloh.<br>		Tulus toh janjin Hatalla, <br>		je jari banohon.<br>		Itah toh tau harap,<br>		mangenang manggau<br>		slamat, kasanang hung Yesus.<br>			<h5>Lago : Tara Hatalla, <br>		&nbsp;&nbsp;&nbsp;&nbsp;je pangkahai Raja<br>		&nbsp;&nbsp;&nbsp;&nbsp;L.N. No.90</h5>	</p>'];
var nu_36=['<h3>36. KELEH ITAH TOH MANARA</h3>	<h4>F = 1 (3/4)</h4>	<p align="justify">	<b>Ayat 1</b> <br>		Keleh itah toh manara<br>		Yesus Kristus Tuhan itah.<br>		Tengah hormat, nyanyi akae<br>		keton kare ungkup aie.<br>		<br>		<b>Ayat 2</b> <br>		Ite toh kapaham asi<br>		<u>ain</u> Hatalla i je brasih<br>		ije toh malalus janjie<br>		dengan oloh handiai<br>		<br>		<b>Ayat 3</b> <br>		Bintang Yahob te mamala<br>		Kristus, Tempon sokah raja.<br>		Ie, ije mampakalah<br>		setan tuntang <u>kua</u>sa aie.<br>		<br>			<b>Ayat 4</b> <br>		Hanjak rantang kare oloh,<br>		awang harap ie toto,<br>		ije lembut bara ngambo,<br>		maja itah oloh toh.<br>		<br>			<b>Ayat 5</b> <br>		Je impeter huang dulang,<br>		Juruslamat, je ingenang<br>		soho ikei melai sanang <br>		jeha huang eka <u>Aim</u>!<br>			<h5>Lago : L.N. No.90<br>		&nbsp;&nbsp;&nbsp;&nbsp;</h5>	</p>'];
var nu_37=['<h3>37. ALEM BRASIH SAMPAI TINAI</h3>	<h4>ES = 1 (3/4)</h4>	<p align="justify">	<b>Ayat 1</b> <br>		Alem brasih, sampai tinai,<br>		Patut itah hanjak toh.<br>		Keleh kgogop, tangis sanai,<br>		buah hanjak huang Roh!<br>		Yesus Juruslamatku <br>		ie batang khanjak toh.<br>		Keleh itah hanjak rantang<br>		huang klawa je ingenang!<br>		<br>		<b>Ayat 2</b> <br>		Has, toh tara sintan Tuhan,<br>		kare oloh korik, hai, <br>		basa itah toh katawan<br>		asie ije pangkahai.<br>		Yesus, Juruslamatku,<br>		ie Batang asi toh.<br>		ije imbit Alem Brasih!<br>		<br>		<b>Ayat 3</b> <br>		Klawa, ije toh manyingah <br>		hapus penda langit toh,<br>		handak mimbit itah hobah,<br>		belom tumon sohon Roh.<br>		Yesus, Juruslamatku, <br>		ie Batang klawa toh.<br>		Keleh hanjak huang klawa,<br>		ije lembut bara sorga!<br>					<h5>Lago : Schweigt ihr ernsten Glocken<br>		&nbsp;&nbsp;&nbsp;&nbsp;L.N.P No.2</h5>	</p>'];
var nu_38=['<h3>38. O IKAU, RAJA, IJE DUMAH</h3>	<h4>A = 1 (3/4)</h4>	<p align="justify">	<b>Ayat 1</b> <br>		O Ikau raja ije dumah<br>		o Yesus, eka ampongku :<br>		toh terai kpehen dan kasusah<br>		te basa slamat tokep toh.<br>		Hung ikau sorga hunjun petak,<br>		Hatalla manja ikei to<br>		O tame kea atei aingku,<br>		mampangat hapus huangku.<br>		<br>		<b>Ayat 2</b> <br>		O  Juruslamat, tenga ksang<br>		kan ikei ije pehe te!<br>		Karandah ayum huang dulang<br>		manatau ikei hante wei<br>		Toh ikei dengan atei bujur<br>		haus belom indu hormat <u>aim</u>.<br>		O soho sintam te harajur<br>		ngagalan ikei kan kah<u>aim</u>!<br>			<h5>Lago : O du mein Trost <br>	&nbsp;&nbsp;&nbsp;&nbsp;und susses Hoffen<br>		&nbsp;&nbsp;&nbsp;&nbsp;Gr.M.H 6 L.N.P No.32</h5>	</p>'];
var nu_39=['<h3>39. HAS, KELEH TOH MABO AUH NYANYI</h3>	<h4>C = 1 (6/8)</h4>	<p align="justify">	<b>Ayat 1</b> <br>		Has keleh toh mambo <u>auh</u> nyanyi <br>		kan tara Immanuel toh!<br>		Horumat aie keleh harajur<br>		insanan hung ungkup aie toh.<br>		Has, nyanyi toh barami-rami!<br>		O tenga horumat kahai.<br>		kan Raja salamat je dumah,<br>		Immanuel aran aie.<br>		<br>		<b>Ayat 2</b> <br>		Panumah aie mimbit kahanjak,<br>		salamat, je paham kahaie.<br>		Yoh ie je jari mananggong<br>		mampuas kasalam samai.<br>		Has, nyanyi toh barami-rami!<br>		O tenga horumat kahai,<br>		kan Rajan salamat je dumah,<br>		Immanuel aran aie.<br>		<br>			<b>Ayat 3</b> <br>		Yoh sintae te keleh toh manang <br>		hung hapus karajaan aie,<br>		manenga pambelom, kasanang,<br>		manyuang toh itah samai. <br>		Has, nyanyi toh barami-rami!<br>		O tenga horumat, kahai,<br>		kan Rajan salamat je dumah,<br>		Immanuel aran aie<br>			<h5>Lago : : Kom, stemt mee den <br>	&nbsp;&nbsp;&nbsp;&nbsp;psalmzang der eeuwen <br>	&nbsp;&nbsp;&nbsp;&nbsp;(Tot Aandenken No.37)<br>		&nbsp;&nbsp;&nbsp;&nbsp;L.N.P No.13</h5>	</p>'];
var nu_40=['<h3>40. MLEKAT DUMAH BARA SORGA</h3>	<h4>G = 1 (4/4)</h4>	<p align="justify">	<b>Ayat 1</b> <br>		Mlekat dumah bara sorga <br>		mohon kan kalunen toh.<br>		Ie nampahai manara <br>		Kristen Yesus dan hamauh :<br>		“Ksanang hunjan petak aton,<br>		akan kakare olon!”<br>		Hanjak keton, hanjak keton,<br>		Kristus dumah hining yoh!<br>		<br>		<b>Ayat 2</b> <br>		Tulus janji ain Hatalla <br>		dengan kare oloh aie, <br>		akan Abram tuntang Yakob, <br>		akan Dawid, nabi aie.<br>		Ie jari mampadumah <br>		Juruslamat akan itah.<br>		Nyanyi toh, malekat aie, <br>		tara akae hong kahaei,<br>		Nyanyi toh, malekat aie,<br>		tara akae hong kahaei!<br>		<br>			<b>Ayat 3</b> <br>		Huang ie itah jari <br>		supa asi paham hai.<br>		Ie ije mangarinah<br>		sintan Bapae, ije hai.<br>		Toh kakilak ayue aton<br>		akan kare-kare olon.<br>		Tara Tuhan panghahai, <br>		hormat palus katatai!<br>		Tara Tuhan pangkahai,<br>		hormat palus katatai!<br>			<h5>Lago : Eere zij God (Nieuwe <br>		&nbsp;&nbsp;&nbsp;&nbsp;Liederen V.J.D.S) <br>		&nbsp;&nbsp;&nbsp;&nbsp;L.N.P No.31</h5>	</p>'];
var nu_41=['<h3>41. TARA, HORUMAT KAN RAJA SALAMAT</h3>	<h4>G = 1 (4/4)</h4>	<p align="justify">	<b>Ayat 1</b> <br>		Tara, horumat kan Raja salamat,<br>		bintang aie mimbit kahanjak je hai<br>		Jari manyingah hong timur, hong barat<br>		Hanjak toh itah hung Yesus samai.<br>		<br>		<b>Ayat 2</b> <br>		le toh Batang kalawa je tinduh<br>		mimbit salamat, panatau, kahai.<br>		Ikei balaku toh hayak mananggoh :<br>		Plawa ah ikei je kaput, akai!<br>		<br>			<b>Ayat 3</b> <br>		Jurusalamat toh tantai maliwus<br>		tuntang naheta pambelom dan roh.<br>		Bereng, hambruan toh puna <u>ain</u> Yesus,<br>		imbit te, Tuhan, kan sogra <u>aim</u> toh!<br>			<h5>Lago : Bintang di timur S.L.31<br>		&nbsp;&nbsp;&nbsp;&nbsp;L.N.P No.45</h5>	</p>'];
var nu_42a=['<h3>42a. SORAK, LAHAP RAMI-RAMI</h3>	<h4>C = 1 (2/4)</h4>	<p align="justify">	<b>Ayat 1</b> <br>		Sorak lahap rami-rami,<br>		ambo <u>auh</u> kahanjak toh<br>		Imbit hormat trimakasi<br>		kan panewus ayum toh<br>		krana Tuhan pangkahai<br>		marar ikau, ungkup aie!<br>		<br>		<b>Ayat 2</b> <br>		Ela mikeh, ela rungkok,<br>		ela magon nyukok wei!<br>		Aloh jalam jari bingkok,<br>		Tuhan mampun dosam te,<br>		dan mamprasih ateim toh<br>		toto hapan <u>kua</u>san Roh<br>		<br>			<b>Ayat 3</b> <br>		Hapan asi katatahi<br>		Tuhan marar ikau toh,<br>		mampong ateim tuntang masi<br>		hapan sinta, hapan Roh.<br>		Ikau eka sinta aie<br>		palus sampai katatai.<br>		<br>			<b>Ayat 4</b> <br>		Kare bukit akan hongge<br>		lungkoh akan tandar wei,<br>		tapi asin Tuhan hante<br>		tetep tuntang eter wei.<br>		Kare janji slamat aie<br>		jaton haying katatai.<br>		<br>			<b>Ayat 5</b> <br>		Nyanyi, tara trimakasih <br>		akan Tuhan pangkahai<br>		je menyengok huang asie<br>		ikau ije utus aie,<br>		maja oloh handiai<br>		huang Anak tonggal aie.<br>					<h5>Lago : Padang benyem<br>		&nbsp;&nbsp;&nbsp;&nbsp;R.L. No.593</h5>	</p>'];
var nu_42b=['<h3>42a. SORAK, LAHAP RAMI-RAMI</h3>	<h4>C = 1 (4/4)</h4>	<p align="justify">	<b>Ayat 1</b> <br>		Sorak lahap rami-rami,<br>		ambo <u>auh</u> kahanjak toh!<br>		Imbit hormat trimakasi<br>		kan panewus ayum toh!<br>		<br>		<b>Ayat 2</b> <br>		Ela mikeh, ela rungkok,<br>		ela magon nyukok wei!<br>		Aloh jalam jari bingkok,<br>		Tuhan mampun dosam te,<br>		dan mamprasih ateim toh<br>		toto hapan <u>kua</u>san Roh<br>		<br>			<b>Ayat 3</b> <br>		Hapan asi katatahi<br>		Tuhan marar ikau toh,<br>		mampong ateim tuntang masi<br>		hapan sinta, hapan Roh.<br>		Ikau eka sinta aie<br>		palus sampai katatai.<br>		<br>			<b>Ayat 4</b> <br>		Kare bukit akan longge<br>		lungkoh akan tandar wei,<br>		tapi asin Tuhan hante<br>		tetep tuntang eter wei.<br>		Kare janji slamat aie<br>		jaton haying katatai.<br>		<br>			<b>Ayat 5</b> <br>		Nyanyi, tara trimakasih <br>		akan Tuhan pangkahai<br>		je menyengok huang asie<br>		ikau ije utus aie,<br>		maja oloh handiai<br>		huang Anak tonggal aie.<br>					<h5>Lago : Eweh tawon oloh kanih<br>		&nbsp;&nbsp;&nbsp;&nbsp;L.N No.21</h5>	</p>'];
var nu_43=['<h3>43. TOH HINING AUH MALEKAT</h3>	<h4>F = 1 (2/4)</h4>	<p align="justify">	<b>Ayat 1</b> <br>		Toh hining <u>auh</u> Malekat :<br>		Halleluya! <br>		hong Alem brasih horan :<br>		Halleluya!<br>		“Horumat kan Hatalla<br>		horumat kan Hatalla!”<br>		Halleluya, Halleluya!<br>		<br>		<b>Ayat 2</b> <br>		Toh hining <u>auh</u> malekat :<br>		Halleluya!<br>		hong Alem brasih horan :<br>		Halleluya!<br>		“Kasanang hunjun petak,<br>		kasanang hunjun petak!”<br>		Halleluya, halleluya!<br>		<br>			<b>Ayat 3</b> <br>		Toh hining <u>auh</u> malekat :<br>		Halleluya!<br>		hong Alem brasih horan :<br>		Halleluya!<br>		“Kakilak dengan olon, <br>		kakilak dengan olon!”<br>		Halleluya, halleluya!<br>				<h5>Lago : Hort ihr Engel singen?<br>		&nbsp;&nbsp;&nbsp;&nbsp;</h5>	</p>'];
var nu_44=['<h3>44. AYO, BALALU ITAH TOH SAMAI</h3>	<h4>F = 1 (4/4)</h4>	<p align="justify">	<b>Ayat 1</b> <br>		Ayo, balalu toh ith samai,<br>		bawi hatue haguet samai<br>		palus kan Betlehem manampayah<br>		ije imbrita nah<br>		akan itah Ela nikeh!<br>		<br>		<b>Ayat 2</b> <br>		Kawan tabiri toh melai bewei;<br>		itah toh palus kan Betlehem te!<br>		Taloh kalunen toh inalikut,<br>		palus ilihi hong eka kaput,<br>		Lihi bewei!<br>		<br>			<b>Ayat 3</b> <br>		Selo-seloa toh itah samai<br>		tanggoh je dumah kan itah samai.<br>		Awau inakan je Kristus area.<br>		Kare malekat menyanyi tarae<br>		Tara bewei!<br>		<br>		<b>Ayat 4</b> <br>		Paham kahalap <u>auh</u> brita toh lah <br>		ije insanan malekat te nah!<br>		Jurusalamat manalih itah!<br>		Hanjak, yo hanjak toh atei itah!<br>		Hanjak bewei!<br>		<br>		<b>Ayat 5</b> <br>		Khanjak, kasanang, salamat je hai<br>		jari inatap kan itah samai.<br>		Anak Hatalla hong kandang meto<br>		inakan akan itah alem toh.<br>		Halleluya!<br>		<br>			<b>Ayat 6</b> <br>		Tara, horumat toh Tuhan bewei,<br>		petak mandino kasanang hai te,<br>		tinai kalunen ingilak Tuhan<br>		toh huang Anak aie je inakan<br>		O slamat hai!<br>				<h5>Lago : Kommet ihr Hirten.<br>		&nbsp;&nbsp;&nbsp;&nbsp;Gr.Missionsharfe<br>		&nbsp;&nbsp;&nbsp;&nbsp;No.34</h5>	</p>'];
var nu_45=['<h3>45. HAS NYANYI WEI</h3>	<h4>Es = 1 (4/4)</h4>	<p align="justify">	<b>Ayat 1</b> <br>		Has nyanyi wei, has nyanyi wei <br>		kan Anak te hong Betlehem,<br>		je mimbit khanjak ije hai<br>		kan kare itah handiai!<br>		Has nyanyi wei : Halleluya!<br>		<br>		<b>Ayat 2</b> <br>		Has tara wei, has tara wei<br>		kan Anak te hong Betlehem,<br>		je jari mimbit klawa hai,<br>		mamplawa itah handiai!<br>		Has tara wei : Halleluya!<br>		<br>			<b>Ayat 3</b> <br>		Horumat wei, horumat wei<br>		kan Anak te hong Betlehem,<br>		je mimbit itah handiai<br>		kan human Bapae hong kahaie!<br>		Horumat wei : Halleluya!<br>					<h5>Lago : Empor zu Gott<br>	&nbsp;&nbsp;&nbsp;&nbsp;mein Lobgesang<br>		&nbsp;&nbsp;&nbsp;&nbsp;</h5>	</p>'];
var nu_46=['<h3>46. HAS KELEH ITAH HANDIAI</h3>	<h4>G = 1 (3/4)</h4>	<p align="justify">	<b>Ayat 1</b> <br>		Has keleh itah handiai<br>		hong Alem brasih jetoh<br>		manalih Betlehem samai<br>		mangumang taloh jetoh :<br>		Hatalla Tuhan pangkahai<br>		malihi sorga dan kahai,<br>		majadi toto olon.<br>		<br>		<b>Ayat 2</b> <br>		Dialoh ije biti wei<br>		je <u>tau</u> harati toto<br>		katimben taloh heran te<br>		je ingarinah hetoh<br>		Kalunen sangang, hengan, wei<br>		nampayah Anak awau te<br>		je huang kandang meto.<br>		<br>			<b>Ayat 3</b> <br>		Yoh jaka atei aingku<br>		toh kilau tasik lombah<br>		je jaton bara tikas aje<br>		dan jaton taratuga,<br>		te mahin aku hindai wei<br>		<u>tau</u> mangasene taloh te<br>		je jari toh manjadi.<br>		<br>			<b>Ayat 4</b> <br>		Kakaput <u>ain</u> pampatei te<br>		je manyangkulep aku<br>		dan manganjungen hante wei<br>		kakare utus oloh,<br>		toh kala awi klawa te<br>		<u>ain</u> Matanandau asi te<br>		je jari lembut hetoh.<br>		<br>				<b>Ayat 5</b> <br>		O keleh genep biti toh<br>		balaku musok toto :<br>		Parangkah ah toh ateiku<br>		kan slamat <u>aim</u>, o Tuhan<br>		dan melai huang ateiku!<br>		Te aku hapus umurku<br>		harajur <u>aim</u>, o Tuhan!<br>		<h5>Lago : Hatalla buah impahai<br>		&nbsp;&nbsp;&nbsp;&nbsp;L.N No.33</h5>	</p>'];
var nu_47=['<h3>47. TOH KELEH HANJAK RANTANG</h3>	<h4>F = 1 (4/4)</h4>	<p align="justify">	<b>Ayat 1</b> <br>		Toh keleh hanjak rantang<br>		kakare itah toh<br>		dan atei sanang landing<br>		ong alem brasih toh.<br>		malekat bara ngambo <br>		manalih itah toh.<br>		Has, keleh itah mambo<br>		<u>auh</u> nyanyi tara toh<br>		has keleh itah mambo<br>		<u>auh</u> nyanyi tara toh!<br>		<br>		<b>Ayat 2</b> <br>		Malekat bara sorga,<br>		mansana khanjak hai,<br>		kahanjak ije paham,<br>		kan oloh handiai.<br>		Hatalla maja itah,<br>		hong Alem brasih toh.<br>		Has, keleh itah mambo,<br>		<u>auh</u> nyanyi tara toh.<br>		has keleh itah mambo, <br>		<u>auh</u> nyanyi rata toh!<br>		<br>			<b>Ayat 3</b> <br>		Hung Anak Aie je tonggal<br>		Hatalla maja toh<br>		manalih dan manyengok,<br>		kakare itah toh.<br>		Salamat bara sorga,<br>		imbagi alem toh.<br>		Has, keleh itah mambo,<br>		<u>auh</u> nyanyi tara toh,<br>		Has, keleh itah mambo,<br>		<u>auh</u> nyanyi tara toh!<br>		<br>			<b>Ayat 4</b> <br>		Hong Alem jetoh horan,<br>		hong lewu Betlehem,<br>		Hatalla manamunan,<br>		kaolon itah te.<br>		Kalunen dengan sorga,<br>		inyapan awie toh.<br>		Has, keleh itah mambo,<br>		<u>auh</u> nyanyi tara toh,<br>		has keleh itah mambo,<br>		<u>auh</u> nyanyi tara toh!<br>			<h5>Lago :  Freuet euch, ihr <br>		nbsp;&nbsp;&nbsp;&nbsp;lieben Christen<br>		&nbsp;&nbsp;&nbsp;&nbsp;P.B.I No.232</h5>	</p>'];
var nu_48=['<h3>48. AKU HANDAK MAMPAHAYAK</h3>	<h4>Es = 1 (3/4)</h4>	<p align="justify">	<b>Ayat 1</b> <br>		Aku handak mampahayak<br>		toh sakatik te<br>		hong jalan akan lewus Betlehem<br>		dan manyembah Anak te.<br>		<br>		<b>Ayat 2</b> <br>		Aku handak mampahayak<br>		toh <u>auh</u> nyanyi <u>ain</u> malekat<br>		mampahai, mahormat toh<br>		sintan, asin Tuhanku.<br>		<br>			<b>Ayat 3</b> <br>		Aku handak mampahayak<br>		toh Maria dan mangumang<br>		gawi <u>ain</u> Hatallangku<br>		hante huang ateiku.<br>		<br>			<b>Ayat 4</b> <br>		Aku handak mampahayak<br>		oloh pintar dan manyara<br>		bitingku, pembelomku<br>		akan Juruslamatku<br>		<br>		<b>Ayat 5</b> <br>		Metoh aku hunjun petak <br>		aku handak mampahayak<br>		Yesus Kristus, Tuhangku<br>		sampai hapus umurku.<br>		<br>			<h5>Lago :  Mit den Hirten will ich gehen <br>		&nbsp;&nbsp;&nbsp;&nbsp;R.I No.48</h5>	</p>'];
var nu_49=['<h3>49. HAS ITAH MIMBIT TARA TOH</h3>	<h4>A = 1 (4/4)</h4>	<p align="justify">	<b>Ayat 1</b> <br>		Has itah mimbit tara toh<br>		hong nyelo je taheta<br>		kan Tuhan ije sampai toh<br>		harajur masi itah.<br>		Kasanang tuntang asi hai<br>		yoh kutoh berkat handiai<br>		inenga nyelo malem.<br>		<br>		<b>Ayat 2</b> <br>		Horumat, tara akan yoh<br>		o Apang huang sorga!<br>		Tarima lakun ikei toh,<br>		je handak blakudoa.<br>		O ampun dosa handiai<br>		dan tenga berkat te samai<br>		kan ikei huang Yesus.<br>		<br>			<b>Ayat 3</b> <br>		Hong nyelo je taheta toh,<br>		pahayak kare oloh.<br>		Paabas ikei awi Roh,<br>		naheta ikei magon;<br>		nakara ikei handiai<br>		manyembah Tuhan pangkahai<br>		mahapan toto atei.<br>			<h5>Lago : L.N  No.29<br>		&nbsp;&nbsp;&nbsp;&nbsp;</h5>	</p>'];
var nu_50=['<h3>50. TUHAN YESUS KLAWANGKU</h3>	<h4>F = 1 (3/4)</h4>	<p align="justify">	<b>Ayat 1</b> <br>		Tuhan Yesus klawangku<br>		Dia usah aku mikeh<br>		taloh kaput je ngapehe<br>		oloh hong kalunen toh<br>		krana Yesus klawangku;<br>		krana Yesus Klawangku<br>		<br>		<b>Ayat 2</b> <br>		Tuhan Yesus ampongku!<br>		Hong kasusah dan kajake<br>		Ie marar aku hante<br>		sampai sanang ateiku.<br>		Tuhan Yesus ampongku,<br>		Tuhan Yesus ampongku!<br>		<br>			<b>Ayat 3</b> <br>		Yesus wei kalindongku!<br>		Kare-kare taloh papa,<br>		je mantakan tuntang mimpa,<br>		jaton <u>kua</u>sae dengangku.<br>		Yesus wei kalindongku,<br>		Yesus wei kalindongku!<br>		<br>		<b>Ayat 4</b> <br>		Yesus wei pambelomku!<br>		Aloh huang jam pampatei<br>		aku dengan khanjak atei<br>		buli akan eka Aie.<br>		kan pambelom katatai,<br>		kan pambelom katatai!<br>			<h5>Lago : L.N. No.50<br>		&nbsp;&nbsp;&nbsp;&nbsp;</h5>	</p>'];
var nu_51=['<h3>51. HUANG ARAN YESUS</h3>	<h4>C = 1 (4/4)</h4>	<p align="justify">	<b>Ayat 1</b> <br>		Huang ara Yesus,<br>		toh itah handak manampara<br>		nyelo je taheta,<br>		yoh mimbit akae nyanyi tara<br>		Ara Yesus kota hai<br>		akan kare oloh aie<br>		<br>		<b>Ayat 2</b> <br>		Yesus wei Pamawat hai<br>		jadi mawat kare itah<br>		ije puna ungkup aie,<br>		bara kare-kare dosa.<br>		Ruar bara Ie te<br>		itah toh binasa wei!<br>		<br>			<b>Ayat 3</b> <br>		Baya huang Yesus wei<br>		itah tau mandino ksanang<br>		slamat ije toto te,<br>		je ientai dan ingenag.<br>		Awie itah dinon toh,<br>		<br>		<b>Ayat 4</b> <br>		Kare utut handiai,<br>		kan indeko huang aran<br>		Yesus, Raja pangkahai,<br>		Ie ije puna Tuhan.<br>		Kare jela handiai<br>		kan mangaku ara aie.<br>		<br>		<b>Ayat 5</b> <br>		Patut aran Yesus wei<br>		impahai hong atei itah,<br>		Ie wei alamat te<br>		huang nyelo je taheta.<br>		Aran ayue Pangkahai.<br>		<br>			<h5>Lago : Patut aku hanjak toh<br>		&nbsp;&nbsp;&nbsp;&nbsp;L.N. No.107</h5>	</p>'];
var nu_52=['<h3>52. JATON KATAWANGKU JALANKU TE</h3>	<h4>Es = 1 (4/4)</h4>	<p align="justify">	<b>Ayat 1</b> <br>		Jaton katawangku jalanku te.<br>		Je hila <u>baung</u>ku hong kaput wei.<br>		Tapi katawangku : jalanangku<br>		jari ia toh awi Tuhangku.<br>		<br>		<b>Ayat 2</b> <br>		Jatoh katawangku jam aku toh <br>		liwus dan lapas bara kpehengku.<br>		Tapi Hatallangku hong asi aie<br>		manukas jam je patut haliai.<br>		<br>			<b>Ayat 3</b> <br>		Jaton katawangku taloh en-en.<br>		Tapi katapasku te dia men.<br>		Hatallangku je kuasa haliai,<br>		mimbing pambelomku hong lenge aie.<br>		<br>		<b>Ayat 4</b> <br>		Aloh tanggongangku babehat toh<br>		dan kaput pijem kare jalangku.<br>		Katawangku batantu haliai<br>		Hatalla mimbit aku kan kahaie.<br>		<br>		<b>Ayat 5</b> <br>		Tagal te ateiku hante bewei<br>		sanang dan suni ih hong jalan te,<br>		je tintue puna salamat ije hai<br>		hinje Hatallangku hong sorga aie.<br>			<h5>Lago : Weiss ich den weg auch nicht<br>		&nbsp;&nbsp;&nbsp;&nbsp;R.L.No.415. N.R. No.150	</h5>	</p>'];
var nu_53=['<h3>53. O TUHAN YESUS KRISTUS</h3>	<h4>F = 1 (4/4)</h4>	<p align="justify">	<b>Ayat 1</b> <br>		O Tuhan Yesus Kristus<br>		je jari toh manewus <br>		kakare ikei toh.<br>		Tahaseng <u>aim</u><br>		O Tuhan inyarah indu sapan. <br>		Toh ikei slamat katatai!<br>		<br>		<b>Ayat 2</b> <br>		Katapas dan kajake,<br>		kahawen tuntang kpehe<br>		nyarenam gantingku.<br>		Kapehem halalian<br>		kahanjak Eden horan<br>		kasanang slamat akangku.<br>		<br>			<b>Ayat 3</b> <br>		Yoh Tuhan jari matei<br>		toh dosa dan pampatei<br>		impala handiai.<br>		Toh eweh tau mampikeh?<br>		Kakare dosan ikei<br>		Impuas awi daha <u>aim</u>!<br>		<br>		<b>Ayat 4</b> <br>		Toh akam kare tara,<br>		hong hetoh huang sorga,<br>		o Tuhan pangkahai!<br>		Paabas oloh ayum<br>		nakara tau belom,<br>		o Yesus, dengam katatai!<br>			<h5>Lago : Toh jari ikei hetoh<br>		&nbsp;&nbsp;&nbsp;&nbsp;L.N. No.127</h5>	</p>'];
var nu_54=['<h3>54. O YESUS, IJE BRASIH</h3>	<h4>F = 1 (4/4)</h4>	<p align="justify">	<b>Ayat 1</b> <br>		O Yesus ije brasih<br> 		dan puna jaton sala<br>		hong kayu sampalaki<br>		ilantak tagal dosa<br>		nakara ikei empas,<br>		je paham toto tiwas.<br>		O Yesus, pasi ikei!<br>		<br>		<b>Ayat 2</b> <br>		Toh liwus toto ikei,<br>		inewus awi daham<br>		dan nihau kare like,<br>		o Yesus, awi sintam.<br>		Toh ela jete haying<br>		Yoh hag bele layang.<br>		o Yesus, pasti ikei!<br>		<br>			<b>Ayat 3</b> <br>		Horumat tara akam,<br>		je jari mandal toto.<br>		Paham ka<u>taun</u> basaram,<br>		hung asim je hakutoh.<br>		Yoh dohop tuntang awat,<br>		nakara ikei slamat,<br>		o Yesus pasi ikei!<br>			<h5>Lago : L.N. No.84<br>		&nbsp;&nbsp;&nbsp;&nbsp;</h5>	</p>'];
var nu_55=['<h3>55. ELA ATEIKU TAU KALAPEAN</h3>	<h4>G = 1 (4/4)</h4>	<p align="justify">	<b>Ayat 1</b> <br>		Ela ateiku <u>tau</u> kalapean<br>		kpehe <u>aim</u>, o Tuhanku<br>		ije tantai jari inyarenam<br>		hapan mawat aku toh<br>		bara kutoh kare utang dosa,<br>		bara <u>kua</u>san setan dan kapapa,<br>		Dosa <u>aing</u>ku toto hai,<br>		Hai haream asi <u>aim</u>.<br>		<br>		<b>Ayat 2</b> <br>		Akam tara, hormat trimakasih,<br>		Yesus, Tuhan pangkahai,<br>		ije paham toto jari masi,<br>		mawat ikei handiai.<br>		Jijit atei ikei akan ngambo<br>		mangat ikei heret dengam toto<br>		dan manempo, mampahai<br>		ikau, Tuhan pangkahai,<br>		<br>			<b>Ayat 3</b> <br>		Ikei, je hapumpong into hetoh<br>		mingat kare sintam te,<br>		palus ikei pakat toto-toto<br>		handak omba Tuhan wei,<br>		hayak sinta Tuhan buju-bujur<br>		bara toh dan palus raju-rajur.<br>		Dohop ikei toh samai, <br>		Tuhan, palus katatai!<br>			<h5>Lago : L.N. No.20<br>		&nbsp;&nbsp;&nbsp;&nbsp;</h5>	</p>'];
var nu_56=['<h3>56. O TUHAN YESUS, IJF JATON SALA</h3>	<h4>Bes = 1 (4/4)</h4>	<p align="justify">	<b>Ayat 1</b> <br>		O Tuhan Yesus, ije jaton sala<br>		en buku oloh te mamutus,<br>		uka mampatei Tuhan <br>		ije puna brasih<br>		dan kontep asi?<br>		<br>		<b>Ayat 2</b> <br>		Kalote ampie ewen oloh papa, <br>		mamukul Tuhan sampai lembut daha.<br>		Makota duhi majok, mangapehe<br>		takolok ayum.<br>		<br>			<b>Ayat 3</b> <br>		Limbah te oloh magah Tuhan, mangat<br>		mampateie sama kilau oloh b sat.<br>		Pai lenge ayum buah ajok paku,<br>		kapehe toto. <br>		<br>		<b>Ayat 4</b> <br>		En bukue Tuhan buah kare kpehe?<br>		Yoh tagal aku, ije patut matei.<br>		Kapehe <u>aim</u> te tagal dosa <u>aing</u>ku.<br>		O sinta toto!<br>		<br>		<b>Ayat 5</b> <br>		Yoh heran toto, Tuhan ije brasih<br>		mananggong aku ije asi-asi,<br>		mangganti aku ije are dosa<br>		tuntang kasalae.<br>		<br>		<b>Ayat 6</b> <br>		Toh, kilen aku manarimakasih,<br>		akam o Tuhan, hayak belom brasih?<br>		Tarima aku, dohop belom bujur <br>		akam harajur!<br>					<h5>Lago : L.N. No.50<br>		&nbsp;&nbsp;&nbsp;&nbsp;</h5>	</p>'];
var nu_57=['<h3>57. KARE KPEHEM SAMPAI MATEI</h3>	<h4>G= 1 (4/4)</h4>	<p align="justify">	<b>Ayat 1</b> <br>		Kare kpehem sampai matei<br>		inyarenam Tuhanku.<br>		Patut aku kpehe atei<br>		tagal kare dosangku.<br>		Huang tingkes handiai<br>		patut aram impahai.<br>		Haga ikei uka ela magon<br>		hureh dengan dosa!<br>		<br>		<b>Ayat 2</b> <br>		Amon aku handak layak<br>		manyak jalan lombah te,<br>		ije kontep taloh hayang :<br>		Yesus dohop aku wei<br>		mingat himang <u>aim</u> samai,<br>		baleh dosa handiai,<br>		bele aku palus layau,<br>		tapi kare kipen Nihau.<br>		<br>			<b>Ayat 3</b> <br>		Tuhan jari mampakala<br>		kare taloh papa te<br>		ije maroh aku omba<br>		huang jalan ayum wei.<br>		Dohop mangat ateiku<br>		inaheta awi Roh :<br>		tatap kea tuntang simpan<br>		indu huma <u>aim</u> o Tuhan!<br>					<h5>Lago : Ije tinai minggo hapus<br>		&nbsp;&nbsp;&nbsp;&nbsp;L.N. No.46</h5>	</p>'];
var nu_58=['<h3>58. KAPEHE AIM O TUHAN YESUS</h3>	<h4>G= 1 (4/4)</h4>	<p align="justify">	<b>Ayat 1</b> <br>		Kapehe <u>aim</u>, o Tuhan Yesus,<br>		baguna toto haliai<br>		kan ikei ije jari liwus,<br> 		yoh awi daham katatai<br>		pampatei jaton bara <u>kua</u>sa,<br>		pambelom ije manangtoh.<br>		Panatau dan ka<u>hain</u> Hatalla <br>		Imbagim akan ikei toh.<br>		<br>		<b>Ayat 2</b> <br>		O Tuhan, eweh <u>tau</u> mansana<br>		Ka<u>taum</u>, kahalapm dan ka<u>haim</u>?<br>		Yoh Raja slamat je inganan,<br>		je matei gantin oloh <u>aim</u>.<br>		Kapehem ikei buah Tuhan,<br>		inanggong awim handiai.<br>		Toh jari Nihau kare ksalan :<br>		O sinta ije toto hai!<br>		<br>			<b>Ayat 3</b> <br>		Makota duhi mangapehe<br>		Takolok ayun Tuhangku.<br>		Kahawen, pukul buah ie,<br>		te tagal kare dosangku.<br>		Yoh hung kapehe Tuhan suni,<br>		dan jaton lembut jawab aie,<br>		nakara ie manampuli<br>		kan ikei slamat dan kahai.<br>		<br>		<b>Ayat 4</b> <br>		O Yesus, dohop aku kea<br>		<u>tau</u> belom akam, Tuhangku :<br>		mangaku, mampahai, manara<br>		toh aram awi gawingku.<br>		Paabas aku, harap segah,<br>		nakara aku ije <u>aim</u>,<br>		manyaksi aram hung kajurah,<br>		hong hetoh palus hung ka<u>haim</u>.<br>					<h5>Lago : Haluli minggo manampara<br>		&nbsp;&nbsp;&nbsp;&nbsp;L.N. No.23</h5>	</p>'];
var nu_59=['<h3>59. YESUS KRISTUS IJE TOH INGENAG</h3>	<h4>G= 1 (4/4)</h4>	<p align="justify">	<b>Ayat 1</b> <br>		Yesus Kristus ije toh ingenag<br>		hapus hamba ruangku<br>		Magon aku handak toh mangumang :<br>		Tuhan ije Andalku.<br>		Ije buah kpehe buah himang<br>		Tagal aku, ije puna layang, <br>		jari tanggong dosangku <br>		jari matei gantingku.<br>		<br>		<b>Ayat 2</b> <br>		Dohop aku, uka mangon mingat<br>		kpehe <u>aim</u> o Tuhangku,<br>		mangat hante ateiku impingat,<br>		hanjak hambaruangku.<br>		Awim Yesus, aku toh iawat,<br>		sintam toto jari mimbit slamat<br>		dan kasanang akangku.<br>		Pasi aku Tuhangku.<br>		<br>			<b>Ayat 3</b> <br>		Aku ayum, Tuhan sewut amen,<br>		tinai ikau ayungku.<br>		Dia usah aku toh mahamen,<br>		basa Tuhan Tempongku.<br>		Aku handak sinta Tuhan toto,<br>		hayak belom akam brasih mantoh.<br>		Jete tukas ateiku,<br>		dohop aku Tuhangku.<br>					<h5>Lago : Ela ateiku tau kalapean<br>		&nbsp;&nbsp;&nbsp;&nbsp;L.N. No.20</h5>	</p>'];
var nu_60=['<h3>60. TUHAN YESUS IJE TAME</h3>	<h4>G= 1 (4/4)</h4>	<p align="justify">	<b>Ayat 1</b> <br>		Tuhan Yesus ije tame <br>		kpehe tagal dosangku.<br>		Ajar aku toh kasene<br>		sintam juruslamatku.<br>		Awi asim ije hai<br>		Oloh <u>aim</u> samandiai<br>		<u>tau</u> mandino bara <br>		ngambo slamat dan <br>		pambelom toto.<br>		<br>		<b>Ayat 2</b> <br>		Tara akam, je mananggong<br>		dosan ikei handiai.<br>		Dohop ikei toh mananjong<br>		huang klawam ije hai,<br>		mangat awi klawa te<br>		atei ikei blawa wei<br>		tuntang hante <u>tau</u> malalus<br>		kare prentah <u>aim</u>, o Yesus.<br>		<br>			<b>Ayat 3</b> <br>		Pasi kea kare oloh<br>		ije hung kakaput te.<br>		Jijit ewen uka tanggoh<br>		Juruslamat ayue wei.<br>		Plawa ateie awi Roh<br>		mangat toto <u>tau</u> hamauh :<br>		aku liwus bara setan,<br>		ihanjean dengan Tuhan.<br>		<br>		<b>Ayat 4</b> <br>		Tenga <u>kua</u>sa bara ngambo<br>		akan ikei handiai<br>		mangat awi ikei hetoh<br>		aram toto impahai.<br>		Ikei, awi daha <u>aim</u><br>		<u>tau</u> tame hung ka<u>haim</u>.<br>		Akam Yesus kare tara<br>		huang hetoh, huang sorga.<br>				<h5>Lago : Ije tinai minggo hapus<br>		&nbsp;&nbsp;&nbsp;&nbsp;L.N. No.46</h5>	</p>'];
var nu_61=['<h3>61. OH YESUS DAHAM KATATAI</h3>	<h4>D= 1 (4/4)</h4>	<p align="justify">	<b>Ayat 1</b> <br>		O Yesus daham katatai<br>		mamprasih aku toh<br>		Ka<u>taum</u> te toto paham hai<br>		manyanang huangku<br>		<br>		<b>Ayat 2</b> <br>		Yoh, Tuhan toto Imam te<br>		je blaku akangku<br>		nakara awi asim wei<br>		salamat bagingku.<br>		<br>			<b>Ayat 3</b> <br>		Tuh haying akal musoh te,<br>		je tulas haliai<br>		te basa daham hante wei<br>		kalindong ije hai<br>		<br>		<b>Ayat 4</b> <br>		Yoh, amon aku mingat toh<br>		kalangkahku samai,<br>		te magon aton ampongku<br>		je toto haliai	<br>		<br>		<b>Ayat 5</b> <br>		O dohop mangat aku <u>tau</u> <br>		nampayah Tuhan wei<br>		hong jalan simit te mang<u>gau</u><br>		salamat toto te.<br>			<h5>Lago : L.N. No.99<br>		&nbsp;&nbsp;&nbsp;&nbsp;</h5>	</p>'];
var nu_62=['<h3>62. HONG GOLGOTA, HONG SAMPALAKI</h3>	<h4>Bes = 1 (6/8)</h4>	<p align="justify">	<b>Ayat 1</b> <br>		Hong Golgota, hong sampalaki <br>		<u>ain</u> Yesus je Tempon kahai,<br>		tahasak kasayang,<br>		karasih mahasor kan oloh samai<br>		Tampayah Tabirin Hatala,<br>		parapah hong Golgota te,<br>		te keton mandino salamat<br>		salamat inenga bewie!<br>		<br>		<b>Ayat 2</b> <br>		Hong Golgota Yesus mananggong<br>		kasalam je paham kahain;<br>		hong hete bewei aton ampong<br>		kan oloh badosa samai.<br>		Tampayah Tabirin Hatalla,<br>		parapah hong Golgota te,<br>		te keton mandino salamat,<br>		salamat inenga bewei!<br>		<br>		Hong Golgota aton kaliwus,<br>		palembut kasanang je hai;<br>		hong hete <u>baun</u>tonggang kan Pirdus<br>		imbangah kan itah samai.<br>		Tampayah Tabirin Hatalla<br>		parapah hong Golgota te,<br>		te keton mandino salamat,<br>		salamat inenga bewei<br>					<h5>Lago : O seele, komm eilend zum Kreuze <br>		&nbsp;&nbsp;&nbsp;&nbsp;R.I. 158 L.N.P. No.19</h5>	</p>'];
var nu_63=['<h3>63. HONG KAYU SAMPALAKI</h3>	<h4>Es = 1 (4/4)</h4>	<p align="justify">	<b>Ayat 1</b> <br>		Hong kayu sampalaki<br>		<u>ain</u> Juruslamat<br>		mamarah sinta Yesus<br>		je tanggong dosaku<br>		Kasanang dan kahanjak <br>		aie manyuang ateiku;<br>		hong kpehe dan kajakengku<br> 		kasanang melai wei.<br>		<br>		<b>Ayat 2</b> <br>		Toh ampun tuntang <br>		asi batantu haliai,<br>		te basa Andal <u>aing</u>ku<br>		mananggong dosa te.<br>		Toh aku dengan oloh<br>		aie pahayak ie wei,<br>		hong jalan ije simit te<br>		kasanang melai wei.<br>					<h5>Lago : Am Kreuze meines Heilands<br>		&nbsp;&nbsp;&nbsp;&nbsp;R.I. 263 L.N.P No.17</h5>	</p>'];
var nu_64=['<h3>64. KAN EWEH YESUS, TUHANGKU</h3>	<h4>Bes = 1 (6/8)</h4>	<p align="justify">	<b>Ayat 1</b> <br>		Kan eweh Yesus Tuhangku, <br>		mamusuh daha aie!<br>		Kanduen kare kpehe te<br>		hong sampalaki aie?<br>		Tagal dosangku,<br>		matei gantingku<br>		yoh gantin itah handiai.<br>		O sinta ije hai!<br>		<br>		<b>Ayat 2</b> <br>		O Tuhan, akan musoh<br>		<u>aim</u> ilakum asi wei,<br>		impuas awim dosa aie,<br>		iampun handiai.<br>		Juruslamatku, matei gantingku,<br>		yoh gantin itah handiai, <br>		o ingat sintai aie!<br>		<br>		<b>Ayat 3</b> <br>		Yoh paham kpehen ateiku,<br>		je tiwas haliai,<br>		o ingat aku, Tuhangku,<br>		hung sorga, eka <u>aim</u>!<br>		Juruslamatku, matei gantingku,<br>		Yoh gantin itah handiai.<br>		O trima sinta aie!<br>		<br>		<b>Ayat 4</b> <br>		Hung kare tingkes setan te,<br>		hong kikeh handiai,<br>		te aku mingat daham wei,<br>		<u>auh</u> sorga toh mandai :<br>		Juruslamatku, matei gantingku,<br>		yoh gantin itah handiai. <br>		O harap asi aie!<br>		<br>		<b>Ayat 5</b> <br>		O trima hapus ateiku<br>		karr baleh kpehe <u>aim</u>!<br>		Katahin aku belom toh<br>		<u>auh</u> nyanyingku kakai :<br>		Juruslamatku, matei gantingku,<br>		yoh gantin itah handiai.<br>		O hanjak ungkup aie!<br>					<h5>Lago : Sagtan, vergoss der herr sein Blut?<br>		&nbsp;&nbsp;&nbsp;&nbsp;RR.I. 91 L.N.P. No.28</h5>	</p>'];
var nu_65=['<h3>65. MAHOROI ARE TANAH</h3>	<h4>F = 1 (6/8)</h4>	<p align="justify">	<b>Rangkah.<br>Ayat 1</b><br>		Mahoroi are tanah<br>		halisang aku toh;<br>		yoh are bukit gantong <br>		<u>tau</u> gitan matangku<br>		Te jadi indu eka <br>		kakilak ayungku.<br>		Toh baya bukit tunis<br>		je arae Golgota<br>		toh baya bukit tunis,<br>		je area Golgota<br>		<br>		<b>Ayat 2</b> <br>		<u>Baun</u> andau langit jaton<br>		inyampai tantan aie;<br>		yoh bukit jete korik<br>		dan randah haliai.<br>		Te mahin petak jatoh<br>		hong hete kejau wei.<br>		Kamangat sorga tokep <br>		hong bukit tunis te,<br>		kamangat sorga tokep<br>		hong bukit tunis te<br>		<br>		<b>Basikap isut<br>Ayat 3</b> <br>		Hong hete lenyoh atei<br>		<u>ain</u> oloh gagah te <br>		hong hete bigal tame<br>		<u>baun</u> tonggang Pirdus te.<br>		Hong hete tara hining <br>		<u>auh</u> slamat gloria<br>		<u>auh</u> nyanyi katatahi<br>		tahiu Golgota.<br>		<br>		<b>Rangkah-rangkah<br>Ayat 4</b> <br>		Hong bukit jete tende<br>		palisang <u>aing</u>ku toh,<br>		hong hete kare dosa<br>		inanggong Tuhangku<br>		je <u>haus</u> mandino ksanang as,<br>		keleh mingat ah :<br>		Toh jalan akan Pirdus<br>		mahoroi Golgota :<br>		toh jalan akan Pirdus<br>		mahoroi Golgota<br>		mahoroi Golgota.<br>					<h5>Lago : Durch manche Landersrecke <br>		&nbsp;&nbsp;&nbsp;&nbsp;Friedensgrusse<br>		&nbsp;&nbsp;&nbsp;&nbsp;No.10 L.N.P No.30</h5>	</p>'];
var nu_66=['<h3>66. TAHASAK IJE BRASIH TE</h3>	<h4>G = 1 (3/2)</h4>	<p align="justify">	<b>Ayat 1</b><br>		Tahasak ije brasih te,<br>		te dahan Tuhangku,<br>		mahasor tagal asie wei,<br>		mapuas dosangku.<br>		O keleh daha brasih<br>		te mampangat aku toh,<br>		mahalit kare himangku <br>		mamprasih ateiku!<br>		<br>		<b>Ayat 2</b> <br>		Bamillion kare oloh te,<br>		je jipen setan wei.<br>		inewus awi daha te, <br>		imprasih haliai.<br>		O keleh daha brasih <br>		te mampangat aku toh,<br>		mahalit kare himangku,<br>		mamprasih ateiku!<br>			<h5>Lago : Es ist ein Born R.L.No.175<br>		&nbsp;&nbsp;&nbsp;&nbsp;L.N.P. No.48</h5>	</p>'];
var nu_67=['<h3>67. TOH AKU MINGAT ARE KPEHEM</h3>	<h4>F = 1 (3/4)</h4>	<p align="justify">	<b>Ayat 1</b><br>		Toh aku mingat are kpehem<br>		je inyarenam Tuhangku<br>		Kahatang hambaruan ayum,<br>		imbuku awi dosangku.<br>		O Tuhan abes <u>aim</u> mahasor<br>		mahatis kilau daha wei,<br>		hambruam pehe sampai matei<br>		hong jete hong Getsemane.<br>		<br>		<b>Ayat 2</b> <br>		Toh aku mingat ampin Tuhan<br>		ilantak hong samplaki te<br>		Pai lengem ije inatelan,<br>		imaku into kayu te.<br>		Makota duhi mangapehe<br>		takolok <u>aim</u>, o Tuhangku.<br>		Kakare sapa, kare hukum<br>		Inanggongm tagal dosangku.<br>		<br>		<b>Ayat 3</b> <br>		Tahasak sinta dan kasanang<br>		mahasor hete akangku;<br>		dan awi daham aku landing.<br>		imprasih liken dosangku.<br>		Kakare utangku te punah,<br>		pambelom ije katatai<br>		iulih awim hong pampateim<br>		kan kare ikei handiai.<br>		<br>		<b>Ayat 4</b> <br>		O trima ganti kare kpehem<br>		salepah hambaruangku,<br>		tarima biti bereng <u>aing</u>ku<br>		kan baleh sintam, Tuhangku!<br>		O dohop, mangat aku toto<br>		manempo Tuhan Tempongku!<br>		Pambelom <u>aing</u>ku tonggal akam<br>		je jari matei gantingku.<br>					<h5>Lago : L.N.No.65 R.L.No.72<br>		&nbsp;&nbsp;&nbsp;&nbsp;</h5>	</p>'];
var nu_68=['<h3>68. TUHAN IKAU JARI MATEI</h3>	<h4>A = 1 (1/4)</h4>	<p align="justify">	<b>Ayat 1</b><br>		Tuhan ikau jari matei<br>		matei tagal dosangku.<br>		mangat aku sanang atei, <br>		slamat hai te bagingku<br>		Trimakasih akam Tuhan<br>		tagal kpehem te samai,<br>		i ijari inyarenam<br>		huang sintam ije hai.<br>		<br>		<b>Ayat 2</b> <br>		Hormat tara akam Tuhan<br>		ije matei gantingku<br>		intu kayu sampalaki,<br>		mangat aku belom toh.<br>		Amon aku lius buli,<br>		sanang landing huangku<br>		basa Tuhan manampuli<br>		slamat hai te akangku!<br>					<h5>Lago : Atei oloh ije pakai<br>		&nbsp;&nbsp;&nbsp;&nbsp;L.N. No.14</h5>	</p>'];
var nu_69=['<h3>69. KASENANGKU TOH BATANG DANOM</h3>	<h4>As = 1 (3/4)</h4>	<p align="justify">	<b>Ayat 1</b><br>		Kasenangku to batang danom je hai,<br>		je paham kaheran, kahai.<br>		Lalehan kahalap tampayang aie te!<br>		Tangkalalu kalombah aie te!<br>		Paharingku lius bewei!<br>		O <u>gau</u> batang danom hai te!<br>		Yoh, ingat ah : Akam danom te<br>		mahasor magon bewei!<br>		<br>		<b>Ayat 2</b> <br>		<u>Auh</u> lahap, <u>auh</u> sorak, <u>auh</u> tara bewei<br>		Ihining hong tiwing aie te.<br>		Yoh eweh je melai hong hete bewei<br>		mandino salamat hai te<br><br>				Paharingku lius bewei!<br>		O <u>gau</u> batang danom hai te!<br>		yoh, ingat ah : Akam danom te<br>		mahasor magon bewe!<br>		<br>			<b>Ayat 3</b> <br>		Tahasak aie aton hong Golgota te,<br>		mahasor toh magon bewei :<br>		dan puna tatamba je <u>mait</u> haliai,<br>		kan oloh badosa samai.<br><br>				Paharingku lius bewei!<br>		O <u>gau</u> batang danom hai te!<br>		yoh, ingat ah : Akam danom te<br>		mahasor magon bewe!<br>		<br>	<b>Ayat 4</b> <br>		Katawam toh, en batang danom hai te?<br>		Te daha ain Yesus bewei,<br>		je mimbit karasih, kasanang, kahai,<br>		salamat, kahanjak je hai!<br><br>				Paharingku lius bewei!<br>		O <u>gau</u> batang danom hai te!<br>		yoh, ingat ah : Akam danom te<br>		mahasor magon bewe!<br>					<h5>Lago : Ich weiss einen Strom<br>		&nbsp;&nbsp;&nbsp;&nbsp;R.L. No.187</h5>	</p>'];
var nu_70=['<h3>70. YESUS INTU SAMPALAKI</h3>	<h4>G = 1 (4/4)</h4>	<p align="justify">	<b>Ayat 1</b><br>		Yesus itun sampalaki, <br>		ie eka sintangku;<br>		awi ie jari matei <br>		tagal kare dosangku.<br>		Jeton tugas ateiku<br>		uka hapus umurku : <br><br>				Akae ije hong sampalaki,<br>		aku handak belom, matei.<br>		<br>		<b>Ayat 2</b> <br>		Hong <u>kueh</u> tarasondau sinta<br>		ije kilau sinta aie,<br>		jari mindah itah bara<br>		kare hokum handiai?<br>		Ie matei gantingku,<br>		Mangat aku belom toh!<br><br>				Akae ije hong sampalaki,<br>		aku handak belom, matei.<br>		<br>			<b>Ayat 3</b> <br>		Toto ie je manahor<br>		kare utang dosangku;<br>		jaton kpehe ije maur,<br>		jari puna utangku.<br>		Rusah-rambai Tuhangku<br>		tagal kadarhakangku.<br><br>				Akae ije hong sampalaki,<br>		aku handak belom, matei.<br>		<br>	<b>Ayat 4</b> <br>		Ie je batawah toto,<br>		imparandah haliai<br>		hong tampayah kare oloh,<br>		tagal dosangku samai.<br>		Ie wei Pamawatku<br>		tuntang eka slamatku.<br><br>				Akae ije hong sampalaki,<br>		aku handak belom, matei.<br>		<br>		<b>Ayat 5</b> <br>		Himang ayue je mamprasih,<br>		mampahalit himangku;<br>		bereng ayue ije brasih<br>		te mamuat peresku,<br>		kare kadarhakangku,<br>		dosa dan kalangkahku.<br>				Akae ije hong sampalaki,<br>		aku handak belom, matei.<br>				<h5>Lago : Ije tinai minggo hapus<br>		&nbsp;&nbsp;&nbsp;&nbsp;L.N No.46</h5>	</p>'];
var nu_71=['<h3>71. HUANG ROH AKU MANALIH</h3>	<h4>G = 1 (4/4)</h4>	<p align="justify">	<b>Ayat 1</b><br>		Huang roh aku manalih <br>		kubur raja pangkahai,<br>		hayak ewen oloh bawi,<br>		atei hetang haliai<br>		awi Yesus ingapehe<br>		into sampalaki matei,<br>		kare kharap ewen te<br>		Nihau tagal kubur te.<br>		<br>		<b>Ayat 2</b> <br>		Tapi bara tumbang kubur<br>		jari tandar batu te,<br>		eka Tuhangku ingujuh<br>		toh balihi benang wei<br>		Prea kubur <u>tau</u> manahan<br>		Tuhan Yesus, je insanan<br>		awi nabi handiai?<br>		Hanjak itah toh samai!<br>		<br>			<b>Ayat 3</b> <br>		Lahap keton, kare ungkup <br>		hong kalunen, nyanyi wei!<br>		Basa Tuhan itah belom,<br>		hanjak rantang atei wei!<br>		Tuhan Yesus jari manang,<br>		kare oloh ayue sanang.<br>		Setan dan pampatei te<br>		jaton <u>kua</u>sae, kala wei.<br>		<br>	<b>Ayat 4</b> <br>		Tara, hormat, trimakasih <br>		akan Tuhan pangkahai!<br>		Awi kutoh sintae, asie,<br>		itah jadi baris aie.<br>		Keleh Tuhan mimbit kea<br>		kare-kare tunduh kola <br>		kan pambelom katatai<br>		akan sorga, kan kahai!<br>			<h5>Lago : Yesus raja pangkahalap<br>		&nbsp;&nbsp;&nbsp;&nbsp;L.N No.54</h5>	</p>'];
var nu_72=['<h3>72. TOH, BASA YESUS TUHANGKU</h3>	<h4>G = 1 (4/4)</h4>	<p align="justify">	<b>Ayat 1</b><br>		Toh, basa Yesus Tuhangku <br>		imbelom impahai,<br>		kasalan tontang dosangku<br>		inganan handiai<br>		inganan handiai<br>		<br>		<b>Ayat 2</b> <br>		Kahanjak ije toto hai <br>		inengae akangku;<br>		toh setan tuntang kawan aie<br>		impalah Tuhangku,<br>		impalah Tuhangku.<br>		<br>			<b>Ayat 3</b> <br>		Kakare dosa ayungku <br>		mambuku hukum hai.<br>		Te Yesus Kristus, Andalku,<br>		mananggong te samai,<br>		mananggong te samai.<br>		<br>	<b>Ayat 4</b> <br>		<u>Auh</u> Yesus, Juruslamatku <br>		kalotoh : Aku toh<br>		nahuang oloh ayungku<br>		imbelom kea toh,<br>		imbelom kea toh.<br>		<br>		<b>Ayat 5</b> <br>		Toh, amon lepah umurku <br>		o Tuhan pangkahai,<br>		te duan, agah liauku<br>		kan sorga, kan kahai,<br>		kan sorga, kan kahai.<br>		<br>		<b>Ayat 6</b> <br>		Hung sorga aton slamat hai <br>		inatap akangku<br>		dan akan oloh handiai,<br>		je harap Tuhangku,<br>		je harap Tuhangku.<br>				<h5>Lago : O Yesus, tenga akangku<br>		&nbsp;&nbsp;&nbsp;&nbsp;L.N No.88</h5>	</p>'];
var nu_73=['<h3>73. HALLELUYA, YESUS BELOM</h3>	<h4>D = 1 (4/4)</h4>	<p align="justify">	<b>Ayat 1</b><br>		Halleluya Yesus belom,<br>		toh toto lepah kare hukum<br>		salamat bakarinah toh.<br>		Setan jari impakalah,<br>		pampatei jari Nihau <u>kua</u>sae,<br>		pambelom mimbing prentah toh.<br>		Horumat dan kahai harajur <br>		katatai akam Yesus!<br>		Hung sintam te, je toto hai<br>		pambelom ikei handiai.<br>		<br>		<b>Ayat 2</b> <br>		Ajar ikei, o Roh brasih, <br>		kasene Yesus, Batang asih,<br>		percaya kare janji aie.<br>		Plawa hapus atei ikei,<br>		nakara ikei toto mite<br>		kalawa ayum ije hai.<br>		Paabas oloh <u>aim</u><br>		dan imbit kan ka<u>haim</u>, kare ewen,<br>		je tohmanggau ka<u>haim</u> katau<br>		<u>ain</u> Yesus, Juruslamat te.<br>		<br>			<b>Ayat 3</b> <br>		Akam o Hatalla, Bapa, <br>		horumat tuntang kare tara,<br>		tarima nyanyin ikei toh!<br>		Ikei mimbit trimakasih<br>		toh tagal kare sinta, asi,<br>		je jari ingarinahm toh.<br>		Yoh Yesus andalku<br>		dan Juruslamatku aton Raja<br>		dan Imam hai : pambelom aie<br>		inengae kea akangku.<br>					<h5>Lago : Akam Yesus kare tara<br>		&nbsp;&nbsp;&nbsp;&nbsp;L.N No.1</h5>	</p>'];
var nu_74=['<h3>74. TOH HANJAK KETON HANDIAI</h3>	<h4>Es = 1 (4/4)</h4>	<p align="justify">	<b>Ayat 1</b><br>		Toh hanjak keton handiai,<br>		je <u>ain</u> Hatalla pangkahai,<br>		Yehowa tempon prentah!<br>		Kapehen Yesys lepah toh,<br>		parapah ayue awi Roh<br>		iluput tagal dosa <br>		Yesus Kristus belom tinai;<br>		toh pampatei jari kalah <br>		Yesus toh pambelom itah.<br>		<br>		<b>Ayat 2</b> <br>		Katetek Tuhan Yesus toh <br>		<u>ain</u> itah, ije tumon Roh,<br>		mananjong hung kabujur.<br>		Kamangat ije toto hai,<br>		salamat ije katatai<br>		inengae raju-rajur.<br>		Amon aton kapercaya,<br>		impanihau kare sapa<br>		tuntang hukum itah.<br>		<br>			<b>Ayat 3</b> <br>		Handipe bakas jaton <u>tau</u> <br>		ngapehe oloh je mang<u>gau</u><br>		kalindong huang Yesus.<br>		Takolok setan ramuk wei<br>		intakan Juruslamat te,<br>		dan itah toto liwus.<br>		Kuasan setan tuntang akal<br>		jari kala; Yesus mawat,<br>		mimbit itah akan slamat.<br>		<br>		<b>Ayat 4</b> <br>		Naraka tuntang pasong aie. <br>		kakare jarate handiai<br>		toh kalah awi Yesus;<br>		yoh setan dengan rewar aie,<br>		kakare kpapae handiai,<br>		impala Tuhan toto.<br>		Yesus mohon akan ngiwa<br>		dan mansanan brita slamat<br>		akan liau oloh helo.<br>		<br>		<b>Ayat 5</b> <br>		Hatalla, Raja pangkahai, <br>		horumat akam katatai,<br>		yoh akam trimakasih!<br>		O Yesus Kristus sinta <u>aim</u>,<br>		ka<u>taum</u>, karasihm dan ka<u>haim</u>,<br>		inara oloh ayum.<br>		O Roh brasih ajar ikei,<br>		mangat mite slamat toto!<br>		Jijit ikei akan ngambo!<br>					<h5>Lago : L.N No.133<br>		&nbsp;&nbsp;&nbsp;&nbsp;</h5>	</p>'];
var nu_75=['<h3>75. YESUS BELOM, TAGAL TE</h3>	<h4>C = 1 (4/4)</h4>	<p align="justify">	<b>Ayat 1</b><br>		Yesus belum tagal te <br>		aku belum hayak le<br>		O pampetei bara<u>kueh</u> <br>		ikau mangon <u>tau</u> mampikeh?<br>		Aku jari baris <u>ain</u> <br>		Yesus Tuhan pangkahai.<br>		<br>		<b>Ayat 2</b> <br>		Yesus puna Raja hai. <br>		Bapae jari mampamenda,<br>		kare taloh handiai<br>		penda paie : toh ie <u>kua</u>sa,<br>		<u>tau</u> mahaga aku toh<br>		bara kare musohku.<br>		<br>			<b>Ayat 3</b> <br>		Yesus belum ela toh <br>		magon bagalabah atei;<br>		krana <u>kua</u>san dosa te<br>		n hau, awi Yesus matei,<br>		tinai hung pambelom aie<br>		itah belum katatai.<br>		<br>		<b>Ayat 4</b> <br>		Yesus, belum slamat aie<br>		bagi <u>aing</u>ku, patut kea<br>		aku palus katatai<br>		belum akae dan mampalah<br>		kare kipen isingku<br>		hung karasih ateiku.<br>		<br>		<b>Ayat 5</b> <br>		Yesus belom, eweh <u>tau</u><br>		mengkak aku bara ie?<br>		Huang asie, hung ka<u>taue</u><br>		je manantajok lengee,<br>		mimbing aku segah toh, <br>		aloh sangit musohku.<br>		<br>		<b>Ayat 6</b> <br>		Yesus belom, tagal te <br>		bontong aku, amon matei,<br>		buli Tuhan <u>aing</u>ku wei,<br>		tame sorga hanjak atei.<br>		Slamat <u>aing</u>ku toto hai<br>		hinje Yesus hung kahaie.<br>			<h5>Lago : Patut aku hanjak toh<br>		&nbsp;&nbsp;&nbsp;&nbsp;L.N.No.107</h5>	</p>'];
var nu_76=['<h3>76. TARA AKAM TUHAN YESUS</h3>	<h4>D = 1 (4/4)</h4>	<p align="justify">	<b>Ayat 1</b><br>		Tara akam Tuhan Yesus!<br>		Toh ikei handiai inewus,<br>		pampatei jari kalah toh<br>		Ikei liwus bara setan,<br>		nakara ikei toh,<br>		o Tuhan, <u>tau</u> belom <br>		akam tumon Roh.<br>		O Tuhan pangkahai <br>		toh ikei <u>tau</u> mandai<br>		tame sorga.<br>		Salamat <u>aim</u>, je hung ka<u>haim</u>,<br>		toh bagin ikei handiai.<br>		<br>		<b>Ayat 2</b> <br>		Tuhan tame eka brasih, <br>		manalih padadusan asi,<br>		manyapan ikei handiai.<br>		Dinding helat je mamisah<br>		kakare ikei dengan Bapa<br>		inganan awin katatai.<br>		Toh Tuhan impahai,<br>		kakare oloh <u>aim</u>, slamat awim;<br>		kahanjak hai, kasanang <u>aim</u><br>		<u>tau</u> dinon oloh handiai.<br>		<br>			<b>Ayat 3</b> <br>		Tuhan ikei ije belom,<br>		panengam akan oloh ayum,<br>		pambelom ije katatai.<br>		Dohop ikei belom akam,<br>		manara, mahorumat aram,<br>		yoh hung karasih haliai.<br>		O pasi ikei toh<br>		dan suang hapan Roh, atei ikei!<br>		Kasanang <u>aim</u>, yoh Roh ka<u>haim</u><br>		marentah ikei handiai.<br>			<h5>Lago : Akam Yesus kare tara<br>		&nbsp;&nbsp;&nbsp;&nbsp;L.N.No.1</h5>	</p>'];
var nu_77=['<h3>77. LAHAP O KRISTEN, PAHAI TUHAN YESUS</h3>	<h4>F = 1 (4/4)</h4>	<p align="justify">	<b>Ayat 1</b><br>		Lahap o Kristen, <br>		pahai Tuhan Yesus!<br>		Tenga horumat <br>		kan area je hai.<br>		Buah auh nyanyiam<br>		mansanan kaliwus, <br>		kmisik <u>ain</u> Tuhan,<br>		je tempon kahai,<br>		kmisik <u>ain</u> Tuhan, <br>		je tempon kahai.<br>		<br>		<b>Ayat 2</b> <br>		Toh awi Yesus <br>		Paliwus <u>aim</u> toto,<br>		kalah pampatei <br>		dan <u>kua</u>sae aie te,<br>		Yesus maliwus <br>		hambruam batantu<br>		berengm imbelom, <br>		habungas kahai,<br>		berengam imbelom, <br>		habungas kahai.<br>		<br>			<b>Ayat 3</b> <br>		Krana katadan <br>		pampatei dan setan<br>		toto batawah <br>		toh <u>kua</u>sa aie te,<br>		jari ilawan, <br>		impalah, inganan<br>		yoh awi Yesus, <br>		Panewus <u>aim</u> te,<br>		yoh awi Yesus, <br>		Panewus <u>aim</u> te.<br>		<br>		<b>Ayat 4</b> <br>		Toh amon ikau <br>		percaya, mangguna<br>		sinta <u>ain</u> Jurusalamat <br>		<u>aim</u> te.<br>		Te awi le toh<br> 		dosa <u>aim</u> punah,<br>		slamat pambelom <br>		te tengae bewei,<br>		slamat pambelom <br>		te tengae bewei.<br>		<br>		<b>Ayat 5</b> <br>		Tara kan Tuhan <br>		je batang kasanang.<br>		le palembut <br>		pambelom, kahai.<br>		Kubur je huap <br>		mambrita kamanang.<br>		Hanjak, yoh hanjak <br>		toh keton samai,<br>		Hanjak, yoh hanjak <br>		toh keton samai.<br>					<h5>Lago : L.N.No.72<br>		&nbsp;&nbsp;&nbsp;&nbsp;</h5>	</p>'];
var nu_78=['<h3>78. TOH SALAMAT WEI</h3>	<h4>F = 1 (4/4)</h4>	<p align="justify">	<b>Ayat 1</b><br>		Toh salamat wei, <br>		toh kahanjak wei <br>		akan itah katika toh.<br>		Yesus jari matei <br>		jari misik tinai.<br>		Hanjak, hanjak <br>		oloh handiai!<br>		<br>		<b>Ayat 2</b> <br>		Toh salamat wei, <br>		toh kahanjak wei<br>		akan itah katika toh.<br>		Setan impakalah <br>		awi Tuhan itah.<br>		Hanjak, hanjak <br>		oloh handiai!<br>		<br>			<b>Ayat 3</b> <br>		Toh salamat wei, <br>		toh kahanjak wei.<br>		akan itah katika toh.<br>		Itah ije rusak,<br>		imbite akan slamat,<br>		Hanjak, hanjak <br>		Oloh handiai!<br>		<br>		<b>Ayat 4</b> <br>		Toh salamat wei,<br>		toh kahanjak wei<br>		akan itah katika toh<br>		Ikei toh manara aram,<br>		o hatalla <br>		basa aim toto paham hai<br>					<h5>Lago : L.N.No. 136<br>		&nbsp;&nbsp;&nbsp;&nbsp;</h5>	</p>'];
var nu_79=['<h3>79. ANDAU MINGGO HAYAK SAWAH</h3>	<h4>Es = 1 (4/4)</h4>	<p align="justify">	<b>Ayat 1</b><br>		Andau monggo hayak <br>		sawah Nihau kare oloh jaga,<br>		mikeh baun malekat <br>		te mikeh <u>baun</u> malekat te.<br>		Maka dumah oloh bawi,<br>		murid Yesus isut bitie<br>		je manangis pehe wei.<br>		<br>		<b>Ayat 2</b> <br>		Ewen tanggoh kubur <br>		Tuhan hayak jari kalapean<br>		janjie dengan murid aie,<br>		janjie dengan murid aie.<br>		Jaka ewen jari mingat,<br>		atei dia <u>tau</u> babehat,<br>		tapi sanang haliai.<br>		<br>			<b>Ayat 3</b> <br>		Krana batu jari indah,<br>		Tuhan Yesus jari <u>blua</u><br>		bara huang kubur te,<br>		bara huang kubur te.<br>		Harun ewen te katawan<br>		kubur dia <u>tau</u> manahan<br>		Manti <u>ain</u> pambelom te.<br>		<br>		<b>Ayat 4</b> <br>		Are oloh sama bembang,<br>		tanjo-tanjong, hatatimbang,<br>		gogop kilau murid te,<br>		gogop kilau murid te.<br>		Jaton tawan brita slamat,<br>		dia harap Janjin Surat<br>		hung kapehe ayue te.<br>		<br>		<b>Ayat 5</b> <br>		Hining keton <u>auh</u> malekat,<br>		inga-inga <u>auh</u> pampingat<br>		huang kubur boang te,<br>		huang kubur boang te.<br>		Ela pehe atei keton,<br>		krana ije belom jetoh<br>		marak oloh matei te!<br>		<br>		<b>Ayat 6</b> <br>		Intu eka suni, laku sampai<br>		Tuhan <u>tau</u> mangaku<br>		ikau toto murid aie, <br>		ikau toto murid aie.<br>		Tinai hong pambelom <br>		ayum ikau mite le belom<br>		toto tumon janji aie.<br>		<h5>Lago : Hari ahad dini hari<br>		&nbsp;&nbsp;&nbsp;&nbsp;L.N.P.No.1</h5>	</p>'];
var nu_80=['<h3>80. HALLELUYA, KRISTUS BELOM</h3>	<h4>G = 1 (3/4)</h4>	<p align="justify">	<b>Ayat 1</b><br>		Halleluya Kristus belom, <br>		nyanyi toh jalahangku!<br>		Kubur jari nihau <u>kua</u>sae,<br>		batu jari indah toh.<br>		Kristus belom, halleluya,<br>		musoh jari kalah toh,<br>		jari kalah toh!<br>		<br>		<b>Ayat 2</b> <br>		Halleluya, Kristus belom,<br>		le eka ampongku.<br>		Yesus, Anak <u>ain</u> Hatalla<br> 		tanggong hokum gantingku<br>		Slamat aku tuntang sanang <br>		huang lengem Tempongku,<br>		Slamat aku tuntang sanang<br>		huang lengem Tempongku.<br>		<br>			<b>Ayat 3</b> <br>		Halleluya, Kristus belum,<br>		tulus toto janji aie.<br>		Hayak dengae ie mimbit<br>		oloh ayue kan kahaie<br>		Raja slamat, Tempon kuasa,<br>		akam tara katatai,<br>		<br>		<b>Ayat 4</b> <br>		Are oloh sama bembang,<br>		tanjo-tanjong, hatatimbang,<br>		gogop kilau murid te,<br>		gogop kilau murid te.<br>		Jaton tawan brita slamat,<br>		dia harap Janjin Surat<br>		hung kapehe ayue te.<br>		<br>		<b>Ayat 5</b> <br>		Hining keton <u>auh</u> malekat,<br>		inga-inga <u>auh</u> pampingat<br>		huang kubur boang te,<br>		huang kubur boang te.<br>		Ela pehe atei keton,<br>		krana ije belom jetoh<br>		marak oloh matei te!<br>		<br>		<b>Ayat 6</b> <br>		Intu eka suni, laku sampai<br>		Tuhan <u>tau</u> mangaku<br>		ikau toto murid aie, <br>		ikau toto murid aie.<br>		Tinai hong pambelom <br>		ayum ikau mite le belom<br>		toto tumon janji aie.<br>		<h5>Lago : Halleluya, auferstanden. <br>		&nbsp;&nbsp;&nbsp;&nbsp;R.L.No.98<br>		&nbsp;&nbsp;&nbsp;&nbsp;L.N.P.No.11</h5>	</p>'];
var nu_81=['<h3>81. TOH HANJAK TOTO ATEIKU</h3>	<h4>G = 1 (4/4)</h4>	<p align="justify">	<b>Ayat 1</b><br>		Toh hanjak toto ateiku.<br>		te basa Yesus Tuhangku<br>		haluli belom toh.<br>		Yoh ie belom tagal te<br>		pampatei nihau <u>kua</u>sa aie,<br>		pambelom bagingku, <br>		Kakai <u>auh</u> aie. <br>		Batantu aku belom toh!<br> 		Kakai <u>auh</u> aie.<br>		“Batantu aku belom toh!”<br>		<br>		<b>Ayat 2</b> <br>		Yoh ie belom, kubur te<br>		batantu jaton <u>kua</u>sae aie,<br>		manahan Tuhan te.<br>		Kamanang bakarinah toh,<br>		te basa Yesus, Tuhangku<br>		mampalah musoh te.<br>		Kakai <u>auh</u> aie. <br>		“Batantu aku belom toh!”<br> 		Kakai <u>auh</u> aie.<br>		“Batantu aku belom toh!”<br>		<br>			<b>Ayat 3</b> <br>		Toh Yesus belom hung kahai, <br>		inengae slamat katatai <br>		kan oloh ayue te;<br>		kan ewen ije eter wei<br>		<u>tau</u> harap Juruslamat te,<br>		manumon prentah aie.<br>		Kakai <u>auh</u> aie. <br>		“Batantu aku belom toh!”<br> 		Kakai <u>auh</u> aie.<br>		“Batantu aku belom toh!”<br>		<br>		<b>Ayat 4</b> <br>		Yoh, Yesus Tuhangku mandai, <br>		manalih sorga eka aie,<br>		marentah hung kahaie.<br>		Yoh, ie sinta oloh aie,<br>		mampangat ewen handiai<br>		harajur hante wei.<br>		Kakai <u>auh</u> aie. <br>		“Batantu aku belom toh!”<br> 		Kakai <u>auh</u> aie.<br>		“Batantu aku belom toh!”<br>		<br>		<b>Ayat 5</b> <br>		Dan limbah matei ewen te<br>		manalih Tuhan pnewus aie<br>		dan belom dengae wei.<br>		Kasanang, slamat bagi aie,<br>		kahanjak tengan Tuhan aie,<br>		harajur sukup wei.<br>		Kakai <u>auh</u> aie. <br>		“Batantu aku belom toh!”<br> 		Kakai <u>auh</u> aie.<br>		“Batantu aku belom toh!”<br>				<h5>Lago : Ik weet, dat mijn <br>		&nbsp;&nbsp;&nbsp;&nbsp;Verslosser leeft<br>		&nbsp;&nbsp;&nbsp;&nbsp;S.219.L.N.P.No.52</h5>	</p>'];
var nu_82=['<h3>82. YESUS BELOM, MANANG TOH!</h3>	<h4>G = 1 (6/8)</h4>	<p align="justify">	<b>Ayat 1</b><br>		Yesus belom, manang toh.<br>		Halleluya Amen.<br>		Aloh setan sangit toh<br>		mawi kawan Tuhan.<br>		Ampong ungkup Tuhan <br>		hai bentok kare musoh aie<br>		Yesus belom manang toh.<br>		Halleluya! Amen.<br>		<br>		<b>Ayat 2</b> <br>		Huang kare klahi aie <br>		ie magon manang,<br>		<u>kua</u>sae puna pangkahai,<br>		gawin setan haying.<br>		Penda sampalaki aie <br>		manang kea oloh aie.<br>		Yesus belom manag toh.<br>		Halleluya! Amen.<br>		<br>			<b>Ayat 3</b> <br>		Kristus, pangkalima hai <br>		jaton mikeh musoh ; <br>		akal awen handiai,  <br>		kalah rusak toto. <br>		<u>Kua</u>san Raja sorga  <br>		te mawat itah magon wei. <br>		Yesus belom manag toh. <br>		Halleluya! Amen. <br>		<h5>Lago : Jesus lebet, Jesus <br>		&nbsp;&nbsp;&nbsp;&nbsp;siegt. R.L.No.102<br>		&nbsp;&nbsp;&nbsp;&nbsp;L.N.P.No.21</h5>	</p>'];
var nu_83=['<h3>83. PAHAI, PAHAI BAUTONGGANG</h3>	<h4>Bes = 1 (3/4)</h4>	<p align="justify">	<b>Ayat 1</b><br>		Pahai, pahai <u>bau</u>ntonggang,<br> 		yoh parangkah arep keton toh<br>		kan Rajan kare raja te<br>		je manang baka manang wei.<br>		Impalah toh <u>kua</u>sa ain setan te.<br>		Pampatei impakalah,<br>		handipe bakas kalah.<br><br>				Lahap, sorak! Ambo nyanyi<br>		kan hormat Tuhan Yesus!<br>		<br>		<b>Ayat 2</b> <br>		<u>Bau</u>ntonggang patut impahai<br>		Kan Yesus Raja Katatai<br>		je blua bara kubur aie,<br>		manenga slamat dan kahai<br>		kan ewen je toto wei bari aie!<br>		Toh keleh hanjak rantang<br>		dan atei sanang landang!<br><br>				Lahap, sorak! Ambo nyanyi<br>		kan hormat Tuhan Yesus!<br>		<br>			<b>Ayat 3</b> <br>		<u>Baun</u>tonggang eka liau, yoh<br>		kakare atep kubur toh<br>		imbangah awi <u>kua</u>sae wei.<br>		Yoh ie puna Raja te,<br>		Je Manti <u>ain</u> pambelom, <br>		slamat te!<br>		Kalunen tuntang sorga<br>		toh imbit hormat, tara!<br><br>				Lahap, sorak! Ambo nyanyi<br>		kan hormat Tuhan Yesus!<br>		<h5>Lago : Macht auf die Tor <br>		&nbsp;&nbsp;&nbsp;&nbsp;de G’rechtigkeit<br>		&nbsp;&nbsp;&nbsp;&nbsp;P.B.I.No.239</h5>	</p>'];
var nu_84=['<h3>84. TARA HATALLA PANGKAHAI</h3>	<h4>G = 1 (6/4)</h4>	<p align="justify">	<b>Ayat 1</b><br>		Tara Hatalla Pangkahai<br>		dan Tuhan Yesus <br>		hong kahaie<br>		toh tagal kare sinta aie<br>		Halleluya, Halleluya,<br>		Halleluya<br>		<br>		<b>Ayat 2</b> <br>		Yoh, tara Tuhan Yesus toh,<br>		je jari matei gantingku.<br>		ingubur into petak toh!<br>		Halleluya, halleluya,<br>		halleluya!<br>		<br>			<b>Ayat 3</b> <br>		Hong andau telo batu hai,<br>		je intu tumbang kubur aie<br>		inandar awi mlekat hai!<br>		Halleluya, halleluya,<br>		halleluya!<br>		<br>		<b>Ayat 4</b> <br>		Hayak jajewu haliai<br>		Hatalla Tuhan Pangkahai<br>		membelom Yesus anak aie.<br>		Halleluya, halleluya,<br>		halleluya!<br>		<br>		<b>Ayat 5</b> <br>		<u>Kua</u>san pampatei kalah toh,<br>		Rajan pambelom manang toh,<br>		Mambelom kea aku toh!<br>		Halleluya, halleluya,<br>		halleluya!<br>		<br>		<b>Ayat 6</b> <br>		Yoh, aloh lius matei toh,<br>		batantu toto, Tuhangku<br>		mampisik kea aku toh!<br>		Halleluya, halleluya,<br>		halleluya!<br>		<br>		<b>Ayat 7</b> <br>		Dan magah aku, oloh aie <br>		kan sorga palus kan kahai,<br>		manenga slamat katatai.<br>		Halleluya, halleluya,<br>		halleluya!<br>		<br>		<b>Ayat 8</b> <br>		Tara Hatalla Pangkahai<br>		dan Tuhan Yesus hong kahai<br>		toh tagal kare sinta aie!<br>		Halleluya, halleluya,<br>		halleluya!<br>			<h5>Lago : Gelobt sei Gott <br>		&nbsp;&nbsp;&nbsp;&nbsp;im hochsten Thron<br>		&nbsp;&nbsp;&nbsp;&nbsp;P.B.I.No.240 R.L.No.9</h5>	</p>'];
var nu_85=['<h3>85. IKEI MANYANYI, O YESUS</h3>	<h4>G = 1 (3/4)</h4>	<p align="justify">	<b>Ayat 1</b><br>		Ikei manyanyi, o Yesus <br>		pan<u>daim</u> akan sorga!<br>		Ewen sawalas temendeng<br>		nampayah, menyembah.<br>		Tuhan mandai tame<br>		haluli kahai, <br>		buli toh tinai Hatalla.<br>		<br>		<b>Ayat 2</b> <br>		Jalan kan sorga toh buap,<br>		dan ikei <u>tau</u> kea<br>		sana malihi kalunen <br>		manyampai Hatalla.<br>		Akam bewei, <br>		o Raja pangkahai te,<br>		tara kahai tuntang hormat.<br>		<br>			<b>Ayat 3</b> <br>		Tuhan mambagi toh <br>		kare panengan salamat.<br>		Oloh percaya mandino<br>		te tuntang kahanjak.<br>		Bara ka<u>haim</u> huang<br>		karajaan <u>aim</u>,<br>		mohon toh asi dan berkat.<br>		<br>		<b>Ayat 4</b> <br>		Hapus karajaam <br>		akan mandino kasanang,<br>		krana <u>auh</u> Bapam menjadi<br>		dan jaton je haying.<br>		Ie ha<u>mauh</u> : Mondok <br>		toh hila gan<u>tau</u><br>		<u>aing</u>ku, marentah dan manang.<br>			<h5>Lago : Tara Hatalla je <br>		&nbsp;&nbsp;&nbsp;&nbsp;pangkahai Raja<br>		&nbsp;&nbsp;&nbsp;&nbsp;L.N.No.188</h5>	</p>'];
var nu_86=['<h3>86. PANEWUS ITAH YESUS</h3>	<h4>Bes = 1 (4/4)</h4>	<p align="justify">	<b>Ayat 1</b><br>		Panewus itah Yesus,<br>		malihi murid aie,<br>		mandai dan buli sorga;<br>		toh ie hung kahai<br>		marentah uka slamat <br>		kakare ije harap<br>		hung ie eter wei,<br>		hung ie eter wei.<br>		<br>		<b>Ayat 2</b> <br>		Toh Yesus huang sorga,<br>		hung padadusae aie,<br>		gan<u>taun</u> Hatalla Bapa, <br>		yoh ie impahai.<br>		Hong sorga Yesus<br>		mingat kakare ije handak<br>		manumon prentah aie,<br>		manumon prentah aie.<br>		<br>			<b>Ayat 3</b> <br>		Hung sorga ie nguan <br>		toh eka oloh aie,<br>		dan berkat ayue <br>		mohon kan itah handiai.<br>		Rahian Tuhan dumah <br>		haluli uka itah<br>		<u>tau</u> tame huang kahaie,<br>		<u>tau</u> tame huang kahaie.<br>		<br>		<b>Ayat 4</b> <br>		O Yesus jijit atei<br>		<u>ain</u> ikei, oloh <u>aim</u><br>		kan ngambo, uka ikei<br>		mahormat aran <u>aim</u>.<br>		o tenga akan ikei<br>		Roh ayum, mangat ie<br>		ngarasan ikei toh,<br>		ngarasan ikei toh.<br>			<h5>Lago : L.N.No.106<br>		&nbsp;&nbsp;&nbsp;&nbsp;</h5>	</p>'];
var nu_87=['<h3>87. YESUS KRISTUS, TUHAN ITAH</h3>	<h4>G = 1 (4/4)</h4>	<p align="justify">	<b>Ayat 1</b><br>		Yesus Kristus Tuhan itah<br>		impahai oloh aie <br>		hanjak tuntang sanang;<br>		krana Yesus mimbit <u>kua</u>sae<br>		hung kahai katatai<br>		hunjun petak kea. <br>		<br>		<b>Ayat 2</b> <br>		Jete toto are gunae<br>		oloh aie handiai<br>		dinon toh panengae,<br>		ie te : Roh <u>ain</u> Hatalla<br>		Roh kahai, bagi <u>ain</u><br>		oloh je percaya<br>		<br>			<b>Ayat 3</b> <br>		Tinai, basa Yesus belom<br>		hung kahaie, oloh aie<br>		liwus bara hukum.<br>		Yesus toto tempon itah.<br>		je manggau hong kataue<br>		kare oloh laying.<br>		<br>		<b>Ayat 4</b> <br>		Yesus, tenga kapercaya,<br>		uka toh awi Roh<br>		ikei belom akam;<br>		aloh ikei hung celaka<br>		harap wei janjim te,<br>		ije into ikei.<br>		<br>		<b>Ayat 5</b> <br>		Tara akam, o Hatalla!<br>		Hormat aim hung kahaim<br>		jaton bara tikas.<br>		Kare kawan taloh belom<br>		mampahai aran aim,<br>		ikei omba kea.<br>		<h5>Lago : L.N.No.52<br>		&nbsp;&nbsp;&nbsp;&nbsp;</h5>	</p>'];
var nu_88=['<h3>88. HONG BAUNANDAU LANGIT SANANG</h3>	<h4>F = 1 (4/4)</h4>	<p align="justify">	<b>Ayat 1</b><br>		Hong <u>baun</u>andau langit<br>		sanang Raja ije jari manang,<br>		buli sorga eka aie,<br>		buli sorga eka aie.<br>		Sembah ie, hayak tenga<br>		akae hormat tuntang tara,<br>		Yesus ije impahai <br>		Yesus ije impahai!<br>		<br>		<b>Ayat 2</b> <br>		O tampayah awan himang<br>		huang lengee je hagatang,<br>		je mamberkat murid aie!<br>		je mamberkat murid aie!<br>		Imbit akae trimakasih!<br>		Ije tame eka brasih<br>		Imam itah katatai!<br>		Imam itah katatai!<br>		<br>			<b>Ayat 3</b> <br>		Hong <u>baun</u>andau langit <br>		kea Tuhan te mamala jeha<br>		huang <u>kua</u>sae, huang kahai.<br>		huang <u>kua</u>sae, huang kahai.<br>		Slamat oloh, awing sinta<br>		ie ije handak dumah :<br>		Raja, Imam, Sobat hai!<br>		Raja, Imam, Sobat hai!<br>		<h5>Lago : L.N.P.No.16<br>		&nbsp;&nbsp;&nbsp;&nbsp;</h5>	</p>'];
var nu_89a=['<h3>89a. KAKARE KUASA HUANG SORGA</h3>	<h4>F = 1 (3/8)</h4>	<p align="justify">	<b>Ayat 1</b><br>		Kakare <u>kua</u>sa huang sorga<br>		dan hunjun hapus petak toh<br>		inenga Bapae kan Anake,<br>		je impahai toh awi Roh<br>		<u>Dia</u>loh nara-narai je tau<br>		malawan <u>kua</u>sae <br>		tuntang <u>auh</u>e<br>		<br>		<b>Ayat 2</b> <br>		Hung sinta ie jari matoh,<br>		manyoho itah murid aie<br>		marawei kare utus oloh,<br>		manjadi kea murid aie,<br>		mambrita slamat katatai<br>		kan kare oloh handiai.<br>		<br>			<b>Ayat 3</b> <br>		Je mimbing kare <br>		<u>kua</u>sa kandak<br>		harajur hinje itah toh,<br>		malalus janjie, mampahayak<br>		kakare murid huang Roh.<br>		Has keleh itah handiai<br>		manumon kare peteh aie!<br>		<h5>Lago : Hong sorga aton sobat toto<br>		&nbsp;&nbsp;&nbsp;&nbsp;L.N. No. 44 (tahiu <br>		&nbsp;&nbsp;&nbsp;&nbsp;Mateus 28 :18-20)</h5>	</p>'];
var nu_89b=['<h3>89b. KAKARE KUASA HUANG SORGA</h3>	<h4>F = 1 (4/4)</h4>	<p align="justify">	<b>Ayat 1</b><br>		Kakare <u>kua</u>sa huang sorga<br>		dan hunjun hapus petak toh<br>		inenga Bapae kan Anake,<br>		je impahai toh awi Roh<br>		<u>Dia</u>loh nara-narai je tau<br>		malawan <u>kua</u>sae <br>		tuntang <u>auh</u>e<br>		<br>		<b>Ayat 2</b> <br>		Hung sinta ie jari matoh,<br>		manyoho itah murid aie<br>		marawei kare utus oloh,<br>		manjadi kea murid aie,<br>		mambrita slamat katatai<br>		kan kare oloh handiai.<br>		<br>			<b>Ayat 3</b> <br>		Je mimbing kare <br>		<u>kua</u>sa kandak<br>		harajur hinje itah toh,<br>		malalus janjie, mampahayak<br>		kakare murid huang Roh.<br>		Has keleh itah handiai<br>		manumon kare peteh aie!<br>		<h5>Lago : Toh jari toto bakarinah <br>		&nbsp;&nbsp;&nbsp;&nbsp;L.N. No.128<br>		&nbsp;&nbsp;&nbsp;&nbsp;(tahiu Mateus 28:18-20)</h5>	</p>'];
var nu_90=['<h3>90. O ROH HATALLA, ROH KAHAI</h3>	<h4>Es = 1 (4/4)</h4>	<p align="justify">	<b>Ayat 1</b><br>		O Roh Hatalla Roh kahai,<br>		tampayah ikei handiai,<br>		je kaput dan babute.<br>		O soho klawam ije hai<br>		mamplawa ikei handiai,<br>		mamintar ikei handiai te.<br>		Tenga klawa dan pambelom<br>		ije ayum akan ikei,<br>		mangat liwus bara kikeh!<br>		<br>		<b>Ayat 2</b> <br>		Kapintar, kaharati te<br>		je bara ikau, tenga wei<br>		kan ikei ije blaku.<br>		O suang atei ikei toh<br>		nakara ikei huang Roh<br>		<u>tau</u> hanjak rantang toto.<br>		Tatap atei, mangat ikei<br>		<u>tau</u> manyaksi brita khanjak<br>		awi gawi, awi kotak.<br>		<br>			<b>Ayat 3</b> <br>		O dohop ikei handiai<br>		ngagalan ikei korik, hai<br>		hong jalan ije bujur,<br>		Paabas mangat ikei toh<br>		manumon lepah kare auhm<br>		toh palus raju-raju.<br>		Ingat, mangat oloh layau<br>		tuntang nihau, o Hatalla,<br>		tau kea inaheta.<br>		<br>		<b>Ayat 4</b> <br>		Hung klahi dengan setan te<br>		dan dengan kare kawan aie,<br>		je mangalahi ikei.<br>		Paabas ikei, uka <u>tau</u><br>		mampalah ie dan mang<u>gau</u><br>		kamanang ije toto.<br>		Keleh mohon, mampahayak,<br>		mampaabas ikei toto.<br>		Tuhan, berkat ikei hetoh!<br>		<br>		<b>Ayat 5</b> <br>		O dohop hung kalunen toh,<br>		nakara ikei toto <u>tau</u><br>		mang<u>gau</u> karasih ayum.<br>		Hung <u>kua</u>sam ikei <u>tau</u> bewei<br>		malekak kare gawi te,<br>		je puna bukun hukum. <br>		Imbit, jijit atei ikei<br>		akan ngambo, mangat tulus,<br>		ikei toto baris Yesus.<br>		<h5>Lago : Toh hanjak keton handiai<br>		&nbsp;&nbsp;&nbsp;&nbsp;L.N.No.133</h5>	</p>'];
var nu_91=['<h3>91. O ROH HATALLA, PASI AH</h3>	<h4>Es = 1 (4/4)</h4>	<p align="justify">	<b>Ayat 1</b><br>		O Roh Hatalla pasih ah<br>		sakare ikei; tenga ah<br>		kaabas akan ikei!<br>		Kalawa ayum ije hai<br>		mamplawa ikei handiai,<br>		je kaput dan babute.<br>		Keleh Tuhan mimbit magah<br> 		dan mahaga mampahalap ikei,<br>		uka dinon slamat<br>		<br>		<b>Ayat 2</b> <br>		O Roh Hatalla, Roh kahai,<br>		tampayah ikei handiai,<br>		yoh, prasih atei ikei.<br>		Mamintar ikei, mangat <u>tau</u><br>		harati gawim dan mang<u>gau</u><br>		kasanang akai atei.<br>		Hintan, bulau akan nihau,<br>		jaton <u>tau</u> manantau ikei;<br>		awim ikei puas atei<br>		<h5>Lago : Toh hanjak keton handiai<br>		&nbsp;&nbsp;&nbsp;&nbsp;L.N.No.133</h5>	</p>'];
var nu_92a=['<h3>92a. HATALLA, ROH AIM</h3>	<h4>A = 1 (3/4)</h4>	<p align="justify">	<b>Ayat 1</b><br>		Hatala, Roh <u>aim</u>, <br>		Roh brasih <u>aim</u> te,<br>		mahaga, ngan<u>tau</u>, <br>		mamplawa bewei,<br>		kakare je tanggar<br>		hung atei mang<u>gau</u> <br>		karasih, salamat <br>		dan berkat ka<u>tau</u><br>		<br>		<b>Ayat 2</b> <br>		Toh awi Roh <u>aim</u><br>		implawa bewei,<br>		je toto mang<u>gau</u><br>		katetek <u>aim</u> te;<br>		nakara hung Yesus<br>		toh ikei samai<br>		mandino kahalap,<br>		kasanang kahai.<br>		<h5>Lago : Toh hanjak <br>		&nbsp;&nbsp;&nbsp;&nbsp;keton handiai<br>		&nbsp;&nbsp;&nbsp;&nbsp;L.N.No.35a</h5>	</p>'];
var nu_92b=['<h3>92b. HATALLA, ROH AIM</h3>	<h4>A = 1 (3/4)</h4>	<p align="justify">	<b>Ayat 1</b><br>		Hatala, Roh <u>aim</u>, <br>		Roh brasih <u>aim</u> te,<br>		mahaga, ngan<u>tau</u>, <br>		mamplawa bewei,<br>		kakare je tanggar<br>		hung atei mang<u>gau</u> <br>		karasih, salamat <br>		dan berkat ka<u>tau</u><br>		dan berkat ka<u>tau</u><br>		<br>		<b>Ayat 2</b> <br>		Toh awi Roh <u>aim</u><br>		implawa bewei,<br>		je toto mang<u>gau</u><br>		katetek <u>aim</u> te;<br>		nakara hung Yesus<br>		toh ikei samai<br>		mandino kahalap,<br>		kasanang kahai.<br>		<h5>Lago : L.N.No.35b<br>		&nbsp;&nbsp;&nbsp;&nbsp;</h5>	</p>'];
var nu_93=['<h3>93. ROH HATALLA, ROH PAMBELOM</h3>	<h4>F = 1 (4/4)</h4>	<p align="justify">	<b>Ayat 1</b><br>		Roh Hatalla, Roh Pambelom,<br>		Roh katoto katatai!<br>		Tame atei ku mambelom aku,<br>		oloh <u>aim</u> samai.<br>		Klawa dan katoto <u>aim</u>,<br>		jadi bagin murid <u>aim</u>.<br>		<br>		<b>Ayat 2</b> <br>		Keleh toh, o Roh Hatalla<br>		jadi gurun huangku; <br>		tunjuk akangku je sala<br>		dan pabujur tirokku;<br>		uka hapus ateiku<br>		tumon prentahm,<br>		Tuhangku!<br>		<br>		<b>Ayat 3</b> <br>		Je mampangat, Roh Hatalla<br>		suang hapus huangku<br>		hapan sinta bara sorga<br>		dan paabas ateiku,<br>		uka kare gawingku<br>		indu hormat Tuhangku.<br>		<br>		<b>Ayat 4</b> <br>		Roh Hatalla, Roh Karasih<br>		prasih toto ateiku,<br>		uka tirokku barasih,<br>		kare kotak gawingku.<br>		Mangat belom akam toh,<br>		Bapak, Anak tuntang Roh.<br>		<br>		<b>Ayat 5</b> <br>		Roh Hatalla, Roh Kasanang<br>		keleh mangagalan toh,<br>		mangat aku magon manang<br>		sampai lepah umurku,<br>		palus tame sorga <u>aim</u><br>		melai slamat huang ka<u>haim</u>.<br>			<h5>Lago : L.N.No.109<br>		&nbsp;&nbsp;&nbsp;&nbsp;</h5>	</p>'];
var nu_94=['<h3>94. TUHAN IKEI TOH MAHINING</h3>	<h4>As = 1 (6/4)</h4>	<p align="justify">	<b>Ayat 1</b><br>		Tuhan, ikei toh mahining<br>		kutoh kare berkat <u>aim</u>.<br>		tokep kijau hakaliling<br>		mohon akan oloh <u>aim</u>.<br>		Ikei toh, korik hai <br>		mentai kea berkat <u>Aim</u>.<br>		<br>		<b>Ayat 2</b> <br>		Ela ah mahalau, Apang,<br>		ikei ije pehe toh!<br>		Tanah ikei, pasi saying,<br>		tapas toto ujan Roh!<br>		Pasi ah, tenga toh,<br>		akan ikei ujan Roh!<br>		<br>		<b>Ayat 3</b> <br>		Keleh ah, o Tuhan Yesus,<br>		maja ikei, murid <u>Aim</u>!<br>		Penyau ikei, o Panewus,<br>		sampai brasih haliai!<br>		soho toh ungkup <u>Aim</u>,<br>		mite tinai kuasa <u>Aim</u>!<br>		<br>		<b>Ayat 4</b> <br>		O Roh brasih, Roh katoto,<br>		suang ikei  oloh <u>Aim</u>!<br>		mangat atei ikei lenyoh,<br>		tatap indu huma <u>Aim</u>!<br>		Dumah ah, Roh kahai,<br>		mangat Yesus impahai!<br>			<h5>Lago : Kami dengar berkat turun<br>		&nbsp;&nbsp;&nbsp;&nbsp;L.N.P.No.49</h5>	</p>'];
var nu_95=['<h3>95. HATALANGKU! KATAUM</h3>	<h4>D = 1 (4/4)</h4>	<p align="justify">	<b>Ayat 1</b><br>		Hatallangku! Ka<u>taum</u>,<br>		ka<u>haim</u> dan <u>kua</u>sam,<br>		babala toh hung <br>		kare gawi ayum.<br>		Horumat akam katatai,<br>		Horumat akam katatai.<br>		<br>		<b>Ayat 2</b> <br>		Kalawa <u>aim</u> manyingah<br>		hung kalunen dan sampai<br>		toh harajur aton asim,<br>		kabujur dan katoto <u>aim</u>,<br>		kabujur dan katoto <u>aim</u>.<br>		<br>		<b>Ayat 3</b> <br>		Hung Kristus wei, <br>		je Juruslamat ikei<br>		kakaree te, je toto<br>		bujur ateie,<br>		iangkat indu anak <u>aim</u>,<br>		iangkat indu anak <u>aim</u>.<br>		<br>		<b>Ayat 4</b> <br>		Roh brasih ije<br>		tumon janjim horan<br>		mahaga toh dan <br>		majar oloh ayum;<br>		O tenga akan ikei toh,<br>		O tenga akan ikei toh!<br>			<h5>Lago : L.N.No.39<br>		&nbsp;&nbsp;&nbsp;&nbsp;</h5>	</p>'];
var nu_96=['<h3>96. AKAM, O HATALLA BAPA</h3>	<h4>F = 1 (4/4)</h4>	<p align="justify">	<b>Ayat 1</b><br>		Akam, o Hatalla Bapa <br>		Tuhan ikei je manjapa,<br>		nguan taloh handiai<br>		Jaton bara tikas <u>kua</u>sam,<br>		langit petak penda prentahm;<br>		akam hormat katatai, <br>		akam hormat katatai.<br>		<br>		<b>Ayat 2</b> <br>		Akam, Tuhan Yesus Kristus<br>		Batang asi dan Paliwus,<br>		Juruslamat oloh <u>aim</u>.<br>		Akam kare tara, hormat,<br>		hayak nyanyi ain malekat,<br>		hetoh palus hung ka<u>haim</u>,<br>		hetoh palus hung ka<u>haim</u>.<br>		<br>		<b>Ayat 3</b> <br>		O Roh brasih, je marawei,<br>		majar dan mamplawa atei,<br>		hormat ayum toto hai.<br>		Ikei toh manyanyi akam,<br>		tuntang mimbit hormat taram.<br>		Agah ikei kan kahai,<br>		Agan ikei kan kahai!<br>			<h5>Lago : Yesus Kristus aton Raja<br>		&nbsp;&nbsp;&nbsp;&nbsp;L.N.No.49</h5>	</p>'];
var nu_97=['<h3>97. HATALLA BUAH IMPAHAI</h3>	<h4>G = 1 (3/4)</h4>	<p align="justify">	<b>Ayat 1</b><br>		Hatalla buah impahai<br>		dan asi aie inara.<br>		Te basa palus katahi<br>		calakan itah lepas.<br>		Toh itah eka sinta aie,<br>		harajur sanang haliai;<br>		kalait lepah tende.<br>		<br>		<b>Ayat 2</b> <br>		Hatalla Bapa, je mang<u>gau</u><br>		kakare anak Adam.<br>		Mahaga, mian mangatau<br>		kalunen bara horan.<br>		Yoh <u>kua</u>sam jatoh tikas aie<br>		dan sintam toto pangkahai.<br>		Toh sukur kapania. **)<br>		<br>		<b>Ayat 3</b> <br>		O Yesus, Anak tonggal te<br>		je tumon janji Bapa!<br>		Yehowa dan Immanuel!<br>		Sahiring*) tagal dosa!<br>		Pamampun dosa handiai<br>		Pamawat kare oloh aie<br>		je hapit tuntang jake.<br>		<br>		<b>Ayat 4</b> <br>		O Roh Hatalla, Roh kahai,<br>		pampangat ungkup Tuhan!<br>		Yoh dohop ikei toh samai,<br>		percaya tuntang simpan.<br>		O rentah ikei handiai<br>		mahormat tuntang mampahai<br>		manuntut Yesus toto<br>				<br><br>		------------------------<br>		*) Sharing = (menjadi) parapah<br>		**) kapania = akan Hatalla (kepadaNya)<br>	<h5>Lago : L.N.No.33<br>		&nbsp;&nbsp;&nbsp;&nbsp;</h5>	</p>'];
var nu_98=['<h3>98. HATALLA, IKEI HANDAK TOH</h3>	<h4>G = 1 (3/4)</h4>	<p align="justify">	<b>Ayat 1</b><br>		Hatalla, ikei handak toh<br>		manara aran ayum.<br>		O dohop ikei tenga Roh,<br>		je majar <u>auh</u> katotom.<br>		Nakara ikei awi <u>auhm</u><br>		kasene asim dan ka<u>taum</u>.<br>		O berkat gawin ikei!<br>		<br>		<b>Ayat 2</b> <br>		Yoh Apang, paham<br>		toh ka<u>taum</u>,<br>		bassaram dengan ikei.<br>		Kajoham dan kamanis <u>auhm</u><br>		<u>tau</u> mampong kpehen atei.<br>		O tanggoh keton handiai!<br>		Salamat ije toto hai<br>		Inenga akan keton.<br>		<br>		<b>Ayat 3</b> <br>		O Tuhan Yesus, Imam hai<br>		dan Juruslamat ikei,<br>		parapahm palus katatai,<br>		mampuas dosan ikei.<br>		Hung sampalaki ayum wei<br> 		ilantak surat dawa te.<br>		Toh ikei slamat toto.<br>		<br>		<b>Ayat 4</b> <br>		O Roh karasih, Roh kahai<br>		pampangat beken jaton.<br>		Kalawam ije toto hai<br>		mamplawa ikei magon.<br>		Kakare oloh ayum te<br>		ihagam, mangat dehen wei<br>		kasanang aie harajur.<br>		<br>		<b>Ayat 5</b> <br>		Hatalla, Tuhan pangkahai,<br>		o hining taran ikei,<br>		auh nyanyi ije toh mandai.<br>		je lembut bara atei.<br>		Hung sorga kare oloh aim,<br>		manara aram hung kahaim<br>		harajur katatahi.<br>	<h5>Lago : Hatalla buah impahai<br>		&nbsp;&nbsp;&nbsp;&nbsp;L.N.No.33</h5>	</p>'];
var nu_99a=['<h3>99a. HATALLA, BAPA HONG KAHAIM</h3>	<h4>D = 1 (4/4)</h4>	<p align="justify">	<b>Ayat 1</b><br>		Hatalla, Bapa hong ka<u>haim</u><br>		o lawan oloh handiai,<br>		je handak mawi Anak <u>aim</u>,<br>		mambaring pada dusae aie!<br>		<br>		<b>Ayat 2</b> <br>		Karinah <u>kua</u>sam dan ka<u>haim</u>.<br>		o Yesus Tuhan Pangkahai,<br>		hong bentok kare ungkup <u>aim</u>,<br>		kalindong kare oloh <u>aim</u>!<br>		<br>		<b>Ayat 3</b> <br>		Hatalla, Roh Pamampong te,<br>		o keleh mahanjean wei<br>		kakare oloh <u>aim</u> samai<br>		hong sintam palus katatai!<br>	<h5>Lago : Horumat palus katatai<br>		&nbsp;&nbsp;&nbsp;&nbsp;L.N.No.40</h5>	</p>'];
var nu_99b=['<h3>99b. HATALLA, BAPA HONG KAHAIM</h3>	<h4>G = 1 (4/4)</h4>	<p align="justify">	<b>Ayat 1</b><br>		Hatalla, Bapa hong ka<u>haim</u><br>		o lawan oloh handiai,<br>		je handak mawi Anak <u>aim</u>,<br>		mambaring pada dusae aie!<br>		<br>		<b>Ayat 2</b> <br>		Karinah <u>kua</u>sam dan ka<u>haim</u>.<br>		o Yesus Tuhan Pangkahai,<br>		hong bentok kare ungkup <u>aim</u>,<br>		kalindong kare oloh <u>aim</u>!<br>		<br>		<b>Ayat 3</b> <br>		Hatalla, Roh Pamampong te,<br>		o keleh mahanjean wei<br>		kakare oloh <u>aim</u> samai<br>		hong sintam palus katatai!<br>	<h5>Lago : Gb.No.343<br>		&nbsp;&nbsp;&nbsp;&nbsp;</h5>	</p>'];
var nu_100=['<h3>100. HONG ARAM IKEI MIAR TOH</h3>	<h4>D = 1 (4/4)</h4>	<p align="justify">	<b>Ayat 1</b> <br>		Hong arem ikei miar toh <br>		mangenang, blaku asi toh: <br>		O Bapa, Anak tuntang Roh <br>		pahayak,agak ikei toh! <br>		<br>			<b>Ayat 2</b> <br>		Hong kare jalan handiai<br>		ngagalan ikei toh samai! <br>		O Bapa,Anak Tuntang Roh<br>		pahayak,agak ikei toh! <br>		<br>			<b>Ayat 3</b> <br>		Hong Katatesan jalan te <br>		je tintue hila kanih wei: <br>		O Bapa,Anak Tuntang Roh<br>		pahayak,agak ikei toh! <br>					<h5>Lago : L.N. No.40</h5>	</p>'];
var nu_101=['<h3>101. O YESUS,ANAK AWAU TOH</h3>	<h4>D = 1 (4/4)</h4>	<p align="justify">	<b>Ayat 1</b> <br>		O Yesus,anak awau toh,<br>		iagah ikei tumon auhm, <br>		impandoi huangaran aim, <br>		mandino bagi hung khaim. <br>		<br>			<b>Ayat 2</b> <br>		Toh puas kare dosa aie,<br>		yoh berkat ie katatai, <br>		makara tanggar atei aie<br>		manempo Tuhan pangkahai.<br>		<br>			<b>Ayat 3</b> <br>		karinah asim dan Kataum <br>		harajur akae ,mangat tau <br>		manajong bujur hila toh<br>		dam belom akam tumon Roh. <br>		</br>	<b>Ayat 4</b></br>		yoh akan ikei tenga Roh, <br>		je brasih,mangat ikei toh<br>		tau majar anak awau te<br>		manunutut jalan aim bewei.<br>			<h5>Lago : L.N. No.40</h5>	</p>'];
var nu_102=['<h3>102. YESUS, PASI IKEI TOH</h3>	<h4>D = 1 (4/4)</h4>	<p align="justify">	<b>Ayat 1</b> <br>		Yesus pasi ikei toh,<br>		je hapumpong huang aram<br>		mimbit anak awau toh,<br>		mangat le tumon prentahm,<br>		tau inyarah ikei akam<br>		uika ela ie layang.<br>		<br>			<b>Ayat 2</b> <br>		Pandoi anak awau toh,<br>		harapan Roh dan harapan danom,<br>		tumon jari janjim,yoh<br>		mangat ie baris ayum<br>		Keleh Tuhan manheta<br>		ateie ije pahir * kpapa.<br>		<br>			<b>Ayat 3</b> <br>		Penyau biti bareng aie <br>		bara kare liken dosa,<br>		manga liwus haliai<br>		bara dasar kadarhaka <br>		tuntang je brasih toto<br>		bara dosa pahir tatoe.<br>		</br>	<b>Ayat 4</b></br>		O Sakatit ije hai<br>		awi manyakatik toto<br>		anak toh, tabirin aim,<br>		mangat ie belom bujur<br>		sampai ie dapit jeha<br>		tau tame huang sorga.<br>	<h5>Lago : L.N. No.147</h5>	</p>'];
var nu_103=['<h3>103. SOHO, SOHO ANAK KORIK</h3>	<h4>E<small>s</small> = 1 (4/4)</h4>	<p align="justify">	<b>Ayat 1</b> <br>		  Soho soho anak korik tangguh aku toh wei!”<br>			Kai auh Tuhan Yesus hayak<br>			baue bajenta haliai.      <br>			Kantoh keton,  anak korik, <br>			tangguh aku, kantoh  wei!<br>			Kantoh keton   samandiai!”  <br>			Kai auh Juruslamat te.<br>		<br>			<b>Ayat 2</b> <br>		Tuhan Yesus   je  mangahau, <br> sintae   toto paham hai.<br>Toh o   anak,   ela layau, <br>langkap, seneh ih  auh aie!<br> Kantoh keton,  anak korik, <br> tangguh aku, kantoh  wei!<br>Kantoh keton   samandiai!”  <br>Kai auh Juruslamat te.<br>		<br>			<b>Ayat 3</b> <br>		 Melai tokep Tuhan Yesus,  <br>  		jete mangat haliai<br>		Krana ie je Panewus <br>		akan kare sobat aie.<br>		Kantoh keton,  anak korik, <br>		tangguh aku, kantoh  wei!<br>		Kantoh keton   samandiai!”  <br>		Kai auh Juruslamat te.<br>		<br>		</br>	<b>Ayat 4</b></br>		  Asal aku toh tau  hinje  <br> dengan Yesus Tuhangku,<br> te batantu aku  hante  <br> magon hanjak ateiku.<br>Kantoh keton,  anak korik, <br>		tangguh aku, kantoh  wei!<br>		Kantoh keton   samandiai!”  <br>		Kai auh Juruslamat te.<br>	<h5>Lago : L.N. No.113</h5>	</p>'];
var nu_104=['<h3>104. O YESUS HINING, IKEI IJE BLAKU</h3>	<h4>B<small>es</small> = 1 (4/4)</h4>	<p align="justify">	<b>Ayat 1</b> <br>		O Yesus hining,ikei ije blaku toh.<br>		akan ewen ije toh mangaku katoton<br>		auh aim, hung pampandoi brasih<br>		O tenga asim!<br>		<br>			<b>Ayat 2</b> <br>		Auh janjie sama kilau tanggong sapa<br>		manganan kare taloh ije papa,<br>		nahuang omba iku, Juruslamat<br>		toh palus jeha.<br>		<br>			<b>Ayat 3</b> <br>		O puas kare dosa aie o Tuhan!<br>		Dan penyau ie kilau muridm horan!<br>		Yoh Roh manyaksi akae: Kare dosam<br>		iampun akam.<br>		<br>		</br>	<b>Ayat 4</b></br>		Hatalla Bapa, Anak dan Roh brasih!<br>		Paabas ie belom hung karasih,<br>		yoh haga ie, je inyarah akam<br>		toh huang aram<br>	<h5>Lago : L.N. No.85</h5>	</p>'];
var nu_105=['<h3>105. AMBO TOH AUH NYANYI</h3>	<h4>B<small>es</small> = 1 (4/4)</h4>	<p align="justify">	<b>Ayat 1</b> <br>	Ambo tau auh nyanyi hanjak haliai<br>	omba basa sorak,asi hai <br>	jari dinon oloh ije hobah to,<br>	palus sondau slamat tuhangku.<br>	Tara, tara nyanyi dah pahai,<br>	aran tuhan je hung asi aie<br>	rajin mawat mampun, mampahanjak toh,<br>	awang hobah tumon sohon Roh.<br>		<br>			<b>Ayat 2</b> <br>				Ingat Tuhan Yesus ,Ingat toh auh aie:<br>		malaekat hong ngambo hung kahai,<br>		ewen uras hanjak , hanjak haliai,<br>		tagal ije bitih hobah to.<br>	Tara, tara nyanyi dah pahai,<br>	aran tuhan je hung asi aie<br>	rajin mawat mampun, mampahanjak toh,<br>	awang hobah tumon sohon Roh.<br>		<br>			<b>Ayat 3</b> <br>		Ungkup Tuhan ,keleh omba mampahai<br>		Yesus Kristus, basa kuasa aie<br>		jari mampakalah musoh kabas te,<br>		mawat oloh ije hobah to.<br>	Tara, tara nyanyi dah pahai,<br>	aran tuhan je hung asi aie<br>	rajin mawat mampun, mampahanjak toh,<br>	awang hobah tumon sohon Roh.<br>					<h5>Lago : L.N. No.12</h5>	</p>'];
var nu_106=['<h3>106. HUNG ALEM TUHAN YESUS BUAH JUAL</h3>	<h4>B<small>es</small> = 1 (4/4)</h4>	<p align="justify">	<b>Ayat 1</b> <br>	 Hung alem Tuhan Yesus buah jual, <br>   Induae rote  dan mamberkat jete,<br>Mandaraie dan  manengae akan muride<br>   Hamauh kalotoh:<br>		<br>			<b>Ayat 2</b> <br>		       Toh duan kuman, jetoh bereng aingku,<br>   Inenga akan keton, oloh aingku.<br>Sasining keton, kuman rote jetoh<br>    Te ingat aku.<br>		<br>			<b>Ayat 3</b> <br>    Limbah te Tuhan mimbing sangkir kea,<br>    mamberkat te,manjulok jete,koae:<br>    toh ihop, keton jetoh daha aingku.<br><br>	<b>Ayat 4</b> <br> Sasining keton,mihop sangkir jetoh,<br>    pampatei aingku patut ingat keton:<br>    mambrita kea kare  gawi  aingku<br>    Mahormat aku.<br><br> 	<h5>Lago : L.N. No.85</h5>	</p>'];
var nu_107=['<h3>106. HUNG ALEM TUHAN YESUS BUAH JUAL</h3>	<h4>B<small>es</small> = 1 (4/4)</h4>	<p align="justify">	<b>Ayat 1</b> <br>Toh ikei, Tuhan pangkahai<br> mandeku utut toh;<br> dan atei ikei handiai<br>   hagatang huang roh<br>  nakara blaku asim te kan ikei<br>  ije pehe wei! OApang,keleh hong<br>   kataum, nampayah ikei,je manggau salamat  aim  hung  Yesus, Imam hai<br>		<br>			<b>Ayat 2</b> <br>		 Kalangkah ikei handiai, <br> O Tuhan,toto hai;<br>  kajoha tuntang asi aim<br>  labien haliai.<br>		<br>			<b>Ayat 3</b> <br> Hung aran Yesus ikei toh  <br>manalih,hayak blaku toh: <br>Tarima ikei hung kataum, <br>o tenga ampong bara auhm <br>Dan berkat aim, kan ikei handiai!<br> 	<h5>Lago : L.N. No.85</h5>	</p>'];
var nu_108=['<h3>108.BUNGA AREPM, O HAMBRUAN</h3>	<h4>E<small>s</small> = 1 (4/4)</h4>	<p align="justify">	<b>Ayat 1</b> <br> Bungas arepm, o hambruan<br> Hining ikau toh parawei<br> blua akan  eka  klawa.<br> keleh ikau hanjak atei;<br>  Krana  Tuhan  je pamasi<br>  Yesus Kristus, Batang asi<br>   ije kuasa tuntang tatau,<br>   Ie toto sinta ikau.<br>		<br>			<b>Ayat 2</b> <br>		Basa Tuhangku  marawei<br>aku talih hanjak atei;<br>  krana jete toto hormat,<br>   asi hai dan toto slamat<br>mondok hinje mejan  raja|<br>   ije hai dan toto  kuasa,<br>   ije tempon taloh ngambo<br>tuntang hunjun petak jetoh.<br>		<br>			<b>Ayat 3</b> <br>	Yesus handak toh pakanan<br>	aku dengan taloh kinan<br>	tuntang dengan taloh ihop<br>	je tatamba dan pandohop<br>	mampakeleh peres dosa.<br>	Isi daha aie manenga<br>slamat dan pambelom toto.<br>Has toh tanggoh tuntang blaku.<br> <br> <b> Ayat 4</b><br> Oloh blau dan teah belai<br> tuntang ije pehe ateie,<br> tagal kare kadarhakae,<br> tagal dosae dan kasalae,<br> tau manjadi besoh toto<br> awi taloh kinan jetoh:<br> kare dosa dan kapapa.<br> nihau lepah impuas lepah.<br>  <br> <b> Ayat 5 </b><br> Yesus Kristus,pasi aku<br> dan mampingat aku toto,<br> uku aku toh mariksa<br> arepku dan toto hobah,<br> mangat aku tatap toto,<br> omba kuman mihop jetoh:<br> bele aku buah hukum,<br> tapi supa berkat ayum.<br><br>  <b>Ayat 6</b><br> Yesus, Matanandau asi,<br> akam tara ,trima kasih.<br> Aku blaku nyame-nyame;<br> Soho aku dapit tame<br> eka ayum huang sorga<br> mondok manaharep meja,<br> eka ewen inyarongan,<br> je imprasih awi daham.<br>	<h5>Lago : L.N. No.19</h5>	</p>'];
var nu_109=['<h3>109.BAS, ITAH TOH MANYANYI</h3>	<h4>D = 1 (4/4)</h4>	<p align="justify">	<b>Ayat 1</b> <br>	Has, itah toh manyanyi<br>	manara Tuhan te.<br>	je tumon kare janji<br>	harajur masi wei.<br>	Kakare je pahias<br>	manumon prentah aie,<br>	dan harap ie toto<br>	mahoramat aran aie,<br>mahoramat aran aie.<br>		<br>			<b>Ayat 2</b> <br>		Toh eweh huang sorga?<br>		Has sewut arab aie!<br>		Yoh, aran aie Yehowa,<br>		Hatalla pangkahai,<br>		je manjadian itah<br>		dan taloh handiai<br>		kakare taloh belom<br>		te tampan lenge aie!<br>		te tampan lenge aie!<br>		<br>			<b>Ayat 3</b> <br>	Hatalla je pakanan<br>	mahagae handiai.<br>	Toh ela Kalapean<br>	mahormat aran aie!<br>	Hung ie itah sondau <br>	Kasanang,slamat wei.<br>	Yoh oloh jete tatau,<br>	je baris Tuhan te,<br>	je baris Tuhan te.<br> 	<h5>Lago : L.N. No.31</h5>	</p>'];
var nu_110=['<h3>110.HAS HANJAK-HANJAK ITAH TOH</h3>	<h4>F = 1 (4/4)</h4>	<p align="justify">	<b>Ayat 1</b> <br>	Has hanjak hanjak itah toh,<br> yoh hanjak haliai! <br>Te basa huang asie te<br>Hatalla mingat oloh aie<br>Hung kalunen toh.<br>		<br>			<b>Ayat 2</b> <br>		hung Yesus Kristus  Anak aie,<br> toh itah  handiai!       <br>   Je harap asie dan kataue<br>Baketep blaku dan manggau<br>Tau dinon slamat te.<br>		<br>			<b>Ayat 3</b> <br>	Has  itah toh   samandiai  <br> manyanyi, mamphai!       <br>Manara toh Hatalla te,<br>Harajur, tagal asie wei,<br>Je bagin oloh aie.<br> 	<h5>Lago : L.N. No.31</h5>	</p>'];
var nu_111=['<h3>111. TOH AKU HANDAK ,O YEHOWA </h3>	<h4>C=1 (4/4)</h4>	<p align="justify">	<b>Ayat 1</b> <br>Toh aku handak , o Yahowa<br>manyanyi dan mahormat aran aim,<br>te basa ikau, o Hatalia,<br>bajorah mingat aku hung  kahaim.<br>O ajar aku hapan Roh je aim,<br>nakara aku tau mbrita khaim.<br>		<br>			<b>Ayat 2</b> <br>		O apang pangkahai Hatalla,<br>		toh imbit aku rantep tuhangku<br>		dan engkak kau bara dosa,<br>		nakara akam tom pambelomku.<br>		Te aku toto omba mampahai,<br>		manara Tuhan palus katatai.<br>		<br>			<b>Ayat 3</b> <br>Kakare hormat tuntang tara <br>toh akam,Yehowa, Tuhangku.<br>Yoh aku handak toh manara <br>Hataalla ije puna tempongku.<br>Kataum dan sitam tuntang asim hai<br>manyanyang oloh layang handiai.<br><br><b> Ayat 4 </b><br>O Tuhan dohop,pasi sayang,ngagalan aku huang jalan aim:<br>yoh agah aku bele layang ,<br>malengkan mangat aku tame khaim.<br>Te aku mimbit nyanyi ,katatai<br>hung sorga akam, Tuhan pangkahai.<br> 	<h5>Lago : L.N. No.125</h5>	</p>'];
var nu_112=['<h3>112.TARA HATALLA JE PANGKAHAI RAJA </h3>	<h4>G=1(3/4)</h4>	<p align="justify">	<b>Ayat 1</b> <br>Tara  Hatalla  je pangkahai Ra-ja ain itah<br> Ie marentah hong tasik hong petak, hong sorga<br>Hung asi aie ie mahaga samai<br> taloh je jari injapae.<br>		<br>			<b>Ayat 2</b> <br>		Tara  Hatalla, je toto pamasi panyanyang!	<br> Ie nyarenan dan mampun kalunen je hayang.	<br>Toto kakai : Itah badosa  samai,	<br>tapi Hatalla pamasi.	<br>		<br>			<b>Ayat 3</b> <br>Tara  Hatalla yoh hapus jalahan ain Yesus!<br> Ie Yehowa dan Bapa ain  itah hung Kristus.<br> Hormat bewei Tuhan je pangkahai  te.<br>Batang pambelom salamat.<br><br><b> Ayat 4 </b><br>Hormat Hatalla! Yoh hapus ka-lu-nen manyanyi !<br>Has toh mamsuman, mambrita kahai dan<br> karasihe!<br>Oloh samai, hapus  karajaan  aie:<br>sembah Yehowa  je brasih.<br> 	<h5>Lago : L.N. No.188</h5>	</p>'];
var nu_113=['<h3>113.O HATALLA PANGKAHAI  </h3>	<h4>G=1(3/4)</h4>	<p align="justify">	<b>Ayat 1</b> <br>O Hatalla pangkahai,<br>Tuhan ije paham kuasa<br>dan basewut haliai:<br>aram patut toh inara!<br>Hormat akam dan kahai<br>hetoh,palus katatai<br>		<br>			<b>Ayat 2</b> <br>	Taloh belom handiai,<br>	Kerub ije huang sorga<br>	tuntang oloh korik hai,<br>	keleh hayak toh manara<br>	aran Tuhan pangkahai,<br>ije brasih haliai.<br>		<br>			<b>Ayat 3</b> <br>	Brasih Tuhan sebasot,<br>	kuasae hunjun kare taloh,<br>	le tau mandohop toh,<br>hung Kapehen kare oloj;<br>langit, petak uras aim,<br>manyarita kare khaim<br><br><b> Ayat 4 </b><br>Tuhan, dohop ikei toh,<br>soho berkat ayum mohon!<br>Pasi, pasi tenga roh<br>akan ikei akan oloh,<br>mangat ikei handiai<br> 	<h5>Lago : L.N. No.81</h5>	</p>'];
var nu_114=['<h3>114. TUHAN, HATALLANGKU IJE INARAKU </h3>	<h4>G=1(3/4)</h4>	<p align="justify">	<b>Ayat 1</b> <br>	Tuhan Hatallangku ije inaraku<br>	Rajan kahai!<br>	Oloh samandiai, has tara mampahai<br>	Tuhan Hatallangku, tempon kahai!<br>		<br>			<b>Ayat 2</b> <br>	Krana paham kahai sintae dan asi aie,<br>	Kutoh katau<br>	le nampayah wei taloh injapae te<br>	tuntang mamberkat wei taloh samai<br>		<br>			<b>Ayat 3</b> <br>	AKu manyembah toh, Tuhan , Hatallangku,<br>	je pangkahai.<br>	Handak manumon wei prentah je brasih te<br>	tenga toh ekangku Kuasan Roh aim<br>	 	<h5>Lago : L.N. No.146</h5>	</p>'];
var nu_115=['<h3>115. TARA PAHAI,HATALLA PANGAKAHAI </h3>	<h4>C=1(4/4)</h4>	<p align="justify">	<b>Ayat 1</b> <br>	Tara pahai,Hatalla pangkahai!<br>	Kajohe melai harajur tuntang palus katatai,<br>	palus katatai, palus katatai!<br>		<br>			<b>Ayat 2</b> <br>Hambruangku, toh tara bewei!<br>Dan ela kayau tahiu asi ain Hatallangku<br>ain Hatallangku, ain Hatallangku!<br>		<br>			<b>Ayat 3</b> <br>	Yoh, kuasa aie,je paham kahaie,<br>	marentah toto kakare  taloh tampan lenge aie,<br>	tampan lenge aie, tampan lenge aie.<br>	<b> Ayat 4</b><br>Taloh samai , toh sembah pahai<br>Hatallan itah! Sepsimpan taloh kontep hormat<br>aie,<br>kontep hormat aie, kontep hormat aie!<br><br><b>Ayat 5</b><br>Nyanyi pahai,o keton samai!<br>Yehowa Raja, je brasih , brasih, brasih,brasih haliai,<br>brasih haliai,brasih haliai!<br> 	<h5>Lago : L.N. No.122</h5>	</p>'];
var nu_116a=['<h3>116a.O JAKA TOTO TATAP JELA </h3>	<h4>B<small>es</small>=1(4/4)</h4>	<p align="justify">	<b>Ayat 1</b> <br>	O jaka toto tatap jela<br>	dan tatap kea nyamangkuku,<br>	nakara aku tau manara<br>	Hatalla ije tempongku.<br>	 Yoh ie Tuhan pangkahai<br>je masi itah handiai.<br>je masi itah handiai.<br>	 		<br>			<b>Ayat 2</b> <br> O jaka auhku tarahining<br> kakejau matanandau te,<br> manyanyi tara hanyak suling<br> katahing aku belom wei<br> manara tuntang mampahai<br> Hatalla,Tuhan pangkahai!<br> Hatalla,Tuhan pangkahai!<br>	<br>			<b>Ayat 3</b> <br>	Yoh akam,Apang kare tara<br>	kakare hormat dan kahai!<br>	Hung asi ayum te ihaga<br>	pambelom ikei handiai.<br>	Kapatut ikei toh samai<br>	manara asim katatai.<br>	manara asim katatai.<br>	<br><b> Ayat 4</b><br>Yoh Apang, ikei jari masi,<br>manyanyang ikei handiai,<br>manyoho Yesus , ije brasih,<br>manewus ikei toh samai;<br>manenga Roh je brasih te:<br>Te urase sintam wei.<br>Te urase sintam wei.<br><br><b>Ayat 5</b><br>Toh patut sintam te inara <br>katain ikei belom toh.<br>O tatap nyame tuntang jela,<br>nakara ikei toto tau <br>mpahai mahormat aran aim,<br>Hong htoh palus hung kahaim.<br>Hong htoh palus hung kahaim.<br> 	<h5>Lago : L.N. No.77</h5>	</p>'];
var nu_116b=['<h3>116b.O JAKA TOTO TATAP JELA </h3>	<h4>F=1(4/4)</h4>	<p align="justify">	<b>Ayat 1</b> <br>	O jaka toto tatap jela<br>	dan tatap kea nyamangkuku,<br>	nakara aku tau manara<br>	Hatalla ije tempongku.<br>	 Yoh ie Tuhan pangkahai<br>je masi itah handiai.<br>	 		<br>			<b>Ayat 2</b> <br> O jaka auhku tarahining<br> kakejau matanandau te,<br> manyanyi tara hanyak suling<br> katahing aku belom wei<br> manara tuntang mampahai<br> Hatalla,Tuhan pangkahai!<br>	<br>			<b>Ayat 3</b> <br>	Yoh akam,Apang kare tara<br>	kakare hormat dan kahai!<br>	Hung asi ayum te ihaga<br>	pambelom ikei handiai.<br>	Kapatut ikei toh samai<br>	manara asim katatai.<br>		<br><b> Ayat 4</b><br>Yoh Apang, ikei jari masi,<br>manyanyang ikei handiai,<br>manyoho Yesus , ije brasih,<br>manewus ikei toh samai;<br>manenga Roh je brasih te:<br>Te urase sintam wei.<br><br><b>Ayat 5</b><br>Toh patut sintam te inara <br>katain ikei belom toh.<br>O tatap nyame tuntang jela,<br>nakara ikei toto tau <br>mpahai mahormat aran aim,<br>Hong htoh palus hung kahaim.<br> 	<h5>Lago : L.N. No.128</h5>	</p>'];
var nu_117=['<h3>117.O HATALLA PANGKAHAI </h3>	<h4>G=1(3/4)</h4>	<p align="justify">	<b>Ayat 1</b> <br>	O Hatalla pangkahai<br>	Tempon langit tuntang petak<br>	ikei toh samandiai<br>	mimbit nyanyi tera hormat;<br>	krana sintam,asim hai<br>	dengan ikei handiai.<br>	 		<br>			<b>Ayat 2</b> <br> Kare Kerub,Serap te,<br> Kare Kawan taloh belom<br> ije sanang slamat wei,<br> manyarita hormat ayum;<br> yoh mangaku ikau hai,<br> brasih haliai<br> 	<br>			<b>Ayat 3</b> <br>	Kare rasul,Nabi aim,<br>	tawon kare oloh brasih<br>	tokep padadusan aim<br>	mimbit hormat,trimakasih<br>	kare saksi horan te<br>	mambo nyanyi tara wei.<br>		<br><b> Ayat 4</b><br>	Dengan kare rewar aim,<br>	je hung sorga ,hunjun petak, <br>	ikei manyarita khaim,<br>	hayak ikei blaku: engkak<br>	bara dosa handiai,<br>	awat ikei handiai.<br>	<br><b>Ayat 5</b><br>	Pasi ikei toh sama!<br>	Berkat ikei awi Yesus<br>	tumon janjim ije hai<br>	dengan oloh je inewus;<br.	tenga ampun slamat aim,<br>	mangat tame hung khaim.<br> 	<h5>Lago : L.N. No.81</h5>	</p>'];
var nu_118=['<h3>118. TARA YEHOWA,HAMBARUAN AINGKU </h3>	<h4>G=1(3/4)</h4>	<p align="justify">	<b>Ayat 1</b> <br>	Tara Yehowa hambruan aingku;<br>	hormata pahai toh aran aie!<br>	Kahum pambelomku hung kalunen<br>	patut Yehowa impahai!<br>	Toh biti aingku, aim samai,<br>	tara Yehowa katatai.<br>	Halleluyah!Halleluyah!<br>		<br>			<b>Ayat 2</b> <br>le slamat,yoh toto slamat<br>ije indohop Tuhan te;<br>yoh huang ateie harajur tamat,<br>harap, percaya Yesus wei:<br>je ingalindong Tuhan te,<br>slamat toto slamat wei,<br> Halleluyah!Halleluyah!<br>	<br>			<b>Ayat 3</b> <br>Oloh kalunen,toh nyanyi tara<br>akan Hatalla kuasa te!<br>Kare malekat, horumat arae<br>tuntang harajur hanjak wei!<br>O oloh Kristen handiadi,<br>tara Hatalla pangkahai!<br>Halleluyah!Halleluyah!<br>	 	<h5>Lago : L.N. No.119</h5>	</p>'];
var nu_119=['<h3>119. ITAH HANDAK TOH MANARA </h3>	<h4>A=1(3/4)</h4>	<p align="justify">	<b>Ayat 1</b> <br>	itah handak toh manara aran Tuhan pangkahai.<br>	Intu bentok are basa area patut impahai,<br>	Krana arae te talawang kota dehen haliai,<br>	akan kare oloh aie. le toto batu karang<br>	akan oloh handiai. Area patut impahai!<br>		<br>			<b>Ayat 2</b> <br>	Eweh padan dengan Tuhan , ije area Sebaoth?<br>	Ie Tuhan kare kawan taloh belom,tempon Roh!<br>	Awi langit injadian, petak, tasik handiai<br>	Taloh korik,taloh hai jaton ije katapasan<br>	uras tamapan lenge aje: Ara patut impahai!<br>		<br>			<b>Ayat 3</b> <br>Kilau bapa sinta anake,Tuhan sinta itah toh;<br>mampong tuntang mampahayak magon hapan<br>kuasan Roh<br>Uras itah to ihaga, ingalindong hante wei;<br>tinai kuasan setan te kalah awi Tuhan itah.<br>Tagal sintae ije hai; Area patut impahai!<br><b> Ayat 4</b><br>	Tuhan wei panewus itah danpandohop ije hai.<br>	Kare gawie uras buah,sukup, tinduh handiai.<br>	Tuhan handak itah kea toto belom akae wei,<br>	mangat palus ayue te tau manjadi bagin itah<br>	hetoh palus katatai: Ara patut impahai!<br>	 	<h5>Lago : Sollt ich meinem Gott nicht singen</h5>	</p>'];
var nu_120=['<h3>120. TARA HATALLA HUNG NGAMBO </h3>	<h4>G=1(4/4)</h4>	<p align="justify">	<b>Ayat 1</b> <br>	Tara Hatalla hung ngambo,<br>	kasanang hung petak dan<br>	kakilak Hatalla dengan olon.<br>	Amen! Amen! O Tuhan akam<br>	hormat tara toh! o Tempon kahai!<br>		<br>		Kakare hormat ayum samai.<br>		Te tegal sintam asim, katotom,<br>		Tuhan,Raja dan Bapa<br>		je melai harajur,Tuhan,<br>		Anak Bapa, o Yesus Kritus ,<br><br>				Tuhan,Tempon ikei ungkup aim toh.<br>		Je tanggong dosan kalunen<br>		o pasi toh ikei!<br>		Je tonggong dosan kalunen,<br>		talingan pinding aim!<br>		<br>		 		 Tuhan , hila gantaun Bapa ayum,<br>		 o pasi toh ikei!<br>		 Karana Tuhan brasih,<br>		 Tuhan Je pangkahai.<br>		 Tonggal Tuhan Je Tempon kuasa;<br>			 	<h5>Lago : L.N. No.121 </h5>	</p>'];
var nu_121=['<h3>121. TARA, HORUMAT KAN TUHANGKU </h3>	<h4>C=1(4/4)</h4>	<p align="justify">	<b>Ayat 1</b> <br>			Tara horumat kan Tuhangku!<br>		Tara, horumat ,tara horumat kan Tuhang,<br>		ku:Hatallangku,Panewusku:<br>		hong ie aton slamat,<br>		hong ie aton kasanang<br>		Tara, horumat kan Tuhangku!<br>		Kakajau kare langit kutoh kare sintae.<br>		Tara, horumat kan Tuhangku!<br>		Has,toh maharap,<br>		manarima kasih kan Tuhangku,<br>		Tempongku basa sorak.<br>		Tara, horumat kan Tuhangku!<br>		Tara, horumat kan Tuhangku!<br>	 	<h5>Lago : L.N.P. No.46 </h5>	</p>'];
var nu_122=['<h3>122. TARA, HORUMAT TOH </h3>	<h4>C=1(4/4)</h4>	<p align="justify">	<b>Ayat 1</b> <br>			Tara horumat kan Tuhangku!<br>		Tara, horumat kan Tuhangku"<br>		Tara horumat kan Tuhangku!<br>		Tara, horumat kan Tuhangku,<br>		kan Tuhangku kan Tuhangku.<br><br>				Tara tara pahai! kan Tuhangku, Tarapahai,<br>		tara pahai! kan Tuhangku, Hatallangku tara,<br>	tara pahai! kan Tuhangku, Hatallangku tara<br>	tara pahai! Tara,Horumat,tara pahai!<br>	Tara tara pahai! Halleyula,Halleyula.<br> 	<h5>Lago : L.N.P. No.47 </h5>	</p>'];
var nu_123=['<h3>123. HALLEYULA,TARA TUHAN </h3>	<h4>C=1(4/4)</h4>	<p align="justify">	<b>Ayat 1</b> <br>	Halleyula! Tara Tuhan tagal kare asi Aie,<br>	Ambo nyanyi tutang masmur arae patut impahai,<br>	arae patut impahai, arae patut impahai,<br>	arae patut impahai.<br>	<b>Ayat 2</b> <br>	Slamat ie, je indohop hong kajake handiai,<br>	awim, o Hatallan Yakob tuntang harap janji Aim!<br>	tuntang harap janji Aim!tuntang harap janji Aim!<br>	tuntang harap janji Aim!<br><br>	<b>Ayat 3</b> <br>	Sion, Raja aim marentah dan palus katatai,<br>	Ie tempon kare kuasa, Sion, nyanyi tara Aie!<br>	nyanyi tara Aie!nyanyi tara Aie!<br>	nyanyi tara Aie!<br> 	<h5>Lago : L.N.P. No.12 </h5>	</p>'];
var nu_124=['<h3>124. AKAM,YEHOWA,HORMAT TARA </h3>	<h4>B<small>es</small>=1(4/4)</h4>	<p align="justify">	<b>Ayat 1</b> <br>	Akam Yehowa, hormat tara kahalap Ayum<br>	nyanyingku.<br>	Sinta kasanayang Aim mamarah hong kare gawim<br>	dengangku.<br>	jaka kelan aingku sampet manara Ikau lipe-lipet!<br>	O Hatallangku, Rajangku Imam hai,<br>	Hatallang,ku o Tempongku akam kahai!<br><br>		<b>Ayat 2</b> <br>	Akam hagatang tampalawei salepah atei huangku.<br>	Jahanjak hai manara Ikau harajur tinai genep andau!<br>	O Hatallangk, Rajangk, Imam hai,<br>	Hatallang,ku o Tempongku akam kahai!<br><br>		<b>Ayat 3</b> <br>	Duan pambelom aingku akam, yoh biti bareng,<br>	gawingku!<br>	Okeleh trima aku, Apang, o suang hapus huangku!<br>	Te ikau tau mangilak toto parapah tara aingku hetoh.<br>	O Hatallangk, Rajangk, Imam hai,<br>	Hatallang,ku o Tempongku akam kahai!<br> 	<h5>Lago : J.Heim.37 </h5>	</p>'];
var nu_125=['<h3>125. DENGAN KAHAJAK IKEI MANYANYI </h3>	<h4>G=1(9/8)</h4>	<p align="justify">	<b>Ayat 1</b> <br>	Dengan kahanjak ikei manyanyi,mimbit horumat<br>	tuntang kahai<br>	akam,o Tuhan je tumon janjie , rajin manenga berkat <br.	je hai.<br>	Ikei harap tuntang percaya,sintam dan asim,je <br>	paham hai,<br>	rajin manempo tuntang kahanjak Ikau o Tuhan,<br>	Tempon kahai.<br><br>		<b>Ayat 2</b> <br>	Oloh je eter harap auh Tuhan,palus manumon kare <br>	auh aie<br>	le harajur mangat dan sanang, atei aie hanjak, plawa<br>	bewei;<br>	ie bagare anak Hatalla, dinon panatau tuntang hakai.<br>	Hanjak, yoh hanjak, ungkup ain Tuhan tagal panenga<br>	je toto hai.<br><br>		<b>Ayat 3</b> <br>	 Tuhan mahaga,yoh ie manggau,magah harajur<br>	 huang kataue,<br>	 oloh je ayue handau hamalem hayak manyanyang<br>	 tuntang manggau<br>	 oloh bados, je magon layang, uka tau tame karajan<br>	 aie,<br>	 palus mangkeme kutoh kasanang tuntang salamat je toto hai.<br> 	<h5>Lago : L.N.P. No.9 </h5>	</p>'];
var nu_126=['<h3>126. TUHAN, HATALLANGKU,IJE HAI KUASAE </h3>	<h4>E<small>s</small>=1(4/4)</h4>	<p align="justify">	<b>Ayat 1</b> <br>Tuhan,Hatallangku, Ije hai kuasae,<br>sorga dan petak te uras Aim<br>Tetek bujur wei,jalan Aim heran,<br>Auh Aayum tulus samandiai.<br>Raja je pangkahai akam horumat,<br>nyanyi dan tara katatai.<br>		<b>Ayat 2</b> <br>	Sembah yoh sembah wei, utus dan bangsa,<br>	tenga horumat kan aran Aie!<br>	Ie Immannuel, Raja je manang,<br>	musoh aie kalah toh penda paie<br>	Lahap, yoh lahap wei, tenga horumat<br>	toh tutang palus katatai<br><br>	Lahap ,yoh lahap wei, tenga horumat <br>	toh tutang palus katatai!<br> 	<h5>Lago : L.N.P. No.51 </h5>	</p>'];
var nu_127=['<h3>127. TOH NYANYI AKAN TUHAN </h3>	<h4>F=1(3/4)</h4>	<p align="justify">	<b>Ayat 1</b> <br>	Toh nyanyi akan Tuhan salepah hambarangku,<br>	yoh ela kalapean kakare asin Tuhangku!<br>	Kalangkah ku iampun, te punah utangku<br>	yoh aku toh iampong hong kare kpehengku.<br>	Kasayngku, sintan Tuhan jaton balentaswei.<br>	Toh nyanyi akan Tuhan,nyanyi taheta te!<br><br>		<b>Ayat 2</b> <br>	Hatalla mampakanan, mambelom aku, oloh aie.<br>	mahaga, mangalindong, manyanyang hapan sinta<br>	aie.<br>	Yoh, aku ije randah, je kilau kawo ei<br>	dan kilau sehep keang je amput riwut te,<br>	iangkat awi Tuhan manjadi anak aie,<br>	ainantu akan slamat,pambelom katatai.<br> 	<h5>Lago : R.L. No.14 </h5>	</p>'];
var nu_128=['<h3>128. TARA HATALLA KETON SAMANDIAI </h3>	<h4>G=1(3/4)</h4>	<p align="justify">	<b>Ayat 1</b> <br>	Tara Hatalla keton samandiai,<br>	imbit horumat kan Tuhan Pangkahai.<br>	Hapus kalunen nyanyi tara<br>	akan Yehowa dan hormat arae<br>	akan Yehowa dan hormat arae<br><br>		<b>Ayat 2</b> <br>	Krana salamat je palus katatai<br>	jari inatap kan keton handiai,<br>	bauntonggang sorga toh imbangah:<br>	uras irawei kan eka kasanang,<br>	uras irawei kan eka kasanang,<br><br>		<b>Ayat 3</b> <br>		Has, keleh tekon ton hanjak haliai<br>		palus manalih Hatalla Pangkahai,<br>		je Tempon langit, tasikpetak.<br>		Tempon salamat,pambelom,berkat,<br>		Tempon salamat,pambelom,berkat,<br><br>			<b>Ayat 4</b> <br>		Kare malekat ewen samandiai<br>		hante manyembah Hatalla Pangkahai.<br.		O keton ije tampan ayue<br>		tenga horumat kan ayue,<br>		tenga horumat kan ayue,<br> 	<h5>Lago : R.L. No.14; P.B.l.No.170 </h5>	</p>'];
var nu_129=['<h3>129. HAS SEWUT HALLELUYA </h3>	<h4>B<small>es</small>=1(4/4)</h4>	<p align="justify">	<b>Ayat 1</b> <br>	Has sewut Halleyula,<br>	o hambaruangku dan<br>	tara kan Yehowa,<br>	Hatalla ayungku!<br>	Katahing ku namuei.<br>	Kakare nyanyingku<br>	manintu le bewei<br>	je puna Tempongku.<br>	<br>		<b>Ayat 2</b> <br>	Salamat kare oloh<br>	je hante magon wei<br>	maharap janjin Tuhan<br>	Hatalla kuasa te,<br>	je Tempon langit, petak<br>	dan taloh handiai<br>	yoh eter kare janjie<br>	harajur katatai<br>	<br>		<b>Ayat 3</b> <br>	Yehowa mampakanan<br>	kakare oloh te<br>	je blau dan manyarenan,<br>	balaku dengae wei;<br>	kakare je tawanan<br>	iliwus handiai,<br>	dan ewen je inganan,<br>	unggatang, impahai.<br>	<br>			<b>Ayat 4</b> <br>		Yehowa mamparenang<br>		toh maton oloh te<br>		je kaput dan nahuang<br>		namapayah le wei<Br>		Yoh utut je paleko<br>		ingancang Tuhan toh<br>		je sinta kare oloh<br>		je tetek awi Roh<br>		<br>		<b>Ayat 5</b> <br>		Yehowa manganggulo<br>		tamuei handiai,<br>		mamatut nole,balo<br>		hung sintae ije hai.<br>		Yehowa Tempon prentah,<br>		kuasae katatai.<br>		Salamat ingarinah<br>		kan oloh baris aie!<br>		<br>		<b>Ayat 6</b> <br>		Has sewut Halleyula,<br>		o hambaruangku<br>		dan tara kan Yehowa<br>		Hatalla ayungku<br>		Katahingku namuei,<br>		kakare nyanyingku<br>		manintu Tuhan bewei,<br>		Hatalla, Tempongku!<br>		<br> 	<h5>Lago : L.N.No.129 </h5>	</p>'];
var nu_130=['<h3>130. TARA HATALLA TAGAL KARE ASIE  </h3>	<h4>C=1(2/2)</h4>	<p align="justify">	<b>Ayat 1</b> <br>Tara Hatalla tagal kare asie,<br>horumat, nyanyi tuntang trima kasih<br>kan aran Tuhan, ije brasih bra sih!<br>Tara Hatalla!<br>	<br>		<b>Ayat 2</b> <br>	Tara Hatalla ije tempon itah,<br>	Tempon hambruan tuntang bereng itah,<br>	ije mambelom, mampakanan itah.<br>	Tara Hatalla!<br>	<br>		<b>Ayat 3</b> <br>	Tara Hatalla imbit toh parapah<br>	tarima kasih, tara akan Bapa,<br>	je jari mampanihau kare sapa.<br>	Tara Hatalla!<br>	<br>			<b>Ayat 4</b> <br>		Tara Hatalla ije tau basarae,<Br>		sintae,kataue harajur bakarinah;<br>		je masi aloh itah kinjap sala.<br>		Tara Hatalla!<br>		<br>		<b>Ayat 5</b> <br>		Tara Hatalla tagal kare berkat!<br>		Hong hetoh kea imbit tara hormat,<br>		ambo toh nyanyi hayak Koor malekat.<br>		Tara Hatalla!<br>		 	<h5>Lago : P.B.I.256 </h5>	</p>'];
var nu_131a=['<h3>131a. TARA, HORMAT TRIMAKASIH	<h4>F=1(3/2)</h4>	<p align="justify">	<b>Ayat 1</b> <br>	Tara hormat trima\'kasih<br>	akan Tuhan Pangkahai,<br>	ije hapan sinta,<br>	asie marar itah handiai.<br>	Kare hukum jadi indahe<br>	dan Kalaite terai toh. <br>	Baya slamat tuntang sintae<br>	toh ingkeme awiku<br>	<br>		<b>Ayat 2</b> <br>	Tuhan puna Batang slamat,<br>	ie eka kharapkku.<br>	Arae patut toh ihormat,<br>	akae kare nyanyingku<br>	Ela itah toh hasuat,<br>	tapi hanjak haliai<br>	masip bara kalin slamat<br>	ain Hatalla Pangkahai<br>	<br>		<b>Ayat 3</b> <br>	Kare tara akam Tuhan,<br>	aram petut impahai<br>	tagal kare heran<br>	intu bentuk utus aie.<br>	Lahap,nyanyi, rami-ramu<br>	akan Tuhan Pangkahai.<br>	Hayak mimbit trimakasih<br>	akae palus katatai.<br>	 	<h5>Lago : L.N.No.8 </h5>	</p>'];
var nu_131b=['<h3>131b. TARA, HORMAT TRIMAKASIH	<h4>F=1(3/2)</h4>	<p align="justify">	<b>Ayat 1</b> <br>	Tara hormat tri\'makasih<br>	akan Tuhan Pangkahai,<br>	ije hapan sinta,<br>	asie marar itah handiai.<br>	Kare hukum jadi indahe<br>	dan Kalaite terai toh<br>	Baya slamat tuntang sintae<br>	toh ingkeme awiku<br>	<br>		<b>Ayat 2</b> <br>	Tuhan puna Batang slamat,<br>	ie eka kharapkku.<br>	Arae patut toh ihormat,<br>	akae kare nyanyingku<br>	Ela itah toh hasuat,<br>	tapi hanjak haliai<br>	masip bara kalin slamat<br>	ain Hatalla Pangkahai<br>	<br>		<b>Ayat 3</b> <br>	Kare tara akam Tuhan,<br>	aram petut impahai<br>	tagal kare heran<br>	intu bentuk utus aie.<br>	Lahap,nyanyi, rami-ramu<br>	akan Tuhan Pangkahai.<br>	Hayak mimbit trimakasih<br>	akae palus katatai.<br>	 	<h5>Lago : G.L.109 </h5>	</p>'];
var nu_132=['<h3>132. TAWAM IKAU KARE BINTANG<h4>F=1(3/4)</h4>	<p align="justify">	<b>Ayat 1</b> <br>	Tawam ikau kare bintang<br>    intu langit handiai?<br>jari isem huang padang <br>Kawan meto korik hai?<br>Uras japa ain Hatalla<br>uras te ihagae kea<br>bara solak sampai toh,<br>bara solak sampai toh<br>	  	  <b>Ayat 2</b> <br>	 Tuhan,pangkahai Hatalla<br>     jari misee handiai;<br>     tapas ije mahin dia <br>     marak kare kawan aie.<br>     le jari mise kae<br>     genep rambar balau itah,<br>     aloh kutoh kerete,<br>     aloh kutoh karee te.<br>	  <br>	  <b>Ayat 3</b> <br>	  Ie nguan tuntang mawat <br>      itah, oloh korik,hai;<br>      tuntang handak manyalamat<br>      itah,palus katatai;<br>      asal harap dan percaya <br>      tuntang atei itah segah <br>      intu yesus, Tuhan hai,<br>      intu yesus, Tuhan hai,<br><h5>L.N. No.124. </h5>	</p>'];
var nu_133=['<h3>133. KALUNEN TOKEP, KEJAU<h4>E=1(4/4)</h4>	<p align="justify">	<b>Ayat 1</b> <br>	Kalunen tokep kejau,Hatalla manunte.<br>    Hung petak,tasik,pulau<br>    auh kuasa aie bewei. <br>    Bara Tuhan itah,<br>    je toto pangkahai,<br>    harajur mohon taloh samai,<br>    harajur mohon taloh samai.<br><br>    	  	  <b>Ayat 2</b> <br>	Dan bulan,matanandau<br>    yoh bintang korik hai,<br>    hamalem kilau handau<br>    mansanan hormat aie. <br>    Bara Tuhan itah,<br>    je toto pangkahai,<br>    harajur mohon taloh samai.<br>	  <br>	  <b>Ayat 3</b> <br>	  Yoh petak je imberkat<br>      palembut bua aie,<br>      dan liu,nyaho,kilat<br>      mansanan hormat aie.<br>      Bara Tuhan itah,<br>      je toto pangkahai,<br>      harajur mohon taloh samai.<br>      <br>        <b>Ayat 4</b> <br>	  Laok sloang lundan, <br>      yoh, meto korik hai. <br>      Sakaree injadian <br>      kan hormat aran aie. <br>      Bara Tuhan itah, <br>      je toto pangkahai, <br>      harajur mohon taloh samai. <br>      <br>            <b>Ayat 5</b> <br>	 Hatalla wei manguan <br>     pakanan te samai,<br>     dan jaton katapasan<br>     imbesoh handiai.<br>     Bara Tuhan itah,<br>     je toto pangkahai,<br>     harajur mohon taloh samai.<br>      <br><h5>L.N. No.63 </h5>	</p>'];
var nu_134=['<h3>134. ALO OLOH JADI TATAU<h4>G=1(4/4)</h4>	<p align="justify">	<b>Ayat 1</b> <br>	Aloh oloh jadi tatau,<br>    jete jaton otong hai,<br>    amon jaton jari sondau<br>    asin Tuhan pangkahai.<br>    <br>    	  <b>Ayat 2</b> <br>	Ramo ain Kalunen jetoh<br>    gulong nihau rusak wei;<br>    ramo ije bunggut toto<br>    jaton marak taloh te.<br>	  <br>	  <b>Ayat 3</b> <br>	  Oloh ije jari sondau<br>      auh Hatalla,ie wei<br>      slamat tuntang toto tatau<br>      asal belom tumon te.<br>      <br>        <b>Ayat 4</b> <br>	Auh Hatalla mimbit brita <br>    ije heran tuntang hai:<br>    Yesus,Anak ain Hatalla<br>    mandal itah handiai.<br>      <br>            <b>Ayat 5</b> <br>	Brita jete hayang <br>    sampai huang andau toh<br>    amon petak,langit,bintang,<br>    uras rusak lilap wei.<br>      <br>              <b>Ayat 6</b> <br>	Baya Auh ain Hatalla<br>    melai palus katatai;<br>    janjie tulus,itah kea<br>    bara bagi hung kahai!<br>      <h5>L.N. No.11 </h5>	</p>'];
var nu_135=['<h3>135. LANGIT,PETAK,BULAN,BINTANG<h4>F=1(4/4)</h4>	<p align="justify">	<b>Ayat 1</b> <br>	Langit,petak,bulan bintang,<br>    rear bulau kare hintan uras<br>    uras hayang handiai;<br>    ije melai katatahie,<br>    eter dehen jaton malih:<br>    Auh ain Tuhan Pangkahai.<br>    Auh ain Tuhan Pangkahai.<br>    <br>    	  <b>Ayat 2</b> <br>	Kare peteh aie kabujur,<br>    kare janjie te harajur<br>    toto tulus handiai.<br>    Auh ain tau maplawa atei,<br>    mampong olog belom matei,<br>    sampai snang haliai;<br>    sampai snang haliai.<br>	  <br>	  <b>Ayat 3</b> <br>	  Auh katoto ain Hatalla <br>      manang tuntang mampakalah<br>      punga,tipu,handiai.<br>      Yoh kapapadan tanjaro<br>      je playang kare oloh,<br>      akan hihau katatai,<br>      akan hihau katatai.<br>      <br>        <b>Ayat 4</b> <br>	Amon tipu daya tende, <br>    langit tuntang petak hongge,<br>    rusak,lilap,handiai,<br>    te haluli tara-tara<br>    aku,tegal auh Hatalla,<br>    hung sorga hung kahai,<br>    hung sorga hung kahai.<br>                    <h5>L.N. No.49 </h5>	</p>'];
var nu_136=['<h3>136. SALAMAT TANAH,EKA TE<h4>E<small>s</small>=1 (4/4)</h4>	<p align="justify">	<b>Ayat 1</b> <br>	Salamat tanah ,eka te<br>    auh Tuhan tarang haliai<br>    insanan akan oloh<br>    Auh Tuhan manis haliai,<br>    barega toro klawa aie.<br>    mamplawa itah toto.<br>    Auh te tau wei mampong atei<br>    ije pehe mimbit oloh<br>    sondau ksanang slamat toto.<br>    <br>    	  <b>Ayat 2</b> <br>	Kalunen akan nihauwei,<br>    auh Tuhan melai,tagal te<br>    tau itah harap le<br>    Tanjaro, tipu handiai<br>    impalah lepah haliai<br>    auh Tuhan manang hante.<br>    Auh aie melaikatahi<br>    tuntang janjie dehen toto.<br>    aloh langit petak lenyoh.<br>	  <br>	  <b>Ayat 3</b> <br>	 Toh buah taran Tuhan te <br>     imbrita tuntang magon wei<br>     auh ayue sasar tayap!<br>     Yoh patut itah handiai<br>     manyaksi arae ije hai <br>     harajur hung kaharap<br>     Yesus Kritus pasi ikei,<br>     mangat hante hanjak atei,<br>     heret dengam katatai<br>                      <h5>L.N. No.133 </h5>	</p>'];
var nu_137a=['<h3>137a. SALAMAT IJE SONDAU GALANG<h4>F=1 (3/8)</h4>	<p align="justify">	<b>Ayat 1</b> <br>	Salamat ije sondau galang <br>    je dehen segah haliai<br>    de puna jaton tau imbalang ,<br>    je tahan palus katatai.<br>    Katawam narai galang te <br>    je jaton tara gerek wei?<br>    <br>    	  <b>Ayat 2</b> <br>	Batonggal kare auh Hatalla<br>    Manja di galang dehen te,<br>    je jaton nihau,jaton sala<br>    dan magon ete-ete wei,<br>    je palus sampai katatai<br>    harajur segah haliai.<br>	  <br>	  <b>Ayat 3</b> <br>	O keleh ah pambelom itah <br>    hagalang auh Hatalla te,<br>    je toto tau iharap segah <br>    dan rajur-rajur eter wei.<br>    Te slamat,sananghaliai<br>    kakare itah handiai.<br>                      <h5>L.N. No.4 </h5>	</p>'];
var nu_137b=['<h3>137b. SALAMAT IJE SONDAU GALANG<h4>B<small>es</small>=1 (4/4)</h4>	<p align="justify">	<b>Ayat 1</b> <br>	Salamat ije sondau galang <br>    je dehen segah haliai<br>    de puna jaton tau imbalang ,<br>    je tahan palus katatai.<br>    Katawam narai galang te <br>        je jaton tara gerek wei,<br>    je jaton tara gerek wei?<br>    <br>    	  <b>Ayat 2</b> <br>	Batonggal kare auh Hatalla<br>    Manja di galang dehen te,<br>    je jaton nihau,jaton sala<br>    dan magon ete-ete wei,<br>    je palus sampai katatai<br>    harajur segah haliai,<br>    harajur segah haliai.<br>	  <br>	  <b>Ayat 3</b> <br>	O keleh ah pambelom itah <br>    hagalang auh Hatalla te,<br>    je toto tau iharap segah <br>    dan rajur-rajur eter wei.<br>    Te slamat,sananghaliai<br>    kakare itah handiai,<br>    kakare itah handiai.<br>                      <h5>L.N. No.77 </h5>	</p>'];
var nu_138=['<h3>138. KARE AJAR AUH HATALLA<h4>G=1 (4/4)</h4>	<p align="justify">	<b>Ayat 1</b> <br>	Kare ajar auh Hatalla<br>    hera-heran haliai:<br>    Tuhan ie te Yehowa<br>    je kasenen oloh aie.<br>    Ewe-eweh je magaku<br>    aran Tuhan toto-toto,<br>    ie akan undur wei<br>    bara kare kpapate.<br>        <br>    	  <b>Ayat 2</b> <br>	Kare janji ayun Tuhan<br>    eter dehen haliai,<br>    galang ayue toto tahan<br>    palus sampai katatai.<br>    Ije baris ayue simpan,<br>    tatap hante mangat nguan<br>    gawi je bahalap te <br>    akan taran Tuhan wei.<br>	  <br>	  <b>Ayat 3</b> <br>	Maka huang jete aton<br>    tuah ije totoha;<br>    amon ombet huang magon<br>    dengan puna bagi aie.<br>    Asal atoh toh pakaian<br>    tuntang sukup taloh kinan,<br>    buah huange terai wei<br>    dengan ramo minjam te.<br>    <br>     <b>Ayat 4</b> <br>           Buah oloh je ain Tuhan<br>           manantuneng magon wei<br>           auh Hatalla kilau bulan<br>           je lalendang blawa te,<br>           sampai andau handak blawa<br>           bintang sawah te mamala<br>           huang atei oloh te<br>           ije mentai klawa wei.<br>      <h5>L.N. No.54 </h5>	</p>'];
var nu_139=['<h3>139. KELEH ITAH TOTO NGUANG GAWIN ITAH<h4>G=1 (4/4)</h4>	<p align="justify">	<b>Ayat 1</b> <br>Keleh itah toto nguan <br>Kare gawin itah wei<br>suro itah dia tahan<br>hong jalanan itah te;<br>Mangat tame ksanang<br>Tuhan je injanjie<br>bara horan akan kare oloh aie.<br>hinje denganae hong kahai.<br>        <br>    	  <b>Ayat 2</b> <br>	Auh Hatalla puna manang<br>    tuntang kuasa haliai<br>    yoh banyihi bara padang<br>    lawan toto belai aie<br>    tuntang kuman hasansila.<br>    Oloh jaton bara hila<br>    mawat milang arepe wei<br>    bara kuasaan aih aie te.<br>	  <br>	  <b>Ayat 3</b> <br>	Auh Hatalla manambelan<br>    dan mamisah palus wei<br>    roh te dengan hambaruan<br>    dan mariksa urase te.<br>    Tirok atei dan patongan<br>    dia tau iyohokan.<br>    Auh Hatalla hakim hai<br>    akan itah handiai.<br>    <br>     <b>Ayat 4</b> <br>          Kranaintu baun Hatalla <br>          uras te talampas wei,<br>          yoh halangi tuntang blawa <br>          jaton basahokan wei.<br>          Jaton taloh je basilim<br>          dia kea tau iilim.<br>          krana matan Tuhan te<br>          mite itah hante wei.<br>          <br>      <b>Ayat 5</b> <br>      Buah itah mangkarene<br>      nguan gawi handiai<br>      hayak toto mangasene<br>      wayah asi ije hai.<br>      belom hong taharep Tuhan;<br>      bele buah kaputusan<br>      hukum ije paham khai,<br>      ije palus katatai.<br><h5>L.N. No.54 </h5>	</p>'];
var nu_140=['<h3>140. SALAMAT KARE OLOH TE</h3><h4>G=1 (3/4)</h4>	<p align="justify">	<b>Ayat 1</b> <br>Salamat kare oloh te<br>je blaku awat,dohop<br>batonggal dengan Tuhan wei<br>hong kpehe dan kagogop.<br>je hong kajake handiai<br>manalih Tuhan pangkahai<br>iawat dan indohop.<br>        <br>    	  <b>Ayat 2</b> <br>	Yehowa tau manyanang wei<br>    hong kare kpehe atei<br>    maliwus je tawanan te,<br>    mambelom ije matei,<br>    je mangop nyaman musoh te,<br>    manadoh riak,riwut te,<br>    mandohop hong kajake.<br>	  <br>	  <b>Ayat 3</b> <br>	Yoh gawin Tuhan toto hai,<br>    ketetek ayue manang;<br>    auh Tuhan eter haliai.<br>    Salamat dan kasanang<br>    je palus sampai katatai<br>    inenga akan oloh aie<br>    kahanjak dan kamanang<br>    <h5>L.N. No.33 </h5>	</p>'];
var nu_141=['<h3>141. METOH TUHAN JARI MASI</h3><h4>G=1 (4/4)</h4>	<p align="justify">	<b>Ayat 1</b> <br>Metoh Tuhan jari masi<br>halalian Sion te.<br>angat ikah kilau nupi<br>awi toto hanjak wei.<br>Bara nyaman itah toh<br>lembut nyanyi tara yoh,<br>hapus atei hambaruan<br>basa sorak akan Tuhan.<br>        <br>    	  <b>Ayat 2</b> <br>	Atei itah toh mamurai<br>    tagal gawie ije hai,<br>    je ilalus jaton terai<br>    awi Tuhan Pangkahai.<br>    Hanjak rantang itah toh <br>    hong katoto,huang Roh<br>    tagal gawi ain Hatalla<br>    	  <br>	  <b>Ayat 3</b> <br>	Kare itah je tawanan <br>    jari bebas, buli we:<br>    ewh ije toh ngagalan<br>    akan eka slamet te?<br>    Tuhan tanggoh utus aie,<br>    mimbit ie kan kahaie<br>    Kare johon mate lepah.<br>     <br>	  <b>Ayat 4</b> <br>    Ewen ije kasaburan,<br>    unggo-unggol haliai,<br>    usang bara jaman horan,<br>    buli puna eka aie.<br>    Ije manarenan wei<br>    kutoh kare kpehe te <br>    toh iagah bara klahi<br>    kan ksanang katatahi.<br>    <br>    <b>Ayat 5</b> <br>    Oloh ije jari malan <br>    hayak tangis tatum wei,<br>    manarahing,manyarenan,<br>    awi uras hayang te,<br>    itah toh samandiai<br>    dinon asi ije hai<br>    itah hayak lahap sorak,<br>    tau manggetem hong kahanjak<br>        <br>    <b>Ayat 6</b> <br>    Palus itah bara khanjak,<br>    rami-rami palus wei;<br>    mimbit taloh getem hayak<br>    akan lepau Tempoe te.<br>    Bara nyaman itah toh <br>    lembut nyanyi tara,yoh<br>    ela atei toh batengkan<br>    tagal kare sintan Tuhan.<br>        <h5>R.l. No.577 </h5>	</p>'];
var nu_142a=['<h3>142a. BASORAK KARE LANGIT </h3><h4>C=1 (2/4)</h4>	<p align="justify">	<b>Ayat 1</b> <br>Basorak kare langit,<br>hanjak wei, opetak toh!<br>Krana Tuhan jari<br>mimbit ungkup oloh ayue toh!<br>Kare mlekat handiai,<br>hanjak rantang haliai!<br>        <br>    	  <b>Ayat 2</b> <br>	Krana huang wayah asi,<br>    intu andau slamat toh,<br>    ije kasaburan jari<br>    halalian Tuhan, Yoh<br>    itah,oloh handiai<br>    manarima slamat hai!<br>    	  <br>	  <b>Ayat 3</b> <br>		Kilen, taukah oloh bawi<br>        kalapean awau aie<br>        sampai ie dia masi<br>        ije puna anak aie?<br>        Tuhan jaton haliai<br>        Kalapean oloh aie.<br>     <br>     	  <b>Ayat 4</b> <br>   Itah toh imintik Awie<br>   huang lokap lenge aie.<br>   Tuhan melai hinje itah,<br>   huang bentok ungkup aie.<br>   Itah toh samandiai,<br>   eka sintae katatai.<br>        <h5>R.l. No.593 </h5>	</p>'];
var nu_142b=['<h3>142a. BASORAK KARE LANGIT </h3><h4>C=1 (4/4)</h4>	<p align="justify">	<b>Ayat 1</b> <br>Basorak kare langit,<br>hanjak wei, opetak toh!<br>Krana Tuhan jari mimbit<br> ungkup oloh ayue toh!<br>Kare mlekat handiai,<br>hanjak rantang atei aie!<br>        <br>    	  <b>Ayat 2</b> <br>	Krana huang wayah asi,<br>    intu andau slamat toh,<br>    ije kasaburan jari<br>    halalian Tuhan, Yoh<br>    itah,oloh handiai<br>    manarima slamat hai!<br>    	  <br>	  <b>Ayat 3</b> <br>		Kilen, taukah oloh bawi<br>        kalapean awau aie<br>        sampai ie dia masi<br>        ije puna anak aie?<br>        Tuhan jaton haliai<br>        Kalapean oloh aie.<br>     <br>     	  <b>Ayat 4</b> <br>   Itah toh imintik Awie<br>   huang lokap lenge aie.<br>   Tuhan melai hinje itah,<br>   huang bentok ungkup aie.<br>   Itah toh samandiai,<br>   eka sintae katatai.<br>        <h5>L.N. No.21 </h5>	</p>'];
var nu_143=['<h3>143. YOH KILAU HAPAN PALAPAS</h3><h4>C=1 (4/4)</h4>	<p align="justify">	<b>Ayat 1</b> <br>	Yoh kilau hapan palapas<br>    ain burung nasar te<br>    kai Tuhan jari meton<br>    mananggong aku toh.<br>    Tambuan tasik pambelom<br>    jeha riak paham haliai.<br>    Aku jaton mangkeme kaheka<br>    inanggong kan eka kahai.<br>    Aku jaton mangkeme kaheka<br>    inanggong eka kahai.<br>        <br>    	  <b>Ayat 2</b> <br>	Yoh kilau penda palapas<br>    ain burung nasar te,<br>    kalote aku iilang<br>    ingalindong hante wei<br>    Yoh penda palapas ain Tuhan<br>    aku sanang, yoh sanang bewei<br>    marak kare, bahaya dan musoh<br>    je mimpa harajur bewei,<br>    marak kare, bahaya dan musoh<br>    je mimpa harajur bewei<br>    	  <br>	  <b>Ayat 3</b> <br>		Yoh aloh hunjun palapas<br>        yoh aloh penda te,<br>        palapas te puna abas,<br>        toh aku tau sanang bewei.<br>        Kalote aku harajur<br>        ingalndong ingalndong bewei<br>        kilau hapan palapas je abas te,<br>        kan Kanaan ngambo te,<br>        kilau hapan palapas je abas te,<br>        kan Kanaan ngambot te.<br>        	</p>'];
var nu_144=['<h3>144. TUHAN MANGANGGAPONG AKU</h3><h4>A=1 (4/4)</h4>	<p align="justify">	<b>Ayat 1</b> <br>	Tuhan manganggapong aku<br>    hila likut hila bau:<br>    Tuhan manalawang aku<br>    hila sambil hila gantau,<br>    awie aku toh ihaga<br>    ingalindong hante wei<br>    bara kare taloh papa<br>    tuntang bara setan te.<br>        <br>    	  <b>Ayat 2</b> <br>	Aran Tuhan puna ampuh <br>    kota dehen haliai<br>    akan kare-kare oloh <br>	ije toto baris aie.<br>    Oloh je mahakan kante <br>    bakalindong haliai,<br>    sanang landang, hanjak hante<br>    palus sampai katatai.<br>        <h5>L.N. No.14 </h5>	</p>'];
var nu_145=['<h3>145. KAKARE KHANJAK KARE TUAH</h3><h4>E<small>s</small>=1 (2/4)</h4>	<p align="justify">	<b>Ayat 1</b> <br>	Kakare khanjak,kare tuah,<br>    kakare kpehe ije buah<br>    tamuei aim hong petak toh,<br>    pambelom aingku hila hetoh<br>    iatoh Tuhan bara helo,<br>    inantu awim akang kua:<br>    <br>    	  <b>Ayat 2</b> <br>	Yoh tagal te ksanang ,kmangat<br>    kahanjak tuntang kare berkat,<br>    kapehe kea handiai<br>    narimaku toh samandiai<br>    penengan lengem kakare te<br>    je lembut bara sintam wei.<br> <br>     <b>Ayat 3</b> <br>      Yoh aloh kinjap aku munguh<br>     dan ateiku toh hetang toto<br>      nyarenan kutoh kapehengku,<br>      jam ayum wei ije manantu<br>      hamprea terai toh kphengku,<br>      inengam slamat akangku.<br> <br>             <b>Ayat 4</b> <br>        Yoh mahim ije krambar balau<br>        takolok aingku dia nihau<br>         je ruar bara khanjak aim.<br>         O Apang je makayan oru<br>         pakanan burong,kare meto,<br>         mambelom kea anak aim.<br>         <br>          <b>Ayat 5</b> <br>         Toh aloj langit petak lilap<br>         dan nihau taloh je iharap,<br>         balihang pasahayungku<br>         Katawangku kasayang ayum,<br>         yoh sintam tuntang kare kataum<br>         harajur melai dengangku <br>                             <h5>B.L.No.524 </h5>	</p>'];
var nu_146=['<h3>146. O TUHANGKU,HATALLANGKU</h3><h4>B<small>es</small>=1 (2/4).(6/4)</h4>	<p align="justify">	<b>Ayat 1</b> <br>	O Tuhangku Hatallangku<br>    eka kasanang aingku toh <br>    je toto tau iharap<br>    Kalunen to manipu wei,<br>    kahanjak je hanjolo te<br>    bagulong toto lilap.<br>    Yoh aloh petak lomos wei,<br>    Hatallangku je ete te:<br>    Pamampong atei aingku toh<br>    dan Yesus Jurus Slamatku<br>    Tuhangku, Pamawatku,<br>    Hatallangku<br>    batonggal Ikau slamatku!<br>        <br>    	  <b>Ayat 2</b> <br>	Hambruangku, tahasengku<br>    dan palus biti berengku:<br>    panengam o Hatalla.<br>    O dohop, mangat aku toh<br>    mahapan ramon berengku<br>    kan taram,o Yehowa!<br>    Karigasku,kaabasku,<br>    kakare andau umurku,<br>    kataunku dan pambelomku<br>    kan hormat aim, o Tuhangku!<br>    O Tuhangku, Pamawatku<br>    Hatallangku<br>    batonggal Ikau slamatku!<br>    <br>          <b>Ayat 3</b> <br>     Dan amon panamueiku<br>    hong petak handak hapus toh,<br>    paliusku hung Aram.<br>    O soho toh malekat aim<br>    manduan rohku dan kahaim,<br>    balalu akan ekam.<br>    Yoh berengku ilian wei<br>    kan usale huang petak te,<br>    insahan sampai andau hai,<br>    imbelom awim kan kahai.<br>     O Tuhangku, Pamawatku<br>     Hatallangku<br>     batonggal Ikau slamatku!<br>            <h5>R.L.No.275 </h5>	</p>'];
var nu_147=['<h3>147. TUHAN MAJAR OLOH TE</h3><h4>E<small>s</small>=1 (4/4)</h4>	<p align="justify">    	<b>Ayat 1</b> <br>	Tuhan majar otoh te<br>    ije toto eka sintae.<br>    Baya batang anak wei<br>    buah pukul tuntang jara.<br>    Kare kpehe handiai:<br>    berkat hai!<br>        <br>    	  <b>Ayat 2</b> <br>	Ela itah bantus wei <br>    manyarenan jaran Tuhan.<br>    le kilau bapa te<br>    sinta anake bara horan:<br>    maka itah anak aie,<br>    katatai.<br>    <br>          <b>Ayat 3</b> <br>     Bele itah rusak toh <br>    Tuhan majar, murok itah <br>    hapan gawie,hapan Rohe<br>    mangat itah tau iagah<br>    akan slamat katatai,<br>    hong kahaie.<br>    <br>                 <b>Ayat 4</b> <br>         Metoh kare jara te,<br>        jaton ije mampahanjak.<br>        Je ingkeme kpehe wei,<br>        tapi awie lembut sorak<br>        tagal kmanang ije hai,<br>        katatai.<br>        <br>                         <b>Ayat 5</b> <br>         Kare taloh handiai<br>        uras te mandohop itah<br>        akan slamat ije hai<br>        asal itah puna sinta <br>        Tuhan, batang slamat te<br>        hante wei.<br>        <br>         <b>Ayat 6</b> <br>          Kare kpehe minjam wei,<br>         jaton ije tau mamisah <br>         amon mingat slamat te <br>         ije kareh ingarinah<br>         akan itah handiai,<br>         hong kahaie.<br>            <h5>L.N.No.96 </h5>	</p>'];
var nu_148a=['<h3>148a. PERCAYA BEWEI</h3><h4>A=1 (3/4)</h4>	<p align="justify">    	<b>Ayat 1</b> <br>	Percaya bewei <br>    hong kpehe aim te,<br>    dan harap bewei<br>    auh Tuhan aim te!<br>    Batantu auh janjie<br>    hung sintae je hai,<br>    ilalus toh awie dan tulus samai.<br>        <br>    	  <b>Ayat 2</b> <br>	Yoh baring bawei<br>    kagogop aim te,<br>    kapehem samai<br>    kan Tuhan je hai <br>    je manun kasindep <br>    pambelom ain toh,<br>    manenga katetep,<br>    kaabas hung Roh!<br>    <br>          <b>Ayat 3</b> <br>    Hanjulo bewei <br>   kapehe aim te.<br>   O ingat bewei<br>   salamat hai te,<br>   je jari inyimpan<br>   kan itah samai <br>   hong eka ain Tuhan,<br>   je Tempon kahai!<br>       <h5>L.N.No.35a </h5>	</p>'];
var nu_148b=['<h3>148a. PERCAYA BEWEI</h3><h4>F=1 (4/4)</h4>	<p align="justify">    	<b>Ayat 1</b> <br>	Percaya bewei <br>    hong kpehe aim te,<br>    dan harap bewei<br>    auh Tuhan aim te!<br>    Batantu auh janjie<br>    hung sintae je hai,<br>    ilalus toh awie <br>    dan tulus samai.<br>        <br>    	  <b>Ayat 2</b> <br>	Yoh baring bawei<br>    kagogop aim te,<br>    kapehem samai<br>    kan Tuhan je hai <br>    je manun kasindep <br>    pambelom ain toh,<br>    manenga katetep,<br>    kaabas hung Roh!<br>    <br>          <b>Ayat 3</b> <br>    Hanjulo bewei <br>   kapehe aim te.<br>   O ingat bewei<br>   salamat hai te,<br>   je jari inyimpan<br>   kan itah samai <br>   hong eka ain Tuhan,<br>   je Tempon kahai!<br>       <h5>L.N.No.35b </h5>	</p>'];
var nu_149=['<h3>149. HATALLA BEWEI MAMATUT</h3><h4>C=1 (4/4)</h4>	<p align="justify">    	<b>Ayat 1</b> <br>	Hatalla wei mamatut hong taloh handiai.<br>    jam ije puna patut dan buah haliai.<br>    Harajur le tatap mandohop oloh aie,<br>    mansuwit bara kpehe dan mimbit kan kahai.<br>        <br>    	  <b>Ayat 2</b> <br>	Dan amon arut itah hong tasik kpehe te,<br>    inapi riwut barat dan handak kahem wei:<br>    O ela itah gogop! hatalla magah wei<br>    kan palabohan ksanang, kan eka slamat te!<br>        <h5>L.N.No.129 </h5>	</p>'];
var nu_150a=['<h3>150a. KELEH KETON HANJAK RANTANG</h3><h4>C=1 (3/4)</h4>	<p align="justify">    	<b>Ayat 1</b> <br>	Keleh keton hanjak ratang <br>    huang Tuhan Pangkahai,<br>    atei keton sanang landang <br>    palus sampai katatai!<br>        <br>    	  <b>Ayat 2</b> <br>	Buah keton tau basara<br>    dengan oloh handiai<br>    Tuhan aton tokep dumah <br>    humang kuasae, hung kahai.<br>    <br>        <b>Ayat 3</b> <br>    Ela atei keton gogop<br>    tagal taloh korik hai,<br>    tapi buah blaku dohop<br>    intu Tuhan Pangkahai!<br>    <br>         <b>Ayat 4</b> <br>     Sanan katon kare asi<br>     je ingenang keton toh,<br>     hayak imbit trimakasih<br>     akan Tuhan huang Roh.<br>     <br>         <b>Ayat 5</b> <br>     Te kasanang akan keton<br>     ije manangkalau toh<br>     kare kaharat in olon <br>     mohon huang kuasan Roh<br>     <br>            <b>Ayat 6</b> <br>    Hanjak keton huang Tuhan <br>    tagal kuasa ije hai,<br>    mimbit akan karajaan<br>    huang sorga katatai!<br>               <h5>tahiu Pilipi 4.4-7 </h5>	</p>'];
var nu_150b=['<h3>150a. KELEH KETON HANJAK RANTANG</h3><h4>E <small>s</small>=1 (4/4)</h4>	<p align="justify">    	<b>Ayat 1</b> <br>	Keleh keton hanjak ratang <br>    huang Tuhan Pangkahai,<br>    atei keton sanang landang <br>    palus sampai katatai!<br>        <br>    	  <b>Ayat 2</b> <br>	Buah keton tau basara<br>    dengan oloh handiai<br>    Tuhan aton tokep dumah <br>    humang kuasae, hung kahai.<br>    <br>        <b>Ayat 3</b> <br>    Ela atei keton gogop<br>    tagal taloh korik hai,<br>    tapi buah blaku dohop<br>    intu Tuhan Pangkahai!<br>    <br>         <b>Ayat 4</b> <br>     Sanan katon kare asi<br>     je ingenang keton toh,<br>        <br>         <b>Ayat 5</b> <br>     Te kasanang akan keton<br>     ije manangkalau toh<br>     kare kaharat in olon <br>     mohon huang kuasan Roh<br>     <br>            <b>Ayat 6</b> <br>    Hanjak keton huang Tuhan <br>    tagal kuasa ije hai,<br>    mimbit akan karajaan<br>    huang sorga katatai!<br>               <h5>L.N.No.123 </h5>	</p>'];
var nu_151=['<h3>151. NARAI KEA ONTONG OLOH</h3><h4>F=1 (3/4)</h4>	<p align="justify">    	<b>Ayat 1</b> <br>	Narai kea ontong oloh<br>    amon ie supa toh <br>    kare pnatau jeha kutoh<br>    pangkat tuntang hormat toh!<br>    Tapi ie manalua<br>    mamparugi hambaruae<br>    je barega haliai<br>    je barega haliai.<br>        <br>    	  <b>Ayat 2</b> <br>	Narai tau inenga oloh,<br>    mangat tau manewus toh,<br>    hambaruae je inderoh<br>    awi kuasan setan ,yoh<br>    hintan,bulau dan salaka<br>    jaton gunae hong celaka<br>    ije buah oloh te,<br>    ije buah oloh te.<br>    <br>        <b>Ayat 3</b> <br>  Kran tewus hambaruan <br>  puna toto paham hai,<br>  kare ramo je pandehan<br>  jaton gunae handiai.<br>  Tikas ije tau maliwus,<br>  jete dahan Tuhan Yesus<br>  ije brasih haliai,<br>  ije brasih haliai.<br>    <br>         <b>Ayat 4</b> <br>    Itah jari to imilie;<br>    regan itah paham hai,<br>    ela itah hakalihi<br>    tapi pakat mampahai <br>    aran Tuhan Yesus Kristus, <br>    Juruslamat dan Panewus,<br>    sintae toto paham hai,<br>    sintae toto paham hai!<br>               <h5>L.N.No.124 </h5>	</p>'];
var nu_152a=['<h3>152a. HANJAK RANTANG ATEI ITAH HANDIAI</h3><h4>B<small>es</small>(C) =1 (4/4)</h4>	<p align="justify">    	<b>Ayat 1</b> <br>	Hanjak rantang atei itah handiai:<br>    itah eka sintan Tuhan Pangkahai!<br>            <br>    	  <b>Ayat 2</b> <br>	Handau dan hamalem Tuhan Pangkahai<br>    hinje dengan itah ije anak aie!<br>    <br>        <b>Ayat 3</b> <br> Tuhan mangagalan itah hante wei,<br> mimbit itah sampai akae ngambo te!<br>     <br>         <b>Ayat 4</b> <br>   Asal uras itah toto baris aie,<br>   itah sanang, slamat palus katatai!<br>               <h5>L.N.No.56 </h5>	</p>'];
var nu_152b=['<h3>152a. HANJAK RANTANG ATEI ITAH HANDIAI</h3><h4>G=1 (3/4)</h4>	<p align="justify">    	<b>Ayat 1</b> <br>	Hanjak rantang atei itah handiai:<br>    itah eka sintan Tuhan Pangkahai!<br>            <br>    	  <b>Ayat 2</b> <br>	Handau dan hamalem Tuhan Pangkahai<br>    hinje dengan itah ije anak aie!<br>    <br>        <b>Ayat 3</b> <br> Tuhan mangagalan itah hante wei,<br> mimbit itah sampai akae ngambo te!<br>     <br>         <b>Ayat 4</b> <br>   Asal uras itah toto baris aie,<br>   itah sanang, slamat palus katatai!<br>               <h5>L.N.No.76 </h5>	</p>'];
var nu_153a=['<h3>153a. KATAWAM TALOH IJE BAGUNA HALIAI</h3><h4>C=1 (6/8)</h4>	<p align="justify">    	<b>Ayat 1</b> <br>	Katawam taloh ije bauna haliai?<br>    Yoh taloh te mambatang kan itah handiai!<br>            <br>    	  <b>Ayat 2</b> <br>	Kamangat dan karigas,horumat dan kahai<br>    inggau, ingkahimat, ingenang haliai.<br>        <br>        <b>Ayat 3</b> <br>	Hanjolo jete aton, balau nihau wei.<br>    Yoh, amon umur sampai, balihi urase te.<br>     <br>         <b>Ayat 4</b> <br>   Batonggal Ije aton je melai katatai:<br>   Kasayang tuntang asi ain Tuhan Pangkahai.<br>   <br>    <b>Ayat 5</b> <br>     Yoh jete je mambatang kan itah handiai:<br>     Kasanang, asin Tuhan je melai katatai!<br>        <h5>L.N.No.117 </h5>	</p>'];
var nu_153b=['<h3>153a. KATAWAM TALOH IJE BAGUNA HALIAI</h3><h4>E<small>s</small>=1 (4/4)</h4>	<p align="justify">    	<b>Ayat 1</b> <br>	Katawam taloh ije bauna haliai?<br>    Yoh taloh te mambatang kan itah handiai!<br>            <br>    	  <b>Ayat 2</b> <br>	Kamangat dan karigas,horumat dan kahai<br>    inggau, ingkahimat, ingenang haliai.<br>        <br>        <b>Ayat 3</b> <br>	Hanjolo jete aton, balau nihau wei.<br>    Yoh, amon umur sampai, balihi urase <br>     <br>         <b>Ayat 4</b> <br>   Batonggal Ije aton je melai katatai:<br>   Kasayang tuntang asi ain Tuhan Pangkahai.<br>   <br>    <b>Ayat 5</b> <br>     Yoh jete je mambatang kan itah handiai:<br>     Kasanang, asin Tuhan je melai katatai!<br>        <h5>L.N.No.89 </h5>	</p>'];
var nu_154=['<h3>154. TUHAN PATUT TOH INARA</h3><h4>A=1 (4/4)</h4>	<p align="justify">    	<b>Ayat 1</b> <br>	Tuhan patut toh toh inara<br>    awi itah handiai<br>    tagal asie tuntang arae<br>    ije heran haliai.<br>    Tuhan je mambesoh toto<br>    hambaruan ije blau, <br>    magon hapan kuasaan auhe<br>    dan mamuas atei oloh <br>    ije teah belai toh<br>    hapan sintae hapan Roh.<br>                <br>    	  <b>Ayat 2</b> <br>	kare  oloh ije imasong <br>    tagal kare dosa aie,<br>    ije mondok huang karong <br>    kaput pijem haliai;<br>    ije hong kasinggul ateie,<br>    hong kajake ije hai<br>    asi-asi haliai<br>    dan bagisahbilak matei <br>    dinon ampong ije hai<br>    bara Tuhan Pangkahai.<br>        <br>        <b>Ayat 3</b> <br>	Pasong te ingarak Tuhan;<br>    pahalendang klawa aie<br>    kilau matanandau akan <br>    kare-kare oloh aie!<br>    Tuhan magah oloh ayue <br>    bara eka kpehe te<br>    huang jalan bujur wei.<br>    sampai tame batang lewue<br>    ije puna asal aie,<br>    eka slamat katatai.<br>    <h5> </h5>	</p>'];
var nu_155a=['<h3>155a. MISIK,MENDENG,BLAWA IKAU!</h3><h4>C=1 (4/4)</h4>	<p align="justify">    	<b>Ayat 1</b> <br>	Misik,mendeng,blawa,ikau!<br>    Krana Klawam dumah toh:<br>    kahain Tuhan je haginyau*)<br>    yoh mamarah akam toh!<br>    Toh kakaput kalah wei<br>    awi klawan Tuhan te!<br>                <br>    	  <b>Ayat 2</b> <br>	kare utus kereh bontong **)<br>    hanjak huang klawa wei;<br>    kare raja kan mananjong<br>    hong sangkowong heran te,<br>    ije lembut hong kahaie<br>    akan oloh handiai!<br>        <br>        <b>Ayat 3</b> <br>	Tuhan ije eter janjie <br>    Ie wei Panewus aim;<br>    toto,Ie ije masi<br>    Ie Juruslamat aim.<br>    Kpehen atei aim samai<br>    nihau palus katatai.<br><br>          <b>Ayat 4</b> <br>	Jaton kareh hining tinai<br>    auh kamunguh, tangis wei;<br>    jaton auh tarahing hindai<br>    lembut intu eka te.<br>    Kotam, jete slamat hai,<br>    tara, te bauntonggang aie!<br><br>     <b>Ayat 5</b> <br>     Matanandau jaton hindai<br>     kan mamplawa lewu aim,<br>     bulan jaton kea hindai<br>     kan manyingah eka aim;<br>     Krana Tuhan Pangkahai<br>     indu klawam katatai.<br>          <br>     *)  hagiau = hagining,haginau<br>     **) bontang = baontong,batuah<br>        <h5>L.N.No.21 </h5>	</p>'];
var nu_155b=['<h3>155b. MISIK,MENDENG,BLAWA IKAU!</h3><h4>C=1 (2/4)</h4>	<p align="justify">    	<b>Ayat 1</b> <br>	Misik,mendeng,blawa,ikau!<br>    Krana Klawam dumah toh:<br>    kahain Tuhan je haginyau<br>    yoh mamarah akam toh!<br>    Toh kakaput kalah wei<br>    awi klawan Tuhan te!<br>                <br>    	  <b>Ayat 2</b> <br>	kare utus kereh bontong <br>    hanjak huang klawa wei;<br>    kare raja kan mananjong<br>    hong sangkowong heran te,<br>    ije lembut hong kahaie<br>    akan oloh handiai!<br>        <br>        <b>Ayat 3</b> <br>	Tuhan ije eter janjie <br>    Ie wei Panewus aim;<br>    toto,Ie ije masi<br>    Ie Juruslamat aim.<br>    Kpehen atei aim samai<br>    nihau palus katatai.<br><br>          <b>Ayat 4</b> <br>	Jaton kareh hining tinai<br>    auh kamunguh, tangis wei;<br>    jaton auh tarahing hindai<br>    lembut intu eka te.<br>    Kotam, jete slamat hai,<br>    tara, te bauntonggang aie!<br><br>     <b>Ayat 5</b> <br>     Matanandau jaton hindai<br>     kan mamplawa lewu aim,<br>     bulan jaton kea hindai<br>     kan manyingah eka aim;<br>     Krana Tuhan Pangkahai<br>     indu klawam katatai.<br>                 <h5>R.L.No.593 </h5>	</p>'];
var nu_156=['<h3>156. OAPANG HUANG SORGA</h3><h4>D=1 (4/4)</h4>	<p align="justify">    	<b>Ayat 1</b> <br>	O Apang huang sorga toh,<br>    tampayah ikei tenga Roh,<br>    nakara lakun oloh aim<br>    tau sampai pada dusan aim!<br>                <br>    	  <b>Ayat 2</b> <br>	O Apang, Tuhan pangkahai<br>    tangkilik oloh handiai,<br>    je magon ruar ungkup aim<br>    dan jaton bagie hung kahaim!<br>        <br>        <b>Ayat 3</b> <br>	Toh magon are oloh wei<br>    harajur manyak jalan te,<br>    je tintue kabinasa aie<br>    dan ateie kaput haliai!<br>    <br>          <b>Ayat 4</b> <br>	O Apang, obah atei aie,<br>    nakara ewen handiai <br>    malihi jalan sala te,<br>    balalu harap Yesus wei!<br>    <br>         <b>Ayat 5</b> <br>    O Tuhan,pasi ikei toh,<br>    paabas ikei awi Roh <br>    mahormat aram ije hai,<br>    harajur palus katati<br>                 <h5>L.N.No.40 </h5>	</p>'];
var nu_157=['<h3>157. APANG IKEI HUANG KAHAI</h3><h4>A=1 (4/4)</h4>	<p align="justify">    	<b>Ayat 1</b> <br>	Apang ikei hung kahai,<br>    hining ikei blaku doa!<br>    Aram buah impahai.<br>    Keleh karajam dumah;<br>    Yoh kahandakm huang sorga,<br>    jadi hunjun petak kea.<br>            <br>    	  <b>Ayat 2</b> <br>	Tenga taloh handiai<br>    ije indu hapan ikei.<br>    Ampon ikei toh samai <br>    kilau hapan toto atei<br>    ikei mampun ije sala,<br>    maka Tuhan mampun kea.<br>        <br>        <b>Ayat 3</b> <br>	Huang tingkes handiai<br>    ela manameanikei!<br>    Kpapa, aloh korik hai,<br>    dohop, kanan bara ikei!    Tuhan kuasa, hai dan tatau<br>    janjim puna jaton nihau.<br>            <h5>L.N.No.147 </h5>	</p>'];
var nu_158=['<h3>158. DOHOP IKEI, O HATALLA</h3><h4>D=1 (4/4)</h4>	<p align="justify">    	<b>Ayat 1</b> <br>	Dohop ike o Hatalla,<br>    mahining hayak manarima<br>    auh ayum ije brasih te.<br>    Jete toto are gunae, kan kare oloh,<br>    ije puna irusak awi dosa te.<br>    Karinah asim wei,<br>    kan ikei je manggau<br>    tuntang blaku.<br>    Hung sintam te je toto hai,<br>    tampayah ikei handiai!<br>            <br>    	  <b>Ayat 2</b> <br>	Soho auh aim te imbrita<br>    hong hetoh dan hong kare eka,<br>    yoh marak oloh handiai,<br>    ije toh harajur kejau,<br>    je magon hindai jari sondau <br>    hung aram slamat katatai.<br>    O plawa ateie toh!<br>    Dan ajar awi Roh ije brasih <br>    kakare te je sampai toh<br>    harajur hung kakaput wei.<br>    <br>            <h5>L.N.No.1 </h5>	</p>'];
var nu_159=['<h3>159. HATALLA APANG, OTAMPAYAH</h3><h4>C=1 (4/4)</h4>	<p align="justify">    	<b>Ayat 1</b> <br>	Hatalla Apang o tampayah,<br>    hung asim tuntang sintam ije hai;<br>    toh ikei ije blaku doa<br>    manumon petah Yesus Anak aim,<br>    O Apang, soho gulong haliai,<br>    karajaam te dumah hong kahai.<br>            <br>    	  <b>Ayat 2</b> <br>	Katika horan saksi ayum<br>    inyohom mangat hung kaabas Roh<br>    mambrita slamat dan pambelom<br>    kan kare oloh ije layan te,<br>    o soho kea hong katika toh<br>    auh aim imbrita huang kuasan Roh!<br>    <br>         <b>Ayat 3</b> <br>     Toh ara oloh layang magon <br>     je hante manyak jalan lombah te <br>     kakaput tirok atei jaton<br>     kasene Yesus Juruslamat te,<br>     o obah ie gulong haliai,<br>     nakara sondau slamat ije hai.<br><br>         <b>Ayat 4</b> <br>    O Tuhan pasi pulau jetoh<br>    nakara aram hetoh impahai!<br>    Toh oloh magon baya isut oloh <br>    je harap Yesus Juruslamat hai<br>    Hong hetoh hung toh samai,<br>    karajam dumah gulong haliai.<br>    <br>        <h5>L.N.No.125 </h5>	</p>'];
var nu_160a=['<h3>160a. AKAM TRIMAKASIH</h3><h4>C=1 (4/4)</h4>	<p align="justify">    	<b>Ayat 1</b> <br>	Akam trimakasih, Tuhan tagal auhm.<br>    Tagal brita slamat, ije hung kataum.<br>            <br>    	  <b>Ayat 2</b> <br>	Toh inengam magon akan ikei toh <br>    tuntang akan oloh, ije tumon auhm. <br>    <br>         <b>Ayat 3</b> <br>    Tuhan, o plawa atei ieki toh <br>    ajar dan ngagalan ikei awi Roh! <br>    <br>         <b>Ayat 4</b> <br>    Tuhan, pasi berkat kare oloh aim, <br>    uka ewen tetap tame hung kahaim. <br>    <br>     <b>Ayat 5</b> <br>     Pasi kea oloh ije layau te!<br>     Imbit ewen buli akan jalam wei!<br>     <br>           <b>Ayat 6</b> <br>      Soho auh katotom tayap gulong wei,<br>      mangata kare oloh sondau asim te!<br>       <br>    <h5>L.N.No.2 </h5>	</p>'];
var nu_160b=['<h3>160a. AKAM TRIMAKASIH</h3><h4>G=1 (3/4)</h4>	<p align="justify">    	<b>Ayat 1</b> <br>	Akam trimakasih, Tuhan tagal auhm.<br>    Tagal brita slamat, ije hung kataum.<br>            <br>    	  <b>Ayat 2</b> <br>	Toh inengam magon akan ikei toh <br>    tuntang akan oloh, ije tumon auhm. <br>    <br>         <b>Ayat 3</b> <br>    Tuhan, o plawa atei ieki toh <br>    ajar dan ngagalan ikei awi Roh! <br>    <br>         <b>Ayat 4</b> <br>    Tuhan, pasi berkat kare oloh aim, <br>    uka ewen tetap tame hung kahaim. <br>    <br>     <b>Ayat 5</b> <br>     Pasi kea oloh ije layau te!<br>     Imbit ewen buli akan jalam wei!<br>     <br>           <b>Ayat 6</b> <br>      Soho auh katotom tayap gulong wei,<br>      mangata kare oloh sondau asim te!<br>           <h5>L.N.No.76 </h5>	</p>'];
var nu_161a=['<h3>161a. PADANG BENYEM TUNTANG TUNIS</h3><h4>C=1 (2/4)</h4>	<p align="justify">    	<b>Ayat 1</b> <br>	Padang benyem tuntang tunis,<br>    eka keang haliai,<br>    petak rinhgket hayak mapis<br>    huang padang ije hai;<br>    kare eka te samai<br>    akan hobah haliai.<br>        <br>    	  <b>Ayat 2</b> <br>	Kutoh sungei kareh lampang <br>    huang padang baras te,<br>    kambang mawar te mangambang,<br>    belom hete hante wei;<br>    kare tananh handiai<br>    bara rami haliai.<br>    <br>         <b>Ayat 3</b> <br>   Kanca-kanca kare penang,<br>   lenge je mandulei te;<br>   kare utut toh inakang,<br>   je paleko, uyuh wei!<br>   kare kpehe te samai<br>   akan nihau haliai,<br>    <br>         <b>Ayat 4</b> <br>   Je babtue rata-rata<br>   tau mite tarang, yoh <br>   pinding je badengan kea <br>   uras imparewang toh;<br>   je batimpang, susah te<br>   manangkajok, hanjak wei.<br>    <br>     <b>Ayat 5</b> <br>     Awi ewehkah iatoh<br>     kare taloh heran te?<br>     Ewen je maharak musoh<br>     je mampikeh hante wei?<br>     Ie Tuhan Pangkahai,<br>     ijedumah hung kaheie<br>     <br>           <b>Ayat 6</b> <br>    Hete kare atong jalan <br>    rampar, brasih haliai,<br>    oloh je mahoroie, akan <br>    bujur toto tanjung aie.<br>    Ewen te samandiai<br>    tame slamat katatai.<br>       <br>              <b>Ayat 7</b> <br>       Kare ewen je inewus<br>       awi Tuhan Pangkahai<br>       bara hukum, toto liwus,<br>       hanjak rantang haliai.<br>       Ewen haya-hayak wei<br>       buli Sion ngambo te.<br>                  <h5>Wassertrome will ich giessen </h5>	</p>'];
var nu_161b=['<h3>161b. PADANG BENYEM TUNTANG TUNIS</h3><h4>C=1 (4/4)</h4>	<p align="justify">    	<b>Ayat 1</b> <br>	Padang benyem tuntang tunis,<br>    eka keang haliai,<br>    petak rinhgket hayak mapis<br>    huang padang ije hai;<br>    kare eka te samai<br>    akan hobah haliai.<br>        <br>    	  <b>Ayat 2</b> <br>	Kutoh sungei kareh lampang <br>    huang padang baras te,<br>    kambang mawar te mangambang,<br>    belom hete hante wei;<br>    kare tananh handiai<br>    bara rami haliai.<br>    <br>         <b>Ayat 3</b> <br>   Kanca-kanca kare penang,<br>   lenge je mandulei te;<br>   kare utut toh inakang,<br>   je paleko, uyuh wei!<br>   kare kpehe te samai<br>   akan nihau haliai,<br>    <br>         <b>Ayat 4</b> <br>   Je babtue rata-rata<br>   tau mite tarang, yoh <br>   pinding je badengan kea <br>   uras imparewang toh;<br>   je batimpang, susah te<br>   manangkajok, hanjak wei.<br>    <br>     <b>Ayat 5</b> <br>     Awi ewehkah iatoh<br>     kare taloh heran te?<br>     Ewen je maharak musoh<br>     je mampikeh hante wei?<br>     Ie Tuhan Pangkahai,<br>     ijedumah hung kaheie<br>     <br>           <b>Ayat 6</b> <br>    Hete kare atong jalan <br>    rampar, brasih haliai,<br>    oloh je mahoroie, akan <br>    bujur toto tanjung aie.<br>    Ewen te samandiai<br>    tame slamat katatai.<br>       <br>              <b>Ayat 7</b> <br>       Kare ewen je inewus<br>       awi Tuhan Pangkahai<br>       bara hukum, toto liwus,<br>       hanjak rantang haliai.<br>       Ewen haya-hayak wei<br>       buli Sion ngambo te.<br>                  <h5>L.N.No.21 </h5>	</p>'];
var nu_162=['<h3>162. TARA HATALLA, KETON SAMAI</h3><h4>G=1 (3/4)</h4>	<p align="justify">    	<b>Ayat 1</b> <br>	Tara Hatalla keton samai,<br>    kare jalahan oloh!<br>    Awi mahormat aran Aie,<br>    hapus kalunen jetoh!<br>    Te basa itah handiai<br>    jari toh eka sintan Aie<br>    hung Kristus Anak Ayue.<br>        <br>    	  <b>Ayat 2</b> <br>	Krana kapaham asie te,<br>    kare katoto Ayue<br>    melai harajur eter wei,<br>    mamala tarang toto.<br>    Girir-manggirir katatai<br>    ie mahaga janjie Aie.<br>           <h5>L.N.No.120 </h5>	</p>'];
var nu_163=['<h3>163. O, OLOH KALUNEN , TOH TARA PAHAI</h3><h4>F=1 (2/4)</h4>	<p align="justify">    	<b>Ayat 1</b> <br>	O oloh kalunen, toh tara pahai<br>    mahormat toh Yesus je tempon kahai<br>    Hung ie iasi toh itah samai:<br>    toh tatap salamat, panatau je hai.<br>            <br>    	  <b>Ayat 2</b> <br>	Kalunen basala, badosa bewei;<br>    Hatalla hung sintae, je pangkahai te,<br>    manenga kaliwus, mamprahan kataue<br>    kan oloh je hobah, je jari manggaue.<br>    <br>      <b>Ayat 3</b> <br>       Kalangkah hung Pirdus palembut kalait <br>       dan hukum je paham babehat bapait.<br>       Hung Yesus toh tinai kan itah samai<br>       Hatalla mambagi, manenga kahai.<br>                         <h5>L.N.No.93 </h5>	</p>'];
var nu_164=['<h3>164. HAS, KANTOH OLOH HANDIAI</h3><h4>E<small>s</small>=1 (4/4)</h4>	<p align="justify">    	<b>Ayat 1</b> <br>	Has hanjak oloh handiai,<br>    manara Tuhan Pangkahai<br>    o Tengah hormat akae!<br>    Yoh huang asie ije hai<br>    manyarah Anak Tonggal aie<br>    manjadi Andal itah.<br>    Yesus Kristus manampuli<br>    mimbit buli oloh layang<br>    awi asie dan kasayange<br>                <br>    	  <b>Ayat 2</b> <br>	Kapehen hukum paham hai,<br>    je baleh dosa handiai,<br>    inanggong Andal itah.<br>    Toh itah empas haliai<br>    dan setan tuntang kawan aie<br>    harajur nihau kuasae<br>    Yesus, Kristus, Tuhan itah<br>    aton Raja je marentah<br>    hunjun petak, huang sorga.<br>                  <h5>L.N.No.164 </h5>	</p>'];
var nu_165=['<h3>165. AKAM YESUS KARE TARA</h3><h4>D=1 (4/4)</h4>	<p align="justify">    	<b>Ayat 1</b> <br>	Akam Yesus kare tara,<br>    te basa ikau bara sorga <br>    manalih maja ikei toh<br>    Ikei olon toto papa, <br>   yoh patut ikei buah sapa,<br>   te tagal gawin ikei toh.<br>   O Tuhan sinta aim,<br>   kasayang ije hai,<br>   mimbit ikei malihi khaim panatau aim,<br>   nakara mawat ikei toh.<br>                <br>    	  <b>Ayat 2</b> <br>	Ikei jari inakirim,<br>    o Yesus tuntang awi asim <br>    toh ikei slamat haliai.<br>    Tuhan tanggong dosan ikei,<br>    te, uka ela ikei matei<br>    dan palus nihau katatai.<br>    O asi haliai!<br>    Toh ikei tau mandai, tanggoh Bapa;<br>    toh slamat wei kakare te,<br>    je harap Juru slamat wei.<br>        <br>        <b>Ayat 3</b> <br>       Yesus Kristus, dohop pasi, <br>       nakara ikei tau harati <br>       auh ayum ije brasih te. <br>       Dohop genep bitin ikei, <br>       percaya, aloh belom matei <br>       tau rantep dengan haliai! <br>       Yoh ikei toh samai <br>       aim palus katatai. Tuhan tenga  <br>       toh Roh kahaim kan oloh aim, <br>       yoh tenga berkathandiai. <br>             <h5>L.N.No.1 </h5>	</p>'];
var nu_166=['<h3>166. HATALLA SINTA KALUNEN JETUH</h3><h4>F=1 (3/4)</h4>	<p align="justify">    	<b>Ayat 1</b> <br>	Hatalla sinta kalunen jetuh, <br>    Hatalla sinta tau dengangku. <br>    Toh toto tawang ku Hatalla sinta <br>    Hattala sinta tau denganku. <br>                    <br>    	  <b>Ayat 2</b> <br>	Katika helo te dosan itah <br>    dan setan mawi, ngrapehe wei. <br>    Toh toto tawangku, Hatalla sinta <br>    Hatalla sinta, tau dengang ku. <br>        <br>        <b>Ayat 3</b> <br>      Toh Yesus dumah, Pnewus itah, <br>      maliwus itah, je rusak wei. <br>      Toh toto tawangku, Hatalla sinta <br>      Hatalla sinta, tau dengangku. <br>      <br>      <b>Ayat 4</b> <br>        Kapehen itah inaggong Yesus<br>        hung sintae asie, je toto hai.<br>        Toh toto tawangku,Hatalla sinta <br>        Hatalla sinta, tau denganku.<br><br>         <b>Ayat 5</b> <br>         Yoh, ie matei hong sampalaki,<br>         manusuh dahae, je brasih te.<br>         Toh toto tawangku, Hatalla sinta<br>         Hatalla sinta, tau dengangku.<br>                  <br>        <b>Ayat 6</b> <br>        Sarohan Tuhan mansanan slamat, <br>        marawei itah samandiai. <br>        Toh toto tawangku, Hatalla sinta<br>        Hatalla sinta, tau dengangku. <br>        <br>        <b>Ayat 7</b> <br>       Pambelom, slamat , yoh Roh Hatalla<br>       panengan Tuhan kan itah toh.<br>       Toh toto tawangku, Hatalla sinta<br>       Hatalla sinta , tau denganku.<br>        <br>                <b>Ayat 8</b> <br>       O Tuhan Yesu, horumat akam,<br>       pambelom aingku toh akam wei.<br>       Toh toto tawangku, Hatalla sinta <br>       Hatalla sinta, tau denganku.<br>                    <h5>L.N.No.37 </h5>	</p>'];
var nu_167=['<h3>167. BINTANG IJE BLAWA</h3><h4>F=1 (4/4)</h4>	<p align="justify">    	<b>Ayat 1</b> <br>	Bintang ije blawa,Batu karangku.<br>    Andal je iharap, Sokah lengengku.<br>    Rote ain pambelom,<br>    tintun ateiku,<br>    jete uras ikau Yesus Tuhangku!<br>                <br>    	  <b>Ayat 2</b> <br>	Ruar bara Ikau, Juruslamatku,<br>    jaton aku sondau ampong akangku,<br>    Kejau bara Ikau,kueah kaabasku?<br>    Aku omba Ikau, Yesus Tuhangku,<br>    Aku omba Ikau, Yesus Tuhangku!<br>        <br>        <b>Ayat 3</b> <br>  Keleh Ikau magon magah aku toh<br>  tumon tirok Ayum hapus umurku,<br>  sampai huang sorga lembut nyanyingku,<br>  Kare hormat, tara Akam, Tempongku,<br>  Kare hormat, tara Akam, Tempongku!<br>            <h5>L.N.P.No.7 </h5>	</p>'];
var nu_168=['<h3>168. JURUSLAMAT TUHANG YESUS</h3><h4>F=1 (4/4)</h4>	<p align="justify">    	<b>Ayat 1</b> <br>	Juruslamat Tuhan Yesus, sintam te ingkemeku;<br>    Krana ikau wei newus ,manyalamat aku toh.<br>    Jaton tara sanan berkat, ije nihau andau toh,<br>    amon dia toto harap, jaton blaku huang Roh<br>            <br>    	  <b>Ayat 2</b> <br>	Amon musoh hai te mado tau marusak itah toh;<br>    Yesus mangalindong toto,asal itah blaku toh <br>    intu ie je bajoha tuntang kuasa haliai.<br>    Ie Tuhan, Sobat itah , je pamangat oloh aie.<br>        <br>        <b>Ayat 3</b> <br> Amon seke huang itah, jalan kaput haliai,<br> keleh itah manampayah Yesus, Juruslamat hai.<br> Aloh kare sobat undur, sintan Yesus eter wei.<br> Sanang ie je harajur harap Sobat ngambo te.<br>            <h5>L.N.P.No.10</h5>	</p>'];
var nu_169=['<h3>169. SAMPAI AH KAHALAP ARAM</h3><h4>A<small>s</small>=1 Sadang</h4>	<p align="justify">    	<b>Ayat 1</b> <br>	Sampai ah kahalap aram Yesus, Tuhan Pangkahai!<br>    Ie wei kalindong akan kare oloh aie.<br>    Ingat ah aran aie, kota slamat katatai.<br>  Ingat ah aran aie, kota slamat katatai.<br>            <br>    	  <b>Ayat 2</b> <br>	Aran ayue paham kuasa, awei ikau manang toh,<br>    mampakalah musoh papa honbg kalunen minjam toh.<br>    Ingat ah aran aie, kota slamat katatai.<br>  Ingat ah aran aie, kota slamat katatai.<br>        <br>        <b>Ayat 3</b> <br> Jaka dosam are toto, setan dumah, mamok wei,<br> buah ikau harap blakku, huang aran Yesus wei.<br>  Ingat ah aran aie, kota slamat katatai.<br>  Ingat ah aran aie, kota slamat katatai.<br>  <br>   <b>Ayat 4</b> <br>  Nyanyi huang aran Yesus , keton kare oloh aie,<br>  sampai keton melai palus , jeha dengae hung kahaie<br>   Ingat ah aran aie, kota slamat katatai.<br>  Ingat ah aran aie, kota slamat katatai.<br>    <h5>8.L.11 L.N.P.No.41</h5>	</p>'];
var nu_170=['<h3>170. YESUS PANDOHOP IJE HAI</h3><h4>C=1 (4/4)</h4>	<p align="justify">    	<b>Ayat 1</b> <br>	Yesus Pandohop ije hai magon bewei <br>    Ie Pamangat oloh aie je toto te. <br>    Yesus kasene oloh aie, Auh ayue melai katatai <br>    Ie pamasi haliai magon bewei. <br>    Magon bewei. <br>    Ie pamasi haliai magon bewei! <br>        <br>    	  <b>Ayat 2</b> <br>	Suman kan oloh handiai, sintae je hai. <br>    Ie malihi sorga aie tuntang kahai. <br>    ingat toh keton, ingat ah gawi aie hunjung Golgota, <br>    heran dan hai, Halleluya, sintae je hai! <br>    Sintae jae hai, sintae je  hai, <br>    heran dan hai,Halleluya, sintae je hai! <br>        <br>            <b>Ayat 3</b> <br>Lahap toh keton, oloh aie,tara pahai! <br>Kare kajentae, sinta aie,tara pahai! <br>Hunag kalawan asi aie, penda palapas kuasa aie <br>itah slamat haliai,tara pahai. <br>Tara pahai,tara pahai, <br>itah slamat haliai,tara pahai. <br>    <h5> R.L.30 L.N.P.No.20</h5>	</p>'];
var nu_171=['<h3>171. LAPAS BARA TUHAN YESUS</h3><h4>G=1 (4/4)</h4>	<p align="justify">    	<b>Ayat 1</b> <br>	Lapas bara Tuhan Yesus <br>    oloh te celaka wei. <br>    Krana eweh tau maliwus <br>    kare oloh papa te? <br>    Tikas Tuhan Yesus tau  <br>    le kuasa tau hamauh: <br>    Kantoh keton je basala <br>    aku mampun kare dosa <br>        <br>    	  <b>Ayat 2</b> <br>	Tuhan ! Keleh mimbit kei <br>    magon rantep dengam wei, <br>    mangat degnan khanjak atei, <br>    manyak jalan simit te, <br>    ije tumon janji aim <br>    mimbit ikei kan kahaim, <br>    uka ikei toto slamat  <br>    hung kalunen, hung ahirat <br>    <h5> L.N.No.46</h5>	</p>'];
var nu_172=['<h3>172. SALAMAT SONDAU ITAH WEI</h3><h4>G=1 (4/4)</h4>	<p align="justify">    	<b>Ayat 1</b> <br>	Salamat sondau itah wei <br>    hung Yesus Tuhan; <br>    kakare dosan itah te <br>    impuas daha aie, impuas daha aie. <br>        <br>    	  <b>Ayat 2</b> <br>	Yoh tagal sintae asie wei <br>    kapehe handiai <br>    nyarenae, uka satan te <br>    implahe haliai, impalahe haliai. <br>    <b>Ayat 3</b> <br>    Kakare oloh nihau wei, <br>    celaka haliai. <br>    Toh imbit Yesus, andal te <br>    slamat katatai, slmat kattai. <br>     <br>    <b>Ayat 4</b> <br>    Toh keleh itah handiai,<br>    mananggong Yesus wei,<br>    nakara itah toh samai<br>    mandino slamata te, mandino slamat te.<br>        <h5> L.N.No.88</h5>	</p>'];
var nu_173=['<h3>173. O TUHAN YESUS,IJE TEMPON IKEI </h3><h4>F=1 (4/4)</h4>	<p align="justify">    	<b>Ayat 1</b> <br>	O Tuhan Yesus, ije Tempon ikei, <br>    akam tara dan kahai!<br>    Aku handak sinta,ikau,<br>    O Tuhan; te basa sintam toto hai!<br>            <br>    	  <b>Ayat 2</b> <br>	Yoh taloj japam, uras te bahalap,<br>    bungas, paris handiai.<br>    Tapi kau, Tuhan je pangkahalap<br>    kahalap ayum toto hai!<br>     <br>    <b>Ayat 3</b> <br>    Toh matanandau, bintang tuntang bulan<br>    tau mamplawa petak toh:<br>    tapi malabien klawam o Tuhan:<br>    o plawa atei ikei toh.<br>    <br>         <b>Ayat 4</b> <br>     Oloh kalunen jaton ije melai,<br>     urase kilau kambang te.<br>     Harun jete burai, palus iningkai.<br>     Yoh baya Yesus eter wei.<br>      <b>Ayat 5</b> <br>     Kare kahalap langit tuntang petak <br>     baya kangkalingen aim!<br>     Uras mimbit hormat, yoh haya-hayak<br>     manara Tuhang hung kahaim!<br><br>         <b>Ayat 6</b> <br>    Toh ikei kea mampahai manara  <br>    aram ije paham hai. <br>    Dapit huang sorga, Tuhan inara <br>    harajur, palus katatai. <br>        <h5> L.N.No.101</h5>	</p>'];
var nu_174=['<h3>174. PATUT AKU HANJAK TOH</h3><h4>C=1 (4/4)</h4>	<p align="justify">    	<b>Ayat 1</b> <br>	Patut aku hanjak toh, <br>    basa aku baris Yesus <br>    Ie Juruslamatku  <br>    tuntang huang ie tulus  <br>    kare janji handiai <br>    ain Hatalla pangkahai. <br>        <br>    	  <b>Ayat 2</b> <br>	Yesus toto mangatau <br>    atei hambaruan itah; <br>    jaton puji oloh blau, <br>    ije harap Yesus segah. <br>    Taloh korik, taloh hai <br>    tengan Yesus handiai. <br>     <br>    <b>Ayat 3</b> <br>    Dia patut aku toh  <br>    magon hanjak rantang atei? <br>    Krana toto tawangku <br> Yesus mimbit limbah matei, <br>    aku tame sorga aie, <br>    uka slamat katatai, <br>               <h5> L.N.No.107</h5>	</p>'];
var nu_175=['<h3>175. KANTOH, MAMPAHAI HATALLA</h3><h4>G=1 (4/4)</h4>	<p align="justify">    	<b>Ayat 1</b> <br>	Kantoh, mampahai Hatalla <br>    keton oloh korik hai; <br>    krana ie tau basara, <br>    sintae toto paham hai; <br>    Yesus Kritus, Anak aie, <br>    Andal itah handiai. <br>        <br>    	  <b>Ayat 2</b> <br>	Ela mangon toh mahormat <br>    jata,dewa,taloh te; <br>    jaton kuasae manyalamat <br>    tapi mangapehe wei; <br>    oloh awang baris aie <br>    nihau palus katatai. <br>     <br>         <b>Ayat 3</b> <br>   Slamat ije blaku awat <br>   dengan Yesus,Tuhan aie, <br>   Ie kuasa manyalamat <br>   dan mambelom katatai. <br>   Oloh, awang baris aie <br>   slamat palus katatai. <br> <br>    <b>Ayat 4</b> <br>   Pasi ikei, o Hatalla ,<br>   harap Yesus haliai;<br>   pisah dengan taloh papa,<br>   palus manyakjalan aie;<br>   uka kare oloh aim.<br>        <h5> L.N.No.64</h5>	</p>'];
var nu_176=['<h3>176. YESUS KRISTUS ATON RAJA</h3><h4>F=1 (4/4)</h4>	<p align="justify">    	<b>Ayat 1</b> <br>	Yesus Kritus aton Raja,<br>    ije hai dan paham kuasae,<br>    sorga petak pegang aie<br>    kare kuasa hung sorga<br>    tuntang hunjung petak kea,<br>    uras huang lenge aie<br>    uras huang lenge aie.<br>        <br>    	  <b>Ayat 2</b> <br>Kare taloh belom,kantoh!<br>Awang ngiwa,awang ngambo;<br>Sembah Tuhan pangkahai!<br>oloh korik, hai mangaku<br>Yesus Kristus Raja toto,<br>ije patut impahai,<br>ije patut impahai.<br>     <br>         <b>Ayat 3</b> <br>  Yesus Kristus jari matei,<br>  uka setan dan pampatei<br>  terai mawi oloh aie.<br>  Toh salamat toto tatap<br>  akan oloh ije harap<br>  Yesus Kristus haliai,<br>  Yesus Kristus haliai.<br>  <br>      <b>Ayat 4</b> <br>   Oloh haban, oloh pehe,<br>   ingat: Yesus mampakeleh:<br>   ksanang ije toto hai!<br>   himang ayue  mampahalit<br>   himang keton, tinai dapit<br>   keton omba hung kahaie,<br>   keton omba hung kahaie.<br>    <br>    <b>Ayat 5</b> <br>    Baya huang Yesus slamat,<br>    baya ie Batang berkat<br>    akan oloh handiai.<br>    Toh pambelom bakarinah<br>    dan kaliwus jari dumah<br>    tikas huang Yesus wei,<br>    tikas huang Yesus wei.<br><br>        <b>Ayat 6</b> <br>    Kare oloh je inewus <br>    awi dahan Tuhan Yesus,<br>    belom indu hormat aie.<br>    Jaton kea ie mikeh<br>    kabinasa, krana ie<br>    harap Juruslamat aie,<br>    harap Juruslamat aie.<br><br>         <b>Ayat 7</b> <br>     Kare jipee awang brasih,<br>     oloh tetekje iasi,<br>     manaharep krosi aie.<br>     Kare saksi awang horan<br>     jari matei tagal aran <br>     Yesus Tuhan pangkahai,<br>     Yesus Tuhan pangkahai.<br><br>     <b>Ayat 8</b> <br>     Aku, aloh korik randah,<br>     mahin aku handak omba <br>     mimbit hormat dan kahai.<br>     Yesus Kristus aton Raja,<br>     ije hai dan paham kuasae,<br>     sorga petak pegang aie,<br>     sorga petak pegang aie.<br>    <h5> L.N.No.49</h5>	</p>'];
var nu_177=['<h3>177. O TUHAN YESUS, JAKA IKAU JATON</h3><h4>A=1 (4/4)</h4>	<p align="justify">    	<b>Ayat 1</b> <br>	O Tuhan Yesus, jaka ikau jaton,<br>    dan jaka daha ayum dia aton:<br>    kueh aku sondau slamat dan pambelom?<br>        kueh aton ampong ?<br>      <br>    	  <b>Ayat 2</b> <br>Yoh jaka Tuhan jari sayang,<br>        jaton manenga ampun dan kasanang,<br>        ake je  tiwas jaton tau katawan<br>        hila mahakan.<br>         <br>         <b>Ayat 3</b> <br> Tapi hung asim Tuhan mingat aku.<br> Toh aku hanjak tuntang ateiakingku<br> handak manara Tuhan ije brasih,<br> tuntang pamasi<br>  <br>      <b>Ayat 4</b> <br>   Aku  manyanyi manarimakasih <br>   akam, o Tuhan ije paham masi<br>   Aram je brasih patut inara.<br>   trima toh tara!<br>         <h5> L.N.No.98</h5>	</p>'];
var nu_178=['<h3>178. YESUS, RAJA PANGKAHALAP</h3><h4>G=1 (4/4)</h4>	<p align="justify">    	<b>Ayat 1</b> <br>	O Tuhan Yesus, jaka ikau jaton,<br> Yesus, Raja pangkahalap<br> ije manang haliai.<br> Pada dusan ayum tatap,<br> kuasam puna katatai.<br> Aku mimbit nyanyi hormat <br> akam ije batang slamat .<br> Aram patut impahai<br> awi oloh handiai!<br>      <br>    	  <b>Ayat 2</b> <br>Hunjun petak Tuhan jari <br>pehe tagal ikei wei;<br>tapi limbah te takirie:<br>hormat, dan khanjak te.<br>Hormat ayum toto paham <br>tumon tukas awi Bapam.<br>Olon dan malaikat aim<br>pahai aram hung kahaim.<br>         <br>         <b>Ayat 3</b> <br> Padadusam huang sorga,<br> ingaliling mlekat aim.<br> Tuhan mimbit kare kuasa,<br> sorga petak pegang aim.<br> Tuhan puna Rajan slamat<br> Tuntang Batang kare berkat.<br> Imbit kuasa huangku.<br> aku ayun Tuhangku.<br>  <br>      <b>Ayat 4</b> <br>   Keleh Tuhan mangrinah <br>   kare kuasa dan khaim,<br>   uka kpapa impakah,<br>   ije maur  karajam aim.<br>   Keleh ah tuh manaheta<br>   kare taloh je injapa,<br>   uka gulong nyata wei,<br>   petak je taheta te.<br>   <br>   <b>Ayat 5</b> <br>   Je mambatang , yoh o Tuhan,<br>   haragapan ungkup te<br>   uka oloh ayum tahan<br>   belom huang sintam wei\'   mangat ewen jadi saksim<br>   tuntang tau malalus gawim,<br>   gawim sintam, asim te,<br>   ije tumon auh aim wei.<br><br>    <b>Ayat 6</b> <br>    Tuhan , o manyuang aku<br>    hapan sinta ayum te.<br>    uka gawingku mangaku<br>    aram dan katotom wei;<br>    mangat aku toto hanjak <br>    sangkom hetuh hunjun petak,<br>    tinai tame sorga aim,<br>    belom akam hung kahaim.<br>      <h5> L.N.No.98</h5>	</p>'];
var nu_179=['<h3>179. HARAP TUHAN YESUS YOH ATEIKU </h3><h4>E<small>s</small>=1 (4/4)</h4>	<p align="justify">    	<b>Ayat 1</b> <br>	Harap Tuhan Yesusyoh ateiku!<br>    Huang ie tulus janjin Apangku.<br>    Sanan bewei,kgogop ateim te,<br>    akan Tuhan Yesus entai asie wei.<br>    Ie mandohop, mampong samai<br>    hung kajaken ewen je oloh aie.<br>              <br>    	  <b>Ayat 2</b> <br>Harap Tuhan Yesus,Tempon kahai!<br>Ie wei maliwus, asie paham hai.<br>Pandak bewwi wayah kpehe te,<br>akan oloh ayue aton khanjak wei.<br>Yesus manenga slamat kahai.<br>akan je manyarah pambelomaie.<br>        <br>               <h5> L.N.No.54</h5>	</p>'];
var nu_180=['<h3>180. KASAYANG TUHAN DENGAN ITAH </h3><h4>G=1 (3/4)</h4>	<p align="justify">    	<b>Ayat 1</b> <br>	Kasayang Tuhan dengan itah.<br>    kasayang ihe toto hai.<br>    Ohining keton hining brita<br>    je horan Tuhan pangkahai.<br>    mamprahan sintae,asie aie,<br>    kasayang ije toto hai.<br>    kasayang ije toto hai.<br>              <br>    	  <b>Ayat 2</b> <br>	Kajake patutu buah aku,<br>    Toh asin Tuhan dengangku.<br>    Hong Yesus aku sondau toto<br>    kaliwus bara dosangku.<br>    Toh awi en manjadi te?<br>    kasayang Tuhan manun te.<br>    kasayang Tuhan manun te.<br>        <br>     <b>Ayat 3</b> <br>   O Tuhan keleh ikau masi,<br>   mahaga aku oloh aim;<br>   te aku mimbit trimakasih,<br>   mambrita tara dan kahaim.<br>   Dan amon lepah umurku,<br>   tarima aku, Tuhangku,<br>   tarima aku, Tuhangku.<br>      <h5> L.N.No.66</h5>	</p>'];
var nu_181=['<h3>181. KAKENANG ATEI AYUM </h3><h4>E<small>s</small>=1 (4/4)</h4>	<p align="justify">    	<b>Ayat 1</b> <br>	kakenang atei ayum, kapeham handiai,<br>    o baring akan Tuhan je mawat oloh aie.<br>    Hung ie ikau sondau kasanang ampong aim<br>    je toto marar ikau, mampangat hante wei.<br>              <br>    	  <b>Ayat 2</b> <br>	Katikam manamuei, kakare kpehe te<br>    manyusah dan manjake, mahapit magon wei.<br>    O entai wei, batantu Hatalla mobah te,<br>    maliwus ikau toto, o harap Ie wei!<br>        <br>     <b>Ayat 3</b> <br> Hung Yesus, wei tau puas salepah ateim te;<br> hung ie ikau sondau kahanjak magon wei.<br> o harap ie toto, te tumon janjie aie.<br> Hatalla mangganggulo hung jalan klawa aie.<br> <br>   <b>Ayat 4</b> <br>  Toh ela ikau mikeh marajur jalan aim!<br>  Batantu Tuhan mite, nampayah tanjong aim.<br>  Yoh ie mawat ikau dan mangalindong toh,<br>  nakara ikau sondau kahanjak huang Roh<br>       <h5> L.N.No.62</h5>	</p>'];
var nu_182=['<h3>182. OSARAH KARE JALAM </h3><h4>E<small>s</small>=1 (4/4)</h4>	<p align="justify">    	<b>Ayat 1</b> <br>	O sarah kare jalam, kepehen ateim te,<br>    kan bapam huang sorga , hung kuasa aie bewei.<br>    Kan riwut bulan, bintang imprahae jalan aie,<br>    batantu jalam kea manumon tukas aie.<br>              <br>    	  <b>Ayat 2</b> <br>	O harap janjin Tuhan, te sanang atei aim; <br>    yoh lalus kare prentahe, te bujur tanjong aim. <br>    Balalu hung kapehe, hung kikeh handiai, <br>    tau ikau mentai ie, pandohop ije hai. <br>        <br>     <b>Ayat 3</b> <br> Aie kutoh kare jalan mandohop oloh aie, <br> tau mawat, tau manguang, mambelom katatai! <br> Toh eweh tau mambalang kakare gawiete? <br> Kahandak ayue manang harajur palus wei. <br> <br>   <b>Ayat 4</b> <br>  Yoh aloh kare setan malawan haliai, <br>  Hatalla puna Tuhan, mampalahe handiai. <br>  kakare tirok ayue kan oloh baris aie, <br>  batantu tulus toto kantarae, kahai. <br> <br> <b>Ayat 5</b> <br> Toh metoh hung kapehe, je mawi bitim te <br> o ela tapareke, malengkan harap wei; <br> Hatalla tempon slamat,pandohop, oloh aie, <br> yoh ie ije mawat, malalus janji aie. <br> <br> <b>Ayat 6</b> <br> Salamat , toto slamat kakare oloh te,<br> je hung kaketep tamat,yoh himat magon wei<br> maharap janjin Tuhan, mahaga prentah aie<br> kan ewen ije tahan, salamat berkat hai.<br><br>    <b>Ayat 7</b> <br>  O Tuhan, toh paterai kapehen ikei te!<br>  paabas,dohop ikei, nakara magon wei<br>  tau harap asi ayum, percaya janjin aim.<br>  Kalote jalan ikei manintu sorga aim.<br>      <h5> L.N.No.62</h5>	</p>'];
var nu_183=['<h3>183. O SOHO AKU TOH MANYANYI </h3><h4>A<small>s</small>=1 (4/4)</h4>	<p align="justify">    	<b>Ayat 1</b> <br>	O soho aku toh manyanyi tahiu sinta ije hai<br>    tahiu uka kare kpehen Yesus tahiu kuasa daha Aie!<br>    Nyanyi toh tahiu Yesus keton pahari handiai<br>    tahiu Yesus hung sampalaki tahiu kuasa daha Aie<br>              <br>    	  <b>Ayat 2</b> <br>	O sosho aku manyarita tahiu himang Tuhangku,<br>    tahiu kare awan paku, makota duhi gantingku.<br>    Nyanyi toh tahiu Yesus, keton pahari handiai.<br>    tahiu Yesus hung sampalaki, tahiu kuasa daha Aie!<br>        <br>     <b>Ayat 3</b> <br>Yoh soho aku toh manara kaheran kare gawiaie.<br>Dosa inanggong, setan kalah, aku mardeka haliai!<br>Nyanyi toh tahiu Yesus, keton pahari handiai.<br>tahiu Yesus hung sampalaki, tahu kuasa daha Aie!<br> <br>   <b>Ayat 4</b> <br>Jurusalamat, je inyinta,aku manyembah darah paim,<br>handak manempo ikau hetoh palus hung sorga eka Aim!<br>Nyanyi toh tahiu Yesus, keton pahari handiai.<br>tahiu Yesus hung sampalaki, tahiu kuasa daha Aie!<br>      <h5> R.L.P.No.249  L.N.P.No.37</h5>	</p>'];
var nu_184=['<h3>184. SANANG HONG LENGEN YESUS </h3><h4>G=1 (4/4)</h4>	<p align="justify">    	<b>Ayat 1</b> <br>	Sanang hung lenge Yesus kare tabiri aie,<br>    toh huang sintae jete kamangat hai.<br>    Auh ayue mampong hante huang kapehe te<br>    "Ela ah ketun mikeh percaya wei!<br>              <br>    	  <b>Ayat 2</b> <br>	Sanang hung lengen Yesus,kejau kagogop te,<br>    awi ku jari sondau kota salamat te.<br>    Mosoh pambelom mikeh kuasan Sakatiku,<br>    Himang ain Tuhan Yesus eka kalindongku.<br>    Sanang hung lengen Yesus kare tabiri ai,<br>    melai toh huang sintae kamangat hai.<br>            <br>     <b>Ayat 3</b> <br>Gawing sampalaki o Juruslamatku,<br>jete ih batu karang, galang kaharapku.<br>Ekaku mentai sanang sampai kakaput te<br>nihau hung pahalendang andau pandumahm te<br>Sanang hung lengen Yesus kare tabiri ai,<br>melai toh huang sintae kamangat hai.<br>    <h5>L.N.P.No.42</h5>	</p>'];
var nu_185=['<h3>185. HUNG KUEH KAABAS AIM </h3><h4>E<small>s</small>=1 (3/4)</h4>	<p align="justify">    	<b>Ayat 1</b> <br>    Hung kueh kaabas aim, hung kueh kasanang toh? <br>    Has toh talih Yesus wei hung ie sondau te! <br>    Punah utangku hanjak aku toh. <br>    Yesus jari mampon te, mardeka akuh toh. <br>      <br>    	  <b>Ayat 2</b> <br>	Toh dosa jaton wei marentah aku toh; <br>    krana kuasan Tuhangku mampalah dosa te. <br>    Punah utangku, hanjak aku toh. <br>    Yesus jari mampon te,mardeka aku toh. <br>    <br>        <br>     <b>Ayat 3</b> <br>	Yoh huang aku toh kaabas dia wei, <br>    baya Yesus,Tuhangku, manjadi kuasangku. <br>    Punah utangku, hanjak aku toh. <br>    Yesus jari mampon te,mardeka aku toh. <br>    <br>         <b>Ayat 4</b> <br>    Hung kuasan Tuhan wei kamanang ayungku.<br>    Ie magah aku toh mahoroi jalan aie.<br>    Punah utangku, hanjak aku toh.<br>    Yesus jari mampon te, mardeka aku toh.<br><br>        <b>Ayat 5</b> <br>    Harajur ie wei manunggo aku toh.<br>    Awi Roh katoto aie iampong huangku.<br>    Punah utangku, hanjak aku toh.<br>    Yesus jari mampon te, mardeka aku toh.<br><br>        <b>Ayat 6</b>     Harumat aka toh, je huang asi aie.<br>    jari mugan jalan te je palus kahaiw.<br>    Punah utangku, hanjak aku toh.<br>    Yesus jari mampon te, mardeka aku toh.<br>                <h5>L.N.P.No.15</h5>	</p>'];
var nu_186=['<h3>186. TONGGAL IKAU, TUHAN YESUS </h3><h4>E<small>s</small>=1 (4/4)</h4>	<p align="justify">    	<b>Ayat 1</b> <br>   Tonggal ikau Tuhan Yesus.<br>   Ikau ih kaharapku.<br>   Asi hatantilap asi tengan Tuhan akangku.<br>   Aku harap ikau je bajoha dan pamasi.<br>   Aku harap huang Asim,<br>   aku harap janji Aim.<br>    <br>	  <b>Ayat 2</b> <br>	Awi asim ikau mampun dosa aingku handiai.<br>    Jete puna janji Ayum, aku harap janji Aim.<br>    Aku harap ikau, Yesus.<br>    YOh ikau je bajoha dan pamasi.<br>    Aku harap huang Asim,<br>    Aku harap janji Aim.<br>     <br>          <b>Ayat 3</b> <br>	Ikau handak mempas aku bara kikeh handiai.<br>    bara kare musoh aingku, aku puna baris Aim.<br>    Aku harap ikau, Yesus.<br>    Yoh ikau je bajoha dan pamasi.<br>      Aku harap huang Asim,<br>    Aku harap janji Aim.<br>    <br>         <b>Ayat 4</b> <br>    Ikau handak magah aku magon hapan klawam te.<br>    Aku handak omba ikau, hapa asiAim ewei<br>    Aku harap ikau, Yesus.<br>    Yoh ikau je bajoha dan pamasi.<br>      Aku harap huang Asim,<br>    Aku harap janji Aim.<br>    <br>            <b>Ayat 5</b> <br>    Ikau handak mampaabas aku hapan kuasa Aim,<br>    nyamah tau manyaksi aram, tau manara sinta Aim.<br>     Aku harap ikau, Yesus.<br>    Yoh ikau je bajoha dan pamasi.<br>      Aku harap huang Asim,<br>    Aku harap janji Aim.<br> <br>        <b>Ayat 6</b>         Aku harap Ikau, Yesus palus hapus umurku,<br>    O paleket aku dengam, Ikau ih kahrapku.<br>    Aku harap ikau, Yesus.<br>    Yoh ikau je bajoha dan pamasi.<br>      Aku harap huang Asim,<br>    Aku harap janji Aim.<br>                 <h5>L.N.P.No.55</h5>	</p>'];
var nu_187=['<h3>187. YESUS JURUSLAMAT JE INGENANG </h3><h4>C=1 (4/4)</h4>	<p align="justify">    	<b>Ayat 1</b> <br>	Yesus Juruslamatku je ingenang, je ientai.<br>    Ie eka sintangku, dengae aku handak melai.<br>    Yesus Juruslamatku ie eka sintangku.<br>          <br>    	  <b>Ayat 2</b> <br>	Yesus galang slamatku, sala bara Ie jaton <br>    hila awat akangku, baya Ie melai magon:<br>    Yesus, Juruslamatku, Ie eka kharapku.<br>     <br>     <b>Ayat 3</b> <br>Yesus, baya Yesus wei eka slamat aingku hetoh.<br>Sukup aku huang te tuntang puas atei toto.<br>basa Yesus, Tempongku,sanang, hanjak aku toh.<br>    <h5>L.N.P.No.22</h5>	</p>'];
var nu_188=['<h3>188. O SANAN BEWEI </h3><h4>B<small>es</small>=1 (4/4)</h4>	<p align="justify">    	<b>Ayat 1</b> <br>	O sanan bewei kapehe aim<br>    te kan Yesus, je kuasa mandohop.<br>          <br>    	  <b>Ayat 2</b> <br>	Kagogop samai, kasalam je hai,<br>    Yoh ina te drah pain Yesus!<br>     <br>          <b>Ayat 3</b> <br>	Sangkowong bau aie, auh janji samai<br>    manenga kasanang, kaempas.<br><br><b>Ayat 4</b> <br>Yoh murah bewei auh kuasa aie te<br>maharah kakaput dan musoh.<br><br><b>Ayat 5</b> <br>Kamangat kahai, kaontong samai<br>hong Yesus ih toto dan tinduh.<br><br><b>Ayat 6</b> <br>Sarenan bewei, hong eka aie te<br>kahanjak aim janton tau lepah.<br>    <h5> R.L.400 L.N.P.No.36</h5>	</p>'];
var nu_189=['<h3>189. BARAT PAHAM MAWI ARUT </h3><h4>E<small>es</small>=1 (4/4)</h4>	<p align="justify">    	<b>Ayat 1</b> <br>	Barat paham mawi arut ije korik wei,<br>    jake toto awi riwut tuntang riak te.<br>    Laku intu Tuhan Yesus hining hining auh aie wei.<br>    Aku tokep genep andau, mandohop keton hante wei<br>    Aku tokep genenp andau mandohop keton hante wei.<br>          <br>    	  <b>Ayat 2</b> <br>	Murid jari mado palus kahem, rusak wei,<br>    hemben te mampisik Yesus hong kamburi te.<br>    Laku intu Tuhan Yesus, hininh, hining auh aie wei:<br>     Aku tokep genep andau, mandohop keton hante wei.<br>    Aku tokep genenp andau mandohop keton hante wei."<br>         <br>          <b>Ayat 3</b> <br>	Yesus mendeng dan mampuji riak,riwut te,<br>    palus jete uras suni,tadoh sanang wei.<br>    Laku intu Tuhan Yesus, hininh, hining auh aie wei:<br>     Aku tokep genep andau, mandohop keton hante wei.<br>    Aku tokep genenp andau mandohop keton hante wei.<br>        <br><b>Ayat 4</b> <br>Yesus dumah, handak mawat kare oloh aie,<br>uka ewen dengan slamat sampai lewu aie.<br>Laku intu Tuhan Yesus, hininh, hining auh aie wei:<br>     Aku tokep genep andau, mandohop keton hante wei.<br>    Aku tokep genenp andau mandohop keton hante wei.<br>            <h5>Ev.L.42</h5>	</p>'];
var nu_190=['<h3>190. RAJANGKU, O TUHAN YESUS </h3><h4>G=1 (4/4)</h4>	<p align="justify">    	<b>Ayat 1</b> <br>	Rajangku, O Tuhan Yesus,ije batang slamatku,<br>    aku Ayum, o Panewus imbing ah toh lengengku.<br>    Katatahi aku aim! Katatahi aku aim!<br>    Aku, Ayum ,o Panewus ,imbing ah toh lengengku!<br>          <br>    	  <b>Ayat 2</b> <br>	Matanandau khanjak aingku, ampong hung kapehengku.<br>    Dohop aku toh manuntut awam paim,o Tuhangku!<br>    Katatahi aku aim, Katatahi aku aim!<br>    Dohop aku toh manuntut awam paim, o Tuhangku!<br>     <br>          <b>Ayat 3</b> <br>	Tuhan, Tempongku hong hetoh tuntang palus katatahi.<br>    Soho aku toh mambrita sintam ije paham hai!<br>    Katatahi aku aim, Katatahi aku aim!<br>    Soho aku toh mambrita sintam ije paham hai!<br>            <h5>R.L.343 L.N.P.39</h5>	</p>'];
var nu_191=['<h3>191. KRISTUS WEI PAMBELOMKU  </h3><h4>F=1 (4/4)</h4>	<p align="justify">    	<b>Ayat 1</b> <br>	Kristus wei pambelomku,<br>    huang ie slamatku,<br>    eka kapercayangku<br>    tuntang batang kharapku.<br>          <br>    	  <b>Ayat 2</b> <br>	Matei indu ontongku,<br>    amon hinje Tuhangku,<br>    Slamat ayue bagingku,<br>    puas toto ateiku.<br>     <br>          <b>Ayat 3</b> <br>	Aku haus toh mindah wei<br>    akan eka slamat te,<br>    ihanjeam palus toh<br>    dengan Juruslamatku.<br><br>         <b>Ayat 4</b> <br>     Maka keleh Tuhan wei<br>     tumon khandak ayue te<br>     matoh uras akangku,<br>     basa ie tempongku.<br>     <br>          <b>Ayat 5</b> <br>    Ela ah khandakku,<br>    tapi ayum Tuhangku,<br>    hante wei manjadi toh<br>    hung pambelom ayungku.<br>            <h5> L.N.No.6</h5>	</p>'];
var nu_192=['<h3>192. TUHAN YESUS WEI</h3><h4>A=1 (3/4)</h4>	<p align="justify">    	<b>Ayat 1</b> <br>	Tuhan Yesus wei<br>    Batang klawa te,<br>    je manyingah atei itah<br>    ije kaput dan bagi sah.<br>    Klawa ayue te manang hantewei<br>          <br>    	  <b>Ayat 2</b> <br>	Tuhan Yesus wei<br>    Batang sinta te,<br>    ije toto tau mampangat<br>    marar, mampong tuntang mawat,<br>    itah handiai, ije baris aie.<br>     <br>          <b>Ayat 3</b> <br>	Tuhan Yesus wei<br>    Batang asi te,<br>    je ingenang awi itah.<br>    Keleh harap dan manyarah<br>    arep itah toh, akae huang Roh<br>    <br>         <b>Ayat 4</b> <br>   Tuhan Yesus wei<br>   Batang slamat te<br>   ije toto manyalamat!<br>   Akae tara tuntang hormat <br>   huang ungkup aie, palus katatai.<br>        <h5> L.N.No.51</h5>	</p>'];
var nu_193=['<h3>193. O TUHAN YESUS KLAWA AINGKU</h3><h4>E <small>s</small>=1 (3/4)</h4>	<p align="justify">    	<b>Ayat 1</b> <br>	O Tuhan Yesus klawa aingku,<br>    Sakatikku Immanuel.<br>    Panewusku, pamawat aingku,<br>    tahasak ain pambelom te.<br>    O keleh Tuhan mangagalan<br>    toh aku huang kare jalan<br>    huang hetoh hapan lenge aim!<br>    Yoh, agah aku toh harajur<br>    hong jalan ayum ije bujur<br>    je magah aku kan kahaim.<br>          <br>    	  <b>Ayat 2</b> <br>	Hong lengem aku toto sanang<br>    dan hanjak rantang ateiku.<br>    Hong kuasam aku magon manang,<br>    mampalah kare musohku.<br>    Yoh matam manangkilik aku<br>    hong kare ekaku hong hetoh,<br>    manyanang aku hante wei,<br>    kakare janjim uras tulus<br>    dan paingku jaton tanggarurus<br>    hong halan ije simit te,<br>     <br>          <b>Ayat 3</b> <br>	Batonggal Tuhan wei katwan<br>    je puna patut akangku.<br>    O ela aku toh malawan<br>    kahandak aim, o Tuhangku!<br>    Karasan aku toh harajur<br>    mahoroi jalan ije bujur<br>    dan gilit ginting dengan wei.<br>    Yoh rantep dengam aku sanang.<br>    hambruangku tau hamjak rantang<br>    tahiu kare gawim te.<br>    <br>         <b>Ayat 4</b> <br>   Yoh ela aku toh tapampat*<br>   hong jalangku baketep wei!<br>   malekat mohon mandai lampat<br>   je arae "lakudoa" te<br>   dan bara ngambo mimbit berkat,<br>   Kasanang sorga dan kamangat <br>   harajur akan ateiku.<br>   Kakare gawim uras tinduh<br>   dan mimbit aku toh manintu <br>   selamat aim o Tuhangku    <br>        *)tapampat = tende awi tege ije mahalang hong jalan.<br>    <h5> L.N.No.111</h5>	</p>'];
var nu_194a=['<h3>194a. matangku toh jari mite</h3><h4>C=1 (2/4)</h4>	<p align="justify">    	<b>Ayat 1</b> <br>	Matangku toh jari mite,<br>    slamat aim, Tuhangku<br>    je inyimpan akan kare<br>    utus hung kalunen toh.<br>    Yesus je malihi khai<br>    tagal oloh handiai,<br>          <br>    	  <b>Ayat 2</b> <br>	Toh kalawa te manyingah<br>    kare utus oloh te<br>    ije heka dan bagisah <br>    inyangkulep kileh wei.<br>    Huang Yesus, Anak aim<br>    ingarinah to kahaim.<br>     <br>          <b>Ayat 3</b> <br>	Soho rewarm hung kasanang<br>    tumon auh janji aim,<br>    buli Tuhan je ingenang,<br>    akan ekam hong kahaim.<br>    Slamat aim toh bagingku<br>    huang Juruslamatku.<br>        <h5> R.N.No.593</h5>	</p>'];
var nu_194b=['<h3>194b.MATANGKU TOH JARI MITE</h3><h4>C=1 (4/4)</h4>	<p align="justify">    	<b>Ayat 1</b> <br>	Matangku toh jari mite,<br>    slamat aim, Tuhangku<br>    je inyimpan akan kare<br>    utus hung kalunen toh.<br>    Yesus je malihi khai<br>    tagal oloh handiai.<br>          <br>    	  <b>Ayat 2</b> <br>	Toh kalawa te manyingah<br>    kare utus oloh te<br>    ije heka dan bagisah <br>    inyangkulep kileh wei.<br>    Huang Yesus, Anak aim,<br>    ingarinah to kahaim.<br>     <br>          <b>Ayat 3</b> <br>	Soho rewarm hung kasanang,<br>    tumon auh janji aim,<br>    buli Tuhan je ingenang,<br>    akan ekam hong kahaim.<br>    Slamat aim toh bagingku<br>    huang Juruslamatku.<br>        <h5> Lukas 2.29-32</h5>	</p>'];
var nu_195=['<h3>195. TUHAN BEWEI PANDOHOPKU</h3><h4>c=1 (6/4)</h4>	<p align="justify">    	<b>Ayat 1</b> <br>	Tuhan bewei Pandohopku<br>    Yesus bewei Pamawatku.<br>          <br>    	  <b>Ayat 2</b> <br>	Tuhan bewei Talawangku,<br>    Yesus bewei kamangku.<br>     <br>          <b>Ayat 3</b> <br>	Tuhan bewei Kasanangku,<br>    Yesus bewei Salamatku.<br><br>         <b>Ayat 4</b> <br>     Tuhan bewei Panewusku,<br>     Yesus bewei Tempongku.<br>          <br>              <b>Ayat 5</b> <br>     Tuhan bewei kaharapku,<br>Yesus bewei Pambelomku.<br>             <h5> R.L.No.339</h5>	</p>'];
var nu_196=['<h3>196. IJE TEAH BELAIE TOTO</h3><h4>C=1 (3/4)</h4>	<p align="justify">    	<b>Ayat 1</b> <br>	Ije teah belaie toto,<br>buah tanggob Tuhan wei;<br>laku dengae mangat dino<br>danum danom kabaringan te<br>Maka palus katatai<br>jaton teah belah aie.<br>          <br>    	  <b>Ayat 2</b> <br>	Tikas Tuhan wei tahasak<br>danum kaharingan te.<br>Hong kalunen jari rusak,<br>uras keroh, papa wei.<br>Oloh je mihop te<br>magon teah belaie wei.<br>         <br>          <b>Ayat 3</b> <br>Danom belom te jarinih,<br>yoh takining haliai.<br>Jete bara hila kanih:<br>Roh ain Tuhan Pangkahai.<br>Oloh ije mihop te<br>toto puas huange wei.<br>	<br>         <b>Ayat 4</b> <br>Danom belom te mahasor<br>tinai bara oloh te,<br>je percaya raju-rajur<br>tau impihop aie wei.<br>Ie indu berkat hai<br>akan kolae handiai.<br>        <h5> L.N.No.82</h5>	</p>'];
var nu_197=['<h3>197. KAKARE ITAH HANDIAI</h3><h4>E<small>s</small>=1 (3/4)</h4>	<p align="justify">    	<b>Ayat 1</b> <br>	Kakare itah handiai<br>tamuei wei hong hetoh<br>je jaton bunggut eka aie<br>bajeleng tau baduroh.<br>Yoh tikas je eka wei<br>bauntonggang humam Bapa:<br>Sampalaki hong Golgota te<br>je muap jalan sorga.<br>          <br>    	  <b>Ayat 2</b> <br>	Kakare itah handiai<br>karenga dia matei<br>hong tasik utang ije hai,<br>bageto anget atei.<br>Pandohop baya Yesus wei<br>je mawat bara kpapa,<br>hong kayu sampalaki te<br>inanggong kare dosa.<br>         <br>          <b>Ayat 3</b> <br>O ite klawa hai<br>je lembut bara hete<br>kan kare oloh handiai<br>je kaput dan babute!<br>Sampalakin Tuhan Yesus wei<br>mampangat,mampong oloh<br>je melai hong kakaput te.<br>hong eka minjam jetoh.<br>	<br>         <b>Ayat 4</b> <br>Yoh itah toh tamuei wei,<br>Hatalla jari muap<br>bauntonggang akan sorga te,<br>Kakare ije harap<br>mahoroi bukit Golgota<br>tautinai buli Bapa<br>je menteikare anak aie<br>hong lewue je katatai.<br>        <h5> wir sind ein Volk vom Strom der Zeil</h5>	</p>'];
var nu_198=['<h3>198. IJE MAWI TALOH SALA</h3><h4>G=1 (4/4)</h4>	<p align="justify">    	<b>Ayat 1</b> <br>	Ije mawi taloh sala,<br>    ie jipen dosa te,<br>    pasong setan dan naraka<br>    palus buah ie wei.<br>    Asi-asi haliai<br>    kare ewen handia,<br>    amun setan ije manang,<br>    atei jatun tau sanang.<br>          <br>    	  <b>Ayat 2</b> <br>	Jatun ije tau mambebas<br>    arepe bara kuasa hai.<br>    Prea setan te malapas<br>    oloh penda prentah aie,<br>    Kuasa puna toto hai<br>    huang kare oloh aie;<br>    rantai jaton tarageto<br>    awi itah je belome.<br>         <br>          <b>Ayat 3</b> <br>	Baya je imbebas Tuhan,<br>    ie toto bebas wei.<br>    Eweh je tau malawan,<br>    aluh musoh bakas te.<br>    Yoh merdeka haliai,<br>    kare-kare murid aie.<br>    Tonggal Tuhan Yesus Kristus<br>    tau maliwus dan manewus!<br>            <h5> L.N.No.46</h5>	</p>'];
var nu_199=['<h3>199. ALOH BARAT, RIAK HAI</h3><h4>G=1 (4/4)</h4>	<p align="justify">    	<b>Ayat 1</b> <br>	Aloh barat riak hai,<br>    arut lunggang langging<br>    riwut paham gutok aie<br>    pinding mangaraning,<br>    ela itah gogop,<br>    yoh keleh blaku musok toh:<br>    Krist Kyrie*<br>    o tanggoh ikei wei.<br>          <br>    	  <b>Ayat 2</b> <br>	Aloh langit kaput wei,<br>    taloh sinde-sindep,<br>    lilap kare bintang te,<br>    bulan jari lelep,<br>    itah harap Yesus wei,<br>    Ie je Pandohop te.<br>    Krist Kyrie,<br>    o tanggoh ikei wei!<br>         <br>          <b>Ayat 3</b> <br>     Aloh rayar rusah,yoh<br>     tihange te bapelek.<br>     Prea itah muride toh<br>     matei bara lelek?<br>     Yesus je Pamawat hai<br>     magon tokep oloh aie,<br>     Krist Kyrie,<br>     o tanggoh ikei wei!<br>	<br>          <b>Ayat 4</b> <br>      huang hentok tasik ,yoh<br>      sarae dia gitan.<br>      Jaton tau balaboh toh,<br>      sauh te dia tahan.<br>      Janjin Tuhan tuntang auhe<br>      tau iharap bara sauh!<br>      Krist Kyrie,<br>      o tanggoh ikei wei!<br>	<br>          <b>Ayat 5</b> <br>      Aloh awi riwut te<br>      arut toh tabias,<br>      Tuhan Yesus palus wei<br>      langkap dan pahias<br>      tanggoh dan mandohop toh<br>      ije blaku tumon auhe.<br>      Krist Kyrie,<br>      o tanggoh ikei wei!<br>	<br>          <b>Ayat 6</b> <br>	Palus awi kuasa toh<br>    uras tadoh sanang,<br>    jari toh mamenda auhe,<br>    atei itah landang.<br>    Arut dengan slamat wei<br>    sampai pelabohan te.<br>    Krist Kyrie,<br>    je mawat itah wei!<br>    <br>        *Tuhan Yesus <br>        <h5> P.B.I.273</h5>	</p>'];
var nu_200=['<h3>200. AMON HUNJUN TASIK AIN PAMBELOM</h3><h4>E<small>s</small>=1 (4/4)</h4>	<p align="justify">    	<b>Ayat 1</b> <br>	Amon hunjun tasik ain pambelom toh,<br>    riwut barat hakaliling maroh wei.<br>    Ingat kare sintan Tuhan dengam toh,<br>    tantu ikau heran manahiu te.<br>          <br>                 Koor:<br>       Itong toh pangulih ayum te,<br>       sewut jete mije-mije wei.<br>       Palus sondau kutoh berkat hai<br>       ije tengan Tuhan akan oloh aie.<br>       <br>                 	  <b>Ayat 2</b> <br>	Kinjap wei kasusah ayum te samai,<br>    tau mahenyak dan mahapit ateim te,<br>    sampalakim je babehat haliai,<br>    keleh toh manyarahe akan Tuhan wei.<br>         <br>                  Koor:<br>       Itong toh pangulih ayum te,<br>       sewut jete mije-mije wei.<br>       Palus sondau kutoh berkat hai<br>       ije tengan Tuhan akan oloh aie.<br>       <br>             <b>Ayat 3</b> <br>    Amon ikau mite oloh beken te,<br>    hapa natau ramo ain kalunen toh.<br>    Ingat wei: panatau aim hong sorga te.<br>    palus ateim hanjak toto huang Roh.<br>	<br>       Koor:<br>       Itong toh pangulih ayum te,<br>       sewut jete mije-mije wei.<br>       Palus sondau kutoh berkat hai<br>       ije tengan Tuhan akan oloh aie.<br>       <br>            <b>Ayat 4</b> <br>      Hong kasusah kapehem handiai,<br>      ela bembang tuntang heka toh;<br>      krana Tuhan hinje oloh aie.<br>      Ie mampong mawat kea ikau toh.<br><br>   Koor:<br>       Itong toh pangulih ayum te,<br>       sewut jete mije-mije wei.<br>       Palus sondau kutoh berkat hai<br>       ije tengan Tuhan akan oloh aie.<br>                <h5> Zangbundel No.246</h5>	</p>'];
var nu_201=['<h3>201. TUHAN ATON TUKEP</h3><h4>G=1 (4/4)</h4>	<p align="justify">    	<b>Ayat 1</b> <br>	Tuhan aton tokep keleh toh manyembah <br>    suni uras sontop akae;<br>    Bentok ungkup ayue, ije toh hapompong<br>    Ie aton toh mananjong.<br>    Korik hai handiai, je kasene Tuhan,<br>    keleh toh marawan.<br>          <br>    	  <b>Ayat 2</b> <br>	Tuhan aton tokep, Ie je inyembah <br>    kare kerok huang sorga.<br>    Brasih ,brasih,brasih:Kai auh nyanyi tara<br>    hakaliling padadusae.<br>    Paham hai asi aie, sampai itah kea<br>    tau mahormat ara.<br>     <br>          <b>Ayat 3</b> <br>	Trima h, o Tuhan parapah ije belom<br>    bara ikei ije ayum:<br>    atei ije Ienyuh,je taharu dengam,<br>    bereng, hambaruan akam.<br>    Tuhan wei,I te, ije Tempon kuasa,<br>    akam kare tara!<br>        <br>         <b>Ayat 4</b> <br> Intu kare eka hong kalunen jetoh,<br> sintam mangaliling aku,<br> kilau kare kambang burai sining andau<br> huang klawan matanandau;<br> keleh wei tumon te, hung sangkowong sintam <br> aku belom akam.<br> <br>   <b>Ayat 5</b> <br>  Soho aku melai suni tuntang sanang <br>  tokep dengam je ingenang.<br>  Tampa huang aku atei ije barasih,<br>  ije dehen awi asi.<br>  Tenga toh plapas Roh, hapangku manintu<br>  eka aim hong ngambo.<br>  <br>    <b>Ayat 6</b> <br>  Keleh jaka aku tatap tuntang simpan<br>  indu huma aim, o Tuhan!<br>  Dengam ije mendeng hong bauntonggang atei,<br>  aku blaku nyame-nyame:<br>  melai toh dengangku, mangat aku belom <br>  indu hormat ayum !<br>            <h5> L.N.No.144</h5>	</p>'];
var nu_202=['<h3>202. O YESUS TENGA ASI</h3><h4>E <small>s</small>=1 (4/4)</h4>	<p align="justify">    	<b>Ayat 1</b> <br>	O Yesus, tenga asi kan ikei toh samai<br>    dan Roh aim ije brasih dan berkat handiai!<br>          <br>    	  <b>Ayat 2</b> <br>	O liwus bara kpapa kakare oloh aim,<br>    kalindong, agah ikei kan sorga kan kahaim!<br>     <br>          <b>Ayat 3</b> <br>	O duan liau ikei, katika matei te,<br>    nakara belom matei, O yesus aim bewei!          <h5> L.N.No.89</h5>	</p>'];
var nu_203=['<h3>203. KAN IKEI TOH SAMAI</h3><h4>F=1 (4/4)</h4>	<p align="justify">    	<b>Ayat 1</b> <br>	kanikei toh samai, o Yesus tenga asi<br>    yoh berkat katatai dan Roh aim ije brasih!<br>    Kapapa handiai, o Yesus kanan toh!<br>    Yoh dohop, uka tau manajong tumon Roh!<br>          <br>    	  <b>Ayat 2</b> <br>	Nakara, setan te, yoh kare taloh sala<br>    dan dosa handiai, mangejau ikei dengae!<br>    O dohop ikei toh, mahoroi jalan aim,<br>    dan belom akam wei,hong hetoh,hung kahaim!<br>        <h5> L.N.No.38</h5>	</p>'];
var nu_204=['<h3>204. O YESUS, TUHANGKU</h3><h4>F=1 (4/4)</h4>	<p align="justify">    	<b>Ayat 1</b> <br>	O Yesus Tuhanku, toh aku blaku dengam.<br>    O hining lakungku, hung asim dan kajoham;<br>    yoh tengaakangku, Roh ije brasih ter,<br>    dan tampa ateiku taheta brasih wei.<br>          <br>    	  <b>Ayat 2</b> <br>	Kasalangku samai, o puas lepa-lepah,<br>    mahapan daha aim, je brasih dan barega.<br>    Salepah ateiku, o prasih haliai,<br>    yoh hapus bitingku jadi aim katatai.<br>    <br>    <b>Ayat 3</b> <br>    Kare kapapa te ain setan, ain naraka, <br>    o Tuhan pangkahai, mambalange uka ela <br>    tau mawi aku toh, je oloh baris aim,<br>    te aku katatai tau omba hung kahaim.<br>            <h5> L.N.No.38</h5>	</p>'];
var nu_205=['<h3>205. O HATALLA JE PAMASI</h3><h4>G=1 (4/4)</h4>	<p align="justify">    	<b>Ayat 1</b> <br>	O Hatalla je pamasi,<br>    dosan ikei paham hai!<br>    Tapi ikei blaku asi<br>    tuntang harap haliai<br>    huang Yesus andal te,<br>    ije tagal ikei wei,<br>    jari matei mangat mawat,<br>    awie ikei toh salamat.<br>          <br>    	  <b>Ayat 2</b> <br>	Tagal Yesus, O Hatalla!<br>    Pasi ikei oloh aim:<br>    ampun kare gawi sala<br>    tagal dahan Anak aim;<br>    prasih atei ikei, yoh<br>    sangkom belom hila toh,<br>    uka, amon umur hapus,<br>    ikei buli, talih Yesus.<br>            <h5> L.N.No.46</h5>	</p>'];
var nu_206=['<h3>206. O YESUS, TEMPON ASI, PAHAYAK IKEI</h3><h4>E<small>s</small>=1 (4/4)</h4>	<p align="justify">    	<b>Ayat 1</b> <br>	O Yesus, Tempon asi, pahayak ikei wei,<br>    dan dohop mangalahi malawan setan te.<br>          <br>    	  <b>Ayat 2</b> <br>      Auh ayum keleh magon mamintar ikei wei,<br>      nakara tau manumon kakare orentahm te.<br>	<br>          <b>Ayat 3</b> <br>      O plawa atei ikei, je magon kaput wei,<br>      nakara ikei toto kasene jalam te.<br>	<br>          <b>Ayat 4</b> <br>      Kalidong tuntang tunggo kakare ikei toh.<br>      yoh dohop, mangat toto irentah awi Roh!<br>	<br>          <b>Ayat 5</b> <br>      Nganggulo ikei, Tuhan, hung jalan ayum te,<br>      dan amon ikei matei, trima ikei wei.<br>	<br>          <b>Ayat 6</b> <br>      O Yesus, dohop ikei manumon peteh aim,<br>      nakara ikei kanih tau omba hung kahaim.<br>	            <h5> L.N.No.89</h5>	</p>'];
var nu_207=['<h3>207. MATANANDAU ASI</h3><h4>C=1 (4/4)</h4>	<p align="justify">    	<b>Ayat 1</b> <br>	Matanandau asi Yesus Tuhangku<br>    ije hai dan brasih, pasi aku toh!<br>    Dan tampayah aku ije oloh aim;<br>    asim aku blaku dan kasanang aim.<br>          <br>    	  <b>Ayat 2</b> <br> Ampun kare dosa, o Panewusku<br> tuntang kadarhaka je iawiku!<br> Tuhan jari matei indu gatingku<br> tuntang indu prapah tagal dosangku.<br>	<br>          <b>Ayat 3</b> <br>      Aku handak sinta ikau, Tuhangku<br>      tuntang belom akam hapus umurku.<br>      Sewut amen, Tuhan, Batukarangku!<br>      Trima hormat, tara, Yesus Andalku!<br>            <h5> L.N.No.74</h5>	</p>'];
var nu_208=['<h3>208. YESUS TUHANGKU</h3><h4>A=1 (3/4)</h4>	<p align="justify">    	<b>Ayat 1</b> <br>	Yesus Tuhangku, pasi, aku toh<br>    uka ela aku layang tokep dengam<br>    aku sanang.<br>    Imbing lengengku agah aku toh!<br>          <br>    	  <b>Ayat 2</b> <br>	Hung kapehengku, hung kajakengku,<br>    je mantakan mamok aku:<br>    O paabas aku toto,<br>    Yesus Tuhangku, eka slamaku!<br>	<br>          <b>Ayat 3</b> <br>      Jaka kolangku, tawa kau toh<br>      buah kpehe dan calaka,<br>      dohop ikei manyarenae,<br>      mangat ikei tau belom tumon auhm.<br>      <br>      <b>Ayat 4</b> <br>      Nguan jalangku hapus hapus umurku:<br>      mangat tanjong aingku bujur<br>      tuntang gawingku harajur<br>      brasih haliai, indu hormat aim.<br>        <h5> L.N.No.51</h5>	</p>'];
var nu_209=['<h3>209. O TUHAN YESUS AKU MANALIH</h3><h4>B <small>es</small>=1 (4/4)</h4>	<p align="justify">    	<b>Ayat 1</b> <br>	O Tuhan Yesus<br>    aku manalih hayak blaku:<br>    Toh awat hapan kuasam,<br>    mahakan kabinasa.<br>          <br>    	  <b>Ayat 2</b> <br>	O Tuhan, tenga asi <br>    dan soho Roh mamprasih<br>    salepah atei aingku<br>    te auh aim belom toto.<br>	<br>          <b>Ayat 3</b> <br>    Yoh buah auh aim Tuhan,<br>    imbrita dan insanan<br>    kan kare oloh layau,<br>    nakara ie hobah.<br>        <h5> L.N.No.135</h5>	</p>'];
var nu_210=['<h3>210. YESUS JURUSLAMATKU</h3><h4>A=1 (4/4)</h4>	<p align="justify">    	<b>Ayat 1</b> <br>	Yesus Juruslamatku,<br>    aku manaharep ikau<br>    handak mingat auh aim toh,<br>    uka ela aku layau.<br>    Tau mahakan kabinasa,<br>    mangay aku tame sorga.<br>          <br>    	  <b>Ayat 2</b> <br>	Akal ikei handiai<br>    magon humong dan halike,<br>    jaka dia klawa hai,<br>    auh aim te mamintar ikei.<br>    Rantep dengam ikei manang,<br>    awim ikei toto sanang.<br>	<br>          <b>Ayat 3</b> <br>   O Palita ije hai,<br>   Roh karasih , Roh Hatalla,<br>   tatap ikei handiai,<br>   pinding, atei, nyame kea.<br>   Mangat ikei tau sombayang,<br>   hining, Tuhan! Pasi sayang!<br>        <h5> L.N.No.147</h5>	</p>'];
var nu_211=['<h3>211. O YESUS TENGA AKANGKU</h3><h4>G=1 (4/4)</h4>	<p align="justify">    	<b>Ayat 1</b> <br>	O Yesus tanga akangku<br>    kutoh atei ije tau<br>    marajin ikau, Tuhangku,<br>    dan belom tumon auhm<br>    dan belom tumon auhm,<br>          <br>    	  <b>Ayat 2</b> <br>	Paabas aku mangat tau<br>    mahoroi jalan aim;<br>    dan mimbit aku tohmanggau<br>    slamat dan kahaim,<br>    slmat dan kahaim.<br>	<br>          <b>Ayat 3</b> <br>   O Roh Hatalla, dohop toh,<br>   mampalah musoh te!<br>   Pabujur kare tanjongku<br>   hung klawa aim bewei,<br>   hung klawa aim bewei.<br>        <h5> L.N.No.88</h5>	</p>'];
var nu_212=['<h3>212. O YESUS, AKU TOH MANYEMBAH</h3><h4>C=1 (3/4)</h4>	<p align="justify">    	<b>Ayat 1</b> <br>	O Yesus aku toh manyembah;<br>    manara tuntang mampahai<br>    kataum dan sintam jaton hobah,<br>    yoh asim toto paham hai.<br>    O jaka hapus ateiaingku<br>    harajur sinta Tuhan toto.<br>          <br>    	  <b>Ayat 2</b> <br>	Toh ateiku mangkeme toto<br>    hung ikau wei salamatku;<br>    hung ramo ain kalunen jetoh <br>    kasanang jaton akangku.<br>    Pambelomku injapam akam,<br>    salamat aingku tikas dengam.<br>	<br>          <b>Ayat 3</b> <br>   Nakiri aku Tuhan matei,<br>   manewus mawat aku toh;<br>   nakara ikau hanjak atei,<br>   tau belom akam huang Roh.<br>   Paleket aku, Tuhan dengam,<br>   te aku tau manara aram.<br>   <br>      <b>Ayat 4</b> <br>   O ela berkat aim mahalau, <br>   yoh soho Roh je brasih te, <br>   marentah aku genep andau, <br>   nakara sinta Tuhan wei, <br>   mansanan hormat aim hong hetoh, <br>   manara sintam , je hakutoh. <br>        <h5> L.N.No.83</h5>	</p>'];
var nu_213=['<h3>213. TRIMAKASIH AKAM TUHAN</h3><h4>B<small>es</small>=1 (6/8)</h4>	<p align="justify">    	<b>Ayat 1</b> <br>	Trimakasih akam Tuhan, <br>    ije matei gantingku! <br>    Awi daha aim inganan <br>    kare dosa ayungku. <br>    Bitingku, gawingku, <br>    tonggal akam Tuhangku! <br>          <br>    	  <b>Ayat 2</b> <br>	Tahi aku jari layang, <br>    kejau dengam, Tempongku; <br>    tapi Tuhan je panyanyang, <br>    jari mawat bitingku. <br>    Bitingku, gawingku, <br>    tonggal akam, Tuhangku! <br>	<br>          <b>Ayat 3</b> <br>   Sana aku tau percaya <br>   sintam, asim dengangku, <br>   aku empas bara dosa, <br>   salamat aim ingkemeku. <br>   Bitingku, gawingku, <br>   tonggal akam, Tuhangku <br>   <br>      <b>Ayat 4</b> <br>  Tokep dengam aku sanang, <br>  hanjak toto ateiku. <br>  Awi asim aku manang, <br>  mampakalah musohku. <br>  Bitingku, gawingku, <br>  tonggal akam, Tuhangku! <br>   <br>      <b>Ayat 5</b> <br>   Rantep dengam aku luput,<br>   mangat toto huangku.<br>   Asala aku wei manuntut<br>   jalan aim, o Tuhangku!<br>   Bitingku, gawingku,<br>   tonggal akam, Tuhangku!<br>   <br>      <b>Ayat 6</b> <br>   Tara akam, Tuhan Yesus!<br>   Asi aim inyanyiku.<br>   Awim aku sanang liwus,<br>   ikau wei pambelomku.<br>   Bitingku, gawingku,<br>   togal akam, Tuhangku!<br>           <h5> L.N.No.139</h5>	</p>'];
var nu_214a=['<h3>214a. AKAM PAMBELOMKU</h3><h4>G=1 (4/4)</h4>	<p align="justify">    	<b>Ayat 1</b> <br>	Akam pambelomku, o Tuhangku,<br>    Jurusalamatku dan tempongku.<br>    Eka kalindongkudan eka kuasangku:<br>    Pasi, o Tuhangku, aku je aim.<br>          <br>    	  <b>Ayat 2</b> <br>	Huang kalunen toh dia bewei<br>    eka ksalamatku je toto te,<br>    Tonggal hung Tuhan wei pambelom slamat te<br>    ije ingenangku hung ateiku.<br>	<br>          <b>Ayat 3</b> <br> Aku namuei wei hung petak toh.<br> Ngambo, hung sorga aim, te ekaku.<br> Dohop o Tuhangku, mangat inyampaiku<br> lewu, je tatap te kan oloh aim.<br>           <h5> L.N.No.3</h5>	</p>'];
var nu_214b=['<h3>214b. AKAM PAMBELOMKU</h3><h4>A=1 (3/4)</h4>	<p align="justify">    	<b>Ayat 1</b> <br>	Akam pambelomku, o Tuhangku!<br>    Jurusalamatku dan tempongku.<br>    Eka kalindongkudan eka kuasangku:<br>    Pasi, o Tuhangku, aku je aim.<br>          <br>    	  <b>Ayat 2</b> <br>	Huang kalunen toh dia bewei<br>    eka ksalamatku je toto te,<br>    Tonggal hung Tuhan wei pambelom slamat te,<br>    ije ingenangku hung ateiku.<br>	<br>          <b>Ayat 3</b> <br> Aku namuei wei hung petak toh<br> Ngambo, hung sorga aim, te ekaku.<br> Dohop o Tuhangku, mangat inyampaiku<br> lewu, je tatap te kan oloh aim.<br>           <h5> Naher mein Gott zu dir</h5>	</p>'];
var nu_214c=['<h3>214c. AKAM PAMBELOMKU</h3><h4>A=1 (3/4)</h4>	<p align="justify">    	<b>Ayat 1</b> <br>	Akam pambelomku, o Tuhangku!<br>    Jurusalamatku dan tempongku.<br>    Eka kalindongkudan eka kuasangku:<br>    Pasi, o Tuhangku, aku je aim.<br>          <br>    	  <b>Ayat 2</b> <br>	Huang kalunen toh dia bewei<br>    eka ksalamatku je toto te,<br>    Tonggal hung Tuhan wei pambelom slamat te,<br>    ije ingenangku hung ateiku.<br>	<br>          <b>Ayat 3</b> <br> Aku namuei wei hung petak toh<br> Ngambo, hung sorga aim, te ekaku.<br> Dohop o Tuhangku, mangat inyampaiku<br> lewu, je tatap te kan oloh aim.<br>           <h5> </h5>	</p>'];
var nu_215=['<h3>215. KAKARE GAWIM TUHANGKU</h3><h4>F=1 (4/4)</h4>	<p align="justify">    	<b>Ayat 1</b> <br>	Kakare gawim Tuhangku,<br>    bahalap tuntang buah,<br>    o imbing lenge aingku toh,<br>    te tanjung aingku segah,<br>    Yoh tawangku, o Tuhangku,<br>    kapanjang sintam asim,<br>    je ingarinah awim<br>          <br>    	  <b>Ayat 2</b> <br>	Paabas kapercayangku<br>    tahiu gawi Ayum.<br>    Toh aku marak kpehengku<br>    tau harap jaran Ayum.<br>    O Pasi ah dan tenga ah<br>    Roh ayum, mangat aku<br>    tau eter, dehen toto.<br>	<br>          <b>Ayat 3</b> <br> 	Yoh aloh lawin jalangku<br>    mahoroi padang benyem.<br>    te baya auh aim hiningku<br>    hong taloh kaput pijem:<br>    O anakku, tabiringku!<br>    has, keleh ikau tatap!<br>    Bauntonggang sorga buap!<br>        <h5>L.N.No.45 </h5>	</p>'];
var nu_216=['<h3>216. O ROH BRASIH, TENGA TOH</h3><h4>G=1 (3/4)</h4>	<p align="justify">    	<b>Ayat 1</b> <br>	O Roh brasih, tenga toh,<br>    klawa aim hung ateiku.<br>    Dohop aku, oloh aim,<br>    belom hung taharep aim.<br>    Tinai dohop mangat tau<br>    mampakalah musohku,<br>    palus agah aku toh<br>    akan huma Apangku.<br>          <br>    	  <b>Ayat 2</b> <br>	O Roh brasih, gurungku<br>    dan pandohop ayungku;<br>    aloh seke huangku,<br>    ampong aim pampangatku.<br>    Aloh are musohku,<br>    kuasam wei kaabasku;<br>    awim aku toto tau<br>    menteng, ureg huangku.<br>    	<br>          <b>Ayat 3</b> <br> 	Tinai amon aku toh<br>    sampai lawin jalangku,<br>    keleh klawa ampong aim,<br>    dan kaharap pnenga aim<br>    mampahajak huangku,<br>    sampai sanang ateiku;<br>    palus agah aku toh<br>    akan huma Apangku.<br>        <h5>L.N.No.95 </h5>	</p>'];
var nu_217=['<h3>217. O TUHAN KLAWA IJE HAI</h3><h4>E<small>s</small>=1 (6/8)</h4>	<p align="justify">    	<b>Ayat 1</b> <br>	O Tuhan, klawa ije hai, horumat tara akam!<br>    Toh ikei, ije baris Aim, manalih tuntang blaku:<br>    Trima nyanyin ikei toh, ije lembut awi Roh<br>    akan palus katatahi.<br>          <br>    	  <b>Ayat 2</b> <br>	Yoh Tuhan, awi sinta aim toh hanjak atei ikei<br>    Kasanang, slamat pnenga Aim,panatau katatahie.<br>    Trima nyanyin ikei toh, ije lembut awi Roh<br>    akan indu hormat Aim palus katatahie!<br>    	<br>          <b>Ayat 3</b> <br>      O Tuhan,haga ikei toh, o berkat gawin ikei,<br>      je haus manara aran Aim dan belom kea akam!<br>      Trima nyanyin ikei toh, ije lembut awi Roh<br>      akan indu hormat Aim palus katatahie!<br> 	<br>        <b>Ayat 4</b> <br>    Yoh jeha huang sorga tau kahanjak ikei sukup,<br>    te musoh jatoh ulih maur, mamapa oloh Ayum.<br>    Trima nyanyin ikei toh, ije lembut awi Roh<br>    akan indu hormat Aim palus katatajie!<br>            <h5>L.N.P.No.35 </h5>	</p>'];
var nu_218a=['<h3>218a. YESUS AKU TOH MANYARAH</h3><h4>A<small>s</small>=1 (4/4)</h4>	<p align="justify">    	<b>Ayat 1</b> <br>	Yesus aku toh manyarah akam hapus bitingku.<br>    Aku handak belom akam. ije puna Tempongku.<br>    Toh dan palus akan katatahie, Yesus aku baris Aim;<br>    akam hapus biti aingku, aku huang lenge Aim!<br>              <br>    	  <b>Ayat 2</b> <br>	Kare ramon bereng akam, mate, pinding, lenge, pai;<br>    nyamangku mansanan taram, hetoh. palus katatai.<br>    Toh dan palus katatahie, Yesus aku baris Aim;<br>    akam hapus biti aingku, aku huang lenge Aim!<br>    	<br>          <b>Ayat 3</b> <br>     Toh kalunen tuntang kipee inalikut huangku.<br>     Hung kahanjak, hung kapehe Tuhan ih kaharapku.<br>     Toh dan palus katatahie, Yesus aku baris Aim!<br>     akam hapus biti aingku, aku huang lenge Aim!<br> 	<br>        <b>Ayat 4</b> <br>    Jete taloh heran toto: Aku eka sintam toh;<br>    aloh dosa aingku kutoh, aloh hai kasalangku.<br>    Toh dan palus katatahie, Yesus aku baris Aim!<br>    akam hapus biti aingku, aku huang lenge Aim!<br>    <br>         <b>Ayat 4</b> <br>    Hayak aku mingat sintam, belom hambaruangku.<br>    Ateiku taharu dengam,akam wei pambelomku.<br>    Toh dan palus katatahie, Yesus aku baris Aim!<br>    akam hapus biti aingku, aku huang lenge Aim!<br>    <br>    <h5>L.N.P.No.18 </h5>	</p>'];
var nu_218b=['<h3>218a. YESUS AKU TOH MANYARAH</h3><h4>E<small>s</small>=1 (4/4)</h4>	<p align="justify">    	<b>Ayat 1</b> <br>	Yesus aku toh manyarah akam hapus bitingku.<br>    Aku handak belom akam. ije puna Tempongku.<br>    Toh dan palus akan katatahie, Yesus aku baris Aim;<br>    akam hapus biti aingku, aku huang lenge Aim!<br>              <br>    	  <b>Ayat 2</b> <br>	Kare ramon bereng akam, mate, pinding, lenge, pai;<br>    nyamangku mansanan taram, hetoh. palus katatai.<br>    Toh dan palus katatahie, Yesus aku baris Aim;<br>    akam hapus biti aingku, aku huang lenge Aim!<br>    	<br>          <b>Ayat 3</b> <br>     Toh kalunen tuntang kipee inalikut huangku.<br>     Hung kahanjak, hung kapehe Tuhan ih kaharapku.<br>     Toh dan palus katatahie, Yesus aku baris Aim!<br>     akam hapus biti aingku, aku huang lenge Aim!<br> 	<br>        <b>Ayat 4</b> <br>    Jete taloh heran toto: Aku eka sintam toh;<br>    aloh dosa aingku kutoh, aloh hai kasalangku.<br>    Toh dan palus katatahie, Yesus aku baris Aim!<br>    akam hapus biti aingku, aku huang lenge Aim!<br>    <br>         <b>Ayat 4</b> <br>    Hayak aku mingat sintam, belom hambaruangku.<br>    Ateiku taharu dengam,akam wei pambelomku.<br>    Toh dan palus katatahie, Yesus aku baris Aim!<br>    akam hapus biti aingku, aku huang lenge Aim!<br>    <br>    <h5> </h5>	</p>'];
var nu_219=['<h3>219. KAHAUSKU SINTA IKAU TOTO</h3><h4>F<small>s</small>=1 (4/4)</h4>	<p align="justify">    	<b>Ayat 1</b> <br>	Ka hausku sinta Ikau toto, O Yesus juruslamatku.<br>    te basa asim, jeha toh manyuang hapus ateiku.<br>    Yoh Tuhan hante hung kataue mamprahan klawa baue.<br>              <br>    	  <b>Ayat 2</b> <br>	O Yesus, klawa aingku hetoh,pambelom dan kahanjakku,<br>    toh akam kare hormat, je imbit hapus huangku.<br>    Yoh patut asim ije hai inara katatai.<br>    	<br>          <b>Ayat 3</b> <br>    O jaka aku helo jari kasene kare sinta Aim!<br>    Ojaka aku dia tahi parisang, bantus haliai,<br>    makan Tuhan, Tempongku, pampangat huangku!<br> 	<br>        <b>Ayat 4</b> <br>     Kasayang Ayum jari mawat tabirim ije hayang te.<br>     O ajar aku toh batawat mananjong huang jalan te.<br>     je simit tumon tukas Aim, te bagingku kahaim,<br>         <h5>L.N.P.No 24 </h5>	</p>'];
var nu_220=['<h3>220. SINING ANDAU TELO TINGKAT MAGON</h3><h4>E<small>s</small>=1 (4/4)</h4>	<p align="justify">    	<b>Ayat 1</b> <br>	Sining andau telo tingkat magon hong baun<br>    sengok karung loteng aei.<br>    Jari daniel manintu<br>    Sion lewun Tuhan pangkahai.<br>    Gatang matan keton kan Yesusalem,<br>    keton ie namuei huang Babiloni,<br>    Sining andau sampai Tuhan Yesus<br>    megah keton kan Sion!<br>              <br>    	  <b>Ayat 2</b> <br>	Ela mikeh apui tuntang rantai,<br>    singa ayun Raja Babel te!<br>    enda plapas Tuhan keton melai<br>    Bakalidong, sanang wei.<br>    Gatang matan keton akan Yerusalem,<br>    keton je namuei huang Babilon,<br>    sining andau sampai Tuhan Yesus<br>    magah keton kan Sion!<br>        	<br>          <b>Ayat 3</b> <br>    Akam, Babelm kare pesta ayum.<br>    auh karami jalan lombah te.<br>    Akan ikei danaum ain pambelom<br>    tuntang nyanyin Sion te.<br>    Gatang matan keton kan Yerusalem,<br>    keton je namuei huang Babilon,<br>        sining andau sampai Tuhan Yesus<br>    magah keton kan Sion!<br> 	<br>        <b>Ayat 4</b> <br>    Nyanyi keton, anak ain Hatalla!<br>    Jam Kaliwus tokep haliai.<br>    Nyanyi keton hayak blakudoa!<br>    Tuhan dumah hong kahaie.<br>    Gatang matan keton kan Yerusalem,<br>    keton je namuei huang Babilon,<br>        sining andau sampai Tuhan Yesus<br>    magah keton kan Sion!<br>         <h5>L.N.P.No 44 </h5>	</p>'];
var nu_221=['<h3>221. DOHOP AKU TOH MANGAKU</h3><h4>A=1 (4/4)</h4>	<p align="justify">    	<b>Ayat 1</b> <br>	Dohop aku toh mangaku<br>    aran aim, o Tuhangku<br>    hong taharep kare oloh:<br>    Tuhan wei Pamawatku.<br>    Liwus bara kikeh dengan<br>    kare oloh handiai<br>    je mamusoh ikei Tuhan<br>    dan basingi oloh aim!<br>              <br>    	  <b>Ayat 2</b> <br>	    Dohop aku toh manyaksi<br>    hong kajurah magon wei,<br>    aram ije puna brasih,<br>    ije eka slamat te!<br>    Aloh aku toh ingganan<br>    tagal kapercayangku,<br>    aku dia milim Tuhan<br>    ije Juruslamatku!<br>            	<br>          <b>Ayat 3</b> <br>    Ewen baya tau mangarak<br>    dan mampatei berengku;<br>    jaton kuasa mamparusak,<br>    mawi hambaruangku.<br>    Awi lengem ikei manang<br>    palus sampai tuntang hanjak rantang<br>    huang slamat ije hai.<br> 	<br>        <b>Ayat 4</b> <br>    Tuhan jari manyarenan<br>    kutoh kpehe gantingku.<br>    Ela aku toh mahakan<br>    kpehe tagal Tuhangku.<br>    Dan mangaku aram kea <br>    sangkom hong kalunen toh,<br>    mangat intu baun Bapa<br>    tau ingakum arangku!<br>         <h5>L.N.No 14 </h5>	</p>'];
var nu_222=['<h3>222. DOSA IJE MAMBUKU TOH</h3><h4>A=1 (4/4)</h4>	<p align="justify">    	<b>Ayat 1</b> <br>	Dosa ije mambuku toh<br>    oloh melai hung calaka.<br>    Kahum hung kalunen yoh,<br>    tinai dapit hung naraka.<br>    Tagal kare taloh sala<br>    oloh buah klai Hatalla.<br>              <br>    	  <b>Ayat 2</b> <br>	Tapi tara Yesus wei,<br>    hormat ayue toh imbrita,<br>    Ie Juruslamat te,<br>    jari matei gantin itah.<br>    Toh kakare je percaya,<br>    sondau asi ain Hatalla.<br>            <h5>L.N.No. 147 </h5>	</p>'];
var nu_223=['<h3>223. HATALLA PASI IKEI</h3><h4>B<small>es</small>=1 (4/4)</h4>	<p align="justify">    	<b>Ayat 1</b> <br>	Hatalla pasi ikei awang tiwas,<br>    je patut buah hukum karas,<br>    sakare rentah aim ilangkah ikei,<br>    basala hante.<br>              <br>    	  <b>Ayat 2</b> <br>	Yoh buah, jaka ikau o Hatalla,<br>    mahukum dan mamaleh gawi sala,<br>    mangan ikei, oloh awang papa<br>    kan binasa.<br>    <br>        <b>Ayat 3</b> <br>    O Pasi ikei mangat tau mahakan<br>    hung Yesus Kristus, ije Puna Tuhan<br>    dahae maliwus ikeimimbit slamat<br>    O Tuhan, awat!<br>                <h5>L.N.No.85 </h5>	</p>'];
var nu_224=['<h3>224. O YESUS TEMPON ASI</h3><h4>G=1 (4/4)</h4>	<p align="justify">    	<b>Ayat 1</b> <br>	O Yesus tempon asi dan Juruslamatku,<br>    toh soho Roh mamplawa ateiku.<br>    Teh bele aku sayup manggau kasanang<br>    dohop hong wayah slamat toh!<br>              <br>    	  <b>Ayat 2</b> <br>	O Tuhan kare prenthm ilangkahku samai;<br>    yoh atei aingku papa dan hules haliai.<br>    O ampung kare dosa dan puas kare ksala,<br>    je jari awiku!<br>    <br>        <b>Ayat 3</b> <br>   Yoh bara aku kanan, kakare kipen te,<br>   dan pikir je malawan, khandak ayum wei.<br>   O Tuhan, dohop aku, nakara aku toto,<br>   mahormat aran aim!<br>   <br>   <b>Ayat 4</b> <br>   Dan tinai, nining Yesus auh laku doangku, <br>   katikaku mahotus, o duan liauku;<br>   nakara aku kanih aku belom katatahi,<br>   manara aran aim!<br>                <h5>L.N.No.87 </h5>	</p>'];
var nu_225=['<h3>225. KAKARE OLOH LAYANG TOH</h3><h4>E<small>s</small>=1 (4/4)</h4>	<p align="justify">    	<b>Ayat 1</b> <br>	Kakare oloh layang toh,<br>    enbukue keton bantos?<br>    Has, gulong keton hobah,<br>    yoh gau Juruslamat, Yesus.<br>              <br>    	  <b>Ayat 2</b> <br>	Kapaham asie, berkat hai,<br>    panengan Yesus magon;<br>    salamat ije katatai<br>    inatap akan keton.<br>    <br>        <b>Ayat 3</b> <br>  O Yesus, Tuhan Pangkahai,<br>  toh hining ikei blaku.<br>  o imbit oloh handiai<br>  manggau slamat toto.<br>            <h5>L.N.No.61 </h5>	</p>'];
var nu_226=['<h3>226. GATANG ATEI AKAN NGAMBO</h3><h4>G=1 (4/4)</h4>	<p align="justify">    	<b>Ayat 1</b> <br>	Gatang atei akan ngambo,<br>    manampayah Yesus wei!<br>    Baya huang aran ayue<br>    oloh sondau slamat te.<br>              <br>    	  <b>Ayat 2</b> <br>	Tuhan Yesus Tempon kuasa,<br>    mohon bara sorga ai,<br>    jari mateigantin itah,<br>    ganting oloh handiai.<br>    <br>        <b>Ayat 3</b> <br>Toh salamat tatap<br>akan oloh, handiai,<br>awang ater ateie harap<br>Yesus Tuhan pangkahai.<br><br><b>Ayat 4</b> <br>Buah ikau toto hobah <br>akan Tuhan Pangkahai. <br>Ateim patut inaheta<br>tonggal tumon prentah aie.<br><br><b>Ayat 5</b> <br>Kai salamat katatahi<br>sondau hung Yesus wei.<br>Tuhan, ikei blaku asi,<br>mangat dinon slamat te.<br>            <h5>L.N.No.11 </h5>	</p>'];
var nu_227=['<h3>227. HAS TOH ATON WAYAH ASI</h3><h4>G=1 (4/4)</h4>	<p align="justify">    	<b>Ayat 1</b> <br>	Has, toh aton wayah asi,<br>    ela itah laya toh!<br>    duan salamat katatahi,<br>    ije tokep wayah toh.<br>    Keleh itah handiai,<br>    mingat kare brita hai,<br>    bara Yesus Panyalamat<br>    Rende-rendeng, hining, ingat!<br>              <br>    	  <b>Ayat 2</b> <br>	Has toh lekak setan, dewa,<br>    urase musoh handiai!<br>    Awie oloh buah sapa<br>    dan mamenda kuasa aie.<br>    Tapi Yesus Kristus te<br>    bara kuasa, Ie  wei<br>    tau mandohop tuntang mawat<br>    awang harap Juruslamat<br>            <h5>L.N.No.46</h5>	</p>'];
var nu_228a=['<h3>228a. TOH IKEI TALI IKAU</h3><h4>C=1 (4/4)</h4>	<p align="justify">    	<b>Ayat 1</b> <br>	Toh ikei talih ikau o Tuhan pangkahai,<br>    nakara ikei sondau salamat katatai.<br>    O liwus bara kpapa dan bara hukum hai<br>    toh ikei, je badosa dan tiwas handia.<br>              <br>    	  <b>Ayat 2</b> <br>	Nakara ikei liwus dan sanang tei wei<br>    hung sinta aim o Yesus, Panewus toto te.<br>    O Tuhan, pasi hante dan haga ikei toh:<br>    Yoh mangat ela bele manumon sohon Roh!<br>            <h5>L.N.No.129</h5>	</p>'];
var nu_228b=['<h3>228b. TOH IKEI TALI IKAU</h3><h4>C=1 (4/4)</h4>	<p align="justify">    	<b>Ayat 1</b> <br>	Toh ikei talih ikau o Tuhan pangkahai,<br>    nakara ikei sondau salamat katatai.<br>    O liwus bara kpapa dan bara hukum hai<br>    toh ikei, je badosa dan tiwas handia.<br>              <br>    	  <b>Ayat 2</b> <br>	Nakara ikei liwus dan sanang tei wei<br>    hung sinta aim o Yesus, Panewus toto te.<br>    O Tuhan, pasi hante dan haga ikei toh:<br>    Yoh mangat ela bele manumon sohon Roh!<br>            <h5>Y.P.No.155</h5>	</p>'];
var nu_229=['<h3>229. HARAJUR OLOH JAKE</h3><h4>E<small>s</small>=1 (4/4)</h4>	<p align="justify">    	<b>Ayat 1</b> <br>	Harajur oloh jake dan magon pehe wei;<br>    katapas ayue hante imbuku dosa te.<br>              <br>    	  <b>Ayat 2</b> <br>	Tahasenge haru aton, balembut tangis te,<br>    hanjulo ie belom, balalu matei wei.<br>    <br>        <b>Ayat 3</b><br>    Toh aloh tumon jete, tau itah sanang wei,<br>    Hatalla masi hante hung Yesus Kristus te.<br>    <br>        <b>Ayat 4</b><br>    Kapehen itah lepah inanggong Yesus wei,<br>    je mulih akan itah pambelom slamat te.<br>        <b>Ayat 5</b><br>    O Yesus, batang asi kan oloh handiai,<br>    O ampun tuntang prasih, toh ikei handiai!<br>    <br>        <b>Ayat 6</b><br>    Hajean ikei dengam, je harap aran aim.<br>    Yoh jijit ikei akam, nakare tame khaim!<br>             <h5>L.N.No.89</h5>	</p>'];
var nu_230a=['<h3>230a. TOH BUAH ITAH HANJAK</h3><h4>E<small>s</small>=1 (9/8)</h4>	<p align="justify">    	<b>Ayat 1</b> <br>	Toh buah itah hanjak, yoh hajak,haliai.<br>    Panenga je bahalap ain Tuhan pangkahai,<br>    kan kare itah oloh kasanang slmat aie,<br>    toh tara ie magon mahormat aran aie.<br>              <br>    	  <b>Ayat 2</b> <br>	Yoh bihin atei itah ingaput haliai.<br>    Toh klawa te mamarah, has tatap trima wei.<br>    auh slamat bara Yesus, je Juruslamat te.<br>    je mawat dan maliwus, has langkap trima wei.<br>    <br>        <b>Ayat 3</b><br>   Yoh misik bara tiroh kahumong ateim te<br>   dan ingat kea kutoh kapintar toto te.<br>   O pasi toto oloh je magon melai wei<br>   manumon tirok helo je kaput haliai.<br>    <br>        <b>Ayat 4</b><br>   Kapintar, panatau, hormat, panengan Tuhan wei<br>   te keleh atei, himat mahaga jete wei,<br>   kan hormat Tuhan Yesus hung talok korik hai,<br>   dan ela kea bantus manumon peteh ai,<br>         <h5>L.N.No.126</h5>	</p>'];
var nu_230b=['<h3>230b. TOH BUAH ITAH HANJAK</h3><h4>C=1 (4/4)</h4>	<p align="justify">    	<b>Ayat 1</b> <br>	Toh buah itah hanjak, yoh hajak,haliai.<br>    Panenga je bahalap ain Tuhan pangkahai,<br>    kan kare itah oloh kasanang slmat aie,<br>    toh tara ie magon mahormat aran aie.<br>              <br>    	  <b>Ayat 2</b> <br>	Yoh bihin atei itah ingaput haliai.<br>    Toh klawa te mamarah, has tatap trima wei.<br>    auh slamat bara Yesus, je Juruslamat te.<br>    je mawat dan maliwus, has langkap trima wei!<br>    <br>        <b>Ayat 3</b><br>   Yoh misik bara tiroh kahumong ateim te<br>   dan ingat kea kutoh kapintar toto te.<br>   O pasi toto oloh je magon melai wei<br>   manumon tirok helo je kaput haliai.<br>    <br>        <b>Ayat 4</b><br>   Kapintar, panatau, hormat, panengan Tuhan wei.<br>   te keleh atei, himat mahaga jete wei,<br>   kan hormat Tuhan Yesus hung talok korik hai,<br>   dan ela kea bantus manumon peteh ai.<br>         <h5>Y.P.No.131</h5>	</p>'];
var nu_231=['<h3>231. BUAH ITAH TOH MANRA</h3><h4>E <small>s</small>=1 (4/4)</h4>	<p align="justify">    	<b>Ayat 1</b> <br>	Buah itah toh manra<br>    sintan Tuhan ije hai;<br>    sintae,asie je mahaga<br>    manyang oloh handiai.<br>              <br>    	  <b>Ayat 2</b> <br>	Sintae te manyanyang magon,<br>    manggau keton hante wei;<br>    handak manyalamat keton,<br>    mimbit sorga te.<br>    <br>        <b>Ayat 3</b><br>	Buah keton manrima<br>    sintae ije paham hai;<br>    ale keton harus umba,<br>    tame wei kerajaan Aie!<br>    <br>        <b>Ayat 4</b><br>  Marak itah le aton,<br>  tokep oloh handiai;<br>  haus malalus lakun keton<br>  mindah dosa te samai.<br>  <br>    <b>Ayat 5 </b><br>  Mapai ah katahin keton<br>  haus malayau, pehe wei,<br>  aloh slamat toto aton<br>  huang Yesus, Tuhan te!<br>  <br>    <b> Ayat 6</b><br>  Kare kamabang haus manintu<br>  mantandau bujur wei,<br>  buah keton toh manantu<br>  arep akan Tuhan te.<br>  <br>    <b> Ayat 7</b><br>  Ules arep palus melai<br>  hinje Yesus Tuhangku!<br>  Te kapehen keton terai,<br>  khanjak tengan Tempongku!<br>         <h5>L.N.No.16</h5>	</p>'];
var nu_232=['<h3>232. KAN KARE OLOH HANDIAI</h3><h4>G=1 (3/4)</h4>	<p align="justify">    	<b>Ayat 1</b> <br>	Kan kare oloh handiai,<br>    je toto lenyoh ateie<br>    toh tagal kare dosa asie dan <br>    toto pehe ateie<br>    inatap ampun ije hai,<br>    inyimpan slamat katatai<br>    hong kayu sampalaki<br>              <br>    	  <b>Ayat 2</b> <br>	Te amon dosa paham hai,<br>    kasayang ain Hatalla<br>    labien kare kuasa aie.<br>    Yoh aloh kare dosa<br>    bahandang kilau daha wei,<br>    te Tuhan handak mobah te,<br>    baputi kilau amau.<br>    <br>        <b>Ayat 3</b><br>	Hong kayu sampalaki te<br>    ilantak surat dawa,<br>    kakare utang punah wei,<br>    toh benyem auh pamada .<br>    Kaliwus, slamat katatai<br>    inatap Tuhan pangkahai<br>    hajamban Anak Ayue.<br>    <h5>L.N.No.33</h5>	</p>'];
var nu_233=['<h3>233. HATALLA PASI AKU TOH</h3><h4>G=1 (3/4)</h4>	<p align="justify">    	<b>Ayat 1</b> <br>	Hatalla pasi aku toh<br>    je toto jari layang<br>    O puas kare dosangku<br>    hong sintam dan kasayangm!<br>    ampun ah ka langkahku dan kare<br>    kadar hakangku karisangku,<br>    kalayang.<br>              <br>    	  <b>Ayat 2</b> <br>	O penyau hapus huangku<br>    to bara kare like!<br>    Dan liwus kea ateiku.<br>    O Tuhan bara kpehe<br>    je handau dan hamalem toh<br>    mampikeh hambaruangku,<br>    mabehat aku hante!<br>    <br>        <b>Ayat 3</b><br>	O ampun ah kasalangku<br>    dan kanan lepah-lepah<br>    kalangkahku dan dosangku<br>    je paham mampaheka<br>    manyeke hapus huangku,<br>    mandawa, mawi aku toh<br>    je paham jari sala.<br>    <br>        <b>Ayat 4</b><br>    Tarima ah, o Tuhangku,<br>    parapah je ingilakm,<br>    hambruan, roh dan ateiku<br>    je lenyoh tuntang bilak<br>    bagto hung kanyasalku!<br>    Tampayah ampin ateiku<br>    hong asim dan kasayangm!<br>    <br>        <b>Ayat 5</b><br>    O tampa intu huangku<br>    toh atei ije barasih!<br>    Yoh keleh manaheta toh<br>    hong sintam tuntang asim,<br>    O Tuhan, hapus huangku!<br>    O tenga ah toh akangaku<br>    Roh ayum ije brasih!<br>        <h5>L.N.No.33</h5>	</p>'];
var nu_234=['<h3>234. KATAWAM TOH KAKARE KAPEHE HAI</h3><h4>E<small>s</small>=1 (4/4)</h4>	<p align="justify">    	<b>Ayat 1</b> <br>	Katawam toh kakare hai<br>    je kilau tasik lomba te,<br>    handelem toto haliai<br>    dan jaton tara tuga wei?<br>              <br>    	  <b>Ayat 2</b> <br>	Kabehat kpehe paham te<br>    je jaton taratonggang wei<br>    babehat bara bukit hai<br>    mahenyak paham hai.<br>    <br>        <b>Ayat 3</b><br>	Yoh handau hamalem wei<br>    kapehen dosa te samai<br>    mambehat mawi oloh te<br>    je toh manjadi jipen aie.<br>    <br>        <b>Ayat 4</b><br>    Hambruan atei oloh te<br>    manangis, manarahing wei,<br>    mangenang panantamba hai<br>    je tau manganan kpehe aie<br>    <br>        <b>Ayat 5</b><br>   Daialoh ije doketer tau,<br>   has keleh oloh te manggau:<br>   Batonggal huang Yesus wei,<br>   Pamawat hong kajake te.<br>   <br>      <b>Ayat 6</b><br>   Tatamba jete daha aie,<br>   barga,brasih haliai,<br>   je mampakeleh toto wei<br>   kapehe tagal dosa te.<br>   <br>       <b>Ayat 7</b><br>    Salamat genep oloh te<br>    je inantamaba Yesus wei;<br>    kakare kpehe te samai<br>    kpehe keleh handiai.<br>    <br>         <b>Ayat 8</b><br>     Te ie palus katatai.<br>     barigas toto haliai<br>     yoh, ie inarima wei<br>     hong sorga, eka slamat te.<br>             <h5>R.L.202</h5>	</p>'];
var nu_235=['<h3>235. IKAU ROHKU, TATAP WEI</h3><h4>E<small>s</small>=1 (4/4)</h4>	<p align="justify">    	<b>Ayat 1</b> <br>	Ikau rohku tatap wei jaga blaku doa!<br>    Mikeh wayah papa te kaje-kajeng dumah!<br>    Setan tau bewei mampalayang oloh<br>    awang bujur toto.<br>              <br>    	  <b>Ayat 2</b> <br>	Tapi misik haliai bara tiroh dosa;<br>    krana hukum katatai aton hung naraka.<br>    Hakan te! Tau bewei suah dan pampatei<br>    manantekas samapai.<br>    <br>        <b>Ayat 3</b><br>	Misik, mangat Yesus tau hasangkowong akam!<br>    Jaka dia, klawa baue hayang akam:<br>    Toh parenang matam!<br>    <br>        <b>Ayat 4</b><br>   Misik bara toh, basa setan mimpa.<br>   Pikir sie manipu toh oloh je mangampa.<br>   Awi te, kinjap wei oloh ain Hatalla<br>   buah pukul, jara.<br>    <br>        <b>Ayat 5</b><br>  Jaga toh! kaunen tau miwas dan mapapa:<br>  kinjap dengan manis baue ie supa akal.<br>  sobat aie handiai, tamput ie nihau.<br>  Jaga, ela layau!<br>   <br>      <b>Ayat 6</b><br>  Jaka kea dengan kras bereng dan hambruan!<br>  Kipen manak dosa, has! Ingat kajariam!<br>  Jaga toh huang Roh,uka aku bujur gawim,<br>  bele nihau asi<br>   <br>       <b>Ayat 7</b><br>    Tapi buah hayak te mugoh huang Tuhan:<br>    awi kuasa aie bewei kalah dosa setan.<br>    Tawangku musohku, kupen dan kajake<br>    balang awi Ie.<br>    <br>         <b>Ayat 8</b><br>    Yesus Kristus, Andalku, ikau handak dumah.<br>    Dohop magon ateiku, jaga blakudoa;<br>    mentai wei andau te, amon Tuhan dumah.<br>    Slamat oloh jaga!<br>        <h5>L.N.No.56</h5>	</p>'];
var nu_236a=['<h3>236a. KELEH ETER, BUJUR WEI</h3><h4>B<small>es</small>=1 (4/4)</h4>	<p align="justify">    	<b>Ayat 1</b> <br>	Keleh eter, bujur wei!<br>    Keleh eter bujur wei!<br>    Aloh kpehe mawi itah,<br>    buah itah toto<br>    omba Yesus Juruslamat te.<br>    keleh eter bujur wei!<br>              <br>    	  <b>Ayat 2</b> <br>	Keleh eter, bujur wei,<br>    keleh eter, bujur wei!<br>    Klahi toto, lawan musoh<br>    awang maroh itah hetoh;<br>    horoi jalan slamat te.<br>    Keleh eter, bujur wei!<br>    <br>        <b>Ayat 3</b><br>	Keleh eter, bujur wei,<br>    keleh eter, bujur wei!<br>    Tatap dengan lakudoa,<br>    hayak ingat uka juga;<br>    himat lakak dosa te.<br>    Keleh eter, bujur wei!<br>    <br>        <b>Ayat 4</b><br>   Keleh eter, bujur wei,<br>   keleh eter, bujur wei!<br>   Sarah bitim akan Yesus.<br>   Ie kuasa tau maliwus<br>   ikau bara setan te.<br>   Keleh eter,bujur wei!<br>    <br>        <b>Ayat 5</b><br> 	Keleh eter,bujur wei,<br>    keleh eter,bujur wei!<br>    Ingat, slamat jari tatap<br>    akan oloh awang harap <br>    Yesus Kristus, Tuhan te<br>    Keleh eter, bujur wei!<br>   <br>      <b>Ayat 6</b><br> Himat toto, himat wei,<br> himat toto, himat wei!<br> Tuhan, aku belom akam;<br> aku haus manyanyi taram<br> hapan ateiku.<br> Keleh eter,bujur wei!<br>   <br>       <b>Ayat 7</b><br>   Hanjak toto ateiku,<br>   hanjak toto ateiku!<br>   Toto dia usah bembang;<br>   krana itah puna manang<br>   awi dahan Tuhangku.<br>   Hanjak toto ateiku!<br>        <h5>L.N.No.68</h5>	</p>'];
var nu_236b=['<h3>236b. KELEH ETER BUJUR WEI</h3><h4>A<small>s</small>=1 (4/4)</h4>	<p align="justify">    	<b>Ayat 1</b> <br>	Keleh eter, bujur wei!<br>    Keleh eter bujur wei!<br>    Aloh kpehe mawi itah,<br>    buah itah toto omba<br>    toto omba, toto omba<br>  Yesus Juruslamat te,<br>  Yesus Juruslamat te.<br>    keleh eter bujur wei!<br>     keleh eter bujur wei!<br>              <br>    	  <b>Ayat 2</b> <br>	Keleh eter, bujur wei,<br>    keleh eter, bujur wei!<br>    Klahi toto, lawan musoh<br>    awang maroh itah hetoh;<br>    awang maroh itah hetoh;<br>    horoi jalan slamat te,<br>     horoi jalan slamat te.<br>    Keleh eter, bujur wei!<br>    Keleh eter, bujur wei!<br>    <br>        <b>Ayat 3</b><br>	Keleh eter, bujur wei,<br>    keleh eter, bujur wei!<br>    Tatap dengan lakudoa,<br>    hayak ingat uka juga;<br>    hayak ingat uka juga;<br>    himat lakak dosa te,<br>    himat lakak dosa te.<br>    Keleh eter, bujur wei!<br>    Keleh eter, bujur wei!<br>    <br>        <b>Ayat 4</b><br>   Keleh eter, bujur wei,<br>   keleh eter, bujur wei!<br>   Sarah bitim akan Yesus.<br>   Ie kuasa tau maliwus<br>   Ie kuasa tau maliwus<br>   ikau bara setan te,<br>   ikau bara setan te,<br>   Keleh eter,bujur wei!<br>   Keleh eter,bujur wei!<br>    <br>        <b>Ayat 5</b><br> 	Keleh eter,bujur wei,<br>    keleh eter,bujur wei!<br>    Ingat, slamat jari tatap<br>    akan oloh awang harap <br>    akan oloh awang harap <br>    Yesus Kristus, Tuhan te<br>     Yesus Kristus, Tuhan te<br>    Keleh eter, bujur wei!<br>     Keleh eter, bujur wei!<br>   <br>      <b>Ayat 6</b><br> Himat toto, himat wei,<br> himat toto, himat wei!<br> Tuhan, aku belom akam;<br> aku haus manyanyi taram<br> aku haus manyanyi taram<br> hapan ateiku.<br> hapan ateiku.<br> Keleh eter,bujur wei!<br>  Keleh eter,bujur wei!<br>   <br>       <b>Ayat 7</b><br>   Hanjak toto ateiku,<br>   hanjak toto ateiku!<br>   Toto dia usah bembang;<br>   krana itah puna manang<br>   krana itah puna manang<br>   awi dahan Tuhangku,<br>    awi dahan Tuhangku.<br>   Hanjak toto ateiku!<br>   Hanjak toto ateiku!<br>        <h5>Appenteller landsgemeinde lied	</h5>	</p>'];
var nu_237=['<h3>237. TRIMAKASIH AKAN TUHAN TAGAL ASI AIE</h3><h4>D=1 (2/4)</h4>	<p align="justify">    	<b>Ayat 1</b> <br>	Trimakasih akan Tuhan tagal akan asi aie.<br>    Yesus dumah mimbit itah akan slamat hai.<br>    Omba, omba Yesus langkap hining rawei aie.<br>    Has toh, kepan kaabas ije puna tenga aie!<br>              <br>    	  <b>Ayat 2</b> <br>	Setan puna abas toto hayak kawan aie.<br>    Ie ije pangkalima hungkakaput te.<br>    Omba, omba Yesus langkap hining rawei aie.<br>    Has toh kepan kaabas ije puna tenga aie.<br>    <br>        <b>Ayat 3</b><br>	Setan kinjap dumah dengan manis ampin baue.<br>    Atei, je batiroh, layang awie tippun auhe.<br>    Omba, omba Yesus langkap hining rawei aie.<br>    Has toh kepan kaabas ije puna tenga aie.<br>    <br>        <b>Ayat 4</b><br>   Has toh, misik, tatap arepm, o hambruangku.<br>   Langkap tanggoh Yesus, ije Andal ayungku.<br>   Omba, omba Yesus langkap hining rawei aie.<br>   Has toh kepan kaabas ije puna tenga aie.<br>        <h5>L.N.No.140</h5>	</p>'];
var nu_238=['<h3>238. ANAK IJE LAYAU</h3><h4>F=1 (4/4)</h4>	<p align="justify">    	<b>Ayat 1</b> <br>	Anak ije layau jari buli tah.<br>    Ie ije nihau, yoh sondau toh<br>    Buah hanjak hanjak, hanjak haliai!<br>    Bapam, ije mentai manambang toh.<br>              <br>    	  <b>Ayat 2</b> <br>	Anak ije jayong, tokep tiani toh <br>    dengan randah atei dan lenyoh toh.<br>    Buah hanja-hanjak, hanjak haliai!<br>    Bapam ije mentai, manambang toh.<br>    <br>        <b>Ayat 3</b><br>	Intu lewu kejau meher tuntang blau,<br>    huang eka Bapa paha katau.<br>    Buah hanja-hanjak hanjak haliai!<br>    Bapam ije mentai, manambang toh.<br>    <br>        <b>Ayat 4</b><br>   Paham toto sanang, mangat haliai<br>   huang human Bapa, yoh slamat hai!<br>   Buah hanja-hanjak, hanjak haliai!<br>   Bapam ije mentai, manambang toh.<br>   <br>         <b>Ayat 5</b><br>     Kare ije layang, keleh buli toh<br>     akan ksanang, ije buap toh.<br>     Buah hanja-hanjak, hanjak haliai!<br>     Bapam ije mentai, manambang toh.<br>        <h5>L.N.P.No.33</h5>	</p>'];
var nu_239=['<h3>239. AMON KETON IMBELOM</h3><h4>A=1 (4/4)</h4>	<p align="justify">    	<b>Ayat 1</b> <br>	Amon keton imbelom<br>    hanjak dengan Kristus toh,<br>    gau taloh ije aton<br>    huang eka Tuhangku<br>    ije mondok darah Bapae<br>    dan marentah hung kahai;<br>    hapus petak penda kuasae,<br>    sorga padadusa aie.<br>              <br>    	  <b>Ayat 2</b> <br>	Kumang taloh ngambo magon,<br>    ela je hong petak toh!<br>    Intu atei ketoh toh.<br>    Lapas arep bara taloh<br>    awang manahan wei,<br>    ije hong kalunen jetoh<br>    urase akan rusak wei!<br>    <br>        <b>Ayat 3</b><br>	Amon Tuhan Yesus Kristus<br>    ingarinah hongkahai,<br>    keton kea akan palus<br>    hinje dengae katatai!<br>    Patut keton hapakaian<br>    dasar je taheta te,<br>    ije baya tenga Tuhan<br>    tonggal awi sintae wei!<br>        <h5>L.N.No.14</h5>	</p>'];
var nu_240a=['<h3>240a. EWEH TOH INALIH ITAH</h3><h4>G=1 (4/4)</h4>	<p align="justify">    	<b>Ayat 1</b> <br>	Eweh toh inalih itah<br>    hong kalunen minjam toh?<br>    Eweh ije mimbit brita<br>    slamat akan itah toh?<br>                  <br>    	  <b>Ayat 2</b> <br>	Tikas Tuhan ije Tempon<br>    auh pambelom katatai.<br>    Ie mawat itah olon <br>    akan slamat, ksanang hai.<br>    <br>        <b>Ayat 3</b><br>	Asal itah wei percaya<br>    Yesus toto Kristus te<br>    ije iminyak awi Bapae<br>    je ientai itah wei.<br>    <br>        <b>Ayat 4</b><br>    Aloh are murid undur<br>    tagal sampalaki aie,<br>    itak handak toh harajur <br>    mondok intu darah paie.<br>    <br>        <b>Ayat 5</b><br>Manarima gawin Tuhan<br>hapan toto atei toh.<br>Genep biti tau mansanan:<br>Yesus Juruslamatku!<br>        <h5>L.N.No.11</h5>	</p>'];
var nu_240b=['<h3>240b. EWEH TOH INALIH ITAH</h3><h4>E<small>s</small>=1 (4/4)</h4>	<p align="justify">    	<b>Ayat 1</b> <br>	Eweh toh inalih itah<br>    hong kalunen minjam toh?<br>    Eweh ije mimbit brita<br>    slamat akan itah toh?<br>                  <br>    	  <b>Ayat 2</b> <br>	Tikas Tuhan ije Tempon<br>    auh pambelom katatai.<br>    Ie mawat itah olon <br>    akan slamat, ksanang hai.<br>    <br>        <b>Ayat 3</b><br>	Asal itah wei percaya<br>    Yesus toto Kristus te<br>    ije iminyak awi Bapae<br>    je ientai itah wei.<br>    <br>        <b>Ayat 4</b><br>    Aloh are murid undur<br>    tagal sampalaki aie,<br>    itak handak toh harajur <br>    mondok intu darah paie.<br>    <br>        <b>Ayat 5</b><br>Manarima gawin Tuhan<br>hapan toto atei toh.<br>Genep biti tau mansanan:<br>Yesus Juruslamatku!<br>        <h5>L.N.No.123</h5>	</p>'];
var nu_241=['<h3>241. YESUS JARI MAMPAKALAH</h3><h4>G=1 (4/4)</h4>	<p align="justify">    	<b>Ayat 1</b> <br>	Yesus jari mampakalah<br>    setan tuntang kuasaaie.<br>    Eweh handak toh mata nah*<br>    oloh je percaya te?<br>    Dosan itah handiai<br>    toh impuas daha ain<br>    Yesus Juruslamat itah,<br>    ije mampon dosa toto.<br>              <br>    	  <b>Ayat 2</b> <br>	Toh kahanjak ije toto<br>    tau ingkeme oloh te,<br>    ije tuntang bujur ateie<br>    harap Kristus Yesus wei.<br>    Kubur dan kakakput aie,<br>    taloh papa handiai,<br>    jaon tau mapikeh oloh,<br>    ije harap Yesus toto.<br>    <br>        <b>Ayat 3</b><br>	Atei ewen toto sanang,<br>    hanjak rantang magon wei.<br>    Awi Tuhan ewen manang,<br>    eka aie hung sorga te<br>    jari tatap hung kahai<br>    akan oloh baris aie,<br>    kharap ewen jaton hayang,<br>    bagie slamat dan ksanang.<br>    <br>        <b>Ayat 4</b><br>   Has toh keleh itah omba<br>   Yesus, Juruslamat wei!<br>   Buah itah toh percaya <br>   kare janji brasih te,<br>   mangat itah toto tau<br>   belom brasih intu baue,<br>   mimbit tara tuntang hormat<br>   akan Yesus, Batang slamat.<br>        <h5>L.N.No.46</h5>	</p>'];
var nu_242=['<h3>242. TARA TOH HATA</h3><h4>E<small>s</small>=1 (4/4)</h4>	<p align="justify">    	<b>Ayat 1</b> <br>	Tara toh Hatalla itah!<br>    Sewut hormat akae wei!<br>    Krana asie bakarinah<br>    itah jari supa te.<br>              <br>    	  <b>Ayat 2</b> <br>	Bara dosa itah empas<br>    awi daha Anak aie;<br>    bara setan itah lapas<br>    tuntang bara hukum hai.<br>    <br>        <b>Ayat 3</b><br>Yesus, Juruslamat itah<br>jari mawat itah toh.<br>Te kasalan itah lepah<br>tinai itah dinon Roh.<br>    <br>        <b>Ayat 4</b><br>   Tuhan Yesus,ikei blaku:<br>   Pasi kare oloh aim!<br>   Haga ikei toto-toto,<br>   imbit ikei kan khaim!<br>   <br>      <b>Ayat 5</b><br>   Mangat ikei hinje dengam,<br>   belom palus katatai;<br>   Tuntang tau manara aram,<br>   ije toto paham hai.<br>        <h5>L.N.No.123</h5>	</p>'];
var nu_243=['<h3>243. HUNG SORGA ATON SOBAT TOTO</h3><h4>F=1 (3/8)</h4>	<p align="justify">    	<b>Ayat 1</b> <br>	Hung sorga aton sobat toto je<br>    tau iharap magon wei.<br>    Hung hetoh mahin aton kutoh, je<br>    bujur, jarang marake te.<br>    Toh tukas toto huangku<br>    manggare Yesus sobatku.<br>                  <br>    	  <b>Ayat 2</b> <br>	Pahari puji ma nanjaro<br>    kai Yesus jaton haliai;<br>    malengkan ie magon toto<br>    malalus kare janji aie.<br>    Toh tukas toto huangku<br>    manggare Yesus sobatku<br>    <br>        <b>Ayat 3</b><br>Mangganti aku ie matei,<br>mananggong kare dosangku;<br>toh ela aku kpehe atei,<br>pambelom ayue bagingku<br>Toh tukas toto huangku<br>manggare Yesus sobatku.<br>    <h5>L.N.No.44</h5>	</p>'];
var nu_244=['<h3>244. HATALLA PUNA KOTANGKU</h3><h4>D=1 (4/4)</h4>	<p align="justify">    	<b>Ayat 1</b> <br>	Hatalla puna kotangku,<br>    pamasi dan panyanyang<br>    Hatallangku kaliwusku,<br>    pamawat dan talawang.<br>    Toh aloh musohku manggau karusaku,<br>    dan aloh akal aie karean haliai:<br>    Hatalla mawat aku.<br>                  <br>    	  <b>Ayat 2</b> <br>	Kaabasku, kapintarku,<br>    kajton aran taloh:<br>    Pandohopoku dan Tampongku,<br>    baguna paham toto.<br>    Toh ewen Ie, je mawat magon wei,<br>    je manang haliai, maramok musoh Aie?<br>    Te Tuhan Yesusu Kristus.<br>    <h5>L.N.No.36</h5>	</p>'];
var nu_245=['<h3>245. ASAL YESUS AINGKU</h3><h4>E<small>s</small>=1 (4/4)</h4>	<p align="justify">    	<b>Ayat 1</b> <br>	Asal Yesus aingku<br>    tuntang akuaie;<br>    amon atei ku taharu<br>    mingat sintae ije hai,<br>    magon aku sanang<br>    krana huang Yesus aku manang.<br>                  <br>    	  <b>Ayat 2</b> <br>	Asal Yesus aingku<br>    hanjak ateiku;<br>    krana tawangku batantu<br>    slamat ayue bagingku;<br>    jaton aku nihau<br>    kilau oloh ije puna layau.<br>    <br>         <b>Ayat 3</b> <br>     Asal Yesus aingku<br>     tuntang aku aie;<br>     asal hapus biti aingku<br>     tau manumon peteh aie,<br>     te harajur berkat<br>     mohon bara Tuhan, batang slamat.<br>     <br>          <b>Ayat 4</b> <br>      Asal Yesus aingku<br>      aku hanjak wei;<br>      kueh-kueh aton lewu aingku,<br>      tempongku mahaga te;<br>      mimbit aku jeha <br>      akan lewungku hung sorga kea.<br>        <h5>L.N.No.13</h5>	</p>'];
var nu_246=['<h3>246. HATALLA BEWEI SAKATIKU TE</h3><h4>F=1 (2/4)</h4>	<p align="justify">    	<b>Ayat 1</b> <br>	Hatalla bewei sakatikku te.<br>    Hong ie mandino kasanang salamat,<br>    kasanang salamat, kasanang salamat<br>    kakare oloh aie.<br>                      <br>    	  <b>Ayat 2</b> <br>	Hatalla je hai kan itah samai<br>    manenga kamangat je toto baguna,<br>    je toto baguna, je toto baguna,<br>    Hong hetoh hong kahai.<br>    <br>         <b>Ayat 3</b> <br>   Katauan Tuhan te dan asie je hai<br>   imbrita kan oloh, je sampai toh layau,<br>   je sampai toh layau, je sampai toh layau<br>   manumon tirok aie.<br>     <br>          <b>Ayat 4</b> <br>    O Temppon kahai! Toh aku je aim,<br>    manalih dan blaku; O tenga kaabas,<br>    o tenga kaabas, o tenga kaabas<br>    mahoroi jalan aim!<br>    <br>        <b>Ayat 5</b> <br>    Ngagalan bewei hung jalan aim te,<br>    toh aku je ayum, nakara manintu,<br>    nakara manintu, nakara manintu<br>    kahanjak hung kahaim.<br>        <h5>L.N.No.32</h5>	</p>'];
var nu_247=['<h3>247. AKU TOTO HAUS TAHARU</h3><h4>F=1 (3/2)</h4>	<p align="justify">    	<b>Ayat 1</b> <br>	Aku toto haus taharu,<br>    tanggoh Yesus Tuhangku,<br>    aloh kueh  kueh tintun ayue,<br>     aku handak omba toh.<br>    Atei aingku pehe paham<br>    tagal dosangku samai.<br>    Keleh Tuhan awi daham <br>    mampu jete handiai!<br>                      <br>    	  <b>Ayat 2</b> <br>	Hung kapehe, hung kajake,<br>    je mantakan aku toh,<br>    ateiku mangenang Ie,<br>    ije eka ampongku.<br>    Jaka aku toh tau lius,<br>    tantu aku palus toh<br>    trawang,mangat tanggong Yesus,<br>    ije eka ksanangku.<br>    <br>         <b>Ayat 3</b> <br>   Kikeh, dosa,yoh pampatei<br>   taloh papa handiai,<br>   Yesus jari tanggoh jete<br>   tikas awi asi Aie.<br>   Asie toto paham kea <br>   dengan oloh handiai.<br>   Aku kea handak omba <br>   melai dengae hung kahai.<br>     <br>          <b>Ayat 4</b> <br>    Keleh ah, o Tuhan Yesus,<br>    melai tokep dengangku;<br>    mangat aku tau iliwus<br>    bara kikeh dosangku!<br>    Hapus ateiku mangkeme,<br>    asim, sintam toto hai.<br>    Tuhan duan aku hinje <br>    dengam palus katatai.<br>        <h5>L.N.No.8</h5>	</p>'];
var nu_248=['<h3>248. O MANGAT TOTO,AMON TAU MANJADI</h3><h4>E<small>s</small>=1 (4/4)</h4>	<p align="justify">    	<b>Ayat 1</b> <br>	O mangat toto amon tau manjadi<br>    tabiri ayue,hung sintae asie<br>    tabiri ayun Tuhan Yesus wei;<br>    nyakatike hante hung Yesus wei;<br>    Kalunen jetoh jaton tau marusak <br>    oloh ije toh manumon auhe.<br>                   <br>    	  <b>Ayat 2</b> <br>	Nakara tuntang kare kusan setan<br>    impalah awi Tuhan pangkahai.<br>    Kasanang dan panatau je ain Tuhan<br>    manjadi bagi ain tabiri aie.<br>    Toh keleh hanjak haliai,<br>    kakare oloh kawan Tuhan pangkahai.<br>    <br>         <b>Ayat 3</b> <br>   Yoh Tuhan Yesus magah kawan ayue<br>   kan eka oru je bahalap te,<br>   kan eka danum je takining toto,<br>   pambelom dan kahajak tengae wei.<br>   Salamat oloh baris aie,<br>   yoh bontong, sanang eweh, oloh korik hai.<br>     <br>          <b>Ayat 4</b> <br>      Pampikeh tuntang taloh papa jaton.<br>      tau mawi, mangapehe oloh te;<br>      te basa Ie je Sakatik, magon<br>      pahayak ewen huang sintae wei.<br>      Yoh aloh kpehe paham hai<br>      hung janah ain pampatei, sanang oloh aie.<br>   <br>         <b>Ayat 5</b> <br>     Toh amon oloh handak belom mangat<br>     dan mite andau je bahalap te,<br>     has keleh bara toh manggau salamat,<br>     je puna tenga ain Sakatik te.<br>     Tabiri ayun Tuhan wei<br>     mandino pnatau dan kahaim Hatalla te.<br>         <h5>L.N.No.92</h5>	</p>'];
var nu_249=['<h3>249. TALOH IJE IH,O TUHAN</h3><h4>E<small>s</small>=1 (4/4)</h4>	<p align="justify">    	<b>Ayat 1</b> <br>	Taloh ije, ih o Tuhan,<br>    dohop aku mintih toh!<br>    Awang beken te pandehan<br>    tau manyanang ateiku.<br>    Panengan kalunen,<br>    yoh aloh baharap.<br>    Hong Ije in aton kamangat je hai,<br>    kahanjak je sukup akan oloh samai.<br>                   <br>    	  <b>Ayat 2</b> <br>	Amon ikau handak sondau<br>    pangkahalap bagi te,<br>    ije jaton akan nihau,<br>    goang jete ngambo wei,<br>    hing Yesus, je Batang pambelom kalawa.<br>    Tahasak panenga je tinduh, barega.<br>    Hung Ie Hatalla ngarinah kataue<br>    kan oloh, je blaku, mangenang, manggaue.<br>    <br>         <b>Ayat 3</b> <br>   Kilau jete jari tulus<br>   metoh hong Betania<br>   darah pai ain Tuhan Yesus<br>   jari mondok maria.<br>   Kakenang aie, dengan salepah hambruan<br>   manyeneh,mangumang auh ajar ain Tuhan!<br>   te ie mandino pantau hai te,<br>   je baya tau sondau hong Yesus bewei.<br>     <br>          <b>Ayat 4</b> <br>     Mangasene sintam magon<br>     tuntang melai hante wei<br>     tokep dengam, hante aton<br>     bagi je bahalap te.<br>     Tampayah o Tuhan, pariksa, kasane<br>     kakenang hambruangku, ije mangkeme:<br>     hung Tuhan wei aton kuasa,kahai,<br>     manyukup katapas ain oloh samai.<br>         <h5>L.N.No.115</h5>	</p>'];
var nu_250=['<h3>250. TOH EWEH TAU MANGKEME</h3><h4>E<small>s</small>=1 (4/4)</h4>	<p align="justify">    	<b>Ayat 1</b> <br>	Toh ewe tau mangkeme sanang hai?<br>    Je harap asim, sintam je pajam hai!<br>    Yoh ije rantep dengam, o Tuhangku,<br>    manumon auh dan prentahm, Hatallangku.<br>                   <br>    	  <b>Ayat 2</b> <br>	Hamalem tuntang handau kasanang aim<br>    pahayak aku toto, je oloh aim!<br>    Kalote aku magon tau hanjak wei,<br>    te basa bakalindong hung asim te.<br>    <br>         <b>Ayat 3</b> <br>  O Tuhan, keleh haga hung andau toh,<br>  hambruan, bereng aingku dan soho Roh<br>  je brasih te marentah hung ateiku;<br>  te aku belom akam, o Tuhangku!<br>         <h5>L.N.No.130</h5>	</p>'];
var nu_251=['<h3>251. HANJAK TOTO ATEIKU</h3><h4>C=1 (3/4)</h4>	<p align="justify">    	<b>Ayat 1</b> <br>	Hanjak toto ateiku<br>        aloh kinjap buah kpehe<br>        Krana Yesus Tuhangku<br>    mampahayak aku hante.<br>    Slamat hai toh bagingku,<br>    basa Yesus Tempong ku.<br>                   <br>    	  <b>Ayat 2</b> <br>	Hung kepehe handiai,<br>    je mantakan aku hetoh.<br>    Ie Tuhan pangkahai,<br>    mangalahi musoh aingku;<br>    aku harap haliai<br>    asie ije katatai<br>    <br>         <b>Ayat 3</b> <br> 	Oloh korik, oloh hai,<br>    ije belom huang klawa<br>    dan manumon haliai<br>    auh Hatalla magon kea,<br>    ie toto sanang wei,<br>    manyak jalan slmat te.<br>    <br>          <b>Ayat 4</b> <br>     Pnatau aim kalunen toh<br>     uras akan hayang tinai;<br>     jaton oloh mimbite, yoh<br>     amon tukase jari sampai,<br>     ie matei: hayang wei,<br>     toto hayang taloh te.<br>     <br>          <b>Ayat 5</b> <br>     Taloh hung kalunen toh,<br>     nihau kilau oru keang;<br>     kahain olon lepah, yoh<br>     palus blayu kilau kambang.<br>     Tagal jete gau bewei,<br>     taloh awang bunggut te!<br>     <br>               <b>Ayat 6</b> <br>     Nyata kare oloh te<br>     awang harap Yesus toto,<br>     jaton rusak nihau wei;<br>     pnatau ayue hila ngambo,<br>     hinje Yesus, Tuhan aie<br>     aton bagie katatai.<br>     <br>               <b>Ayat 7</b> <br>     Yesus, pasi aku toh!<br>     Aku handak belom akam.<br>     Dohop, mangat aku tau<br>     palus bara bagi dengam!<br>     Trima hapus bitingku!<br>     Yesus ikau Tuhangku!<br>         <h5>L.N.No.24</h5>	</p>'];
var nu_252a=['<h3>252a. SAKATIK ITAH ATON</h3><h4>G=1 (4/4)</h4>	<p align="justify">    	<b>Ayat 1</b> <br>	Sakatik itah aton,<br>    Hung sorga eka aie,<br>    je sinta itah magon,<br>    mahaga kawan aie,<br>     mahaga kawan aie.<br>                   <br>    	  <b>Ayat 2</b> <br>	Dan amon itah rajin manuntut awan paie,<br>    te itah imbit awie manyampai sorga aie,<br>    manyampai sorga aie.<br>    <br>         <b>Ayat 3</b> <br> 	Batantu Tuhan Yesus sakatik oloh aie;<br>    Yoh ie je maliwus, manyanang kawan aie,<br>    manyanang kawan aie.<br>    <br>          <b>Ayat 4</b> <br>     Horumat tara akam, o Yesus Tuhangku;<br>     o nguan hapan sintam kakare jalangku,<br>     kakare jalangku.<br>     <br>          <b>Ayat 5</b> <br>    Katika ikei matei, o Tuhan, duan wei<br>    dan lindong agah ikei lewu sorga te,<br>    kan lewu sorga te.<br>        <h5>L.N.No.110</h5>	</p>'];
var nu_252b=['<h3>252b. SAKATIK ITAH ATON</h3><h4>E<small>s</small>=1 (4/4)</h4>	<p align="justify">    	<b>Ayat 1</b> <br>	Sakatik itah aton,<br>    Hung sorga eka aie,<br>    je sinta itah magon,<br>     mahaga kawan aie.<br>                   <br>    	  <b>Ayat 2</b> <br>	Dan amon itah rajin manuntut awan paie,<br>    te itah imbit awie manyampai sorga aie,<br>       <br>         <b>Ayat 3</b> <br> 	Batantu Tuhan Yesus sakatik oloh aie;<br>    Yoh ie je maliwus, manyanang kawan aie,<br>        <br>          <b>Ayat 4</b> <br>     Horumat tara akam, o Yesus Tuhangku;<br>     o nguan hapan sintam kakare jalangku,<br>         <br>          <b>Ayat 5</b> <br>    Katika ikei matei, o Tuhan, duan wei<br>    dan lindong agah ikei lewu sorga te,<br>            <h5>L.N.No.110</h5>	</p>'];
var nu_252c=['<h3>252c. SAKATIK ITAH ATON</h3><h4>c=1 (6/8)</h4>	<p align="justify">    	<b>Ayat 1</b> <br>	Sakatik itah aton,<br>    Hung sorga eka aie,<br>    je sinta itah magon,<br>     mahaga kawan aie.<br>                   <br>    	  <b>Ayat 2</b> <br>	Dan amon itah rajin manuntut awan paie,<br>    te itah imbit awie manyampai sorga aie,<br>       <br>         <b>Ayat 3</b> <br> 	Batantu Tuhan Yesus sakatik oloh aie;<br>    Yoh ie je maliwus, manyanang kawan aie,<br>        <br>          <b>Ayat 4</b> <br>     Horumat tara akam, o Yesus Tuhangku;<br>     o nguan hapan sintam kakare jalangku,<br>         <br>          <b>Ayat 5</b> <br>    Katika ikei matei, o Tuhan, duan wei<br>    dan lindong agah ikei lewu sorga te,<br>            <h5>L.N.No.26</h5>	</p>'];
var nu_253=['<h3>253. HARAJUR GENEP ANDAU</h3><h4>C=1 (6/8)</h4>	<p align="justify">    	<b>Ayat 1</b> <br>	Harajur genep andau Hatalla<br>    eter wei mahaga tuntang <br>    manggau* tabiri ayue te.<br>                   <br>    	  <b>Ayat 2</b> <br>	Kalote ewen sanang <br>    mahoroi jalan Aie,<br>    tau hanjak rantang magon<br>    mangkeme slamat hai!<br>       <br>         <b>Ayat 3</b> <br> 	Panginae sukup aton<br>    hung auh katoto te,<br>    katapas ayue jaton,<br>    harajur sanang wei.<br>        <br>          <b>Ayat 4</b> <br>     Sakatik ayue magahe<br>     manalih danum te,<br>     yoh danum kharingan,<br>     je mangat magon wei.<br>     <br>          <b>Ayat 5</b> <br>   Karajin Tuhan hante,<br>   nakara oloh aie<br>   harajur sanang atei.<br>   salamat haliai.<br>   <br>     <b>Ayat 6</b> <br>     Hung klawa Aie tau hanjak, <br>     je harap Ie wei;<br>     yoh sanang, mangat, puas<br>     toh atei ewen te.<br>     <br>          <b>Ayat 7</b> <br>     Kalote ewen hanjak,<br>     kasanang bagi aie,<br>     hung Yesus Juruslamat,<br>     Sakatik ungkup aie.<br>     <br>     *)manggau- dia manalua.<br>             <h5>L.N.No.26</h5>	</p>'];
var nu_254=['<h3>254. TOTO HAI KAHANJAKKU</h3><h4>D=1 (4/4)</h4>	<p align="justify">    	<b>Ayat 1</b> <br>	Toto hai kahanjaku,<br>    manyakatik aku hante,<br>     basa Yesus Tuhangku<br>     mimbit aku kante kante.<br>    Aku toh tabiri aie toh dan palus katatai.<br>                       <br>    	  <b>Ayat 2</b> <br>	Taloh kinan, ihop te.<br>    uras, uras tengae wei<br>    bereng aingku dan hamruan<br>    jaton inalua Tuhan.<br>    Aku, ije baris aie<br>    hanjak,hanjak haliai!<br>    <br>         <b>Ayat 3</b> <br> 	Ela hengan tagal te<br>    tapi talih Yesus wei,<br>    uka ikau slamat kea<br>    tuntang dapit inameae.<br>    hung eka oloh aie,<br>    uka hanjak katatai!<br>        <h5>L.N.No.138</h5>	</p>'];
var nu_255=['<h3>255. KAHANJAK DAN KASANANG TE</h3><h4>F=1 (2/4)</h4>	<p align="justify">    	<b>Ayat 1</b> <br>    Kahanjak dan kasanang te <br>    inenga Tuhan Yesus wei kan oloh je percaya;<br>    je toto belom pakat wei <br>    dan  harap Juruslamat te<br>    harajur palus dapit,<br>    harajur palus dapit.<br>                   <br>    	  <b>Ayat 2</b> <br>	Toh keleh itah handiai<br>    manumon kare prentah aie,<br>    je tinduh tuntang brasih;<br>    dan belom akan Tuhan te,<br>    nakara itah hanjak wei<br>    hong sinta ije toto,<br>    hong sinta ije toto.<br>    <br>         <b>Ayat 3</b> <br> 	Dan amon dapit itah toh<br>    malihi klunen, mangat tau<br>    hasupe tinai kanih,<br>    te itah slamat haliai<br>    manara Tuhan pangkahai<br>    hong lewu aie je brasih,<br>    hong lewu aie je brasih.<br>        <h5>L.N.No.60</h5>	</p>'];
var nu_256=['<h3>256. SANANG ATEIKU HONG YESUS</h3><h4>C=1 (3/4)</h4>	<p align="justify">    	<b>Ayat 1</b> <br>    Sanang ateiku hong Yesus,<br>    Ie Juruslamatku.<br>    Bara dosa aku liwus, <br>    Ie Batang kharapku.<br>                   <br>    	  <b>Ayat 2</b> <br>	Hapus huangku taharu<br>    mite Yesus andalku.<br>    kueh-kueh eka Yesus aton,<br>    hete kea ekaku.<br>    <br>         <b>Ayat 3</b> <br> 	Dengan slamat huang atei<br>    aku toh halisang wei;<br>    huang klahi, sampai matei<br>    aku mimbing slamat te.<br>    <br>         <b>Ayat 4</b> <br>     Huang sorga aku mite <br>     Ie, je kahanjakku<br>     Sintae, asie te ingkeme<br>     sangkom pahalisangku.<br>     <br>         <b>Ayat 5</b> <br>	Huang sorga mangat toto<br>    nyanyin oloh brasih te.<br>    Yoh malekat tuntang aku<br>    mimbit hormat akae wei.<br>        <h5>L.N.No.112</h5>	</p>'];
var nu_257a=['<h3>257a. BAYA TUHAN YESUS EKA SLAMATKU</h3><h4>B<small>s</small>=1 (4/4)</h4>	<p align="justify">    	<b>Ayat 1</b> <br>	Baya Tuhan Yesus eka slamatku<br>    Je te auh alamat ain pambelomku.<br>                   <br>    	  <b>Ayat 2</b> <br>	Tagal Ie aku anak Bapa Aie.<br>    ingalindong toto, sanang haliai.<br>    <br>         <b>Ayat 3</b> <br> 	Hanjak rantang magon tuntang hengan wei,<br>    hambaruan aingku manahiu te.<br>    <br>         <b>Ayat 4</b> <br>   Aku ije randah, papa haliai,<br>   eka sintan Yesus palus katatai.<br>     <br>         <b>Ayat 5</b> <br>	Jaton tarasanan asin Tuhangku,<br>    gantin aku matei, aku belom toh.<br>    <br> <b>Ayat 6</b> <br> Tau mantehau : Abba ! hayak melai toh<br> huang lengen Yesus, Juruslamatku.<br> <br><b>Ayat 7</b> <br>Melai toh harajur huang sinta Aie. <br>Amen! Halleluya! palus katatai. <br>        <h5>L.N.No.15</h5>	</p>'];
var nu_257b=['<h3>257b. BAYA TUHAN YESUS EKA SLAMATKU</h3><h4>C=1 (3/4)</h4>	<p align="justify">    	<b>Ayat 1</b> <br>	Baya Tuhan Yesus eka slamatku<br>    Je te auh alamat ain pambelomku.<br>                   <br>    	  <b>Ayat 2</b> <br>	Tagal Ie aku anak Bapa Aie.<br>    ingalindong toto, sanang haliai.<br>    <br>         <b>Ayat 3</b> <br> 	Hanjak rantang magon tuntang hengan wei,<br>    hambaruan aingku manahiu te.<br>    <br>         <b>Ayat 4</b> <br>   Aku ije randah, papa haliai,<br>   eka sintan Yesus palus katatai.<br>     <br>         <b>Ayat 5</b> <br>	Jaton tarasanan asin Tuhangku,<br>    gantin aku matei, aku belom toh.<br>    <br> <b>Ayat 6</b> <br> Tau mantehau : Abba ! hayak melai toh<br> huang lengen Yesus, Juruslamatku.<br> <br><b>Ayat 7</b> <br>Melai toh harajur huang sinta Aie. <br>Amen! Halleluya! palus katatai. <br>        <h5>L.N.No.76</h5>	</p>'];
var nu_258=['<h3>258. TOH ITAH SANANG ATEI SAMANDIAI</h3><h4>G=1 (4/4)</h4>	<p align="justify">    	<b>Ayat 1</b> <br>	   Toh itahsanang atei samandiai. <br>       je toto baris Tuhan hung ungkup aie. <br>       Hong Ie genep biti tau hanjak wei, <br>       krana Tuhan marar atei oloh aie te. <br>       Hanjak bewei, keleh hanjak bewe. <br>       ela tarewen tagal musoh aim te! <br>       Tampayah Yesus Kristus, Juruslamat aim. <br>       Ie jaton manalua a oloh je aie. <br>              <br>    	  <b>Ayat 2</b> <br>	Hung kare jalan ayue hong klunen toh. <br>    Hatalla magah ikau hung kuasan Roh. <br>    Kapehe ayum uras tawae bewei, <br>    suman akae wei kakenang atei aim te. <br>    Hanjak bewei, keleh hanjak bewe. <br>       ela tarewen tagal musoh aim te! <br>       Tampayah Yesus Kristus, Juruslamat aim. <br>       Ie jaton manalua a oloh je aie. <br>    <br>         <b>Ayat 3</b> <br> 	Dan amon ikau eter, harap bewei<br>    Hatalla kea meter janji aie te.<br>    Malekat aie hong sorga samandiai<br>    paham hanjak tagal slamat ayum je hai.<br>    Hanjak bewei, keleh hanjak bewe. <br>       ela tarewen tagal musoh aim te! <br>       Tampayah Yesus Kristus, Juruslamat aim. <br>       Ie jaton manalua a oloh je aie. <br>    <br>         <b>Ayat 4</b> <br>  	Yoh amon Tuhan Yesus hung asi aie,<br>    manduan ikau palus akan kahaie,<br>    te ikau toto sanang magon bewei<br>    hinje dengan Tuhan huang eka aie te.<br>     Hanjak bewei, keleh hanjak bewe. <br>       ela tarewen tagal musoh aim te! <br>       Tampayah Yesus Kristus, Juruslamat aim. <br>       Ie jaton manalua a oloh je aie. <br>                  <h5>L.N.P.No.54</h5>	</p>'];
var nu_259=['<h3>259. PAHARI BULAT ATEI</h3><h4>F=1 (4/4)</h4>	<p align="justify">    	<b>Ayat 1</b> <br>	   Pahari bulat atei dan bujur haliai,<br>       paham bahalap je te,<br>       hung oloh handiai;<br>       paham bahalap je te <br>       hung oloh handiai.<br>              <br>    	  <b>Ayat 2</b> <br>	Pahari bulat atei, kasanang bagi aie;<br>    imberkat ie hetoh dan palus katatai,<br>    imberkat ie hetoh dan palus katatai.<br>    <br>         <b>Ayat 3</b> <br> 	Pahari bulat ateie, batuah haliai;<br>    Karajaan Hatalla, te eka lewu aie,<br>    karajaan Hatalla, te eka lewu air.<br>    <br>         <b>Ayat 4</b> <br>  	Pahari bulat ateie, ingilak Tuhangku;<br>    O jaka hinje ewen tau aton bagingku,<br>    Ojaka hinje ewen tau aton bagingku!<br>             <h5>L.N.No.104</h5>	</p>'];
var nu_260=['<h3>260. O PAHARI JE IASI</h3><h4>E<small>s</small>=1 (3/4)</h4>	<p align="justify">    	<b>Ayat 1</b> <br>	   O pahari , je iasi<br>       awi Tuhan, Tempon asi:<br>       Ingat pangkat keton toh!<br>       Kilau Tuhan itah Ije,<br>       buah kea itah hinje,<br>       bulat awi sintan Roh,<br>       Bulat awi sintan Roh.<br>              <br>    	  <b>Ayat 2</b> <br>	Koan Tuhan, tempon itah,<br>    patut itah toh hasinta<br>    hapan sinta toto te.<br>    Tapi amon sinta jaton,<br>    nyata itah dia dinon<br>    bagin slamat ayue te,<br>    bagin slamat ayue te,<br>    <br>         <b>Ayat 3</b> <br> 	Eweh melai huang Tuhan?<br>    Baya oloh ije tahan<br>    melai huang sinta te.<br>    Tuhan itah puna sinta,<br>    maka oloh je hasinta<br>    tetep huang Tuhan wei,<br>    tetep huang Tuhan wei.<br>    <br>         <b>Ayat 4</b> <br>  	Sintae te malulus prentah,<br>    majar itah, uka randah<br>    dan balemo atei wei.<br>    Sinta puna mampahalap,<br>    huang sinta te khanjak,<br>    tenga Tempon sinta te,<br>    tenga Tempon sinta te.<br>    <br>        <b>Ayat 5</b> <br>    Suang atei ikei, Tuhan,<br>    hapan sintam je kahean*<br>    hayak Roh je tengam te.<br>    Yoh, paabas ikei toto,<br>    mangat ikei huang hetoh<br>    melai huang sintam wei,<br>    melai huang sintam wei.<br>    <br>         <b>Ayat 6</b> <br>     Uka, sampai ikei matei,<br>     ikei dengan toto atei<br>     sinta oloh aim samai.<br>     Tinai dapit huang sorga<br>     ikei kea tau manara<br>     aram tagal sintam te,<br>     aram tagal sintam te.<br>             <h5>L.N.No.94</h5>	</p>'];
var nu_261=['<h3>261. SALAMAT UNGKUP IJE JARI TRIMA</h3><h4>D=1 (2/4)</h4>	<p align="justify">    	<b>Ayat 1</b> <br>	Salamat ungkup ije jari trima<br>    o ikau Yesus, Juruslamatku.<br>    Kasanang ayum tame huang humae<br>    marentah oloh awang pakat wei,<br>    dan heret dengam bleku Tuhan dumah<br>    ganggu lo ie huang, sintam te;<br>    karidu klahi kejau barae kae kahanjak<br>     dan kamangat bagie wei.<br>              <br>    	  <b>Ayat 2</b> <br>	Salamat ungkup, eka oloh sama<br>    marajin Tuhan toto haliai;<br>    percaya tuntang bulat ateie kea,<br>    manggau slamat ije katatai,<br>    Yoh slamat ije heret dengam Tuhan,<br>    hung kpehe hung kahanjak magon wei;<br>    harajur sanang ie tau mansahan<br>    salepah bitie huang asim te.<br>    <br>         <b>Ayat 3</b> <br> 	Salamat ungkup, eka indu-bapa<br>    manyarah hante kare anak aie,<br>    mansahan ie hapan lakudoae<br>    hung lengem,Yesus ije sobat aie.<br>    Dan majar ie kahum katabelae<br>    mangenang Tuhan, rajin haliai<br>    manara aram dan harajur kea<br>    mananggoh Tuhan, hapan laku aie.<br>    <br>         <b>Ayat 4</b> <br>  	Salamat ungkup, eka anak oloh <br>    malalus gawie hong taharep aim,<br>    hung taloh korik kea bujur toto,<br>    pahias tumon kare prentah aim;<br>    bakotok jaton, tapi randah atei,<br>    bajenta,paris, kakal haliai;<br>    yoh slamat ie ije sampai matei<br>    harajur mingat ikau, Tuhan aie.<br>    <br>        <b>Ayat 5</b> <br>    O Yesus Kristus, ije Batang slamat<br>    dan batang berkat, palus katatai;<br>    O tame human ikei dan mampangat<br>    hung sintam, asim ije toto hai.<br>    Yoh Tuhan Yesus, ije toh ingenang<br>    salepah atei ikei handiai;<br>    o pasi, mangat ikei toto sanang,<br>    salamat kea apalus katatai.<br>         <h5>L.N.No.57</h5>	</p>'];
var nu_262=['<h3>262. SINTA PUNA PANJANG ATEI</h3><h4>A=1 (4/4)</h4>	<p align="justify">    	<b>Ayat 1</b> <br>	Sinta puna panjang atei,<br>    tau basara haliai.<br>     Ie kinjap kilau lelei akan oloh handiai <br>    Ie eter jaton hobah handiai.<br>    tuntang jaton haliai terai tuntang<br>    bagalabah, tapi tahan katatai.<br>              <br>    	  <b>Ayat 2</b> <br>	Sinta jaton tara-tara<br>    tagal kare gawi aie,<br>    klait, kajoho dan kapapa<br>    kejau bara eka aie.<br>    Ie rajin wei manutup<br>    kare taloh handiai,<br>    manyarenan dan mandohop,<br>    harap taloh handiai.<br>    <br>         <b>Ayat 3</b> <br> 	Sinta te panengan Tuhan,<br>    ije Tempon sinta te.<br>    Kmangat sorga je kahean<br>    mohon hayak sinta te<br>    akan oloh ije toto<br>    muap akae atei aie,<br>    akan sinta bara ngambo <br>    ije melai katatai.<br>                 <h5>L.N.No.14</h5>	</p>'];
var nu_263=['<h3>263. SALAMAT KARE OLOH TE</h3><h4>D=1 (4/4)</h4>	<p align="justify">    	<b>Ayat 1</b> <br>	Salamat kare oloh te je ateie toto<br>    pakat wei manempo Tuhan Pangkahai<br>     harajur palus katatai<br>              <br>    	  <b>Ayat 2</b> <br>	Salamat kare oloh te<br>    je ihanjean Tuhan wei<br>    hong sinta ayue,huang roh,<br>    hapeteng bulat ateie toh.<br>    <br>         <b>Ayat 3</b> <br> Salamat kare oloh te<br> je himat ateie belom wei<br> kan Tuhan ije pangkahai<br> mananjong hong taharap aie.<br>    <br>        <b>Ayat 4</b> <br>    Salamat kare oloh te <br>    je handau dan hamalem wei <br>    manyarah toh pambelom aie<br>    hong lengen Tuhan Pangkahai.<br>             <h5>L.N.No.40</h5>	</p>'];
var nu_264=['<h3>264. YESUS MARAWEI ITAH SAMAI</h3><h4>B<small>es</small>=1 (4/4)</h4>	<p align="justify">    	<b>Ayat 1</b> <br>	Yesus marawei itah samai,<br>    talih toh Ie hining auh aie!<br>    Ie manenga slamat kahai,berkat kasae,<br>    mangat toto ewen handiai<br>    ije jari omba rawei aie.<br>    Hung asie ewen samandiai <br>    tau tame sorga aie.<br>              <br>    	  <b>Ayat 2</b> <br>	Has talih Yesus, sarah bewei,<br>    akae salepah biti aim te!<br>    Ie kalindong kan oloh aie,<br>    yoh asie paham hai.<br>    Mangat toto ewen samandiai<br>    tau tame sorga aie.<br>        <br>         <b>Ayat 3</b> <br> Harap batantu auh janjie wei!<br> Ie malalus jate samai.<br> Ie mampangat hambruam te,<br> hetoh dan hung kahaie.<br> Mangat toto ewen handiai<br> ije jari omba tawei aie.<br> Hung asie ewen samandiai<br> tau tame sorga aie.<br>         <h5>L.N.No.53</h5>	</p>'];
var nu_265=['<h3>265. O TANGGOH YESUS, YOH TANGGOH WEI</h3><h4>B<small>es</small>=1 (4/4)</h4>	<p align="justify">    	<b>Ayat 1</b> <br>	O tanggoh Yesus, yoh tanggoh wei!<br>    Ie je juruslamat aim te.<br>     Ie marawei: Hining auh aie,<br>    trima slamat hai!<br>    mangat, mangat bagi ayum te,<br>    bara dosa empas brasih wei.<br>    Tintum Yerusalem ngambo te:<br>    toh omba Yesus wei!<br>                 <br>    	  <b>Ayat 2</b> <br>	Toh ela langak , trima auh aie,<br>    palus percaya, eter bewei.<br>    Ie kalindong  itah samai.<br>    Ie Panewus te.<br>    Mangat, mangat bagi ayum te,<br>    bara dosa empas brasih wei.<br>    Tintum Yerusalem ngambo te:<br>    toh omba Yesus wei!<br>        <br>         <b>Ayat 3</b> <br> Harap batantu, harap bewei,<br> Yesus je Jeruslamat aim te<br> jari mananggong dosam samai:<br> panengae slamat hai.<br> Mangat, mngat bagi ayum te<br> bara dosa empas brasih wei.<br> Tintum Yerusalem ngambo te:<br> toh omba Yesus wei!<br>         <h5>L.N.No.53</h5>	</p>'];
var nu_266=['<h3>266. TOH ATON AUH BAHALAP</h3><h4>D=1 (3/4)</h4>	<p align="justify">    	<b>Ayat 1</b> <br>	Toh atoh auh bahalap,<br>    marawei keton toh,<br>    insanan awi Yesus, <br>    inyaksi awi Roh;<br>    auh rawei ayue mangat,<br>    barega haliai, <br>    auh ampong tuntang slamatkan oloh handiai:<br>    Kantoh, talih aku, has kan toh keton kantoh,<br>    je heka katanggongan, has kantoh keton toh.<br>    Kantoh, keton kantoh, has kantoh<br>              <br>    	  <b>Ayat 2</b> <br>	Toh ela, o pahari, manolak sinta aie.<br>    te ikau bara bagi hung Ie katatai.<br>    yoh aloh kare dosam, kasalam te samai<br>    bahandang kilau daha, has trima raweiaie!<br>    "kantoh, talih aku, has kantoh keton, kantoh,<br>    je heka katanggongan, has kantoh keton toh.<br>    Kantoh keton kantoh, has kentoh keton kantoh,<br>    te aku handak mampong, mampangat keton toh!"<br>        <h5>L.N.P.No.53</h5>	</p>'];
var nu_267=['<h3>267. YESUS SINTA IKAU</h3><h4>C=1 (6/8)</h4>	<p align="justify">    	<b>Ayat 1</b> <br>	Yesus sinta ikau, mentai ikau wei;<br>    ela magon langak, hining rawie aie!<br>    Ela ranjar ranjra, has toh tukas wei!<br>    Sarah bitim akae, wei ela langak!<br>    Yesus sinta ikau, talih ie wei!<br>    Ie mentai ikau toh, ela langak!<br>                  <br>    	  <b>Ayat 2</b> <br>	Rawei ayue mangat, hining kabar toh!<br>    Aloh dosa paham, ie mampun te.<br>    Eka ikau mikeh, harap ie wei!<br>    Tuhan mentai hung kataue : ela langak!<br>    Yeus sinta ikau, talih ie wei!<br>    Ie mentai ikau toh, ela langak!<br>    <br>        	  <b>Ayat 3</b> <br>          Yesus magon mentai sampai andau toh,<br>          aya-ayau ikau omba rawei aie.<br>          Tenga aie bahalap, tumon janji aie,<br>          ie mampong atei aim : ela langak!<br>          Yesus sinta ikau, talih ie wei!<br>          Ie mentai ikau toh, ela langak!<br>          <br><b>Ayat 4</b> <br>Amon wayahe sampai, tumon tukas aie <br>Tuhan Yesus dumah tinai hung kahai. <br>Palus ie magah oloh ayue te <br>omba tame hung kahaie : ela langak! <br>Yesus sinta ikau, talih ie wei!<br>Ie mentai ikau toh, ela langak!<br>        <h5>L.N.P.No.23</h5>	</p>'];
var nu_268=['<h3>268. KANDUEM TOH MENTAI, PAHARI?</h3><h4>A=1 (6/8)</h4>	<p align="justify">    	<b>Ayat 1</b> <br>	Kanduem toh mentai, pahari?<br>    Has singkap slamat hai te,<br>    je jari inyimpan Hatalla,<br>    imbagi inenga bewei!<br>    Narai entaim?<br>    Talih, trima bagin salamat hai te.<br>                  <br>    	  <b>Ayat 2</b> <br>	En gunae manunggo,pahari?<br>    manahi kapehe aim te?<br>    Kasanang, kaharap batantu<br>    tau aton hung Yesus bewei.<br>    Narai entaim? Mbuhen toh bembang bewei?<br>    Talih, trima bagin slamat hai te!<br>    <br>        	  <b>Ayat 3</b> <br>        Toh Roh tuntang ungkup Hatalla<br>        mangahau : o hining auh aie,<br>        sarai toh daha ain Yesus<br>        hakotak kan oloh samai!<br>        Narai entaim? Mbuhen toh bembang bewei?<br>        Talih, trima bagin salamat hai te!<br>          <br><b>Ayat 4</b> <br>Salamat, je jari irawei<br>kan sorga kan pesta je hai!<br>Bajeleng bauntonggang ingunci,<br>te sayup, te sayup, akai!<br>Narai entaim? Mbuhen to bambang bewei?<br>Talih, trima bagin salamat hai te!<br>    <h5>L.N.P.No.25</h5>	</p>'];
var nu_269=['<h3>269. O HINING WEI!</h3><h4>B<small>es</small>=1 (4/4)</h4>	<p align="justify">    	<b>Ayat 1</b> <br>	O hining wei! Auh Ewanggelion, marawei ikau toh <br>    kan pesta hai, inyimpan Tuhangku<br>    kan oloh handiai.<br>     yoh huang huma ain Hatalla<br>    inatap eka melai akam.<br>    O hining wei O hining wei!<br>                  <br>    	  <b>Ayat 2</b> <br>	Has omba wei! Hatall mentai toh<br>    panumah ayum te.<br>    O awat ah pambelom ayum toh<br>    kan eka slamat te!<br>    Toh hindai sayup, O pahari,<br>    toh hindai lepah wayah asi.<br>    Has omba wei, has omba wei!<br>    <br>        	  <b>Ayat 3</b> <br>       O ingat wei! Jam asin Tuhan te<br>       tau pandak haliai.<br>       Salenga ih bauntonggang sorga te<br>       ingunci katatai.<br>       Tehayang wei auh tangis tatum,<br>       te sayup kare auh lakum:<br>       O uap wei! O uap wei!<br>           <h5>L.N.P.No.34</h5>	</p>'];
var nu_270=['<h3>270. BAHALAP TOTO KABAR</h3><h4>C=1 (4/4)</h4>	<p align="justify">    	<b>Ayat 1</b> <br>	Bahalap toto kabar, je samapai itah<br>    toh tahiu asin Tuhan dan sinta je paham.<br>    Yoh Tuhan sinta itah,dan huang sinta aie<br>    inyohoe Kristus Yesus, manewus itah toh.<br>    Yoh, Tuhan sinta itah, dan huang sinta aie<br>    inyohoe Kristus Yesus, manewus itah toh!<br>                  <br>    	  <b>Ayat 2</b> <br>	Toh, hining Tuhan Yesus, je Juruslamat te,<br>    marawei, mangat itah manalih ie wei.<br>    Yoh talih ie, ikau je uyuh haliai,<br>    je heka, katanggongan, te sanang atei aim.<br>    Yoh Tuhan sinta itah, dan huang sinta aie<br>    inyohoe Kristus Yesus, manewus itah toh.<br>    <br>        	  <b>Ayat 3</b> <br>      Kasanang aie inengae,kamangat toto te;<br>      kahanjak bagin oloh, je harap ie wei.<br>      Yoh, aloh kutoh dosa mambehat atei aim,<br>      batantu ie mampun, mampuas te samai.<br>      Yoh Tuhan sinta itah, dan huang sinta aie<br>      inyohoe Kristus Yesus, manewus itah toh.<br>      <br>            <b>Ayat 4</b> <br>      Has,baring akan Tuhan kakare tanggong aim!<br>      Te angat aim mahian, kasanang bagim wei.<br>      Dan ikau tau mananjong hung jalan Tuhan te,<br>      hong asie ie magon pahayak ikau wei.<br>      Yoh Tuhan sinta itah, dan huang sinta aie<br>      inyohoe Kristus Yesus, manewus itah toh.<br>      <br>      <b>Ayat 5</b> <br>      Hatalla mangkat ikau manjadi anak aie,<br>      manenga hormat akam; panatau ije hai.<br>      Dan tinai ikau sondau hong Yesus, Tuhan te,<br>      pahari ije bujur dan tanggar wei.<br>      Yoh Tuhan sinta itah, dan huang sinta aie<br>      inyohoe Kristus Yesus, manewus itah toh.<br>           <h5>L.N.P.No.6</h5>	</p>'];
var nu_271=['<h3>271. KANTOH KETON, TALIH AKU</h3><h4>D<small>es</small>=1 (3/4)</h4>	<p align="justify">    	<b>Ayat 1</b> <br>	" Kantoh keton, talih aku, kantoh keton handiai,<br>    ije heka , katanggongan, kemetoh kamangat hai!<br>    Kai auh  Yesus o pahari!<br>    Hining hining ah auh rawei trima kare sinta aie!<br>    trima kare sinta aie!<br>                  <br>    	  <b>Ayat 2</b> <br>	" Kepan awisku hong keton, hajar intu aku toh;<br>    krana aku toh balemo tuntang randah ateiku."<br>    Kai auh Yesus, o pahari!<br>    Hining, hining ah auh rawei, trima kare sinta aie!<br>    trima kare sinta aie!<br>    <br>        	  <b>Ayat 3</b> <br>     "Tumon jete keton palus sondau ksanang, slamat te;<br>     krana awis aingku lamos , puatku mahian wei."<br>     Kai auh Yesus, o pahari!<br>     Hining, hining ah auh rawei, trima kare sinta aie!<br>     trima kare sinta aie!<br>          <h5>L.N.No.26</h5>	</p>'];
var nu_272=['<h3>272. KAN KUEH,KAN KUEH</h3><h4>A<small>s</small>=1 (6/8)</h4>	<p align="justify">    	<b>Ayat 1</b> <br>	Kan kueh, kan kueh paharingku?<br>    kan kueh pangguet aim?<br>    kan kueh toh darim, sobatku?<br>    En bujur tanjong aim?<br>    kan kueh, kan kueh?<br>                  <br>    	  <b>Ayat 2</b> <br>		En tintue lawin jalam te,<br>        en jete slamat hai?<br>        Atawa kabinasa wei,<br>        je palus katatai?<br>        Kan kueh, kan kueh?<br>    <br>        	  <b>Ayat 3</b> <br>  O ingat : due eka wei<br>  inintu itah toh:<br>  salamat ije katatai<br>  atawa hukum hai!<br>  Kan kueh, kan kueh?<br>  <br>           <b>Ayat 4</b> <br>      O pasi ah pambelom aim,<br>      o pasi arepm wei!<br>      Hasm hakan bagi papa te<br>      dan goang slamat hai!<br>      Kan kueh, kan kueh?<br>      <br>              <b>Ayat 5</b> <br>     Has buli weim has buli wei  <br>     kan human Bapa aim,   <br>     je mentai ikau magon wei <br>     hong ngambo, hong kahai!  <br>     Has buli wei!   <br>         <h5>R.L.184</h5>	</p>'];
var nu_273=['<h3>273. BULI TINAI,  BULI TINAI</h3><h4>E<small>s</small>=1 (4/4)</h4>	<p align="justify">    	<b>Ayat 1</b> <br>	Buli tinai, buli tinai <br>    ikau ije layang toh,<br>     Ije jayong bara Bapam kejau toto dangae toh;<br>      Ikau ije asi asi,ije nihau wei karasih, <br>      dan pakayam jeharier,robo, <br>      papa haliai; buli bele matei meher<br>    hong kasusah ije hai!<br>              <br>    	  <b>Ayat 2</b> <br>		Bapam ije raju-rajur<br>        mentai ikau, anak aie;<br>        sintae dengam jaton tendur,<br>        asie toto paham hai.<br>        Kare ksalam sia men-men,<br>        asal atei huangm lenyoh<br>        hong kanyasal toto te,<br>        asal ikau buli wei!<br>    <br>        	  <b>Ayat 3</b> <br>  		Buli ikau anak busu<br>        hong karandah ateim wei;<br>        asal buli toto-toto<br>        akan human Bapam wei!<br>        Ela mado jaton gunae!<br>        Kare utang dosam punah<br>        awi sintan, asin Bapam <br>        ije manangkalau wei<br>        kare0kare tirok huangm.<br>        Buli tanggoh Bapam wei!<br>  <br>           <b>Ayat 4</b> <br>    Bapam paham angat huange<br>    dengam ije pehe toh;<br>    sintae asie te manambang<br>    ikau ije anake, yoh<br>    asal wei inggaum karantep<br>    sium sintae palus matep<br>    kare auh kanyasal atei,<br>    uyat aim imalok wei.<br>    Bapam hanjak rantang ateie<br>    asal ikau buli wei!<br>      <br>              <b>Ayat 5</b> <br>   Palus klambim inakiri<br>   hapan je taheta wei,<br>   ije bungam tuntang brasih<br>   je katetek arae te.<br>   Buli, mangat ikau slamat,<br>   jaton beken jalan awat<br>   akan ije jari rusak,<br>   matei hong kalayang wei.<br>   Has toh buli, ela langak,<br>   horoi jalan awat te.<br>   <br>            <b>Ayat 6</b> <br>       Langkap lihi eka kaput, <br>       kare punga, tipu wei; <br>       himat palus toh manuntut <br>       jalan akan klawa te! <br>       Ite kayu sampalaki, <br>       eka Tuhan manakiri! <br>       Lengee toh indepe akam  <br>       tantai trima ikau wei, <br>       mimbit ikau buli Bapam <br>        akan eka slama te. <br>           <h5>R.L.178</h5>	</p>'];
var nu_274=['<h3>274. KELEH AH TOH OMBA YESUS</h3><h4>E<small>s</small>=1 (4/4)</h4>	<p align="justify">    	<b>Ayat 1</b> <br>	Keleh ah toh omba Yesus <br>     metoh magon hamduh toh! <br>     Ela sayup. tapi palus talih <br>     Ie huang Roh! <br>              <br>    	  <b>Ayat 2</b> <br>		Ela mentai sampai andau <br>        jari liwa haliai! <br>        Te bahali ikau sondau <br>        tantu sayup haliai! <br>    <br>        	  <b>Ayat 3</b> <br>  		Ela sampai matanandau <br>        belep tuntang kaput wei; <br>        helo buah ikau sondau <br>        Yesus Juruslamat te! <br>  <br>           <b>Ayat 4</b> <br>    Bele ikau kareh pehe <br>    hong kapijeme haliai, <br>    eka tangis tuntang kikeh <br>    melai palus katatai! <br>      <br>              <b>Ayat 5</b> <br>   Langkop toh manalih Yesus <br>   helo bara andau te <br>   manyalenga tuntang palus <br>   ikau matei bayang wei! <br>   <br>            <b>Ayat 6</b> <br>      Hobah metoh aton dohop <br>      huang wayah asi toh! <br>      Ela ranjar bele sayup, <br>      talih Yesus palus toh <br>       <br>              <b>Ayat 7</b> <br>       Tuhan Yesus wei kalawa<br>       huang jam pampateim te.<br>       Baya Ie toto magah <br>       akan lewu sorga te!<br>       <br>              <b>Ayat 8</b> <br>       Hung kahinjee ikau sanang<br>       palus omba hong kahai,<br>       dan harajur hanjak rantang<br>       palus sampai katatai!<br>           <h5>R.L.178</h5>	</p>'];
var nu_275a=['<h3>275a. RUAR BARA YESUS JURUSLAMAT TE</h3><h4>B<small>es</small>(C)=1 (4/4)</h4>	<p align="justify">    	<b>Ayat 1</b> <br>	Ruar bara Yesus Juruslamat te<br>    huang atei aton tangis tatum wei.<br>              <br>    	  <b>Ayat 2</b> <br>		Tapi amon itah toto baris aie<br>        atei itah suni, sanai haliai.<br>    <br>        	  <b>Ayat 3</b> <br>  		Itah hanjak toto huang sintae te,<br>        sanang tuntang mangat itah hante wei.<br> 	 <br>           <b>Ayat 4</b> <br>  		Sala bara Tuhan atei kaput wei,<br>        baya Ie mimbit klawan sorga te,<br>      <br>              <b>Ayat 5</b> <br>   		Je manyingah toto hong kakaput te,<br>        mamplawa jalan akan sorga wei.<br>   <br>            <b>Ayat 6</b> <br>     Baya Tuhan Yesus mimbit slamat hai,<br>     slamat bara sorga ije katatai.<br>       <br>              <b>Ayat 7</b> <br>     Keleh jaka kare oloh handiai<br>     tau kasene sintan Juruslamat aie.<br>       <br>              <b>Ayat 8</b> <br>     Tantu rata-rata ewen te samai<br>     palus tanggoh Yesus jadi baris aie.<br>     <br>               <b>Ayat 9</b> <br>        Atei ewen sanang hanjak haliai<br>        huang slamat Tuhan, toh dan katatai.<br>            <h5>L.N.No.15</h5>	</p>'];
var nu_275b=['<h3>275b. RUAR BARA YESUS JURUSLAMAT TE</h3><h4>G=1 (3/4)</h4>	<p align="justify">    	<b>Ayat 1</b> <br>	Ruar bara Yesus Juruslamat te<br>    huang atei aton tangis tatum wei.<br>              <br>    	  <b>Ayat 2</b> <br>		Tapi amon itah toto baris aie<br>        atei itah suni, sanai haliai.<br>    <br>        	  <b>Ayat 3</b> <br>  		Itah hanjak toto huang sintae te,<br>        sanang tuntang mangat itah hante wei.<br> 	 <br>           <b>Ayat 4</b> <br>  		Sala bara Tuhan atei kaput wei,<br>        baya Ie mimbit klawan sorga te,<br>      <br>              <b>Ayat 5</b> <br>   		Je manyingah toto hong kakaput te,<br>        mamplawa jalan akan sorga wei.<br>   <br>            <b>Ayat 6</b> <br>     Baya Tuhan Yesus mimbit slamat hai,<br>     slamat bara sorga ije katatai.<br>       <br>              <b>Ayat 7</b> <br>     Keleh jaka kare oloh handiai<br>     tau kasene sintan Juruslamat aie.<br>       <br>              <b>Ayat 8</b> <br>     Tantu rata-rata ewen te samai<br>     palus tanggoh Yesus jadi baris aie.<br>     <br>               <b>Ayat 9</b> <br>        Atei ewen sanang hanjak haliai<br>        huang slamat Tuhan, toh dan katatai.<br>            <h5>L.N.No.76</h5>	</p>'];
var nu_276=['<h3>276. HAS ALEM KAREH DUMAH</h3><h4>F=1 (4/4)</h4>	<p align="justify">    	<b>Ayat 1</b> <br>	Has! Alem kareh dumah; <br>    Hayak jajewu toh metoh <br>     hong kata belam  <br>    talih Yesus,  <br>  		   yoh sarah toh akae  <br>   lepah biti hambruan aim! <br>    Has! Amon alem sampai <br>     sayup haliai! <br>              <br>    	  <b>Ayat 2</b> <br>		Has! Alem kareh dumah! <br>        Hong bentok andau toh <br>        metoh hong katagangam <br>        talih yesus toh! <br>        Hapan salepah kaabas <br>        kan hormat Tempom toh! <br>        Has! Amon alem sampai <br>        sayup haliai! <br>    <br>        	  <b>Ayat 3</b> <br>  		Has! alem tokep sampai, <br>        jari halemei toh! <br>        Ingat ah : gulong halau <br>        wayah asi toh! <br>        Umur aim puna pandak, <br>        toh singkap slamat hai! <br>        Amon pampatei sampai <br>        sayup haliai! <br> 	               <h5>R.L.455</h5>	</p>'];
var nu_277=['<h3>277. TAME WEI, TAME WEI</h3><h4>G=1 (2/2),(3/2)</h4>	<p align="justify">    	<b>Ayat 1</b> <br>	Tame wei, tame wei toh bauntonggang seke te! <br>    Aran ayue te kahobah, horoi jete palus wei; <br>    Ie puna handak magah akan jalan simit, benyem te; <br>    tame wei , tame wei! <br>              <br>    	  <b>Ayat 2</b> <br>		Miar wei, miar wei, <br>        huang jalan simit te; <br>        Aloh ateim bembang toh; <br>        Tame wei bauntonggang seke <br>        palus horoi jalan simit te; <br>        Miar wei, miar wei! <br>    <br>        	  <b>Ayat 3</b> <br>  		Jaga wei, jaga wei  <br>        bele je paningkes te <br>        mimbit akan sampang jalan  <br>        palus mampalayang wei. <br>        Krana jete malampangan <br>        kutoh  kpehe dan kasusah wei. <br>        Jaga wei, jaga wei! <br> 	 <br>           <b>Ayat 4</b> <br>  		Hakan wei, hakan wei <br>        jalan ije lombah te, <br>        je ihoroi kutoh oloh <br>        awi rami haliai. <br>        Tapi tintue te kamungoh, <br>        kabinasa palus katatai. <br>        Hakan wei, hakan wei! <br>      <br>              <b>Ayat 5</b> <br>   		Himat wei, himat wei <br>        goang taroh ngambo te, <br>        je inatap awi Tuhan <br>        akan genep oloh te <br>        ije hobah tuntang tahan <br>        miar manyak jalan simit te. <br>        Himat wei, himat wei! <br>   <br>            <b>Ayat 6</b> <br>     Hanjak wei, hanjak wei <br>     krana jalan simit te <br>     magah ikau akan sorga <br>     kan pambelom dan kahai, <br>     kan Yerusalem taheta, <br>     akan slmat ije katatai. <br>     Hanjak wei, hanjak wei! <br>          <h5>R.L.No.384</h5>	</p>'];
var nu_278=['<h3>278. INGAT, TUHAN MENDENG TOH</h3><h4>E<small>s</small>=1 (4/4)</h4>	<p align="justify">    	<b>Ayat 1</b> <br>	Ingat, Tuhan mendeng toh  <br>    magon hong bauntonggang ateim! <br>   Hining tegah ayue, <br>   yoh uap dengan khanjak ateim! <br>   Tuhan handak ta metoh huang Roh! <br>              <br>    	  <b>Ayat 2</b> <br>		Amon ikau muap toh <br>        ateim akae ije maja, <br>        te bauntonggang sorgae aie <br>        dapit buap akam kea. <br>        Palus dinom slamat hai, <br>        katatai! <br>       <h5>L.N.No.96</h5>	</p>'];
var nu_279=['<h3>279. KAHALAP PANATAU KALUNEN</h3><h4>B<small>es</small>=1 (4/4)</h4>	<p align="justify">    	<b>Ayat 1</b> <br>	Kahalap panatau kalunen, <br>    kamangat kahanjak aie mahalau jaton <br>    dehen hanjulo haliai. <br>              <br>    	  <b>Ayat 2</b> <br>		Karami te jaton lalangen,* <br>        kahalap aie gitangku. <br>        Te mahin taloh beken <br>        ingenang ateiku. <br>         <br>    <b>Ayat 3</b> <br>   Kasanangku are pahari<br>   je magon bewei manggau<br>   panginan hung karami<br>   hambruae hante blau.<br>   <br>      <b>Ayat 4</b> <br>   Kalunen toh jaton mambesoh<br>   kalaun hambaruan aie,<br>   harajur ateie deroh,<br>   papungut haliai.<br>   <br>       <b>Ayat 5</b> <br>    Kaontong, katuah je are<br>    ingenange harajur wei.<br>    Karugi, sial kawe**<br>    iulihe gantin te.<br>    <br>       <b>Ayat 6</b> <br>    Te atei ain itah marako,***<br>    bagisah dan hetang wei.<br>    Harajur haus mandino<br>    salamat toto te.<br>    <br>         <b>Ayat 7</b> <br>    O hining wei: slamat ain Tuhan  <br>    kahanjak je katatai.<br>    inatap tuntang simpan <br>    kan itah handiai.<br>    <br>    <b>Ayat 8</b> <br>    Hung bukit Golgota kamanang,<br>    hong hete batonggal wei<br>    hambruan puas sanang<br>    dan hanjak palus wei.<br>    <br>        <b>Ayat 9</b> <br>    Hong hete Tabirin Hatalla<br>    manyapan kalunen toh<br>    haluli dengan Bapae<br>    je muap sorga toh.<br>    <br>        <b>Ayat 10</b> <br>    Toh keleh kakare pahari <br>    je heka dan uyuh wei<br>    hapakat dari-dari<br>    manalih bukit te.<br>    <br>         <b>Ayat 11</b> <br>     Hong hete kahetang ingganti<br>     nampuli kahanjak hai,<br>     hong hete jalan buli<br>     ka slamat katatai.<br>    <br>        ___________________________________________________<br>    *)  lalangen		= sukup haliai	<br>    **) sial kawe 		= sial ije pangkahai	<br>    ***)marako    		= manjadi hai awi aton pangaruh.<br>    <h5>R.L.N.No.198</h5>	</p>'];
var nu_280a=['<h3>280a. BRITA SLAMAT JARI DUMAH</h3><h4>G=1 (6/8)</h4>	<p align="justify">    	<b>Ayat 1</b> <br>	Brita salamat jari dumah, murik sampai hulu toh,<br>    huang bentok pulau itah klawa aie mamala toh.<br>    Hallelutya, Yesus manang! Hanjak toto oloh aie,<br>    Keton ije hindai sanang trima, trima slamat hai!<br>              <br>    	  <b>Ayat 2</b> <br>		Misik, mendeng, blawa ikau, utus eka sintangku!<br>        Krana klawam aton dumah huang wayah asi toh.<br>        Halleluya, Yesus manang! Hanjak toto oloh aie.<br>        Keton, ije hindai sanang , trima, trima slamat hai!<br>        <br>                <b>Ayat 3</b> <br>   	O jajaga huang kota: "Pire kambon alem toh?"<br>    " Hila timor handak blawa, langit mahahindang toh!"<br>    Halleluya, Yesus manang ! Hanjak toto oloh aie.<br>    Keton ije hnadia sanang, trima, trima slamat hai!<br>    <br><b>Ayat 4</b> <br>Imbit oloh haban pehe, rawei oloh korik hai,<br>soho anak ayum tame panyangkowong kalawa aie.<br>Halleluya, Yesus manang! Hanjak toto oloh aie.<br>Keton, ije hindai sanang, trima,trima slamat hai!<br><br><b>Ayat 5</b> <br>Pendeng toh bandera slamat intu hunjun bukit hai!<br>Keleh saran tasik pakat tanggoh Juruslamat aie!<br>Halleluya, Yesus manang! Hanjak toto oloh aie.<br>Keton, ije hindai sanang, trima, trima slamat hai!<br><br><b>Ayat 6</b> <br>   Bulau. mutiara,hintan bakal lewu sorga te. <br>   Slamat oloh Kalimantan, ije tame lewu te!<br>   Halleluya, Yesus manang! Hanjak toto oloh aie.<br>   Keton,ije hindai sanang ,trima,trima slamat hai!<br>       <h5>L.N.P.No.8</h5>	</p>'];
var nu_280b=['<h3>280b. BRITA SLAMAT JARI DUMAH</h3><h4>E <small>s</small>=1 (4/4)</h4>	<p align="justify">    	<b>Ayat 1</b> <br>	Brita salamat jari dumah, murik sampai hulu toh,<br>    huang bentok pulau itah klawa aie mamala toh.<br>    Hallelutya, Yesus manang! Hanjak toto oloh aie,<br>    Keton ije hindai sanang trima, trima slamat hai!<br>              <br>    	  <b>Ayat 2</b> <br>		Misik, mendeng, blawa ikau, utus eka sintangku!<br>        Krana klawam aton dumah huang wayah asi toh.<br>        Halleluya, Yesus manang! Hanjak toto oloh aie.<br>        Keton, ije hindai sanang , trima, trima slamat hai!<br>        <br>                <b>Ayat 3</b> <br>   	O jajaga huang kota: "Pire kambon alem toh?"<br>    " Hila timor handak blawa, langit mahahindang toh!"<br>    Halleluya, Yesus manang ! Hanjak toto oloh aie.<br>    Keton ije hnadia sanang, trima, trima slamat hai!<br>    <br><b>Ayat 4</b> <br>Imbit oloh haban pehe, rawei oloh korik hai,<br>soho anak ayum tame panyangkowong kalawa aie.<br>Halleluya, Yesus manang! Hanjak toto oloh aie.<br>Keton, ije hindai sanang, trima,trima slamat hai!<br><br><b>Ayat 5</b> <br>Pendeng toh bandera slamat intu hunjun bukit hai!<br>Keleh saran tasik pakat tanggoh Juruslamat aie!<br>Halleluya, Yesus manang! Hanjak toto oloh aie.<br>Keton, ije hindai sanang, trima, trima slamat hai!<br><br><b>Ayat 6</b> <br>   Bulau. mutiara,hintan bakal lewu sorga te. <br>   Slamat oloh Kalimantan, ije tame lewu te!<br>   Halleluya, Yesus manang! Hanjak toto oloh aie.<br>   Keton,ije hindai sanang ,trima,trima slamat hai!<br>       <h5>DSL.99</h5>	</p>'];
var nu_281=['<h3>281. ALOH LANGIT PETAK NIHAU</h3><h4>G=1 (4/4)</h4>	<p align="justify">    	<b>Ayat 1</b> <br>	Aloh langit petak nihau, lilap wei,<br>    aloh musoh hayak mawi itah wei.<br>    Itah harap Yesus tuntang auh aie wei:<br>    Aku hinje keton sining andau wei . . . wei.<br>              <br>    	  <b>Ayat 2</b> <br>		Matanandau, bulan, bintang te samai<br>        huang lengen Tuhan sanang haliai.<br>        Menteng, o pahari, harap auh aie wei.<br>        "Aku hinje keton sining andau wei.<br>        Menteng, o pahari, harap auh aie wei.<br>        "Aku hinje keton sining andau wei.<br>        <br>                <b>Ayat 3</b> <br>   		Kare batang petak, pulau korik hai<br>        sasa-sasar hanjak huang klawa aie.<br>        Sampai Yesus dumah tuntang utus aie<br>        kareh melai dengae palus katatai!<br>        Sampai Yesus dumah tuntang utus aie<br>        kareh melai dengae palus katatai!<br>            <h5>L.N.P.No.3</h5>	</p>'];
var nu_282=['<h3>282. O TUHAN YESUS, IKEI TOH</h3><h4>B<small>s</small>=1 (4/4)</h4>	<p align="justify">    	<b>Ayat 1</b> <br>	O Tuhan Yesus, <br>    ikei toh manumon soho Aim;<br>    te eweh tau mambalang toh <br>    kami argawi Aim;<br>    Yoh aloh bawak parei te hung <br>     petak kilau matei wei,<br>    temahin lembut, during aie,<br>     rahian karebua aie, <br>    tau masak wei hong lason andau te.<br>                      <br>    	  <b>Ayat 2</b> <br>		Mahoroi jalan kpehe te,<br>        je puna jalan Aim,<br>        o Tuhan, murid Ayum te<br>        manuntut awan paim!<br>        Tampayah ikei toh samai,<br>        je mingat kare peteh Aim!<br>        O agah ungkup Ayum te<br>        mahoroi taloh kaput te<br>        kan klawa Aim, kan klawa, kan kahaim!<br>        <br>                <b>Ayat 3</b> <br>   		Yoh, kilau bawak parei te,<br>        kai horan biti Aim<br>        insahan huang kubur te,<br>        imbelom hung kahai.<br>        O Mantir ain pambelom te,<br>        je Tempon kare utus te,<br>        karinah gulong kuasa Aim.<br>        Yoh pisik oloh korik hai,<br>        paabas to saroham hapan Roh!<br>            <h5>L.N.No.131</h5>	</p>'];
var nu_283a=['<h3>283a. KAKARE UNGKUP ITAH</h3><h4>C=1 (4/4)</h4>	<p align="justify">    	<b>Ayat 1</b> <br>	Kakare ungkup itah inyoho Raja hai,<br>     manggatang toh banderae,<br>    manjadi saksi aie,<br>    mangumbang hapus petak mansanan gawi aie;<br>    mambritae dengan khanjak kan oloh handiai.<br>                  <br>    	  <b>Ayat 2</b> <br>		Toh keleh itah bulat hong sinta ayur te,<br>        dan ela baya mingat nahiu arep wei!<br>        O ungkup ayun Kristus je puna bereng aie,<br>        has tuntut Ie palus, je Raja Pangkahai.<br>        <br>                <b>Ayat 3</b> <br>   		Toh keleh kare itah mahormat arae wei;<br>        mambrita kare sintae, manarong gawie te.<br>        Yoh Tuhan Rajan ksanang, kuasae dan kahaie,<br>        karajaan ayue manang harajur katatai.<br>            <h5>L.N.No.129</h5>	</p>'];
var nu_283b=['<h3>283b. KAKARE UNGKUP ITAH</h3><h4>B<small>es</small>=1 (4/4)</h4>	<p align="justify">    	<b>Ayat 1</b> <br>	Kakare ungkup itah inyoho Raja<br>    hai manggatang toh banderae,<br>    manjadi saksi aie,<br>    mangumbang hapus petak mansanan gawi aie;<br>    mambritae dengan khanjak kan oloh handiai.<br>                  <br>    	  <b>Ayat 2</b> <br>		Toh keleh itah bulat <br>        hong sinta ayur te,<br>        dan ela baya mingat<br>         nahiu arep wei!<br>        O ungkup ayun Kristus j<br>        e puna bereng aie,<br>        has tuntut Ie palus, <br>        je Raja Pangkahai.<br>        <br>                <b>Ayat 3</b> <br>   		Toh keleh kare itah<br>         mahormat arae wei;<br>        mambrita kare sintae,<br>         manarong gawie te.<br>        Yoh Tuhan Rajan ksanang,<br>         kuasae dan kahaie,<br>        karajaan ayue manang <br>        harajur katatai.<br>            <h5>Ny.Rokh.No.190</h5>	</p>'];
var nu_284a=['<h3>284a. HUANG KARE EKA TE</h3><h4>G=1 (3/4)</h4>	<p align="justify">    	<b>Ayat 1</b> <br>	Huang kare eka te<br>    sintan Yesus inarima,<br>    hete krajaan sorga te<br>    palus kea bakarinah.<br>    Sintan, asin Tuhan te<br>    patut inarima wei.<br>          <br>    	  <b>Ayat 2</b> <br>		Slamat huang sorga te<br>        dia tau iulih itah.<br>        Baya awi asi wei<br>        itah inamean hete<br>        Keleh manarima wei<br>        slamat ije simpan te!<br>        <br>                <b>Ayat 3</b> <br>   		kilau anak korik te<br>        sanang huang sintan indue,<br>        kai toh itah sanang wei<br>        huang sinta ije tinduh:<br>        sinta ije pangkahai <br>        ije melai katatai.<br>            <h5>L.N.No. 81</h5>	</p>'];
var nu_284b=['<h3>284b. HUANG KARE EKA TE</h3><h4>C=1 (4/4)</h4>	<p align="justify">    	<b>Ayat 1</b> <br>	Huang kare eka te<br>    sintan Yesus inarima,<br>    hete krajaan sorga te<br>    palus kea bakarinah.<br>    Sintan, asin Tuhan te<br>    patut inarima wei.<br>          <br>    	  <b>Ayat 2</b> <br>		Slamat huang sorga te<br>        dia tau iulih itah.<br>        Baya awi asi wei<br>        itah inamean hete<br>        Keleh manarima wei<br>        slamat ije simpan te!<br>        <br>                <b>Ayat 3</b> <br>   		kilau anak korik te<br>        sanang huang sintan indue,<br>        kai toh itah sanang wei<br>        huang sinta ije tinduh:<br>        sinta ije pangkahai <br>        ije melai katatai.<br>            <h5>L.N.No. 107</h5>	</p>'];
var nu_285=['<h3>285. TOH EWEH IJE BARIS AIN JENDERAL</h3><h4>F=1 (4/4)</h4>	<p align="justify">    	<b>Ayat 1</b> <br>	Toh eweh ije baris ain Jendral je pangkahai,<br>    has, tuntut wei bandera aie <br>    hong parang ije hai,<br>     Bandera ije kueh?<br>    Samplaki tandae te!<br>    Toh lius, langkap omba wei<br>    Banderan Tuhan te.<br>        <br>    	  <b>Ayat 2</b> <br>		Hong parang dengan setan te,<br>        je arae "Legion",<br>        iamho itah auh je hai:<br>        " Toh padang Gideon!"<br>        Hatalla pangkahai,<br>        malekat rewar aie,<br>        mamarang akan itah wei,<br>        mampalah asang te!<br>        <br>                <b>Ayat 3</b> <br>   		Ingkepan awi itah toh<br>        ganggaman Tuhan wei,<br>        malawan kare setan te,<br>        je bakalit te.<br>        Karungkong usok te:<br>        Katetek Tuhan wei;<br>        Kopiah ije dehen te:<br>        Salamat Tuhan wei.<br>        <br>                 <b>Ayat 4</b> <br>         Talawang ije andal te<br>         hong lengen itah toh<br>         Kakare lunjun asang te<br>         tampulang awie toh.<br>         Dan damek apui te<br>         imbelep awie wei.<br>         Talawang ije heran te:<br>         te kapercaya wei.<br>         <br>                <b>Ayat 5</b> <br>        Sarunai je batarik auhe<br>        hong parang ije hai:<br>        kakare lakudoa te<br>        je magon wei mandai.<br>        Banyihi padang Roh<br>        hong lengen itah toh:<br>        Auh Tuhan ije kuasa te<br>        pamanang hante wei.<br>        <br>                <b>Ayat 6</b> <br>        Has kancang lengen itah toh<br>        hong parang brasih te.<br>        Kakare itah menteng toh<br>        hong kuasan Tuhan wei.<br>        O langkap tuntut wei,<br>        banderan Tuhan te!<br>        Hong katan sampalaki te<br>        harajur manang wei!<br>            <h5>R.L.No.394 - P.B.I.268</h5>	</p>'];
var nu_286=['<h3>286. SALAMAT TOTO HALIAI</h3><h4>E<small>s</small>=1 (4/4)</h4>	<p align="justify">    	<b>Ayat 1</b> <br>	Salamat toto haliai kabalin oloh handiai,<br>    je Yesus tempon humae.<br>    Hung eka oloh korik hai<br>    manempo Tuhang pangkahai,<br>    kasanang nimbing prentah.<br>    Setan, dosa tuntang klahija toh ulih<br>    mawi oloh, awang harap Yesus toto.<br>        <br>    	  <b>Ayat 2</b> <br>		O yesus. maja andau toh<br>        dan berkat ewen andau toh <br>        je handak belom hinje.<br>        Yoh tenga ramo handiai,<br>        je hapae, palus katatai<br>        je tau manyanang ie.<br>        Kilau horan Tuhan maja<br>        oloh Kana, mimbit berkat,<br>        berkat kea ewen hetoh!<br>         <br>                <b>Ayat 3</b> <br>   		O Yesus, Raja pangkahai!<br>        Hung hetoh ikei handiai<br>        hapumpong huang aram.<br>        Te basa tumon janji aim<br>        auh lakun oloh baris aim<br>        ilalus, jaton hayau.<br>        Awi jete,, ikei blaku<br>        toto-toto, nyame-nyame:<br>        Kantoh tuntang berkat ikei!<br>            <h5>L.N.No.133</h5>	</p>'];
var nu_287a=['<h3>287a. ATEI OLOH IJE PAKAT</h3><h4>A=1 (4/4)</h4>	<p align="justify">    	<b>Ayat 1</b> <br>	Atei oloh ije pakat <br>    belom Tuhan tumon auhm<br>    ie sanang tuntang hanjak <br>    huang asim dan kataum.<br>     Atei aie taharu dengam<br>    ije puna klawa aie,<br>    dan harajur sining andau<br>    mohon akae berkat aim.<br>        <br>    	  <b>Ayat 2</b> <br>		Tuhan, pasi ewen duwe,<br>        ije kawin andau toh,<br>        mangat dengan bujur ateie<br>        janji aie ingakue toh!<br>        O mandehen ewen toto<br>        mangat indu hormat aim,<br>        kare gawin ewen hetoh<br>        bujur brasih haliai.<br>        <br>                <b>Ayat 3</b> <br>   		Dohop ewen toh hasinta<br>        huang sinta ayum te,<br>        mangat ela hatalua,<br>        hanjak, huang Tuhan wei.<br>        Yoh mangejau bara ie<br>        kare klahi handiai:<br>        tinai, Tuhan, rentah ateie<br>        hampun, tumon prentah aim.<br>        <br>                <b>Ayat 4</b> <br>        Haga ewen toto bulat,<br>        mangat huang huma aie<br>        melai slamat dan khanjak,<br>        bagin kare oloh aim.<br>        Haga ewen sampai matei<br>        huang kapercaya te,<br>        ije kuasa huang atei,<br>        mimbit ikei akam wei!<br>            <h5>L.N.No.14</h5>	</p>'];
var nu_287b=['<h3>287a. ATEI OLOH IJE PAKAT</h3><h4>E<small>s</small>=1 (4/4)</h4>	<p align="justify">    	<b>Ayat 1</b> <br>	Atei oloh ije pakat belom, <br>     Tuhan tumon auhm<br>      ie sanang tuntang hanjak <br>    huang asim dan kataum.<br>      Atei aie taharu dengam<br>    ije puna klawa aie,<br>    dan harajur sining andau<br>    mohon akae berkat aim.<br>        <br>    	  <b>Ayat 2</b> <br>		Tuhan, pasi ewen duwe,<br>        ije kawin andau toh,<br>        mangat dengan bujur ateie<br>        janji aie ingakue toh!<br>        O mandehen ewen toto<br>        mangat indu hormat aim,<br>        kare gawin ewen hetoh<br>        bujur brasih haliai.<br>        <br>                <b>Ayat 3</b> <br>   		Dohop ewen toh hasinta<br>        huang sinta ayum te,<br>        mangat ela hatalua,<br>        hanjak, huang Tuhan wei.<br>        Yoh mangejau bara ie<br>        kare klahi handiai:<br>        tinai, Tuhan, rentah ateie<br>        hampun, tumon prentah aim.<br>        <br>                <b>Ayat 4</b> <br>        Haga ewen toto bulat,<br>        mangat huang huma aie<br>        melai slamat dan khanjak,<br>        bagin kare oloh aim.<br>        Haga ewen sampai matei<br>        huang kapercaya te,<br>        ije kuasa huang atei,<br>        mimbit ikei akam wei!<br>            <h5></h5>	</p>'];
var nu_288=['<h3>288. ITAH BELOM HUNG KALUNEN</h3><h4>B<small>es</small>=1 (3/4)</h4>	<p align="justify">    	<b>Ayat 1</b> <br>	Itah belom hung kalunen<br>    kilau hung arut wei.<br>    Tintun itah hilaka nih <br>    dimpah tasik lombah te.<br>    Aloh barat paham toto <br>    hai galombang tasik te,<br>    amon Yesus hong kamburi<br>    ela mikeh sanang wei!<br>        <br>    	  <b>Ayat 2</b> <br>		Tasik lombah te pampatei,<br>        kikeh, katarewan aie,<br>        kilau barat hete-hete<br>        mawi oloh korik hai.<br>        Aloh barat paham toto <br>        hai galombang tasik te,<br>        amon Yesus hong kamburi<br>        ela mikeh, sanang wei!<br>        <br>                <b>Ayat 3</b> <br>   		Sining andau itah hetoh<br>        melai saran tasik te,<br>        Je mandohop mawat toto<br>        tikas Tuhan Yesus wei.<br>        Aloh barat paham toto<br>        hai galombang tasik te,<br>        amon Yesus hong kamburi <br>        ela mikeh, sanang wei!<br>        <br>                <b>Ayat 4</b> <br>      Buah itah mentai ie<br>      tuntang tatap haliai:<br>      buah jaga dan badange<br>      magon tumon soho aie.<br>      Aloh barat paham toto,<br>      hai galombang tasik te,<br>      amon Yesus hong kamburi,<br>      ela mikeh sanang wei!<br>      <br>                 <b>Ayat 5</b> <br>        Amon itah blaku awat,<br>        kareh, hung panumah aie.<br>        Ie mimbit itah lompat<br>        omba hung banama aie.<br>        Aloh barat paham toto,<br>        hai galombang tasik te,<br>        amon Yesus hong kamburi,<br>        ela mikeh sanang wei!<br>        <br>                <b>Ayat 6</b><br>        Tunjuk aie mamprahan kea<br>        sorga lewu dipah te.<br>        Keleh itah tatap omba,<br>        himat omba ie wei.<br>        Aloh barat paham toto,<br>        hai galombang tasik te,<br>        amon Yesus hong kamburi,<br>        ela mikeh sanang wei!<br>        <br>                <b>Ayat 7</b><br>        Narai kanih,lenda-lendeng<br>        bungas brasih haliai?<br>        Te Yerusalem taheta,<br>        bula-bulau ampie wei.<br>        Aloh barat paham toto,<br>        hai galombang tasik te,<br>        amon Yesus hong kamburi,<br>        ela mikeh sanang wei!<br>        <br>                        <b>Ayat 8</b><br>        Bara hete tarahining<br>        auh malekat hung kahai,<br>        je manyanyi dan manyuling,<br>        indu hormat Tuhan aie.<br>         Aloh barat paham toto,<br>        hai galombang tasik te,<br>        amon Yesus hong kamburi,<br>        ela mikeh sanang wei!<br>        <br>                <b>Ayat 9</b><br>        Hete itah tau hasupa<br>        dengan kare kola te,<br>        ije jari helo dimpah,<br>        jari sanang, slamat wei.<br>        Aku haus taharu toh <br>        lompat hung banama ayum,<br>        Tuhan, ije Tempongku!<br>               <br>                <b>Ayat 10</b><br>        Yesus, aku handak mentai<br>        sambil mimbing janji aim,<br>        dohop aku toh manyampai,<br>        palus omba hung khaim.<br>        Sampai ah kamangat toto!<br>        Aku haus taharu toh <br>        lompat hung banama ayum,<br>        Tuhan, ije Tempongku!<br>                            <h5>L.N.No.58</h5>	</p>'];
var nu_289=['<h3>289. ITAH BELOM HONG KALUNEN</h3><h4>B<small>es</small>=1 (3/4)</h4>	<p align="justify">    	<b>Ayat 1</b> <br>	Itah belom hong kalunen, <br>    oloh je namuei wei<br>    mhoroi jalan padang lombah,<br>    mnukat bukit, <br>    Tintun itah jaton beken,<br>    tanggoh lewu brasih te.<br>    sewu janah<br>    mangkahimat lewu sorga,<br>    lewu ije brasih te;<br>    mangkahimat lewu sorga<br>    lewu ije brasih te.<br>        <br>    	  <b>Ayat 2</b> <br>		Are kpehe tuntang kikeh<br>        manarawen itah wei.<br>        Kinjap angat jaton hakon<br>        manyarenan taloh te.<br>        Tapi Yesus tantain aton<br>        magah itah, asal magon<br>        mangkahimat lewu sorga<br>        lewu ije brasih te,<br>        mangkahimat lewu sorga <br>        lewu ije brasih te.<br>        <br>                <b>Ayat 3</b> <br>   		Ije manang, tau manyampai,<br>        tantu sinom bagi aie;<br>        te makota ain pambelom,<br>        ije brasih haliai,<br>        tengan Tuhan akan ewen,<br>        awang bujur, eter ateie,<br>        mangkahimat lewu sorga<br>        lewu ije brasih te,<br>        mangkahimat lewu sorga <br>        lewu ije brasih te,<br>        <br>                <b>Ayat 4</b> <br>      Keleh miar, sanang atei,<br>      huang jalan simit te.<br>      Hung pambelom hung pampatei,<br>      Yesus ampong ungkup aie.<br>      Ela langak tagal en-en,<br>      langkap, ela mue-muen.*<br>      mangkahimat lewu sorga<br>        lewu ije brasih te,<br>        mangkahimat lewu sorga <br>        lewu ije brasih te.<br>           <br>       *) mue-muen= dia toto-toto<br>                   <h5>L.N.No.59</h5>	</p>'];
var nu_290a=['<h3>290a.MAGON GENEP ANDAU</h3><h4>A=1 (4/4)</h4>	<p align="justify">    	<b>Ayat 1</b> <br>	Magon genep andau Tuhan Yesus<br>    te mampahayak itah, jeba dosa wei.<br>           <br>    	  <b>Ayat 2</b> <br>		Aloh dia gitan, Ie tokep wei;<br>        dohop ayue simpan, awi sintae te.<br>        <br>                <b>Ayat 3</b> <br>     Ie mimbit berkat akan huangku,<br>     ie mampahanjak, manggau aku toh.<br>                 <h5>L.N.No.73</h5>	</p>'];
var nu_290b=['<h3>290b.MAGON GENEP ANDAU</h3><h4>C=1 (4/4)</h4>	<p align="justify">    	<b>Ayat 1</b> <br>	Magon genep andau Tuhan Yesus<br>    te mampahayak itah, jeba dosa wei.<br>           <br>    	  <b>Ayat 2</b> <br>		Aloh dia gitan, Ie tokep wei;<br>        dohop ayue simpan, awi sintae te.<br>        <br>                <b>Ayat 3</b> <br>     Ie mimbit berkat akan huangku,<br>     ie mampahanjak, manggau aku toh.<br>                 <h5>L.N.No.2</h5>	</p>'];
var nu_291=['<h3>291.OMBA YESUS AKU RAJIN TOTO</h3><h4>C=1 (4/4)</h4>	<p align="justify">    	<b>Ayat 1</b> <br>	Omba Yesus aku rajin toto<br>    Ie wei manyanang ateiku.<br>    Ksnanang khanjak tenga aie hung hetoh,<br>    Ie slamat dan pambelomku,<br>    ie  slamat dan pambelomku.<br>           <br>    	  <b>Ayat 2</b> <br>		Ie wei je mayakatik aku,<br>        ie wei kalindong ayungku.<br>        Kitoi ayue je maharak musoh,<br>        sokah aie tau mampong huangku,<br>        sokah aie tau mapong huangku.<br>        <br>                <b>Ayat 3</b> <br>     Taloh awang hapaku hung jalan,<br>     ie wei manenga akangku.<br>     Ie majar. mimbit dan ngagalan,<br>     magah aku hung palisangku,<br>     magah aku hung palisangku.<br>     <br>          <b>Ayat 4</b> <br>     Jeha, amon jalan aingku hapus,<br>     Tuhangku maduan liauku,<br>     mangat aku, hinje Ie palus<br>     katatahi slamat bitingku,<br>     katatahi slamat bitingku.<br>     <br>           <b>Ayat 5</b> <br>     Tuhan, pasi aku, mangat rantep,<br>     toto rantep dengam Tuhangku.<br>     Dohop aku eter dan baketep<br>     belom akam, juruslamatku,<br>     belom akam, Juruslamatku.<br>            <h5>L.N.No.91</h5>	</p>'];
var nu_292=['<h3>292. UNGI-UNGI AKU HETOH</h3><h4>B<small>es</small>=1 (3/4)</h4>	<p align="justify">    	<b>Ayat 1</b> <br>	Ungi ungin aku hetoh <br>    huang eka benyem toh,<br>     Ie melai dengangku,<br>     tapi amonung go-unggol,<br>     Yesus maja ateiku,<br>     aku jaton benyem toh,<br>     aku jaton benyem toh.<br>           <br>    	  <b>Ayat 2</b> <br>		Amon Yesu hinje aku,<br>        aloh kueh-kueh ekaku,<br>        aku landang sanang toto.<br>        Hanjak rantang huangku<br>        Yesus tokep denganku,<br>        aku jaton benyem toh,<br>        aku jaton benyem toh.<br>            <br>                <b>Ayat 3</b> <br>    Aloh huang parak-kayu,<br>    aloh huang humangku.<br>    Ie magon hinje aku,<br>    ie mampong ateiku.<br>    Yesus melai denganku<br>    aku jaton benyem toh,<br>    aku jaton benyem toh.<br>     <br>          <b>Ayat 4</b> <br>    Indu bapa, tundah kola<br>    tau kejau dengangku;<br>    maka aloh ewen kea<br>    jaton mingat aku toh.<br>    Yesus melai dengangku,<br>    aku jaton benyem toh,<br>    aku jaton benyem toh.<br>     <br>           <b>Ayat 5</b> <br>     Aloh aku hung celaka,<br>     aloh aton ontongku,<br>     Yesus magon dumah maja,<br>     hante ie sobatku.<br>     Ie melai dengangku,<br>     aku jaton benyem toh,<br>     aku jaton benyem toh.<br>     <br>           <b>Ayat 6</b> <br>      Metoh matei mahin kea<br>      Yesus melai dengangku,<br>      mimbit aku tame sorga,<br>      slamat ayue bagingku.<br>      Yesus melai dengangku,<br>      aku jaton benyem toh,<br>      aku jaton benyem toh,<br>                         <b>Ayat 7</b> <br>       Yesus, palus katatahie<br>       ikau aingku, aku aim,<br>       Hormat, tara, trimakasih<br>       akam, tagal sinta aim,<br>       hetoh palus katatai,<br>       hetoh palus katatai.<br>                   <h5>L.N.No.79</h5>	</p>'];
var nu_293=['<h3>293.ATON AKUMITE JEHA</h3><h4>A<small>s</small>=1 (4/4)</h4>	<p align="justify">    	<b>Ayat 1</b> <br>	Aton aku mite jeha ikau,<br>    o paharingku, huang human Bapa itah,<br>    huang lewun Tuhangku,<br>    eka itah melai sanang limbah <br>    karephe toh tuntang dia tau hambulang<br>    kilau hong kalunen toh.<br>     Amon aku jari manang,<br>     sampai ah kahanjak te <br>     mite ikau hung khasanang lewu ije brasih te!<br>      <br>    	  <b>Ayat 2</b> <br>		Aton aku mite jeha ikau je inyintaku,<br>        huang pirdus ain Hatalla, hinje Yesus, Tempongku,<br>        limbah itah jari manang awi kuasan daha aie?<br>        Aku toto hanjak rantang mite ikau hung kahai.<br>        Amon aku jari manang, sampai ah kahanjak te<br>        mite ikau hung kasanang lewu ije brasih te!<br>            <br>                <b>Ayat 3</b> <br>    Aton aku mite jeha keton toh samandiai<br>    hong Yerusalem taheta, brasih, blawa haliai;<br>    amon lembut auh kitara saran tasik kristal te,<br>    amon oloh manampayah baun Hatalla magon wei?<br>    Amon aku jari manang, sampai ah kahanjak te<br>    mite ikau hung kasanang lewu ije brasih te!<br>            <h5>L.N.P.No.5</h5>	</p>'];
var nu_294=['<h3>294. O SANGKOWONG PANGKAHAI</h3><h4>E<small>s</small>=1 (4/4)</h4>	<p align="justify">    	<b>Ayat 1</b> <br>	O sangkowong pangkahai, <br>    Yesus Kristus klawa sorga atei <br>    jam kajewu toh pahai, <br>    asim tinai dan mamplawa <br>    ikei toh samai haliai <br>          <br>    	  <b>Ayat 2</b> <br>		Dosa dan kakaput aie <br>        buah olon huang Pirdus; <br>        ijei pehe handiai, <br>        tapi ikei blaku Yesus: <br>        Awat ikei toh samai, katatai. <br>          <br>                <b>Ayat 3</b> <br>    Ampun,asi dan katau<br>    keleh lembut bara ngambo<br>    mangat atei ikei tau<br>    misik hung tamparan andau<br>    terai tiroh dosa toh,<br>	huang roh<br>    <br>     <b>Ayat 4</b> <br>     Keleh sintam mohon wei <br>     kilau ambon tampalawei;<br>     mangat ikei tumon te<br>     inaheta dan mangkeme<br>     ampong dan kamanis aim,<br>     hung kahaim.<br>        <h5>L.N.No.96</h5>	</p>'];
var nu_295a=['<h3>295a. HAS,SEWUT TRIMAKASIH</h3><h4>B<small>es</small>=1 (4/4)</h4>	<p align="justify">    	<b>Ayat 1</b> <br>	Has sewut trimakasih toh,<br>    hong jamka jewu jetoh!<br>    Pahai Hatalla, Tuhangku yoh ikau atei aingku<br>     Hatalla ije paham hai <br>     dan kuasae jaton tikas aie,<br>     ngalindong aku magon.<br>          <br>    	  <b>Ayat 2</b> <br>		Toh aku, hapus alem ndau<br>        batiroh sanang toto.<br>        Hatalla manyangko wong baue<br>        mangejau kare musoh.<br>        Yehowa keleh asim te<br>        taheta,sining andau wei;<br>        hung andau jetoh kea.<br>	  <br>                <b>Ayat 3</b> <br>   		O dohop. mangat aku tau<br>        mahormat aram toto,<br>        dan soho ateiku manggau<br>        salamat aim hung hetoh;<br>        hung sintam o Hatallangku,<br>        te mangat hambaruangku<br>        Parentep aku dengam!<br>  	  <br>            <h5>L.N.No.30</h5>	</p>'];
var nu_295b=['<h3>295b. HAS,SEWUT TRIMAKASIH</h3><h4>G=1 (4/4)</h4>	<p align="justify">    	<b>Ayat 1</b> <br>	Has sewut trimakasih toh,<br>    hong jamka jewu jetoh!<br>    Pahai Hatalla, Tuhangku yoh ikau atei aingku<br>     Hatalla ije paham hai <br>     dan kuasae jaton tikas aie,<br>     ngalindong aku magon.<br>          <br>    	  <b>Ayat 2</b> <br>		Toh aku, hapus alem ndau<br>        batiroh sanang toto.<br>        Hatalla manyangko wong baue<br>        mangejau kare musoh.<br>        Yehowa keleh asim te<br>        taheta,sining andau wei;<br>        hung andau jetoh kea.<br>	  <br>                <b>Ayat 3</b> <br>   		O dohop. mangat aku tau<br>        mahormat aram toto,<br>        dan soho ateiku manggau<br>        salamat aim hung hetoh;<br>        hung sintam o Hatallangku,<br>        te mangat hambaruangku<br>        Parentep aku dengam!<br>  	  <br>            <h5>L.N.No.30b</h5>	</p>'];
var nu_295c=['<h3>295c. HAS,SEWUT TRIMAKASIH</h3><h4>A=1 (4/4)</h4>	<p align="justify">    	<b>Ayat 1</b> <br>	Has sewut trimakasih toh,<br>    hong jamka jewu jetoh!<br>    Pahai Hatalla, Tuhangku yoh ikau atei aingku<br>     Hatalla ije paham hai <br>     dan kuasae jaton tikas aie,<br>     ngalindong aku magon<br>          <br>    	  <b>Ayat 2</b> <br>		Toh aku, hapus alem ndau<br>        batiroh sanang toto.<br>        Hatalla manyangko wong baue<br>        mangejau kare musoh.<br>        Yehowa keleh asim te<br>        taheta,sining andau wei;<br>        hung andau jetoh kea.<br>	  <br>                <b>Ayat 3</b> <br>   		O dohop. mangat aku tau<br>        mahormat aram toto,<br>        dan soho ateiku manggau<br>        salamat aim hung hetoh;<br>        hung sintam o Hatallangku,<br>        te mangat hambaruangku.<br>        Parentep aku dengam!<br>  	  <br>            <h5>L.N.No.29</h5>	</p>'];
var nu_296a=['<h3>296a. HUNG HANJEWU JETOH</h3><h4>G=1 (3/4)</h4>	<p align="justify">    	<b>Ayat 1</b> <br>	Hung hanjewu jetoh <br>    patut aku toh mimbit hormat, <br>    tara akam Apangku! <br>          <br>    	  <b>Ayat 2</b> <br>		Krana kuasam Apang, ije hai kataum <br>        jari mangalindong aku alem ndau. <br>       	  <br>                <b>Ayat 3</b> <br>   		Hung tamparan andau, Apang hungkahai, <br>        trima laku aingku, ije toh mandai! <br>  	  <br>    <b>Ayat 4</b> <br>    Keleh , o Yehowa, haga aku toh,<br>    hapus andau kea tanggar ateiku!<br>    <br>        <b>Ayat 5</b> <br>    Keleh manaheta hapus ateiku!<br>    Yoh Roh aim marentah kare pikirku!<br>    <br>               <b>Ayat 6</b> <br>        Mangat aku kea, hapus andau toh<br>        dehen kapercaya, belom tumon Roh<br>        <br>                <b>Ayat 7</b> <br>        Tuhan, pasi, berkat oloh handiai,<br>        ije hindai slamat : Obah jalan aie!<br>        <br>                <b>Ayat 8</b> <br>        Yoh, karajam dumah tuntang sasar hai,<br>        mangat kare oloh sondau slamat aim!<br>        <h5>L.N.No.76</h5>	</p>'];
var nu_296b=['<h3>296b. HUNG HANJEWU JETOH</h3><h4>C=1 (4/4)</h4>	<p align="justify">    	<b>Ayat 1</b> <br>	Hung hanjewu jetoh <br>    patut aku toh mimbit hormat, <br>    tara akam Apangku! <br>          <br>    	  <b>Ayat 2</b> <br>		Krana kuasam Apang, ije hai kataum <br>        jari mangalindong aku alem ndau. <br>       	  <br>                <b>Ayat 3</b> <br>   		Hung tamparan andau, Apang hungkahai, <br>        trima laku aingku, ije toh mandai! <br>  	  <br>    <b>Ayat 4</b> <br>    Keleh , o Yehowa, haga aku toh,<br>    hapus andau kea tanggar ateiku!<br>    <br>        <b>Ayat 5</b> <br>    Keleh manaheta hapus ateiku!<br>    Yoh Roh aim marentah kare pikirku!<br>    <br>               <b>Ayat 6</b> <br>        Mangat aku kea, hapus andau toh<br>        dehen kapercaya, belom tumon Roh<br>        <br>                <b>Ayat 7</b> <br>        Tuhan, pasi, berkat oloh handiai,<br>        ije hindai slamat : Obah jalan aie!<br>        <br>                <b>Ayat 8</b> <br>        Yoh, karajam dumah tuntang sasar hai,<br>        mangat kare oloh sondau slamat aim!<br>        <h5>L.N.No.2</h5>	</p>'];
var nu_297=['<h3>297. O YESUS, KLAWA IJE HAI</h3><h4>G=1 (4/4)</h4>	<p align="justify">    	<b>Ayat 1</b> <br>	O Yesus, klawa ije hai,<br>    O matan andauku!<br>    Hung ikau slamat katatai<br>    dan asi akangku,<br>    dan asi akangku.<br>          <br>    	  <b>Ayat 2</b> <br>		Kakaput ije alem ndau<br>        Impalah klawa toh.<br>        O Tuhan, soho klawan Roh<br>        mamplawa ateiku,<br>        mamplawa ateiku.<br>       	  <br>                <b>Ayat 3</b> <br>   		O Tuhan Yesus,klawangku,<br>        toh tenga asi aim!<br>        Pabujur kare jalangku,<br>        nakara tame khaim,<br>        nakara tame khaim.<br>  	  <br>          <b>Ayat 4</b> <br>    Yoh, sinta aim, O Tuhangku,<br>    mahaga aku toh!<br>    Katetek aim pakayangku,<br>    auh aim panginangku,<br>    auh aim panginangku!<br>    <br>        <b>Ayat 5</b> <br>    Paabas awi asi aim<br>    kakare oloh te,<br>    je haus manggau karasih aim<br>    dan belom akam wei,<br>    dan belom akam wei.<br><h5>L.N.No.88</h5>	</p>'];
var nu_298=['<h3>298. TOH AKU MISIK TINAI</h3><h4>B<small>es</small>=1 (4/4)</h4>	<p align="justify">    	<b>Ayat 1</b> <br>	Toh aku misik tinai,<br>    kalawa andau sampai.<br>    O Yesus kuasam bati roh<br>    aku sanang.<br>          <br>    	  <b>Ayat 2</b> <br>		Toh aku mimbit akam<br>        horumat,nyanyi taram,<br>        O Yesus,Batang asi,<br>        harajur ikau masi.<br>       	  <br>                <b>Ayat 3</b> <br>   		O berkat aku hante,<br>        mandohop hung kpehe<br>        kakare olo ayum,<br>        dan tenga kutoh ampong.<br>        <h5>L.N.No.135</h5>	</p>'];
var nu_299=['<h3>299. HATALLA TUHANGKU</h3><h4>F=1 (4/4)</h4>	<p align="justify">    	<b>Ayat 1</b> <br>	Hatalla Tuhangku, toh aran aim inara!<br>    Dan hung hanjewu toh inyanyi kutoh taram!<br>    O plawa ateiku, dan tenga berkat aim,<br>    nakara aku toh harajur baris aim!<br>          <br>    	  <b>Ayat 2</b> <br>		Toh aku mampahai, manara sintam, Apang!<br>        Te basa asi aim hung Yesus ingarinah.<br>        O pasi aku toh, dan ampun dosangku;<br>        yoh tenga kea Roh je brasih akangku.<br>       	  <br>                <b>Ayat 3</b> <br>   		O Tuhan pangkahai, je Tempon langit petak!<br>        Kakare oloh aim salamat tuntang hanjak;<br>        O dohop aku toh manara aran aim,<br>        dan tenga akangku bagian oloh aim.<br>        <h5>L.N.No.38</h5>	</p>'];
var nu_300=['<h3>300. TARA TOH HATALLAN ITAH</h3><h4>E<small>s</small>=1 (4/4)</h4>	<p align="justify">    	<b>Ayat 1</b> <br>	Tara toh Hatallan itah,<br>    krana huang alem ndau,<br>    ie toto jari mingat<br>    itah hung kahain kataue          <br>    	  <b>Ayat 2</b> <br>		Yesus Kristus,Matanandau,<br>        plawa ikei handia,<br>        uka ela ikei layau,<br>        tapi sondau slamat aim.<br>               	  <br>                <b>Ayat 3</b> <br>   	Haga bara kare dosa<br>    ikei huang andau toh!<br>    Dohop ikei, bele sala,<br>    tapi belom tumon Roh!<br>        <h5>L.N.No.123</h5>	</p>'];
var nu_301=['<h3>301. PATUT HUNG HANJEWU JETOH</h3><h4>E<small>s</small>=1 (4/4)</h4>	<p align="justify">    	<b>Ayat 1</b> <br>	Patut hung hanjewu jetoh<br>    itah mingat Tuhan te,<br>    ije jari masi itah <br>    sampai misik sanang wei.<br>          <br>    	  <b>Ayat 2</b> <br>		Eweh mangalinsong itah<br>        kahum tiroh itah ndau,<br>        dan mangejau taloh papa<br>        bara itah hung kataue?<br>               	  <br>                <b>Ayat 3</b> <br>   		Ie Tuhangku, Hatalla,<br>        asie toto paham hai,<br>        kuasa aie mambelom itah<br>        dan mahaga handiai.<br>        <br>                 <b>Ayat 4</b> <br>         Ikei mimbit , o Hatalla,<br>         hormat, tara kan kahaim.<br>         Trima ikei dan tampayah<br>         ikei, ije baris aim!<br>         <br>                <b>Ayat 5</b> <br>        Dohop ikei toh malalus<br>        gawi ije bujur te,<br>        mangat, amon andau hapus,<br>        atei ikei sanang wei.<br>        <br>                <b>Ayat 6</b> <br>        Imbit ikei, o Hatalla,<br>        rantep dengan Yesus wei;<br>        mangat tame pirdus sorga,<br>        supa ksanang, slamat te.<br>        <h5>L.N.No.123</h5>	</p>'];
var nu_302=['<h3>302. HATALLA, TEMPON ASI</h3><h4>G=1 (3/4)</h4>	<p align="justify">    	<b>Ayat 1</b> <br>	O Hatalla, Tempon asi,<br>    Tempon taloh handiai;<br>    Bapa, Anak dan Roh brasih<br>    ije kuasa haliai,<br>    matan andau bulan te,<br>    uras tampa aim bewei.<br>          <br>    	  <b>Ayat 2</b> <br>		Aram patuh toh inara<br>        dengan khanjak ateiku,<br>        basa Tuhangku Hatalla<br>        mangalindong aku toh,<br>        kahum tiroh aingku ndau,<br>        awi sintam dan kataum.<br>               	  <br>                <b>Ayat 3</b> <br>   		Bereng tuntang hamabaruan<br>        indu, apang, kolangku,<br>        kare sobat sakelan,<br>        anakoloh, ramongku;<br>        handiai inyarahku<br>        akam wei, o Tempongku.<br>        <br>                 <b>Ayat 4</b> <br>        Imbing lengengku, ngagalan<br>        aku hapus andau toh;<br>        mangat paingku manyak jalan,<br>        ije simit bujur, yoh<br>        Tuhan,eka kharapku,<br>        trima ah toh nyanyingku!<br>        <h5>L.N.No.82</h5>	</p>'];
var nu_303=['<h3>303. HAS ATEIKU MANYANYI</h3><h4>B<small>es</small>=1 (4/4)</h4>	<p align="justify">    	<b>Ayat 1</b> <br>	Has ateiku manyanyi,<br>    manyewut trima kasih,<br>    manara toh Hatalla <br>    je paham tau basara!<br>          <br>    	  <b>Ayat 2</b> <br>		Hung alem ije halau<br>        Hatallangku mangejau<br>        bahaya dan calaka,<br>        yoh, kare taloh papa.<br>               	  <br>                <b>Ayat 3</b> <br>   		Yoh, Apang, ije jari<br>        injanjin huang asim,<br>        nahuang milang aku<br>        dan mangalindong toto.<br>        <br>                 <b>Ayat 4</b> <br>        Toh janjim jari lalus,<br>        auh ayum toto tulus;<br>        toh aku misik tinai<br>        barigas, hanjak atei.<br>        <br>                <b>Ayat 5</b> <br>        O Tuhan berkat aku<br>        hung kare gawi aingku;<br>        ganggulo aku hante,<br>        te aku hanjak atei!<br>        <br>                 <b>Ayat 6</b> <br>         Yoh hapan auh aim, Tuhan<br>         mambelom dan pakanan<br>         hambruangku hung hetoh;<br>         te aku puas toto!<br>        <h5>L.N.No.135</h5>	</p>'];
var nu_304=['<h3>304. TOH SANA IKEI MISIK</h3><h4>C=1 (4/4)</h4>	<p align="justify">    	<b>Ayat 1</b> <br>	Toh sanai ikei misik, o Apang, ije hai!<br>    Kakare tara akam, horumat dan kahai!<br>              <br>    	  <b>Ayat 2</b> <br>		Hung alem ije halau kataum dan asim hai<br>        mahaga tuntang manggau kakare oloh aim.<br>               	  <br>                <b>Ayat 3</b> <br>   		Toh keleh manaheta katau dan asi aim;<br>        yoh dengan ikei sanang mandino kmangat hai<br>        <br>                 <b>Ayat 4</b> <br>       O Apang, berkat ikei hung hapus andau toh,<br>       dan rentah pikir atei ain ikei awi Roh.<br>        <br>                <b>Ayat 5</b> <br>        O soho Roh je brasih ngagalan oloh aim,<br>        nakara awi gawie toh aram impahai!<br>        <h5>L.N.No.137</h5>	</p>'];
var nu_305=['<h3>305. APANG IKEI HUANG SORGA</h3><h4>E<small>s</small>=1 (4/4)</h4>	<p align="justify">    	<b>Ayat 1</b> <br>	Apang ikei huang sorga,<br>    ining lakun ikei toh,<br>    berkat ayum,<br>    keleh tenga akan ikei huang Roh.<br>              <br>    	  <b>Ayat 2</b> <br>		Yesus Kristus,Matanandau.<br>        plawa ikei  oloh aim,<br>        mangat ikei toto sondau<br>        bagin slamat hung khaim.<br>               	  <br>                <b>Ayat 3</b> <br>   		Kare taloh je bahalap,<br>        uras huang lenge aim;<br>        Tuhan keleh toh manatap<br>        ikei akan slamat aim.<br>        <br>                 <b>Ayat 4</b> <br>       Tuhan, keleh toh ngagalan<br>       ikei hapan Roh aim te,<br>       mangat ikei manyak jalan,<br>       je manintu sorga wei.<br>        <h5>L.N.No.123</h5>	</p>'];
var nu_306=['<h3>306. HUANG KARE GAWI AIM</h3><h4>F=1 (4/4)</h4>	<p align="justify">    	<b>Ayat 1</b> <br>	Huang kare gawi aim ingat Tuhan Yesus<br>    mangat huang ie wei ikau tau malaluse.<br>    Lakuin Tuhan te,uka ie melai <br>    rantep dengam haliai, handau dan hamalem.<br>              <br>    	  <b>Ayat 2</b> <br>		Sana ikau misik, yoh keleh blakudoa,<br>        mangat Tuhan awi Roh, magah bua-buah<br>        ikau huang jalan aie, sampai ikau sanang<br>        dan paabas atei aim, uka ikau manang.<br>               	  <br>                <b>Ayat 3</b> <br>   		Asal kare gawin te patutu huang Tuhan,<br>        jete buah haliai tuntang manantean*<br>        kutoh berkat ije hai, hetoh mahin kea,<br>        tinai slamat katatai jeha huang sorga.<br>        <br>                <b>Ayat 4</b> <br>        Yoh pambelom ayungku toh inyarah akam;<br>        Dohop mangat aku tau magon rantep dengam. <br>        Aloh belom matei,yoh, aku ayum Tuhan; <br>        tagal jete aku toh haus manara aram <br>        <h5>L.N.No.43</h5>	</p>'];
var nu_307=['<h3>307. YESUS IKEI LIUS KUMAN</h3><h4>F=1 (4/4)</h4>	<p align="justify">    	<b>Ayat 1</b> <br>	Yesus , ikei lius kuman manaharep<br>     taloh kinan Tenga kea berkat aim!<br>     Tuhan, o pakanan kea hapan auh aim<br>     jema haga  oloh ayum kan kahaim!<br>     oloh ayum kan kahaim!<br>                 	<h5>L.N.No.49</h5>	</p>'];
var nu_308=['<h3>308. APANG BERKAT TALOH KINAN</h3><h4>E<small>s</small>=1 (4/4)</h4>	<p align="justify">    	<b>Ayat 1</b> <br>	Apang, berkat taloh kinan<br>    ije jari tatap simpan;<br>    je inengam hung kajoham<br>    akan ikei tagal aram;<br>    uka kahum ikei hetoh<br>    ikei impaabas toto,<br>    sampai ikei tau hasupa dengan oloh<br>    aim hung sorga.<br>             	<h5>L.N.No.17</h5>	</p>'];
var nu_309=['<h3>309. TOH AKAM TRIMAKASIH</h3><h4>B<small>es</small>=1 (4/4)</h4>	<p align="justify">    	<b>Ayat 1</b> <br>	Toh akam trimakasih o Tuhan,<br>    ije masi, mahaga dan pakanan <br>    manenga taloh kinan.<br>    <br>        <b>Ayat 2</b><br>    Yoh bereng, hambarauan<br>    imbelom awim, Tuhan:<br>    hung asim je hakutoh,<br>    tau ikei sanang toto.<br>    <br>        <b>Ayat 3</b><br>    Kakare taloh belom <br>    ianggau awim magon:<br>    kalote ikei kea<br>    harajur palus jeha.<br>    <br>        <b>Ayat 4</b><br>    Toh ikei blaku dengam,<br>    o hining tagal aram,<br>    pakanan ikei hetoh<br>    dan haga ikei toto!<br>    <br>        <b>Ayat 5</b><br>    Yoh haga wei katontoh<br>    te mangat ikei mantoh<br>    dan bujur gawin ikei,<br>    harajur sampai matei!<br>   <br>      *)ianggau- ihaga<br>             	<h5>L.N.No.135</h5>	</p>'];
var nu_310=['<h3>310. TUHAN YESUS TALOH KINAN</h3><h4>F=1 (4/4)</h4>	<p align="justify">    	<b>Ayat 1</b> <br>	Tuhan Yesus taloh kinan,<br>    je inengam, jari simpan;<br>    tenga berkat berkat ayum toh!<br>    Tenga akan ikei kea auh <br>    katotom o Hatalla !<br>    Taloh kinan tumon Roh,<br>    Taloh kinan tumon Roh!<br>    <br>        <b>Ayat 2</b><br>   O pakanan, mampaabas<br>   ikei, mangat ela tapas<br>   nguan gawi tumon auhm!<br>   Pasi dohop mangat jeha <br>   ikei huang sorga kea <br>   melai hinje oloh aim,<br>   melai hinje oloh aim!<br>             	<h5>L.N.No.49</h5>	</p>'];
var nu_311=['<h3>311. IKEI MIMBIT TRIMAKASIH</h3><h4>E<small>s</small>=1 (4/4)</h4>	<p align="justify">    	<b>Ayat 1</b> <br>	Ikei mimbit trimakasih akam,<br>    Tuhan Batang asi,<br>    taloh kinan ije aton<br>    tengam akan ikei magon.<br>    Tuhan, ikei toh harajur<br>    blaku berkat raju rajur;<br>    tenga sukup hapan belom hetoh,<br>    indu hormat ayum.<br>	<h5>L.N.No.17</h5>	</p>'];
var nu_312=['<h3>312. IKEI MANARIMAKASIH</h3><h4>F=1 (4/4)</h4>	<p align="justify">    	<b>Ayat 1</b> <br>	Ikei manarimakasih, akam<br>    Tuhan ije masi dan mambesoh ikei toh!<br>    Keleh tinai mampakanan,<br>    atei tuntang hamabaruan;<br>    suang ikei dengan Roh!<br>    suang ikei dengan Roh!<br>	<h5>L.N.No.49</h5>	</p>'];
var nu_313=['<h3>313. TINAI IJE ANDAU HALAU</h3><h4>G=1 (4/4)</h4>	<p align="justify">    	<b>Ayat 1</b> <br>	Tinai ije andau halau,<br>    matan andau belep toh.<br>    intu Yesus, Tuhangku<br>    Maka Yesus hapus andau<br>     magon tokep dengangku<br>     aku sanang ateiku.<br>     Bereng tuntang hamabaruan<br>     ingalindong awi Tuhan.<br>     <br>          <b>Ayat 2</b><br>     Toto kutoh kare berkat <br>     uras tengam, Tuhangku!<br>     Hanjak aku, basa slamat<br>     toh inengam akangku.<br>     Dosa aingku handiai,<br>     Tuhan mampun te samai.<br>     Dohop aku belom hante<br>     akam tuntang randah atei.<br>     <br>          <b>Ayat 3</b><br>     Awi mangalindong kea<br>     aku huang alem toh!<br>     Haga kare tundah kola<br>     tuntang indu apangku!<br>     Soho toh malekat aim<br>     mangaliling huma ain<br>     ewen, ije harap aram,<br>     mangat ie toto sanang.<br>                                      	<h5>L.N.No.46</h5>	</p>'];
var nu_314=['<h3>314. O HATALLA TUHAN IKEI</h3><h4>G=1 (4/4)</h4>	<p align="justify">    	<b>Ayat 1</b> <br>	O Hatalla, Tuhan ikei,<br>    akam alem toh mandai,<br>    bara nyame bara atei<br>    hormat tara dan kahai,<br>    basa hapus andau toh ikau,<br>    o Hatallangku, jari masi<br>    dan manyanyang ikei ije ouna layang.<br>     <br>          <b>Ayat 2</b><br>    Matanandau jari belep,<br>    tapi ekam blawa wei;<br>    ikei aton manaharep<br>    matam,Apang;asim te<br>    ije dinon ikei ndau <br>    tenga kea alem toh;<br>    tinai ikei blaku asi<br>    akan kare oloh brasih!<br>     <br>          <b>Ayat 3</b><br>    Keleh ah mangejau tinai<br>    kare taloh papa te;<br>    haga ikei mangat sanai<br>    huang asim, sintam wei!<br>    Tunggo ikei alem toh,<br>    o Hatalla! Keleh Roh<br>    ije brasih rantep ikei,<br>    bele ikei buah kikeh.<br>    <h5>L.N.No.46</h5>	</p>'];
var nu_315=['<h3>315. TOH ANDAU HAPUS TINAI</h3><h4>F=1 (4/4)</h4>	<p align="justify">    	<b>Ayat 1</b> <br>	Toh andau hapus tinai,<br>    haluli alem sampai,<br>    kan itah handiai.<br>    Tuhan, keleh ikau mahaga tuntang<br>    manggau hamalem ikei toh samai!<br>     <br>          <b>Ayat 2</b><br>   Toh akam trimakasih<br>   o Yesus, tagal asi <br>   je ingarinahm ndau;<br>   hung ikau ikei sanang,<br>   yoh ikau je manyanyang,<br>   mampangat ikei handiai.<br>     <br>          <b>Ayat 3</b><br>  	O Tuhan, alem jetoh<br>    ganggulo ikei hetoh<br>    hung asi ayum te!<br>    Kalindong, tunggo ikei,<br>    mangejau kare kikeh,<br>    dan tenga toh kasanang aim!<br>    <h5>L.N.No.127</h5>	</p>'];
var nu_316=['<h3>316. TOH IJE ANDAU HALAU TINAI</h3><h4>G=1 (4/4)</h4>	<p align="justify">    	<b>Ayat 1</b> <br>	Toh ije andau halau tinai,<br>    pambelom itah pandak wei:<br>    bajeleng itah lius matei, <br>    toh inga-ingat Tuhan te.<br>    je puna manja dian itah,<br>    mahaga itah sampai toh.<br>    Salamat ayue toh imbrita, <br>    has singkap slamat akam toh!<br>     <br>          <b>Ayat 2</b><br>  Hatalla, ikei toh mangaku<br>  katiwas ikei toto hai.<br>  Toh ikei tanggoh hayak blaku:<br>  O ampun dosa handiai!<br>  Dan tenga Roh aim ije brasih<br>  kan ikei, ije brasih aim,<br>  nakara gawin ikei brasih<br>  mahormat aram ije hai.<br>    <h5>L.N.No.23</h5>	</p>'];
var nu_317a=['<h3>317a. MATANANDAU BELEPI</h3><h4>G=1 (3/4)</h4>	<p align="justify">    	<b>Ayat 1</b> <br>	Matanandau belep,andau hapus toh,<br>    kubur sasar tokep akan itah toh.<br>     <br>          <b>Ayat 2</b><br>  Taloh hung kalunen hayang handiai;<br>  uras akan nihau, taloh korik hai.<br>  <br>    <b>Ayat 3</b><br>  Ije melai tetep palus katatai<br>  ie te Hatalla. Tuhan pangkahai.<br>  <br>    <b>Ayat 4</b><br>  O Hatalla, tenga slamat akangku;<br>  dohop aku belom dengam Tuhangku!<br>    <h5>L.N.No.76</h5>	</p>'];
var nu_317b=['<h3>317b. MATANANDAU BELEPI</h3><h4>C=1 (4/4)</h4>	<p align="justify">    	<b>Ayat 1</b> <br>	Matanandau belep,andau hapus toh,<br>    kubur sasar tokep akan itah toh.<br>    Matanandau belep,<br>     <br>          <b>Ayat 2</b><br>  Taloh hung kalunen hayang handiai;<br>  uras akan nihau, taloh korik hai.<br>  <br>    <b>Ayat 3</b><br>  Ije melai tetep palus katatai<br>  ie te Hatalla. Tuhan pangkahai.<br>  <br>    <b>Ayat 4</b><br>  O Hatalla, tenga slamat akangku;<br>  dohop aku belom dengam Tuhangku!<br>    <h5>L.N.No.2</h5>	</p>'];
var nu_318=['<h3>318.TADOH SANANG KAREN TALOH</h3><h4>D=1 (3/4)</h4>	<p align="justify">    	<b>Ayat 1</b> <br>	Tadoh sanang kare taloh<br>    hung sa sanja alem toh<br>    Keleh jaka tumon jete<br>    magon kea ateiku,<br>    teka ridu hung kalunen<br>    halau kilau nupi wei;<br>    aku sanang jaton memen<br>    aloh hung kapehe te.<br>     <br>          <b>Ayat 2</b><br>  Toto, awim ikei belom,<br>  uras tengam slamat te,<br>  tuntang sanang oloh ayum<br>  mangambutep matae wei.<br>  Helo bara tanggoh suro,<br>  ie mingat Tuhan aie,<br>  palus ie tau batiroh<br>  sanang , mangat haliai.<br>  <br>    <b>Ayat 3</b><br>  Narai gunan kare tiroh<br>  kejau dengam dan kataum?<br>  Baya sanang tiroh oloh,<br>  ije belom tumon auhm.<br>  Ksanang ayum, jete bantal<br>  je mampangat haliai;<br>  tapi atei ije kihal<br>  buah kikeh handiai.<br>  <br>    <b>Ayat 4</b><br>  Tuhan, mangat aku ayum<br>  tuntang slamat katatai,<br>  ikau jari tanggong hukum<br>  aingku lepah handiai.<br>  O toh prasih atei aingku,<br>  tenga Roh, Pampangat te!<br>  Belom matei, dohop aku<br>  toto rantep dengam wei.<br>    <h5>L.N.No.114</h5>	</p>'];
var nu_319=['<h3>319. AKU JARI TOH</h3><h4>F=1 (4/4)</h4>	<p align="justify">    	<b>Ayat 1</b> <br>	Aku jari heka toh,<br>    handak tanggoh ssurungku;<br>    Keleh matam Apangku,<br>    tunggo aku alem toh!<br>     <br>          <b>Ayat 2</b><br> Dosa aingku handiai,<br> Apang, ampun te samai!<br> Tagal dahan Anak aim<br> prasih aku haliai.<br>  <br>    <b>Ayat 3</b><br> Kare awang kolangku<br> tuntang indu apangku,<br> kare oloh korik hai,<br> Apang, tunggo handiai,<br>  <br>    <b>Ayat 4</b><br>  Atei ije pehe wei,<br>  mate je hajoho te,<br>  Apang, pasi te samai,<br>  ampong ie handiai!<br>    <h5>L.N.No.6</h5>	</p>'];
var nu_320=['<h3>320. AMON BINTANG HONG HAMALEM</h3><h4>E<small>s</small>=1 (3/4)</h4>	<p align="justify">    	<b>Ayat 1</b> <br>	Amon bintang honh hamalem gining ngambo te,<br>    aku mingat Yerusalem,lewu ije brasih te,<br>    toh inyimpan awi Yesus akan kare murid aie,<br>    ije mentai ie palus melai huang sinta aie.<br>     <br>          <b>Ayat 2</b><br>	Aloh aku toh mananjog hong kakaput petak toh,<br>    rohku aton hung sangkowong sintan Juruslamatku.<br>    Bintang sawah te mamamla indu ampong haliai,<br>    sampai matanandau sorga kareh lembut hung kahaie.<br>  <br>    <b>Ayat 3</b><br> 	Himat, himat o pahari, itah miar hayak wei!<br>    Himat, sampai itah jari dino Sion ngambo te!<br>    Jalan simit sasar blawa sampai handau haliai,<br>    amon lewu ain Hatalla gitan hung kabungas aie.<br>    <h5>L.N.P.No.4</h5>	</p>'];
var nu_321=['<h3>321. HATALLA, IKEI LIUS MALAN</h3><h4>G=1 (3/4)</h4>	<p align="justify">    	<b>Ayat 1</b> <br>	Hatalla ikei lius malan<br>    O berkat ikei toh o Tuhan<br>     tarima lakun ikei, toh!<br>     nahuang mimbul parei toh.<br>     Ganggu lo ikei, mangat tau<br>     bagawi  bele buah lau<br>     bagawi bele buah lau.<br>         <br>          <b>Ayat 2</b><br>	Hatalla, keleh manampayah<br>    panggawinikei handiai!<br>    je harap berkat tuntang tuah<br>    kan ikei oloh aim samai.<br>    Te gawin ikei bontong wei,<br>    tau hanjakwayah getem te,<br>    tau hanjak wayah getem te.<br>  <br>    <b>Ayat 3</b><br> 	Salepah petak toh inyampam<br>    yoh unak, duhi lembut wei;<br>    te basa Hawa tuntang Adam<br>    malangkah prentah ayum te;<br>    toh oloh pehe dan manggau<br>    panginae dengan bebas baue,<br>    panginae dengan bebas baue.<br>    <br>        <b>Ayat 4 </b><br>    Mahapan dahas Yesus jari<br>    mampuas dosan olon, yoh<br>    Hatalla, Apang, dohop pasi,<br>    o haga tanan ikei toh!<br>    Kahana peres tana te,<br>    nakara dinon toto wei,<br>    nakara dinon toto wei.<br>    <br>        <b>Ayat 5</b><br>    Te hayak ikei mimbing gento<br>    hung wayah getem, tau mandai<br>    auh nyanyi tara akan ngambo,<br>    mahormat Tuhan pangkahai,<br>    je huang asie ije hai<br>    manyanyang ikei handiai,<br>    manyanyang ikei handiai.<br>            <h5>L.N.No.66</h5>	</p>'];
var nu_322a=['<h3>322a. HUANG ARAM O HATALLA</h3><h4>C=1 (2/4)</h4>	<p align="justify">    	<b>Ayat 1</b> <br>	Huang aram, o Hatalla,<br>    ikei manampara toh<br>    gawin ikei bele sala:<br>    Suang ikei hapan Roh,<br>    Jepan dohop katatai<br>    akan ikei handiai!<br>     <br>          <b>Ayat 2</b><br>     Dohop mangat ela hayang<br>     gawin ikei andau toh!<br>     Keleh Tuhan toh manyanyang<br>     ikei ije humong, yoh<br>     berkat ikei handiai<br>     aram buah impahai!<br>        <h5>R.L.No.593</h5>	</p>'];
var nu_322b=['<h3>322a. HUANG ARAM O HATALLA</h3><h4>C=1 (4/4)</h4>	<p align="justify">    	<b>Ayat 1</b> <br>	Huang aram, o Hatalla<br>    ikei manampara toh<br>    gawin ikei bele sala:<br>    Suang ikei hapan Roh,<br>    Jepan dohop katatai<br>    akan ikei handiai!<br>     <br>          <b>Ayat 2</b><br>     Dohop mangat ela hayang<br>     gawin ikei andau toh!<br>     Keleh Tuhan toh manyanyang<br>     ikei ije humong, yoh<br>     berkat ikei handiai<br>     aram buah impahai!<br>        <h5>L.N.No.21</h5>	</p>'];
var nu_323=['<h3>323. HUNG WAYAH GETEM TOH</h3><h4>F=1 (4/4)</h4>	<p align="justify">    	<b>Ayat 1</b> <br>	Huang wayah getem toh kahanjak aton tinai<br>    tebasa Tuhangku manenga taloh kinan;<br>    kataun basaran aie imprahan Tuhan toh <br>    kan itah handiai je tau manggetem toh.<br>        <br>          <b>Ayat 2</b><br>    Kajohe, berkat aie harajur akan itah.<br>    Has itah handiai toh mampahai Hatalla<br>    je mingat oloh aie dan kare ewen te,<br>    je layau sampai toh, manempo taloh wei.<br>    <br>        <b>Ayat 3 </b><br>    Paramon tana te panengan Tuhan itah;<br>    yoh tikas ie wei mamberkat dan manenga<br>    panginan handiai, bajoha magon wei:<br>    O oloh korik hai, has harap Tuhan te!<br>    <br>        <b>Ayat 4</b><br>     Toh aram impahai, yoh akam hormat tara!<br>     Tarimakasih toh o Apang huang sorga!<br>     Yoh awim ikei tau mandino berkat hai:<br>     o dohop toh manggau salamat katatai!<br>    <h5>L.N.No.38</h5>	</p>'];
var nu_324=['<h3>324. ANDAU TOH,ANDAU TOH</h3><h4>G=1 (3/4)</h4>	<p align="justify">    	<b>Ayat 1</b> <br>	Andau toh, andau toh <br>    itah toto brigas wei. <br>    Tapi gulong kilau plita<br>    belep klawan matan itah <br>    itah matei handiai<br>        <br>          <b>Ayat 2</b><br>  Tagal te,tagal te<br>  buat ingat Tuhan wei,<br>  mangat amon itah matei<br>  dengan toto sanang ateiv  itah mentai Tuhan te.<br>    <br>        <b>Ayat 3 </b><br>    Kan kahaie, kan kahaie,<br>    Tuhan mimbit oloh aie;<br>    darah padadusan asi<br>    itah mimbit trimakasih<br>    akan Tuhan pangkahai.<br>    <h5>L.N.No.105</h5>	</p>'];
var nu_325=['<h3>325. PAMBELOM ITAH PANDAK</h3><h4>G=1 (4/4)</h4>	<p align="justify">    	<b>Ayat 1</b> <br>	Pambelom itah pandak, bajeleng nihau wei.<br>    Toh tikas ie hanjak jeharap Tuhan te.<br>    Hong Yesus aton slamat dan<br>    ie rajin mawat je harap asi aie.<br>        <br>          <b>Ayat 2</b><br>	Kakare oloh papa marusak arepe wei,<br>    hong jalan kabinasa, naraka katatai.<br>    O jaka ewen toto mahining auh rawei<br>    ain Yesus, andal aie.<br>    <br>        <b>Ayat 3 </b><br>   Yoh dohop ikei, Tuhan, manggau slamat aim,<br>   dan imbit ikei omba hung sorga, hong kahaim;<br>   pambelom katatahi, tau ikei dinon jete<br>   hong ikau Yesus wei!<br>    <h5>L.N.No.87</h5>	</p>'];
var nu_326=['<h3>326.KILAU KANGKALINGEN TALOH</h3><h4>G=1 (4/4)</h4>	<p align="justify">    	<b>Ayat 1</b> <br>	Kilau kangkalingen taloh<br>    ije gulong lilap wei;<br>    yoh pambelom kare oloh <br>    kilau pating kambang te,<br>    je bunggut toto;<br>    umur itah pandak wei,<br>    keleh toto mingat te!<br>        <br>          <b>Ayat 2</b><br>	Tapi are trimakasih<br>    akan Tuhan Pangkahai,<br>    ije hung kapaham asie,<br>    magah itah handiai,<br>    ije iliwus awi dahae<br>    akan lewu aie hong sorga,<br>    eka slamat dan kahai,<br>    kan pambelom katatai.<br>  <h5>L.N.No.51</h5>	</p>'];
var nu_327=['<h3>327. PAMBELOM AINGKU KRISTUS</h3><h4>E<small>s</small>=1 (4/4)</h4>	<p align="justify">    	<b>Ayat 1</b> <br>	Pambelom aingku Kristus, <br>    je andal ayungku;<br>    yoh, ie wei maliwus <br>    hambruan berengku.<br>        <br>          <b>Ayat 2</b><br>	Toh tuntang hanjak atei<br>    batolak aku toh,<br>    nakara tau manyampai<br>    panewus ayungku.<br>    <br>    <b>Ayat 3</b><br>    Badosa aku puna<br>    dan hukum bagingku,<br>    kaharap aingku Yesus,<br>    je Juruslamatku.<br>    <br>        <b>Ayat 4</b><br>    Toh aku jari manang <br>    hung Yesu, Tuhangku;<br>    yoh atei aingku sanang<br>    dan puas huangku.<br>    <br>        <b>Ayat 5</b><br>    O Tuhan pasi awat, <br>    nakara aku toh<br>    mahotus dengan slamat<br>    tau mite Tuhangku!<br>    <br>        <b>Ayat 6</b><br>    Te aku tau mahormat,<br>    manara aran aim,<br>    O Yesus Juruslamat<br>    hung sorga, hung kahaim.<br>  <h5>L.N.No.89</h5>	</p>'];
var nu_328=['<h3>328. YESUS, JURUSLAMATKU</h3><h4>C=1 (4/4)</h4>	<p align="justify">    	<b>Ayat 1</b> <br>	Yesus Juruslamatku<br>    jari matei belom tinai;<br>    jete batang kharapku,<br>    belom, matei aku sanai<br>    ateiku tau hanjak wei.<br>    krana Yesus mampong te.<br>        <br>          <b>Ayat 2</b><br>	Basa Yesus,Tuhangku<br>    jaton melai hung pampatei<br>   	aku, jete kharapku,<br>    misik aloh jari matei,<br>    belom kamih hung kahai<br>    hinje Tuhan katatai.<br>    <br>    <b>Ayat 3</b><br>    Berengku toh isi wei.<br>    isi akan bulik petak;<br>    maka aloh tumon te,<br>    mahin aku toto hanjak;<br>    krana Yesus, Andalku<br>    jari tanggong dosangku.<br>    <br>        <b>Ayat 4</b><br>    Bereng itah impahai,<br>    matan itah toh inarang,<br>    sampai huang klawa hai<br>    itah, ije jari manang.<br>    manampayah biti aie<br>    Ije Tuhan pangkahai.<br>  <h5>L.N.No.107</h5>	</p>'];
var nu_329=['<h3>329. IJE JARI MATEI TOH</h3><h4>F=1 (4/4)</h4>	<p align="justify">    	<b>Ayat 1</b> <br>	Ije jari matei toh,<br>    dan ingubur itah,<br>    ie baya buli wei<br>    akan eka tempoe te.<br>        <br>          <b>Ayat 2</b><br>	Bereng aie insahan wei<br>    akan huang petak te;<br>    tapi jari liau aie<br>    buli Tuhan Pangkahai.<br>    <br>    <b>Ayat 3</b><br>   Dapit intu andau hai<br>   mahin kea bereng aie<br>   belom tinai hong kahai<br>   awi kuasan Tuhan aie.<br>    <br>        <b>Ayat 4</b><br>   Gene-genep oloh te<br>   ije baris Tuhan wei,<br>   dinon slamat dan kahai<br>   dan pambelom katatai<br>  <h5>L.N.No.6</h5>	</p>'];
var nu_330=['<h3>330. TOH IKAU JE INYINTA</h3><h4>F=1 (4/4)</h4>	<p align="justify">    	<b>Ayat 1</b> <br>	Toh ikau je inyinta <br>    haguet tuntang mindah <br>    malihi ikei wei!<br>    Yoh ikau toh batung<br>    kapkan ngambo akan tingkap<br>    kasanang katatahi te.<br>        <br>          <b>Ayat 2</b><br>	Yoh ikau jari kea<br>    impandoi, inarima<br>    hung aran Tuhan te<br>    je matei manakiri<br>    hong kayu sampalaki<br>    dan mulih akam slamat te.<br>    <br>    <b>Ayat 3</b><br>  Toh Tuhan, ije Tempon <br>  manyoho ikau belom<br>  hung puna eka aie.<br>  Horumat, trimakasih<br>  toh tagal sintae,asie<br>  je bagim palus katatai<br><h5>L.N.No.127</h5>	</p>'];
var nu_331=['<h3>331. O YESUS, TEMPON ASI, O RAJA PANGKAHAI</h3><h4>E<small>s</small>=1 (4/4)</h4>	<p align="justify">    	<b>Ayat 1</b> <br>	O Yesus, Tempon asi o raja pangkahai,<br>    haluli ikau dumah hung kuasam hung khaim<br>        <br>          <b>Ayat 2</b><br>	Te kare oloh ayum iliwus, impahai,<br>    dan kare oloh bantus kapehe bagi aie.<br>    <br>    <b>Ayat 3</b><br>  O Yesus, imbit ikei manuntut awan paim,<br>  paabas kapercaya ain ikei oloh aim.<br>  <br>    <b>Ayat 4</b><br>  Te amon Tuhan dumah harian hung kahaie,<br>  tau ikei buli sorga, je eka oloh aie.<br>  <h5>L.N.No.89</h5>	</p>'];
var nu_332=['<h3>332. YESUS, JE KAHARAPKU</h3><h4>C=1 (4/4)</h4>	<p align="justify">    	<b>Ayat 1</b> <br>	Yesus je kaharapku<br>     jari matei, belom tinai<br>    jete marar ateiku, <br>    amon aku mingat matei.<br>    Aloh tame kubur te,<br>    mahin aku sanang wei.<br>     <br>          <b>Ayat 2</b><br>	Intu andau hukum hai<br>    Yesus dumah tumon janjie<br>    impahayak rewar aie.<br>    kare mlekat ije brasih<br>    dan mampisik bereng te,<br>    je hung kubur maram wei.<br>    <br>    <b>Ayat 3</b><br> Maka hayak ewwen te<br> aku misik palus belom.<br> Krana kubur jaton tau<br> manahanan oloh ayum;<br> basa Yesus Tuhangku,<br> mampahalap berengku.<br>  <br>    <b>Ayat 4</b><br>  Yesus, je kaharapku,<br>  dohop aku pasi, sayang!<br>  Awat, ajar aku toh,<br>  uka ela aku layang!<br>  Yoh parasih ateiku,<br>  te batantu slamatku.<br>  <h5>L.N.No.107</h5>	</p>'];
var nu_333=['<h3>333. "MISIK KETON!" AUH JAJAGA</h3><h4>D=1 (4/4)</h4>	<p align="justify">    	<b>Ayat 1</b> <br>	"Misik keton!" auh jajajga<br>    mante hau bara hunjun kota;<br>    "O Sion Rajam dumah toh<br>    Bentok alem jari tokep,<br>    toh ela sumbun keton belep,<br>    ngarendeng matan keton toh!<br>    manalih ungkup aie.<br>    Halleluyah!Keton samai,<br>    jalahan aie, has, tatap gulong haliai!"<br>     <br>          <b>Ayat 2</b><br>	Sion jari toh mahining<br>    auh nyanyin oloh hakaliling;<br>    toh hanjak rantang atei aie.<br>    Tuhan ayue bara sorga<br>    malalus janjie, handak dumah,<br>    mamala akae hong kahaie.<br>    O Yesus, Tempongku,<br>    Juruslamatku! Hosianna!<br>    Ikei samai, je oloh aim<br>    manuntut akan pesta aim.<br>    <br>    <b>Ayat 3</b><br>	Trimakasih, nyanyi tara,<br>    je impahayak auh kitara<br>    mandai kan padadusan aim.<br>    Hong bauntonggang mutiara,<br>    hung lewu ayum ikei kea<br>    tau tame hayak ungkup aim<br>    Nampayah biti aim.<br>    mananjang hong kahaim. Amen! Amen!<br>    Salamat hai! Hong eka aim<br>    ikei manyanyi katatai.<br>  <h5>L.N.No.1</h5>	</p>'];
var nu_334a=['<h3>334a.O UNGKUP AIN HATALLA</h3><h4>G=1 (6/8)</h4>	<p align="justify">    	<b>Ayat 1</b> <br>	O ungkup Hatalla,<br>    has,tatap keton toh!<br>    Panumah ayun Raja malalus janjie toh.<br>    O ela mue muen manyim pansumbo aim.<br>    manambang toh Pangan ten, <br>    je duma hong kahai!<br>         <br>          <b>Ayat 2</b><br>     Has, gatang wei takolok,<br>     kaliwus tokep toh!<br>     Toh ela magon prontok<br>     hong bentok alem toh!<br>     Auh tehau oloh jaga<br>     ngarendeng ateim te<br>     Panganten handak dumah!<br>     Has, tambang ie wei!<br>     <br>          <b>Ayat 3</b>      Panganten handak mimbit<br>      toh ikau ungkup aie,<br>      je eka sintae,dapit<br>      kan pesta kawin aie.<br>      Pakaian indu hapa, <br>      barasih haliai<br>      inatap awie akam<br>      kan pesta katatai.<br>      <br>            <b>Ayat4</b><br>      Toh buah ungkup Tuhan<br>      batatap haliai,<br>      dan ela katapasan<br>      hung sumbo handiai!<br>      Has, totong,bele layang<br>      hong bentuk alem toh.<br>      manalih dan manambang<br>      Panganten palus toh!<br>       *mue-muen-gaguaian= dia toto- toto<br>  <h5>L.N.No.75</h5>	</p>'];
var nu_334b=['<h3>334b.O UNGKUP AIN HATALLA</h3><h4>G=1 (9/8)</h4>	<p align="justify">    	<b>Ayat 1</b> <br>	O ungkup Hatalla,<br>    has,tatap keton toh!<br>    Panumah ayun Raja malalus janjie toh.<br>    O ela mue muen manyim pansumbo aim.<br>    manambang toh Pangan ten, <br>    je duma hong kahai!<br>         <br>          <b>Ayat 2</b><br>     Has, gatang wei takolok, kaliwus tokep toh!<br>     Toh ela magon prontok hong bentok alem toh!<br>     Auh tehau oloh jaga ngarendeng ateim te<br>     Panganten handak dumah! Has, tambang ie wei!<br>     <br>          <b>Ayat 3</b>      Panganten handak mimbit toh ikau ungkup aie,<br>      je eka sintae,dapit kan pesta kawin aie.<br>      Pakaian indu hapa, barasih haliai<br>      inatap awie akam kan pesta katatai.<br>      <br>            <b>Ayat4</b><br>      Toh buah ungkup Tuhan batatap haliai,<br>      dan ela katapasan hung sumbo handiai!<br>      Has, totong,bele layang hong bentuk alem toh.<br>      manalih dan manambang Panganten palus toh!<br>       *mue-muen-gaguaian= dia toto- toto<br>  <h5>L.N.No.126</h5>	</p>'];
var nu_335=['<h3>335.TAMUEI RAJIN PAHAM</h3><h4>C=1 (6/8)</h4>	<p align="justify">    	<b>Ayat 1</b> <br>	Tamuei rajin pahamnan tarang lewu aie,<br>    nakara sondau kmangat, kasanang ije hai.<br>         <br>          <b>Ayat 2</b><br>    Kalaunen jetoh jaton manyanang atei aie;<br>    kahaus hambaruae aton mandino slamat hai.<br>     <br>          <b>Ayat 3</b>    Dan kanih huang sorga, hung eka Tuhan aie,<br>    te ie sondau kmangat, panatau ije hai.<br>      <br>            <b>Ayat4</b><br>     Kalunen jetoh lilap, yoh taloh korik hai;<br>     kai dia kharap oloh ain Tuhan pangkahai.<br>     <br>    <b>Ayat 5</b><br>  Kaharap ewen tulus,salamat bagi aie;<br>  yoh, ie bontong toto, tau belom katatai.<br>  <br>    <b>Ayat 6</b><br>  Tamuei ie hetoh, manggoang lewu aie,<br>  je aton tatap kanih kan itah handiai.<br>  <h5>L.N.No.117</h5>	</p>'];
var nu_336=['<h3>336. AKAN NGAMBO AKU HANDAK</h3><h4>F=1 (3/4)</h4>	<p align="justify">    	<b>Ayat 1</b> <br>	Akan ngambo aku handak, <br>    akan human Apangku;<br>    hete aku toto hanjak,<br>    sanang,mangat ateiku.<br> 	Hung kalunen toto pehe,<br>    tapi sanang toto kanih:<br>    jaton tapas taloh en,<br>    jaton tapas taloh en.<br>     <br>          <b>Ayat 2</b><br>    Hung kalunen are dosa,<br>    dan tanjaro, tipu wei:<br>    kadarhaka, taloh papa<br>    marak kare oloh te.<br>    Huang sorga uras brasih<br>    dan bahalap toto ampie;<br>    hete beken haliai,<br>    hete beken haliai.<br>     <br>          <b>Ayat 3</b>   O Hatalla, dohop ikei,<br>   mangat ikei hobah toh<br>   dengan toto-toto atei<br>   belom tumon sohon Roh;<br>   mangat jeha dengan khanjak,<br>   ikei uras haya-hayak,<br>   buli sorga, eka aim,<br>   buli sorga, eka aim.<br>   <h5>L.N.No.124</h5>	</p>'];
var nu_337=['<h3>337. TAMUEI AKU HETOH WEI</h3><h4>F=1 (4/4)</h4>	<p align="justify">    	<b>Ayat 1</b> <br>	Tamuei aku hetoh wei,<br>    kahimat aingku ngambo te,<br>    Yerusalem je huang sorga.<br>    Hong hete tatap eka ku inyimpan<br>    awi Tuhangku; Hong hete aku sanang kea.<br>    Tamuei aku hetoh wei kahimat aingku ngambo te.<br>     <br>          <b>Ayat 2</b><br>   Hong hetoh ramo minjam wei.<br>   Hanjulo kare taloh te<br>   mahalau, palus lilap toto.<br>   Hong ngambo tetap ekaku<br>   hung hete luput huangku.<br>   O Yesus dohop, mangat aku<br>   manggau toh ramon sorga te,<br>   balalu omba ikau wei!<br>      <b>Ayat 3</b><br>   Tamuei puna pehe wei;<br>   je tanggoh lewu sorga te,<br>   kapehee dan kajakee are.<br>   Toh korik,simit jalan aie<br>   dan musoh are haliai<br>   harajur mado wei ie,<br>   nahuang maur mambalang wei<br>   kahimat akan sorga te.<br>   <br>      <b>Ayat 4</b><br>   Kapehe te ingkemeku<br>   katahin panamueiku;<br>   kaharap aingku baya Tuhan,<br>   je magon tumon janji aie<br>   ganggulo aku, oloh aie.<br>   Kalote aku magon tahan<br>   mahoroi jalan simit te,<br>   mahimat lewu sorga wei.<br>   <br>      <b>Ayat 5</b><br>   Yoh aku toh tamuei aie,<br>   hung ngambo dengae hung kahaie<br>   te aku sanang, slamat toto.<br>   Hong hete aku magon tau<br>   maharep, manampayah baue,<br>   je eka sintangku hung hetoh.<br>   Tamuei aku hetoh wei,<br>   panatau aingku ngambo te.<br>   <h5>L.N.No.116</h5>	</p>'];
var nu_338=['<h3>338. YESUS TOTO RAJA KUASA</h3><h4>C=1 (4/4)</h4>	<p align="justify">    	<b>Ayat 1</b> <br>	Yesus toto Raja kuasa,<br>    jari manang halaiai<br>    setan jari impa kalah  <br>    tuntang kare kawan aie.<br>    Hanjak rantang aku toh <br>    tagal gawin Tempongku.<br>     <br>          <b>Ayat 2</b><br> 	Toh kamanang te insanan<br>    akan itah handiai.<br>    Pirdus je katika horan<br>    halalian hong kahaie,<br>    hanjak aku magon wei<br>    tagal lewu brasih te.<br>    <br>       <b>Ayat 3</b><br>  Hetoh aku manamuei,<br>  susah hong palisangku;<br>  tapi amon aku mingat<br>  asin Juruslamatku,<br>  tawangku, kpehe te<br>  jaton tahi, halau wei.<br>   <br>      <b>Ayat 4</b><br> Manampayah lewu kanih,<br> ije sanang haliai;<br> hete kare oloh brasih<br> hinje Tuhan pangkahai.<br> Dohop aku Tuhangku,<br> mangat aku manang toh!   <h5>L.N.No.21</h5>	</p>'];
var nu_339=['<h3>339.AKAN NGAMBO AKU HANDAK YOH MANYAMPAI</h3><h4>D=1 (9/8)</h4>	<p align="justify">    	<b>Ayat 1</b> <br>	Akan ngambo aku handak <br>    yoh manyampai human Apangku.<br>    jalan aingku hetoh pandak,<br>    huang sorga puna ekaku.<br>    Hetoh kinjap musoh kumaham <br>    bang manga pehe, maroh aku toh;<br>    ngambo aku sanang tuntang landang<br>    slamat dan pana tau bagingku.<br>     <br>          <b>Ayat 2</b><br> 	Yesus Kristus, Juruslamat;<br>    jari sinta masi aku toh;<br>    ie matei tantai mawat<br>    aku bara kare dosangku.<br>    Ie mampaabas amon heka,<br>    majar aku manyak jalan aie;<br>    ie kea je manatap eka,<br>    uka aku sanang katatai.<br>    <br>       <b>Ayat 3</b><br> 	Tara akam! Yoh harajur<br>    aran aim, o Tuhan, impahai!<br>    Dohop aku belom bujur<br>    dan manyampai ekam hung kahai.<br>    Hete aku manarimakasih<br>    tagal sintam ije paham hai,<br>    hayak dengan kare oloh brasih<br>    mimbit tara akam katatai<br>    <h5>L.N.No.4</h5>	</p>'];
var nu_340=['<h3>340. YERUSALEM ! JE LEWUN BAJANGKU</h3><h4>E<small>s</small>=1 (4/4)</h4>	<p align="justify">    	<b>Ayat 1</b> <br>Yerusalem! je lewun Rajangku,<br>bahalap pangun aim!<br>Yoh paham toh karajin ateiku,<br>kahausku haliai,<br>manalih tuntang mite<br> kabungas ayum te,<br>nakara hanjak atei,<br>hung ikau magon wei.<br>     <br>          <b>Ayat 2</b><br> 	Yerusalem! o lewun Tempongku<br>    kabungas aim paham!<br>    Hung ikau wei inatap akangku<br>    bagin slamat te,<br>    dan limbah kare kpehe,<br>    je hung kalunen toh,<br>    hung ikau aku tame,<br>    te sukup slamatku.<br>    <br>       <b>Ayat 3</b><br> 	Hatallangku! tarima lakungku<br>    dan pasi aku toh<br>    nakara tau manyampai lewu te,<br>    je eka huangku.<br>    Hung hete kare mlekat<br>    dan Rasul, Nabi te,<br>    manyembah dan mahormat<br>    harajur Tuhan wei.<br>    <h5>L.N.No.48</h5>	</p>'];
var nu_341=['<h3>341. YOH TOTO HAI KAMANGAT ITAH JEHA</h3><h4>D=1 (2/4)</h4>	<p align="justify">    	<b>Ayat 1</b> <br>	Yoh toto hai kamangat itah jeha<br>    hong andau, amon Tuhan pangkahai<br>    manyoho itah buli, tame sorga,<br>    mandino slamat, khanjak ije hai.<br>    Te klahin itah hung kalunen je toh<br>    paterai Tuhan awi aie.<br>    Yoh ie mampong atei itah toto,<br>    mamprahan asie. sintae dan kahaie.<br>     <br>          <b>Ayat 2</b><br> 	Hung kanih itah akan manampayah<br>    sangkowong klawan Tuhan pangkahai.<br>    Dan itah toto hanjak, amon lepah<br>    imbebas bara dosa handiai.<br>    Te itah hung karasih, hung kabujur<br>    tau mampahai, manara Tuhan te,<br>    je jari mawat itah dan harajur<br>    ngagalan itah huang jalae wei.<br>    <br>       <b>Ayat 3</b><br> 	Hung kanih itah akan dinon bagi <br>    hung slamat kare oloh brasih te;<br>    malekat Tuhan mambo auh nyanyi<br>    pahayak itah mimbit tara wei.<br>    Te nyanyi, hormat lembut akan Tuhan,<br>    je brasih, brasih, brasih haliai,<br>    dan itah kea omba kare kawan,<br>    manyembah Tuhan palus katatai.<br>    <br>       <b>Ayat 4</b><br>   Yoh toto mangat, amon Tuhan itah<br>   mangahau: Kantoh, je imberkatku!<br>   Kahanjak keton dia tau lepah,<br>   harajur wei hung eka Apangku!<br>   Hung hete itah akan manampayah,<br>   manara Yesus Kristus hung kahai,<br>   je jari matei indu gantin itah,<br>   manewus itah hapan daha aie.<br>   <br>       <b>Ayat 5</b><br>    Yoh taloh ije jaton puji gitan, <br>    je jaton tame pinding itah toh, <br>    tau itah manampayah hayak hengan <br>    dan pinding itah tau mahining auhe. <br>    Hong hete aton slamat dan kasanang, <br>    kahai, panatau, hormat toto te; <br>    kahekan itah toto jaton hayang, <br>    has, itah manyak jalan sorga wei!<br>   <h5>L.N.No.57</h5>	</p>'];
var nu_342=['<h3>342. KUEH EKA KASANANG</h3><h4>E<small>s</small>=1 (4/4)</h4>	<p align="justify">    	<b>Ayat 1</b> <br>	Kueh eka kasanang, kahanjak bewei?<br>    Kueh eka kalindong hambruangku te?<br>    Hung kueh itah sondau karasih kahai?<br>    Hung kueh lewun slamat kan oloh samai?<br>    Intu hetoh jaton, akai!<br>    Malengkan hong sorga,<br>    hung sorga ga bewei<br>     <br>          <b>Ayat 2</b><br> 	Yerusalem ngambo, te eka kahaie<br>    dan lewun salamat kan itah samai.<br>    Tanggera, tampayah, yoh hete bewei<br>    kasanang,kamangat hambruangku te.<br>    Yoh, yoh ngambo, hete bewei.<br>   <h5>L.N.No.71</h5>	</p>'];
var nu_343=['<h3>343.EWEH OLOH JE KAREAN</h3><h4>C=1 (4/4)</h4>	<p align="justify">    	<b>Ayat 1</b> <br>	Eweh oloh je karean,<br>    hama kota handiai,<br>    ije darah padadusan ain <br>    Hatalla pangkahai?<br>    Halleluyah! Nyanyi wei,<br>    mampahai  Hatalla te.<br>     <br>          <b>Ayat 2</b><br> 	Eweh mimbing plapah korma<br>    kanih huang lenge aie<br>    tuntang ampie kilau raja<br>    ije manang haliai?<br>    Huang klahi ije kueh<br>    ewen manang tumon te?<br>    <br>        <b>Ayat 3</b><br>    Eweh kanih hapakain<br>    sutra brasih haliai,<br>    ie te ketetek Tuhan,<br>    tengae akan oloh aie,<br>    ije palus katatai<br>    jaton malik haliai?<br>    <br>        <b>Ayat 4</b><br>    Bara kueh ewen dumah,<br>    sampai ampie tumon te?<br>    Eweh ije manampayah<br>    baun Hatalla magon wei<br>    tuntang palus katatai<br>    slamat hanjak halaiai?<br>    <br>        <b>Ayat 5</b><br>    Jete oloh awang haus<br>    belom brasih haliai,<br>    indu hormat Tuhan Yesus<br>    tuntang tumon prentah aie,<br>    mampakalah musoh te,<br>    manang toto magon wei.<br>    <br>        <b>Ayat 6</b><br>    Aloh ewen manyarenan<br>    kutoh kare kpehe te,<br>    mahin ewen jari tahan<br>    hong kakatep blaku wei.<br>    Toh Hatalla, Tuhan aie,<br>    mampong ewen handiai.<br>    <br>        <b>Ayat 7</b><br>    Toto ewen jari blua <br>    bara kpehe paham te;<br>    klambie jari inaheta <br>    hapan dahan Yesus wei;<br>    ewen toh samandia<br>    sanang, slamat katatai.<br>    <br>        <b>Ayat 8</b><br>    Kahum belom ewen tahan,<br>    nongkang andau tatap wei,<br>    uka tau manambang Tuhan<br>    tuntang hapus bitie te<br>    indu prapah ije hai<br>    akan Yesus, Tuhan aie.<br>    <br>        <b>Ayat 9</b><br>    Yesus, aku haus taharu<br>    hinje kare oloh aim.<br>    Tenga kea bagi aingku<br>    omba ewen hung kahaim!<br>    Trima hapus bitingku,<br>    Yesus ikau Tempongku!<br>   <h5>L.N.No.21</h5>	</p>'];
var nu_344=['<h3>344. IKAU, O TUHAN EKA KAKENANGKU</h3><h4>G=1 (3/4)</h4>	<p align="justify">    	<b>Ayat 1</b> <br>	Ikau, o Tuhan, eka kakenangku;<br>    slamat aim tintun kahimat ateiku.<br>    Hapus pambelom aingku toh akam wei;<br>    o Tuhan dohop hong asim ije hai.<br>     <br>          <b>Ayat 2</b><br> 	Toto bahalap,auh aim, o Tuhangku;<br>    je mampakanan, manyukup huangku.<br>    Sintam o Tuhan, jari ingkemeku,<br>    kasanang ayum mampangat ateiku.<br>    <br>        <b>Ayat 3</b><br>    Yoh asal akau tau rantep dengam wei,<br>    te bagi aingku kasanang ayum te;<br>    dan amon hetoh are kapehengku,<br>    batonggal Tuhan manjadi tintungku.<br>        <br>        <b>Ayat 4</b><br>   Toh aku hanjak, o Tuhan asim te<br>   harajur aton kan oloh ayum wei.<br>   Salamat toto batantu haliai,<br>   o Tuhan sintum manyimpan te samai.<br>   <br>   <b>Ayat 5</b><br>   Yoh paham ke karajin ateiku<br>   manyampai eka slamat ayungku.<br>   Yoh Yerusalem, lewu ije brasih te,<br>   O jete puna kahimat aingku wei.<br>   <h5>L.N.No.55</h5>	</p>'];
var nu_345=['<h3>345. HAMBARUANGKU TAHARU</h3><h4>C=1 (4/4)</h4>	<p align="justify">    	<b>Ayat 1</b> <br>	Hambaruanku taharu <br>    mite Yesus Tuhangku,<br>    palus melai huang lewu ayum,<br>    ije tatap te,<br>    eka aku magon tau<br>    manampayah klawan baue.<br>     <br>          <b>Ayat 2</b><br> 	Tuhan, tanggoh,agah aku<br>    blua bara klahi toh!<br>    Kahum panamuei aingku<br>    kinjap pehe ateiku;<br>    imbit aku, oloh aim,<br>    buli huma, lewu aim.<br>    <br>        <b>Ayat 3</b><br>   Lewu aim te paham bungas,<br>   brasih tuntang paham khai.<br>   Jaka aku bara plapas<br>   aku gulong haliai<br>   trawang tanggoh lewu te,<br>   melai hete katatai.<br>        <br>        <b>Ayat 4</b><br>   Tapi amon aku magon<br>   manamuei hetoh wei.<br>   Dohop mangat tau manumon<br>   kare tukas ayum te.<br>   Aloh are kpehengku.<br>   Tuhan ih kaharapku!<br>   <br>      <b>Ayat 5</b><br>  Amon Tuhan hinje aku,<br>  kikeh fan kpehe te<br>  akan undur, palus toto,<br>  aku melai sanang wei;<br>  mentai wei panumah aim,<br>  mangat tame hung kahaim.<br>  <h5>L.N.No.21</h5>	</p>'];
var nu_346=['<h3>346. AKU TOTO HAUS MANYAMPAI</h3><h4>G=1 (4/4)</h4>	<p align="justify">    	<b>Ayat 1</b> <br>	Aku toto haus manyampai lewun slamta te.<br>    Yesus dohop aku metai, rantep dengam wei.<br>    Aloh are kpehe te jaton tau mambalang wei,<br>    asal aku toto sampai lewun slamat te.<br>     <br>          <b>Ayat 2</b><br> 	Eamo ain kalunen jetoh akannihau wei;<br>    kare taloh hila hetoh uras minjam wei.<br>    Tagal te ingenangku, dengan hapus huangku,<br>    ramo ije bunggut toto, tengan Tuhan wei.<br>    <br>        <b>Ayat 3</b><br>	Yesus, pasi dohop aku agah aku toh.<br>    manyak jalan je manintu eka slamat te.<br>    O paabas aku toh, magon awi kuasaan Roh,<br>    mangat aku tatap toto belom akam wei.<br>  <h5>L.N.No.7</h5>	</p>'];
var nu_347=['<h3>347. BUAH ITAH O PAHARI</h3><h4>B<small>es</small>=1 (3/4)</h4>	<p align="justify">    	<b>Ayat 1</b> <br>	Buah itah o pahari <br>    harap sambil mentai wei,<br>    sampai Tuhan Yesus jari<br>     mimbit akan sorga te.<br>     Lewu sorga lenda-lendang,<br>     bungas brasih haliai;<br>     atei aingku hanjak rantang ,<br>     amon mingat khalap aie.<br>       <br>          <b>Ayat 2</b><br> 	Yoh , Yerusalem taheta<br>    lenda-lendang, brasih, hai;<br>    bula-bulau ampin tampae,<br>    gini-gining haliai;<br>    atei aingku hanjak rantang,<br>    amon mingat khalap aie.<br>    <br>        <b>Ayat 3</b><br>	Toto, kahum itah hetoh<br>    matan ikah kawus wei,<br>    hindai itah tarang toto<br>    mite lewu ngambo te.<br>    Lewu sorga lenda-lendang,<br>    bungas brasih haliai;<br>    atei aingku hanjak rantang.<br>    amon mingat khalap aie.<br>    <br>        <b>Ayat 4</b><br>    Tapi Yesus handak magah<br>    sanai hapan lenge aie,<br>    mimbit itah, uka omba,<br>    melai dengae hungkahaie.<br>    Lewu sorga lenda-lendang,<br>    bungas brasih haliai;<br>    atei aingku hanjak rantang.<br>    amon mingat khalap aie.<br>    <br>        <b>Ayat 5</b><br>  Hete itah haya-hayak<br>  mite Tuhan pangkahai;<br>  hete itah toto hanjak<br>  sanang slamat halaiai.<br>  Lewu sorga lenda-lendang,<br>    bungas brasih haliai;<br>    atei aingku hanjak rantang.<br>    amon mingat khalap aie.<br><h5>L.N.No.58</h5>	</p>'];
var nu_348=['<h3>348. PALUS WEI, PALUS WEI</h3><h4>C=1 (3/4)</h4>	<p align="justify">    	<b>Ayat 1</b> <br>	Palus wei, palus wei,<br>    aku akan salem te.<br>    Paham toto kata haru dengan Yesus,<br>    ije aingku; omba ie mangat wei<br>     <br>          <b>Ayat 2</b><br> 	Yesus wei, Yesus wei,<br>    je mandohop katatai;<br>    gantin itah ie matei,<br>    kalah setan dan pampatei,<br>    limbah jete impahai<br>    <br>        <b>Ayat 3</b><br>	Yesus, hai Yesus hai,<br>    bara taloh handiai.<br>    Ie mimbing huang sorga<br>    tuntang hetoh kare kuasa<br>    hapae mawat oloh aie.<br>    <br>        <b>Ayat 4</b><br>   Aku toh,aku toh<br>   handak buli Tuhangku<br>   uka hete manampayah<br>   Yesus, Juruslamat itah,<br>   hinje dengae katatai.<br>    <br>        <b>Ayat 5</b><br>Hete tau,hete tau,<br>itah manaharep baue.<br>Jaton dosa, jaton klahi<br>maroh itah katatahi:<br>Itah slamat haliai.<br><br> <b>Ayat 6</b><br> Omba wei, omba wei<br> akan lewu brasih te,<br> ije ngambo huang sorga<br> tatap awi Tuhan itah.<br> Tara akae katatai!<br>    <h5>L.N.No.105</h5>	</p>'];
var nu_349=['<h3>349. JE MANANG</h3><h4>E<small>s</small>=1 (3/4)</h4>	<p align="justify">    	<b>Ayat 1</b> <br>	"Je manang, ie kareh kuman <br>    bua hong Eden kanih, tumon sohongku<br>    hong batang ain pambelom huang sorga,<br>    je huang Pirdus ain Hatallangku.<br>    Je bara pinding, keleh mahining<br>     auh Tuhan Yesus kan ungkup aie,<br>    auh Tuhan Yesus kan ungkup aie.<br>         <br>          <b>Ayat 2</b><br> 	Je manang ie dia ingapehe<br>    pampatei ije ambal due te.<br>    Manhu basilim ie tau mangkeme,<br>    mandino kea kasaksian te.<br>    eka mamala aran taheta,<br>    inarang baya kan Tuhan aie,<br>    inarang baya kan Tuhan aie.<br>    <br>        <b>Ayat 3</b><br>	Je manang, ie kareh imakaian<br>    baputi lentah brasih haliai.<br>    Hung surat ain pambelom hete aran<br>    aie aton tarasurat katatai;<br>    ingaku jeha intu baun Bapa,<br>    naharep kare malekat aie,<br>    naharep kare malekat aie.<br>    <br>        <b>Ayat 4</b><br>  O Yesus, dohop aku manang kea,<br>  mampalah awi kuasan sinta aim<br>  kalunen jetoh, setan, kipen papa.<br>  O pasi, hining lakun anak aim!<br>  Sampai hong sorga aku manenga<br>  horumat, tara kan aran aim,<br>  horumat, tara kan aran aim.  <h5>L.N.No.18</h5>	</p>'];
var nu_350=['<h3>350. SLAMAT IJE TAME PIRDUS</h3><h4>E<small>s</small>=1 (3/4)</h4>	<p align="justify">    	<b>Ayat 1</b> <br>	Slamat ije tampe pirdus,<br>    eka Yesus manya katik kawan aie,<br>    magah ie akan dumain pambelom,<br>    ije mangat haliai.<br>         <br>          <b>Ayat 2</b><br> 	Nihau kutoh kare kpehe.<br>    amon hete Bapa mampong anak Aie.<br>    Ie tau mampuas lepah johon matae<br>    sampai sanang haliai.<br>    <br>        <b>Ayat 3</b><br>	Kilau nupi angat itah,<br>    amon jeha itah mite huma Aie,<br>    tame kota lewu slamat, barangilat<br>    kilau yaspis, brasih hai<br>    <br>    <b>Ayat 4</b><br>    Amon marak kambang sorga,<br>    penda bua,ije manis haliai,<br>    oloh brasih tanjo-tanjong, hasangkowong<br>    hong kasanang katatai.<br>    <br>        <b>Ayat 5</b><br>    Hunag lengee plapah korma,<br>    huang nyame Halleluyah, tara wei<br>    tagal dahan Tuhan Yesus, Jurupnewus,<br>    tagal kare sintae te.<br>    <br>        <b>Ayat 6</b><br>    Tuhan, keleh ah manyimpan<br>    ikei, mangat tame huang pirdusAim,<br>    uka limbah ikei manang, melai sanang<br>    hinje dengam hung kahaim.<br>    <h5>L.N.No.142</h5>	</p>'];
var nu_351=['<h3>351. HONG NGAMBO BEWEI</h3><h4>F=1 (2/4)</h4>	<p align="justify">    	<b>Ayat 1</b> <br>	Hong ngambo bewei salamat,<br>    kahanjak, kasanang kan oloh <br>    je harap hung Yesus wei;<br>    kan oloh je harap hong Yesus bewei.<br>         <br>          <b>Ayat 2</b><br> 	Toh taloh samai mamenda kapehe,pampatei,<br>    je bagin kakare je korik, je hai.<br>    <br>        <b>Ayat 3</b><br>	Lalehan kahain panatau kamangat hong sorga,<br>    inyimpan Hatalla hung sintae je hai.<br>    <br>    <b>Ayat 4</b><br> 	Paterai bewei auh tangis, tarahing aim hetoh!<br>    Tanggera kan ngambo, percaya bewei!<br>    <h5>L.N.P.No.14</h5>	</p>'];
var nu_352=['<h3>352. SOHO AKU, SOHO AKU</h3><h4>C=1 (3/4)</h4>	<p align="justify">    	<b>Ayat 1</b> <br>Soho aku, soho aku tanggoh Yesus,<br>Tuhan aingku! Metoh aku toh halisang<br>hapus huangku mangenang melai dengae katatai.<br>         <br>          <b>Ayat 2</b><br> 	Sintae asie, sintae asi jari mampakalah aku<br>    Tagal daha aie je brasih aku kea bara bagi<br>    kanih huang lewu aie.<br>    <br>        <b>Ayat 3</b><br>	Paham kmangat, paham kmangat nyanyi tara ain malekat<br>    jaka aton plapas aingku, aku trawang andau jetoh<br>    akan Sion ngambo te.<br>    <br>        <b>Ayat 4</b><br> 	Pirdus sorga, pirdus sorga, slamat ewen, ije jeha<br>    kuman bara bua ayum, mihop danum ain pambelom,<br>    mite Yesus, Tempongku!<br>    <h5>L.N.No.105</h5>	</p>'];
var nu_353=['<h3>353. LEWU SORGA AMBO KARE BINTANG</h3><h4>D=1 (6/8)</h4>	<p align="justify">    	<b>Ayat 1</b> <br>	lewu sorga ambo kare bintang.<br>    ikau wei ingenang ateiku<br>    Oloh ayum sanang hanjak rantang<br>    limbah klahi hong kalunen toh,<br>    limbah klahi hong kalunen toh.<br>         <br>          <b>Ayat 2</b><br> 	Kare jalan aim halaseh bulau,<br>    hintan kare kotam, gantong hai:<br>    duewlas bauntonggang aim haginyau<br>    hung kabungas mutiara aie,<br>    hung kbungas mutiara aie.<br>    <br>        <b>Ayat 3</b><br>	Awang toh hambilang, tau hapumpong<br>    dapit tinai hung kasanang aim:<br>    kare utus oloh tau mananjong<br>    huang klawan matanandau aim,<br>    huang klawan matanandauaim.<br>    <br>        <b>Ayat 4</b><br> 	Batang lewun oloh aim Hatalla,<br>    ingkahimat hung palisangku.<br>    Dalam Raja tuntang Human Bapa,<br>    eka Yesus, Juruslamatku,<br>    eka Yesus, Juruslamatku.<br>    <br>        <b>Ayat 5</b><br>    Kinjap matangku taharu mite<br>    kangkalingen panyangkowong aim:<br>    huang ngambo, ije bara hete<br>    ikau kareh mohon hung kahaim,<br>    ikau kareh mohon hung kahaim.<br>    <br>        <b>Ayat 6</b><br>    O Y erusalem tahet, brasih,<br>    slamat ewen, ije baris aim!<br>    Trima aku, ije asi-asi,<br>    jeha keas hung bauntonggang aim,<br>    jeha kea hung bauntonggang aim.<br>    <br>        <b>Ayat 7</b><br>    Ije manang, ije brasih klambie<br>    awi dahan Yesus, Tuhan aie,<br>    ie te batantu bara bagi,<br>    huang ikau palus katatai,<br>    huang ikau palus katatai.<br>    <h5>L.N.P.No.29</h5>	</p>'];
var nu_354=['<h3>354. SLAMAT, SLAMAT EWEN</h3><h4>A<small>s</small>=1 (4/4)</h4>	<p align="justify">    	<b>Ayat 1</b> <br>	Slamat slamat ewen <br>    ije tame sorga!<br>    Slamat ewen ie tame sorga,<br>    je jari matei huang Tuhan<br>    Yoh ewen mangat haliai,<br>    yoh ewen mangat haliai.<br>    kasanang bagi aie, nihau kapehe aie.<br>    Hosian na, Hosian na, Hosian na!<br>    Toh gawi aie samandiai<br>    manuntut ewen kan kahai Hosian na !<br>    Hosian na! Hosian na! <br>    Hosan na! Hosan na!<br>      <br>    <h5>L.N.P.No.43</h5>	</p>'];
var nu_355=['<h3>355. SANANG WEI, SANANG WEI!</h3><h4>A<small>s</small>=1 (4/4)</h4>	<p align="justify">    	<b>Ayat 1</b> <br>	Sanang wei, sanang wei!<br>    Asal Yesus, Tuhangku mampahayak aku toh<br>    sanang wei, sanang wei, sanang wei!<br>     <br>          <b>Ayat 2</b><br>     Hanjak wei, hanjak wei!<br>     Minjam wei kapehe te.<br>     Yesus melai palus wei,<br>     palus wei, palus wei, palus wei!<br>     <br>          <b>Ayat 3</b><br>     Slamat wei, slamat wei!<br>     Amon oloh aie samai<br>     imbit Tuhan kan kahaie,<br>     slamat hai katatai bagi aie!<br>    <h5>L.N.P.No.40</h5>	</p>'];
var nu_356=['<h3>356. O YERUSALEM TAHETA</h3><h4>A<small>s</small>=1 (4/4)</h4>	<p align="justify">    	<b>Ayat 1</b> <br>	O Yerusalem taheta ije brasih haliai,<br>    eka lembut nyanyin sorga <br>    hung kasanang katatahi!<br>    prea aku anak aim melai<br>    kea hung kahaim?<br>      <br>          <b>Ayat 2</b><br>    Huang pasah ije honggae<br>    kahum panamueiku,<br>    marak kikeh tuntang kpehe.<br>    Ikau tintun huangku<br>    aloh kutoh musohku,<br>    maur, mnajake aku toh.<br>     <br>          <b>Ayat 3</b><br>    Atei aingku haus taharu<br>    mite Yesus hong kahai.<br>    Hong pambulan Pirdus ngambo<br>    impahayak ungkup Aie,<br>    melai huang lewu te,<br>    je implawa Tuhan wei.<br>    <br>        <b>Ayat 4</b><br>    Hete aku tau manara.<br>    Yesus Juruslamatku<br>    dengan nyanyi, auh kitara<br>    huang human Apangku,<br>    amon limbah klahi hai<br>    Tuhan mampong oloh aie.<br>    <h5>R.L.569</h5>	</p>'];
var nu_357=['<h3>357. AMON KAPEHE KASUSAH</h3><h4>A<small>s</small>=1 (6/4)</h4>	<p align="justify">    	<b>Ayat 1</b> <br>	Amon kapehe, kasusah<br>     je hai uras te jari mahalau samai;<br>     Batang kahanjak kutonggal bewei<br>     Yesus Jurusalamatku te.<br>     Je te bewei slamat hai te.<br>     je te bewei slamat hai te,<br>     harajur wei tokep Tuhangku te,<br>     harajur wei tokep Tuhangku te.<br>         <br>          <b>Ayat 2</b><br>   Amon bauntonggang Yerusalemte <br>   dapit imbangah hong andau hai te;<br>   Batang kahanjakku tonggal bewei<br>   Yesus je Jurusalamatku te.<br>    Je te bewei slamat hai te.<br>     je te bewei slamat hai te,<br>     harajur wei tokep Tuhangku te,<br>     harajur wei tokep Tuhangku te.<br>     <br>          <b>Ayat 3</b><br>     Amon hasupa hong lewu aie te<br>     dengan kakare paharingku te;<br>     Batang kahanjakku tonggal bewei     Yesus je Jurusalamatku te.<br>    Je te bewei slamat hai te.<br>     je te bewei slamat hai te,<br>     harajur wei tokep Tuhangku te,<br>     harajur wei tokep Tuhangku te.<br>    <br>        <b>Ayat 4</b><br>    Amon kahalap, kamangat, kahai,<br>    slamat te bagingku kan katatai:<br>    Batang kahanjaku tonggal bewei<br>    Yesus je Jurusalamatku te.<br>    Je te bewei slamat hai te.<br>     je te bewei slamat hai te,<br>     harajur wei tokep Tuhangku te,<br>     harajur wei tokep Tuhangku te.<br>    <h5>D.S.L.No.192</h5>	</p>'];
var nu_358=['<h3>358. BRASIH,BRASIH, BRASIH</h3><h4>G=1 (4/4)</h4>	<p align="justify">    	<b>Ayat 1</b> <br>	Brasih, brasih,brasih haliai Yehowa!<br>    Hapus petak basuang kahaie.<br>    Hosian na! hosian na ngambo te!<br>    Horumat dan kahai kan arae je hai!    Hosian na! Hosian na! <br>    Hosian na ngambo te!<br>     <br>     <h5>L.N.No.149</h5>	</p>'];
var nu_359=['<h3>359. HORMAT AKAN BAPA</h3><h4>F=1 (4/4)</h4>	<p align="justify">    	<b>Ayat 1</b> <br>	Hormat akan Bapa<br>    tuntang Anak tuntang Roh ije brasih.<br>    kilau bara horan sampai andau toh<br>    tuntang palus katatahi Amen.<br>         <br>     <h5>L.N.No.150</h5>	</p>'];
var nu_360=['<h3>360. TOH JARI IKEI HETOH</h3><h4>F=1 (4/4)</h4>	<p align="justify">    	<b>Ayat 1</b> <br>	Toh jari ikei hetoh,<br>    mahining kare taloh,<br>    je toto paham hai.<br>    O Yesus, tenga asi,<br>    yoh keleh Roh manyak asi,<br>    salamat ikei toh samai!<br>         <br>     <h5>L.N.No.127</h5>	</p>'];
var nu_361=['<h3>361. TUHAN, TENGA BERKAT TOH</h3><h4>A=1 (4/4)</h4>	<p align="justify">    	<b>Ayat 1</b> <br>	Tuhan, tenga berkat toh,<br>    ikei handak buli huma<br>    Agah kare ikei toh<br>    huang jalan ije buah<br>    Klindong ikei bara kpapa,<br>    imbit ikei akan sorga!<br>             <br>     <h5>L.N.No.147</h5>	</p>'];
var nu_362=['<h3>362. HORUMAT PALUS KATATAI</h3><h4>D=1 (4/4)</h4>	<p align="justify">    	<b>Ayat 1</b> <br>	Horumat palus katatai,<br>    kan Tuhan ije pangkahai.<br>    Je sinta masi itah toh,<br>    Hatalla Bapa Anak,Roh!<br>             <br>     <h5>L.N.No.40</h5>	</p>'];
var nu_363=['<h3>363. KELEH ASIN PANGKAHAI TUHAN YESUS</h3><h4>D=1 (4/4)</h4>	<p align="justify">    	<b>Ayat 1</b> <br>	Keteh asin Tuhan Yesus Kristus<br>    tuntang sintan Bapa<br>    tuntang kahin jen Roh <br>    ije brasih pahayak ikei,<br>    hayak ikei, Amen.<br>             <br>     <h5>L.N.No.148</h5>	</p>'];
var nu_364=['<h3>364. YEHOWA,YEHOWA,YEHOWA</h3><h4>D=1 (4/4)</h4>	<p align="justify">    	<b>Ayat 1</b> <br>	Yehowa, Yehowa, Yehowa,<br>    akan aram horumat dan kahai!<br>    Amen, Amen. Yoh sampai taloh handiai,<br>    lilap manumon sohom.<br>    Tuhan wei inara, je brasih, <br>    brasih brasih arae.<br>    Halleluya Halleluya.<br>             <br>     <h5>L.N.No.47</h5>	</p>'];